INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(1, 5027, 'American University', 'Geology, Environmental, Earth & Marine Sciences,Business & Management,Other Health,Physics & Astronomy,Languages, Literature & Linguistics,Education,Sociology,Accounting & Finance,Biological Sciences,Economics & Econometrics,Law,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Computer Science,Mathematics & Statistics,History, Philosophy & Theology,Sport Science,Communication & Media Studies,Chemistry,Medicine & Dentistry,Psychology', 29, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/8b/American_University_Seal.svg/150px-American_University_Seal.svg.png', ' L\'American University (AU ou American) est une université de recherche privée, dotée d\'une charte fédérale, située à Washington, D.C. Son campus principal s\'étend sur 90 acres (36 hectares) à Ward Circle, principalement dans le quartier de Spring Valley, dans le nord-ouest de D.C. L\'AU a été créée par une loi du Congrès en 1893 à la demande de l\'évêque méthodiste John Fletcher Hurst, qui souhaitait créer une institution promouvant le service public, l\'internationalisme et l\'idéalisme pragmatique. L\'AU a commencé la construction en 1902, a ouvert en tant qu\'institution d\'enseignement supérieur en 1914 et a admis ses premiers étudiants de premier cycle en 1925. Bien qu\'affiliée à l\'Église méthodiste unie, l\'appartenance religieuse n\'est pas un critère d\'admission. L\'American University compte huit écoles et collèges : la School of International Service, le College of Arts and Sciences, la Kogod School of Business, la School of Communication, les Professional Studies and Executive Education, la School of Public Affairs, la School of Education, et le Washington College of Law (WCL). Elle propose plus de 160 programmes, dont 71 licences, 87 masters et 10 doctorats, ainsi que des programmes JD, LLM et SJD. Le corps étudiant de l\'AU compte plus de 13 000 personnes et représente les 50 États américains et 141 pays ; environ un cinquième des étudiants sont internationaux. L\'American University est l\'une des trois principales écoles d\'origine du Département d\'État américain. Elle est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\".\nL\'université possède WAMU, la station phare de National Public Radio, qui a été une source de programmation diffusée nationalement et internationalement, telle que The Diane Rehm Show et plus récemment 1A, stylisé comme \"the 1A\", comme dans \"le 1er amendement\".', 32000),
(2, 4730, 'Arizona State University (Tempe)', 'Law,Mathematics & Statistics,Art, Performing Arts & Design,Other Health,Biological Sciences,Communication & Media Studies,Architecture,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Geography,Accounting & Finance,Economics & Econometrics,Chemistry,Politics & International Studies (incl Development Studies),Sport Science,Physics & Astronomy,Business & Management,Civil Engineering,Psychology,History, Philosophy & Theology,Education,Mechanical & Aerospace Engineering,Sociology,Archaeology,Electrical & Electronic Engineering,General Engineering,Computer Science,Languages, Literature & Linguistics', 0, 'https://upload.wikimedia.org/wikipedia/en/a/a1/Arizona_State_University_seal.svg', ' L\'Arizona State University (Arizona State ou ASU) est une université publique de recherche située dans la région métropolitaine de Phoenix. Fondée en 1885 en tant que Territorial Normal School par le 13e Arizona Territorial Legislature, l\'ASU est maintenant l\'une des plus grandes universités publiques en termes d\'effectifs aux États-Unis. Elle faisait partie d\'environ 180 \"écoles normales\" fondées à la fin du XIXe siècle pour former des enseignants pour les écoles publiques communes en croissance rapide. Certaines ont fermé, mais la plupart ont progressivement élargi leur rôle et sont devenues des collèges d\'État au début du XXe siècle, puis des universités d\'État à la fin du XXe siècle.\nL\'ASU, l\'une des trois universités régies par le Arizona Board of Regents, est membre de l\'Association of American Universities et est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". L\'ASU compte près de 145 000 étudiants suivant des cours, dont plus de 62 000 étudiants en ligne, et 112 000 étudiants de premier cycle et près de 30 000 étudiants diplômés sur ses cinq campus et quatre centres d\'apprentissage régionaux répartis dans tout l\'Arizona. L\'ASU propose 350 options de diplômes provenant de ses 17 collèges et de plus de 170 centres et instituts interdisciplinaires pour les étudiants de premier cycle, ainsi que plus de 400 programmes de diplômes et de certificats d\'études supérieures.\nLes Arizona State Sun Devils participent à 26 sports de niveau universitaire dans la NCAA Division I Pac-12 Conference et abritent plus de 1 100 organisations étudiantes enregistrées. Les équipes des Sun Devils ont remporté 165 championnats nationaux, dont 24 trophées de la NCAA. 179 Sun Devils ont fait partie d\'équipes olympiques, remportant 60 médailles olympiques : 25 en or, 12 en argent et 23 en bronze.\nEn janvier 2022, l\'ASU a déclaré que son corps professoral de plus de 5 000 chercheurs comprenait 5 lauréats du prix Nobel, 10 lauréats de la bourse MacArthur, 10 lauréats du prix Pulitzer, 10 membres de l\'Académie nationale d\'ingénierie, 23 membres de l\'Académie nationale des sciences, 26 membres de l\'American Academy of Arts and Sciences, 41 boursiers Guggenheim, 157 boursiers de la National Endowment for the Humanities et 281 boursiers américains du programme Fulbright.', 0),
(3, 194, 'Auburn University', 'Business & Management,Biological Sciences,Other Health,Education,History, Philosophy & Theology,Sport Science,Communication & Media Studies,Electrical & Electronic Engineering,Veterinary Science,Chemical Engineering,Art, Performing Arts & Design,Economics & Econometrics,Chemistry,Languages, Literature & Linguistics,Politics & International Studies (incl Development Studies),General Engineering,Physics & Astronomy,Geography,Agriculture & Forestry,Accounting & Finance,Mechanical & Aerospace Engineering,Psychology,Sociology,Architecture,Medicine & Dentistry,Law,Mathematics & Statistics,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Computer Science', 84, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/7f/Auburn_University_seal.svg/140px-Auburn_University_seal.svg.png', ' L\'Auburn University (AU ou Auburn) est une université publique de recherche agraire située à Auburn, Alabama, aux États-Unis. Avec plus de 26 800 étudiants de premier cycle, plus de 6 100 étudiants diplômés et un effectif total de plus de 33 000 étudiants, aux côtés de 1 330 membres du corps professoral, Auburn est la deuxième plus grande université de l\'Alabama. Elle est l\'une des deux universités publiques phares de l\'État. L\'université est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".\nAuburn a été fondée en 1856 sous le nom de East Alabama Male College, un collège d\'arts libéraux privé affilié à l\'Église épiscopale méthodiste du Sud. En 1872, en vertu du Morrill Act, elle est devenue la première université agraire de l\'État et a été renommée Agricultural and Mechanical College of Alabama. En 1892, elle est devenue la première école coéducative de quatre ans en Alabama et en 1899, elle a été rebaptisée Alabama Polytechnic Institute. En 1960, son nom a été changé en Auburn University pour reconnaître les programmes académiques variés et le cursus élargi d\'une grande université.\nEn 1967, la législature de l\'Alabama a charté un campus supplémentaire à Montgomery, qui est dirigé par le Auburn University Board of Trustees en tant que membre du système de l\'Université Auburn.', 22000),
(4, 4967, 'Baylor University', 'Sociology,Education,Chemistry,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Agriculture & Forestry,Business & Management,Communication & Media Studies,Sport Science,General Engineering,Art, Performing Arts & Design,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Law,Physics & Astronomy,Electrical & Electronic Engineering,Psychology,Mechanical & Aerospace Engineering,Computer Science,Biological Sciences,Accounting & Finance,Mathematics & Statistics,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f0/Baylor_University_seal.svg/150px-Baylor_University_seal.svg.png', ' Baylor University est une université de recherche baptiste chrétienne privée située à Waco, au Texas. Baylor a été chartée en 1845 par le dernier Congrès de la République du Texas. Baylor est la plus ancienne université en opération continue au Texas et l\'une des premières institutions éducatives à l\'ouest du fleuve Mississippi aux États-Unis. Situé sur les rives de la rivière Brazos à côté de l\'I-35, entre la région métropolitaine de Dallas–Fort Worth et Austin, le campus de 1000 acres (400 hectares) de l\'université est le plus grand campus universitaire baptiste au monde.\nÀ l\'automne 2021, Baylor comptait un effectif total de 20 626 étudiants (15 191 au premier cycle, 5 435 aux cycles supérieurs). Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". L\'université décerne des diplômes de premier cycle et des cycles supérieurs, y compris des doctorats et des diplômes professionnels. Les équipes sportives de l\'Université Baylor, connues sous le nom de Bears, participent à 19 sports interuniversitaires. L\'université est membre de la Big 12 Conference de la NCAA Division I.', 0),
(6, 468, 'Boston University', 'Sociology,Medicine & Dentistry,Languages, Literature & Linguistics,General Engineering,Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Communication & Media Studies,Electrical & Electronic Engineering,Architecture,Geography,Other Health,History, Philosophy & Theology,Psychology,Biological Sciences,Art, Performing Arts & Design,Computer Science,Physics & Astronomy,Education,Mathematics & Statistics,Law,Chemistry,Archaeology,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Business & Management,Economics & Econometrics', 25, 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/Boston_University_seal.svg/140px-Boston_University_seal.svg.png', ' Boston University (BU) est une université de recherche privée située à Boston, Massachusetts. BU a été fondée en 1839 par un groupe de méthodistes de Boston avec son campus d\'origine à Newbury, Vermont, avant d\'être chartée à Boston en 1869. Elle est membre de l\'Association of American Universities et du Boston Consortium for Higher Education.\nL\'université est non confessionnelle, bien qu\'elle conserve son affiliation historique avec l\'Église méthodiste unie. L\'université compte plus de 4 000 membres du corps professoral et près de 34 000 étudiants, ce qui en fait l\'un des plus grands employeurs de Boston. Elle propose des diplômes de premier cycle, des maîtrises, des doctorats, ainsi que des diplômes en médecine, en odontologie, en administration des affaires et en droit à travers 17 écoles et collèges répartis sur trois campus urbains. Le campus principal est situé le long de la rivière Charles dans les quartiers Fenway-Kenmore et Allston de Boston, tandis que le Boston University Medical Campus est situé dans le quartier South End de Boston. Le campus Fenway abrite la Wheelock College of Education and Human Development, anciennement Wheelock College, qui a fusionné avec BU en 2018. L\'université est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".\nLes équipes sportives de BU participent aux conférences Patriot League et Hockey East, et leur mascotte est Rhett le Boston Terrier. Les Boston University Terriers concourent en NCAA Division I. Parmi ses anciens élèves et ses professeurs actuels ou passés, l\'université compte 9 lauréats du prix Nobel, 23 lauréats du prix Pulitzer, 10 boursiers Rhodes, 6 boursiers Marshall, 14 lauréats d\'un Oscar, ainsi que des lauréats d\'un Emmy et d\'un Tony. BU compte également des boursiers MacArthur, Fulbright et Truman parmi ses anciens étudiants et son corps professoral. En 1876, le professeur de BU Alexander Graham Bell a inventé le téléphone dans un laboratoire de BU.', 33000),
(7, 482, 'Bowling Green State University', 'Biological Sciences,Languages, Literature & Linguistics,Chemistry,Electrical & Electronic Engineering,Education,Psychology,Art, Performing Arts & Design,Computer Science,Physics & Astronomy,Accounting & Finance,Sport Science,Geography,Civil Engineering,Mathematics & Statistics,Architecture,Business & Management,Other Health,Mechanical & Aerospace Engineering,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Law,Communication & Media Studies,Sociology,History, Philosophy & Theology,General Engineering,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a3/Bowling_Green_State_University_seal.svg/150px-Bowling_Green_State_University_seal.svg.png', ' Bowling Green State University (BGSU) est une université publique de recherche située à Bowling Green, Ohio. Le campus académique principal et résidentiel, qui s\'étend sur 1 338 acres (541,5 hectares), se trouve à 15 miles (24 km) au sud de Toledo, Ohio. L\'université propose des programmes et des installations de recherche reconnus au niveau national dans les domaines des sciences naturelles et sociales, de l\'éducation, des arts, des affaires, de la santé et du bien-être, des sciences humaines et des technologies appliquées. L\'établissement a été accordé une charte en 1910 en tant qu\'école normale, se spécialisant dans la formation des enseignants et l\'éducation. L\'université est passée d\'une petite école normale rurale à une université de recherche publique complète. Elle fait partie du University System of Ohio et est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\".\nEn 2019, Bowling Green proposait plus de 200 programmes de premier cycle, ainsi que des diplômes de master et de doctorat à travers huit collèges académiques. BGSU avait une population étudiante résidentielle d\'environ 6 000 étudiants sur le campus et un effectif total de plus de 19 000 étudiants en 2018. L\'université possède également un campus satellite, connu sous le nom de BGSU Firelands, à Huron, Ohio, à 60 miles (97 km) à l\'est du campus principal. Bien que la majorité des étudiants assistent aux cours sur le campus principal de BGSU, environ 2 000 étudiants suivent des cours à Firelands et environ 600 autres étudiants suivent des cours en ligne. Environ 85 % des étudiants de Bowling Green sont originaires de l\'Ohio.\nL\'université propose un programme de vie étudiante étendu, avec plus de 300 organisations étudiantes. Engageant des équipes sportives connues sous le nom de Bowling Green Falcons, l\'université participe au niveau NCAA Division I en tant que membre de la Mid-American Conference dans tous les sports sauf le hockey sur glace, où l\'université est membre de la Central Collegiate Hockey Association.', 0),
(8, 4997, 'Brandeis University', 'Languages, Literature & Linguistics,Physics & Astronomy,Computer Science,Chemistry,Mathematics & Statistics,Biological Sciences,Art, Performing Arts & Design,Psychology,Agriculture & Forestry,Business & Management,Sociology,Economics & Econometrics,Politics & International Studies (incl Development Studies),History, Philosophy & Theology', 34, 'https://upload.wikimedia.org/wikipedia/en/thumb/3/32/Brandeis_University_seal.svg/800px-Brandeis_University_seal.svg.png', ' L\'université Brandeis (en anglais : Brandeis University) est une université privée américaine située à Waltham dans le Massachusetts, à 16 km à l\'ouest de Boston.\nFondée en 1948 sur le site de l\'ancienne « Middlesex University », elle tient son nom de l\'ancien juge à la Cour suprême des États-Unis, Louis Dembitz Brandeis (auteur en particulier de l\'aphorisme « There is no general federal common law »). En 1946, au début du projet de création de la nouvelle université, il est proposé qu\'elle soit nommée « université Albert Einstein », mais le célèbre physicien, chercheur à l\'université de Princeton et avec qui l\'établissement entretient des liens pour son projet de fondation jusqu\'à fin 1947, décline finalement cette offre.\nBrandeis est la première université financée par la communauté juive aux États-Unis. Bien que multiconfessionnelle, elle compte dès ses débuts une très forte proportion d\'étudiants et d\'enseignants juifs (80 % au cours des années 1950), et c\'est toujours le cas aujourd\'hui. Plus de 45 % de ses étudiants déclarent être de confession juive, alors qu\'ils représentent 2 % de la population des États-Unis, 6 % de la population de l\'état du Massachusetts et 8 à 9 % de celle de la conurbation de Boston.\nDepuis sa création, l\'université est un foyer de contestation et de militantisme de gauche, autant de la part des étudiants que de la part des enseignants.\nBien que très petite par la taille, Brandeis est aujourd\'hui l\'une des universités les mieux cotées aux États-Unis, et l\'un des centres de recherche les plus renommés. Située à proximité de la Massachussetts Route 128 qui constitue le deuxième plus important pôle d\'innovation des États-Unis, après la Silicon Valley californienne, elle bénéficie de sa proximité géographique avec de grandes entreprises comme Sun Microsystems, Polaroid, Oracle ou Raytheon, et les campus d\'autres universités bostoniennes comme Harvard ou le MIT.\nDe plus, dans la même enceinte se trouve The Heller School, fondée en 1959, et remarquable pour son programme en politique sociale ainsi qu\'en développement international.', 32000),
(9, 3907, 'Brown University', 'Chemistry,Archaeology,Mechanical & Aerospace Engineering,Languages, Literature & Linguistics,Mathematics & Statistics,Communication & Media Studies,Psychology,Computer Science,Other Health,History, Philosophy & Theology,Sociology,Electrical & Electronic Engineering,Business & Management,General Engineering,Geology, Environmental, Earth & Marine Sciences,Medicine & Dentistry,Art, Performing Arts & Design,Biological Sciences,Physics & Astronomy,Architecture,Chemical Engineering,Economics & Econometrics,Politics & International Studies (incl Development Studies),Education', 8, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/50/Shield_of_Brown_University.svg/110px-Shield_of_Brown_University.svg.png', ' L\'université Brown (en anglais, Brown University) (on dit simplement « Brown ») est une université privée américaine fondée en 1764 et située à Providence, dans l’État du Rhode Island. Elle fait partie de la Ivy League (groupe d\'universités américaines regroupant les plus anciennes et les plus prestigieuses du pays : Brown, Columbia, Cornell, Dartmouth, Harvard, UPenn, Princeton, Yale).\nL\'admission au premier cycle (undergraduate) est très sélective (avec un taux d\'acceptation de 6.6 % en 2019). L\'université comprend le College, Graduate School, Alpert Medical School, la School of Engineering, la School of Public Health, et la  School of Professional Studies. \nParmi les professeurs et les anciens de Brown, il y a huit prix Nobel, cinq recipiendaires de la  National Humanities Medal, dix lauréats de la National Medal of Science. Parmi les anciens étudiants, il y a huit milliardaires, un juge en chef des États-Unis, quatre secrétaires d\'État, 54 membres du Congrès, 55 Boursiers Rhodes, 48 Marshall Scholars, 14 membres MacArthur Genius, 19 gagnants du prix Pulitzer, des membres de familles royales, ainsi que des leaders et chefs de grandes entreprises internationales.', 25000),
(10, 3675, 'California Institute of Technology', 'Languages, Literature & Linguistics,Economics & Econometrics,Civil Engineering,Mathematics & Statistics,General Engineering,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences,Computer Science,Politics & International Studies (incl Development Studies),Physics & Astronomy,Chemical Engineering,Business & Management,Biological Sciences,History, Philosophy & Theology,Chemistry,Mechanical & Aerospace Engineering', 8, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a4/Seal_of_the_California_Institute_of_Technology.svg/150px-Seal_of_the_California_Institute_of_Technology.svg.png', ' Le California Institute of Technology (abrégé Caltech) est une université privée de recherche située à Pasadena, en Californie. L\'université est responsable de nombreuses avancées scientifiques modernes et fait partie d\'un petit groupe d\'instituts de technologie aux États-Unis qui sont fortement dévoués à l\'enseignement des sciences pures et appliquées. En raison de son histoire d\'innovation technologique, Caltech est considéré comme l\'une des universités les plus prestigieuses au monde.\nL\'institution a été fondée en 1891 en tant qu\'école préparatoire et professionnelle par Amos G. Throop et a commencé à attirer des scientifiques influents tels que George Ellery Hale, Arthur Amos Noyes et Robert Andrews Millikan au début du XXe siècle. Les écoles professionnelles et préparatoires ont été dissoutes et scindées en 1910, et le collège a pris son nom actuel en 1920. En 1934, Caltech a été élue à l\'Association of American Universities, et les précurseurs du Jet Propulsion Laboratory de la NASA, que Caltech continue de gérer et d\'exploiter, ont été établis entre 1936 et 1943 sous la direction de Theodore von Kármán.\nCaltech compte six divisions académiques mettant fortement l\'accent sur les sciences et l\'ingénierie, gérant 332 millions de dollars de recherche parrainée en 2011. Son campus principal de 124 acres (50 hectares) est situé à environ 11 miles (18 km) au nord-est du centre-ville de Los Angeles, à Pasadena. Les étudiants de première année sont tenus de vivre sur le campus, et 95 % des étudiants de premier cycle restent dans le système de logement sur le campus à Caltech. La vie étudiante est régie par un code d\'honneur qui permet aux enseignants d\'attribuer des examens à domicile. Les Caltech Beavers participent à 13 sports interuniversitaires dans la Southern California Intercollegiate Athletic Conference (SCIAC) de la NCAA Division III.\nLes scientifiques et ingénieurs de l\'université ont joué un rôle essentiel dans de nombreuses percées scientifiques et innovations modernes, notamment dans les domaines de la science de la durabilité, de la physique quantique, de la surveillance des tremblements de terre, de l\'ingénierie des protéines et de la robotique souple. En octobre 2022, 79 lauréats du prix Nobel ont été affiliés à Caltech, en faisant l\'institution ayant le plus grand nombre de lauréats du Nobel par habitant en Amérique. Cela comprend 46 anciens élèves et membres du corps enseignant (47 prix, le chimiste Linus Pauling étant la seule personne de l\'histoire à remporter deux prix non partagés). De plus, quatre lauréats de la médaille Fields et six lauréats du prix Turing ont été affiliés à Caltech.', 24000),
(12, 2681, 'California Polytechnic State University, San Luis Obispo', 'Business & Management,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Chemical Engineering,Physics & Astronomy,Accounting & Finance,Chemistry,Law,Architecture,Medicine & Dentistry,Electrical & Electronic Engineering,Geography,Computer Science,Politics & International Studies (incl Development Studies),General Engineering,Languages, Literature & Linguistics,Civil Engineering,Mathematics & Statistics,Art, Performing Arts & Design,Education,Psychology,History, Philosophy & Theology,Biological Sciences,Other Health,Sociology,Mechanical & Aerospace Engineering', 35, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d9/CalPoly_Seal.svg/800px-CalPoly_Seal.svg.png', ' L\'université d\'État polytechnique de Californie, abrégée familièrement Cal Poly San Luis Obispo, est une université publique californienne située près de San Luis Obispo. Cal Poly fait partie des 23 campus de l\'université d\'État de Californie et est l\'université la plus étendue en surface de l\'État. \nL\'université permet de suivre un grand nombre de cursus grâce à ses 7 spécialités, mais elle est surtout connue pour ses cursus d\'ingénieurs, d\'agriculture, d\'architecture, d\'économie et d\'arts graphiques. On compte actuellement 117 000 anciens élèves de Cal Poly et les effectifs de l\'année 2006-2007 s\'élevaient à 17 777 étudiants.', 19000),
(13, 3780, 'Carnegie Mellon University', 'Biological Sciences,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Other Health,Business & Management,Accounting & Finance,Physics & Astronomy,Medicine & Dentistry,Law,History, Philosophy & Theology,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Education,Communication & Media Studies,Languages, Literature & Linguistics,Chemistry,Psychology,Computer Science,Electrical & Electronic Engineering,Mathematics & Statistics,Sociology', 22, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bb/Carnegie_Mellon_University_seal.svg/150px-Carnegie_Mellon_University_seal.svg.png', ' La Carnegie Mellon University (CMU) est une université privée de recherche située à Pittsburgh, en Pennsylvanie. L\'institution a été initialement créée en 1900 par Andrew Carnegie sous le nom de Carnegie Technical Schools. En 1912, elle est devenue le Carnegie Institute of Technology et a commencé à délivrer des diplômes de quatre ans. En 1967, elle est devenue l\'Université Carnegie Mellon actuelle suite à sa fusion avec le Mellon Institute of Industrial Research, fondé en 1913 par Andrew Mellon et Richard B. Mellon, et qui faisait auparavant partie de l\'Université de Pittsburgh.\nL\'université est composée de sept collèges, dont le College of Engineering, la School of Computer Science et la Tepper School of Business. Le campus principal de l\'université est situé à 5 miles (8 km) du centre-ville de Pittsburgh. Elle compte également plus d\'une douzaine de sites délivrant des diplômes sur six continents, notamment des campus au Qatar, dans la Silicon Valley et à Kigali, au Rwanda (Carnegie Mellon University Africa), ainsi que des partenariats avec des universités nationales et internationales. Carnegie Mellon compte 15 818 étudiants sur plusieurs campus, issus de 117 pays, et emploie plus de 1 400 membres du corps enseignant.\nCarnegie Mellon est connue pour ses avancées dans la recherche et les nouveaux domaines d\'études, notamment en étant le berceau de nombreuses premières en informatique (y compris les premiers départements d\'informatique[douteux - à discuter], d\'apprentissage automatique et de robotique), en étant à l\'origine du domaine des sciences de la gestion, et en abritant le premier programme de théâtre aux États-Unis. Carnegie Mellon est membre de l\'Association of American Universities et est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".\nCarnegie Mellon participe aux compétitions sportives de la NCAA Division III en tant que membre fondateur de la University Athletic Association. Carnegie Mellon aligne huit équipes masculines et neuf équipes féminines en tant que Tartans. Le corps professoral et les anciens élèves de l\'université comprennent 20 lauréats du prix Nobel et 13 lauréats du prix Turing, et ont remporté 142 Emmy Awards, 52 Tony Awards et 13 Oscars.', 29000),
(14, 876, 'Case Western Reserve University', 'Accounting & Finance,Biological Sciences,History, Philosophy & Theology,Mathematics & Statistics,Physics & Astronomy,Geography,Business & Management,Languages, Literature & Linguistics,Chemistry,Psychology,Art, Performing Arts & Design,Geology, Environmental, Earth & Marine Sciences,Education,Politics & International Studies (incl Development Studies),Economics & Econometrics,Sociology,Computer Science,Communication & Media Studies', 33, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/08/Case_Western_Reserve_University_seal.svg/150px-Case_Western_Reserve_University_seal.svg.png', ' La Case Western Reserve University (CWRU) est une université privée de recherche située à Cleveland, Ohio. Case Western Reserve a été créée après la fédération formelle en 1967 de la Western Reserve University - fondée en 1826 et nommée en raison de son emplacement dans la Connecticut Western Reserve - et du Case Institute of Technology - fondé en 1880 grâce à la dotation de Leonard Case Jr.\nLa Case Western Reserve University comprend huit écoles proposant plus de 100 programmes de premier cycle et environ 160 options d\'études supérieures et professionnelles dans les domaines des STEM, de la médecine, des arts et des sciences humaines. Notamment, les départements de génie biomédical et de biochimie, gérés par la Case Western Reserve University School of Medicine, ont été respectivement classés 7e et 14e au niveau national pour les activités de recherche et les dépenses.\nEn 2023, l\'université comptait 12 266 étudiants (6 186 de premier cycle et 6 080 d\'études supérieures et professionnelles) en provenance des 50 États et de 102 pays, et employait plus de 1 110 membres du corps enseignant à temps plein. Les équipes sportives de l\'université, les Case Western Reserve Spartans, participent à la NCAA Division III en tant que membre fondateur de la University Athletic Association. Les Spartans participent à 10 sports universitaires masculins et 9 sports universitaires féminins.\nLa Case Western Reserve University est membre de l\'Association of American Universities et est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". Selon la National Science Foundation, en 2019, l\'université a consacré 439 millions de dollars à la recherche et au développement (R&D), la classant au 20e rang parmi les institutions privées et au 58e rang national.\nDix-sept lauréats du prix Nobel font partie du corps professoral ou des anciens élèves de la Case Western Reserve, ou de l\'une de ses institutions précédentes. L\'expérience de Michelson-Morley, qui a réfuté l\'existence de l\'\"éther lumineux\", a été menée à la Case Western en 1887, et Albert A. Michelson est devenu le premier Américain à remporter le prix Nobel en sciences.', 34000),
(15, 3551, 'Chapman University', 'History, Philosophy & Theology,General Engineering,Mechanical & Aerospace Engineering,Sociology,Chemical Engineering,Psychology,Accounting & Finance,Education,Politics & International Studies (incl Development Studies),Other Health,Chemistry,Business & Management,Mathematics & Statistics,Computer Science,Biological Sciences,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Civil Engineering,Communication & Media Studies,Electrical & Electronic Engineering,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/6e/Chapman_University_logo.gif/170px-Chapman_University_logo.gif', ' L\'université Chapman (en anglais : Chapman University) est une université privée, à but non lucratif, située dans la commune d\'Orange en Californie, États-Unis. Elle a été fondée en 1861 sous le nom de Hesperian College et le collège prend le nom de Charles Clarke Chapman, alors maire de la ville de Fullerton en 1934, avant de devenir l\'université Chapman en 1991. L\'établissement est affilié à l\'Église chrétienne des Disciples du Christ, un courant protestant d\'Amérique du Nord1. L\'université Chapman regroupe sept collèges et écoles.', 0),
(16, 5349, 'Clark University', 'Geography,History, Philosophy & Theology,Sociology,Economics & Econometrics,Electrical & Electronic Engineering,Biological Sciences,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Chemistry,Communication & Media Studies,Politics & International Studies (incl Development Studies),Psychology,Business & Management,Accounting & Finance,Physics & Astronomy,Civil Engineering,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Computer Science,Languages, Literature & Linguistics,General Engineering,Education,Mathematics & Statistics,Veterinary Science,Other Health,Architecture,Agriculture & Forestry', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0c/Clark_University_seal.svg/140px-Clark_University_seal.svg.png', ' L\'université Clark (en anglais : Clark University) est une université de recherche privée située à Worcester, Massachusetts. Fondée en 1887 avec une importante dotation de son bienfaiteur Jonas Gilman Clark, homme d\'affaires éminent, Clark a été l\'une des premières universités de recherche modernes aux États-Unis. Initialement une institution entièrement dédiée aux cycles supérieurs, les premiers étudiants de premier cycle de Clark sont entrés en 1902 et les femmes ont été admises pour la première fois en 1942.\nL\'université propose 46 filières, mineures et concentrations dans les domaines des sciences humaines, des sciences sociales, des sciences naturelles et de l\'ingénierie, et permet aux étudiants de concevoir des filières spécialisées et de participer à des programmes préprofessionnels. Elle est membre du Consortium de l\'enseignement supérieur de la région centrale du Massachusetts, ce qui permet aux étudiants de s\'inscrire dans d\'autres institutions de Worcester, notamment le Worcester Polytechnic Institute et le College of the Holy Cross.\nClark est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\". Elle a été l\'un des membres fondateurs de l\'Association of American Universities, mais en a quitté en 1999. L\'université participe à des compétitions interuniversitaires dans 17 sports universitaires de la NCAA Division III en tant que Clark Cougars et fait partie de la New England Women\'s and Men\'s Athletic Conference. Les professeurs, anciens élèves et affiliés de Clark ont inclus des chefs d\'entreprise et des inventeurs du facteur éolien, ainsi que les inventeurs de la pilule contraceptive.', 0),
(17, 3877, 'Clarkson University', 'Civil Engineering,Mechanical & Aerospace Engineering,Economics & Econometrics,Business & Management,Physics & Astronomy,Chemical Engineering,General Engineering,Chemistry,Electrical & Electronic Engineering,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f1/Clarkson-seal.png/150px-Clarkson-seal.png', ' Clarkson University est une université privée de recherche avec son campus principal à Potsdam, New York. Clarkson dispose de programmes de troisième cycle supplémentaires et d\'installations de recherche dans le New York Capital District et à Beacon, New York. Elle a été fondée en 1896 et compte environ 4 600 étudiants poursuivant des études menant à des diplômes de baccalauréat, de maîtrise et de doctorat dans chacune de ses écoles ou instituts : l\'Institute for a Sustainable Environment, la School of Arts & Sciences, la David D. Reh School of Business, la Wallace H. Coulter School of Engineering, et la Earl R. and Barbara D. Lewis School of Health Sciences. L\'université est classée comme une institution de recherche de niveau R2.', 0),
(18, 874, 'Clemson University', 'General Engineering,Business & Management,Geography,Geology, Environmental, Earth & Marine Sciences,Computer Science,Other Health,Sociology,Sport Science,Communication & Media Studies,Education,Art, Performing Arts & Design,Chemistry,Mathematics & Statistics,Agriculture & Forestry,Archaeology,Economics & Econometrics,Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Accounting & Finance,Civil Engineering,Biological Sciences,History, Philosophy & Theology,Veterinary Science,Chemical Engineering,Physics & Astronomy,Languages, Literature & Linguistics,Electrical & Electronic Engineering,Psychology', 47, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/Clemson_University_Wordmark.svg/269px-Clemson_University_Wordmark.svg.png', ' Clemson University est une université publique de recherche avec le statut de land-grant située à Clemson, en Caroline du Sud. Fondée en 1889, Clemson est la deuxième plus grande université en termes d\'effectifs en Caroline du Sud. Pour le semestre d\'automne 2019, l\'université comptait un total de 20 195 étudiants de premier cycle et 5 627 étudiants diplômés, et le ratio étudiants', 18000),
(19, 1799, 'Colorado School of Mines', 'Civil Engineering,Mechanical & Aerospace Engineering,Economics & Econometrics,Business & Management,Physics & Astronomy,Chemical Engineering,General Engineering,Chemistry,Electrical & Electronic Engineering,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences', 56, 'https://upload.wikimedia.org/wikipedia/commons/thumb/8/82/Colorado_School_of_Mines_seal.svg/langfr-120px-Colorado_School_of_Mines_seal.svg.png', ' Le Colorado School of Mines (Mines) est une université publique de recherche située à Golden, au Colorado, fondée en 1874. L\'université propose des diplômes de premier cycle et de cycles supérieurs en ingénierie, sciences et mathématiques, avec un accent sur l\'énergie et l\'environnement. Bien que Mines propose des mineures en sciences humaines, en arts et en sciences sociales, elle propose uniquement des majors dans les domaines STEM, à l\'exception de l\'économie. Au semestre d\'automne 2023, l\'école comptait 7 101 étudiants inscrits, dont 5 443 en programme de premier cycle et 1 658 en programme de cycles supérieurs. L\'école est mixte depuis sa création, cependant, l\'inscription reste principalement masculine (68,5% en automne 2022). Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".', 25000),
(20, 1591, 'Colorado State University, Fort Collins', 'Other Health,Biological Sciences,Psychology,Economics & Econometrics,Mathematics & Statistics,Languages, Literature & Linguistics,Electrical & Electronic Engineering,History, Philosophy & Theology,Sociology,Physics & Astronomy,Computer Science,Chemistry,Archaeology,Veterinary Science,Politics & International Studies (incl Development Studies),General Engineering,Chemical Engineering,Law,Architecture,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Agriculture & Forestry,Business & Management,Communication & Media Studies', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/3/33/Colorado_State_University_seal.svg/150px-Colorado_State_University_seal.svg.png', ' Colorado State University (Colorado State or CSU) est une université publique de recherche land-grant située à Fort Collins, au Colorado. Elle est la principale université du système de l\'Université d\'État du Colorado. Colorado State University est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". Elle a été fondée en 1870 en tant que Colorado Agricultural College, et en 1935, elle a été renommée Colorado State College of Agriculture and Mechanic Arts. En 1957, l\'Assemblée générale du Colorado a approuvé son nom actuel, Colorado State University.\nEn 2018, l\'inscription était d\'environ 34 166 étudiants, y compris les étudiants en résidence et hors résidence. L\'université compte environ 2 000 professeurs répartis dans huit collèges et 55 départements académiques. Des baccalauréats sont proposés dans 65 domaines d\'études, avec des masters dans 55 domaines. Colorado State décerne des doctorats dans 40 domaines d\'études, en plus d\'un diplôme professionnel en médecine vétérinaire. Le campus de CSU abrite le Engines and Energy Conversion Laboratory (EECL), le University Center for the Arts, qui abrite l\'Avenir Museum of Design and Merchandising et le Gregory Allicar Museum of Art, le James L. Voss Veterinary Teaching Hospital, et le Cooperative Institute for Research in the Atmosphere (CIRA).\nLes Colorado State Rams concourent dans la Division I de la NCAA au sein de la Mountain West Conference. La nageuse et sextuple médaillée d\'or olympique Amy Van Dyken est l\'une des athlètes les plus remarquables de CSU. L\'école a rebaptisé West Drive, qui s\'étend le long du côté ouest du bâtiment administratif à l\'extrémité sud de l\'Oval de CSU, Amy Van Dyken Way. Les diplômés de CSU incluent des lauréats du prix Pulitzer, des astronautes, des PDG et deux anciens gouverneurs du Colorado. Pour l\'exercice financier 2021, CSU a dépensé 447,2 millions de dollars pour la recherche et le développement.', 0),
(21, 3304, 'Columbia University', 'Medicine & Dentistry,Economics & Econometrics,Politics & International Studies (incl Development Studies),Sport Science,Art, Performing Arts & Design,Biological Sciences,Physics & Astronomy,History, Philosophy & Theology,Geology, Environmental, Earth & Marine Sciences,Computer Science,Chemistry,Languages, Literature & Linguistics,Education,Geography,Sociology,Business & Management,Accounting & Finance,Law,Psychology,Mathematics & Statistics,Other Health,Communication & Media Studies', 7, 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/ef/Columbia_coat_of_arms_no_crest.png/180px-Columbia_coat_of_arms_no_crest.png', ' L\'université Columbia (officiellement Columbia University in the City of New York ou tout simplement « Columbia ») est une université privée située dans le quartier de Morningside Heights, dans le nord-ouest de l\'arrondissement de Manhattan, à New York (États-Unis). Elle trouve son origine dans le King\'s College fondée en 1754 par le roi George II de Grande-Bretagne. Elle est l\'un des plus anciens établissements d’enseignement supérieur aux États-Unis et fait partie du groupe de l\'Ivy League regroupant huit des universités les plus anciennes, les plus célèbres, les plus prestigieuses et les plus élitistes du pays.\nColumbia est l\'une des universités les plus sélectives et prestigieuses au monde. Le taux d\'admission était de 3,9 % en 20231, comparable à ceux de Harvard et de Stanford. Classée première aux États-Unis pour la recherche3, elle figure au sixième rang mondial (4e aux États-Unis) du classement CUWR des 1 000 meilleures universités mondiales4 et au huitième rang mondial du Classement Shanghai des universités.\n101 Prix Nobel sont associés à Columbia en tant qu\'anciens étudiants, professeurs ou membres du personnel, soit plus que toute autre institution de recherche ou université dans le monde. En outre, 34 chefs d’État, dont l\'ex-président américain Barack Obama, plus de vingt-cinq milliardaires vivants ou encore vingt-neuf récompensés aux Oscars sont sortis de ses rangs.\nL\'université administre chaque année le prix Pulitzer.', 22000),
(22, 2240, 'Cornell University', 'Physics & Astronomy,Languages, Literature & Linguistics,Medicine & Dentistry,Mathematics & Statistics,Mechanical & Aerospace Engineering,History, Philosophy & Theology,Chemical Engineering,Geography,Other Health,Art, Performing Arts & Design,Archaeology,Computer Science,Communication & Media Studies,Economics & Econometrics,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences,Sociology,General Engineering,Biological Sciences,Civil Engineering,Psychology,Chemistry,Politics & International Studies (incl Development Studies)', 13, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/42/Cornell_University_Logo.png/600px-Cornell_University_Logo.png', ' Cornell University est une université de recherche privée de l\'Ivy League avec une charte de terre attribuée par l\'État, basée à Ithaca, New York. L\'université a été fondée en 1865 par Ezra Cornell et Andrew Dickson White. Depuis sa création, Cornell est une institution mixte et non sectaire. En automne 2022, le corps étudiant comptait plus de 15 000 étudiants de premier cycle et 7 000 étudiants diplômés provenant des 50 États américains et de 130 pays.\nL\'université est organisée en sept collèges de premier cycle et sept divisions diplômées sur son campus principal d\'Ithaca, chacun définissant ses normes d\'admission spécifiques et ses programmes académiques avec une autonomie quasi complète. L\'université administre également trois campus satellites, dont deux à New York et un dans la région d\'Education City au Qatar.\nCornell est l\'une des rares universités privées à charte de terre aux États-Unis. Parmi ses sept collèges de premier cycle, trois sont des collèges statutaires ou contractuels soutenus par l\'État par le biais du système de l\'Université d\'État de New York, y compris ses collèges d\'agriculture et d\'écologie humaine, ainsi que son école de relations industrielles. Parmi les écoles supérieures de Cornell, seul le collège vétérinaire est soutenu par l\'État. Le campus principal de Cornell University à Ithaca s\'étend sur 745 acres (301 hectares).\nEn octobre 2023, Cornell compte 62 lauréats du prix Nobel, 4 lauréats du prix Turing et 1 lauréat de la médaille Fields affiliés à l\'université. Cornell compte plus de 250 000 anciens élèves vivants, et son corps professoral et ses anciens élèves comprennent 34 boursiers Marshall, 33 boursiers Rhodes, 29 boursiers Truman, 7 boursiers Gates, 63 médaillés olympiques, 10 PDG actuels du Fortune 500 et 35 anciens élèves milliardaires.', 31000),
(24, 1964, 'Dartmouth College', 'Medicine & Dentistry,Psychology,Other Health,Biological Sciences,Computer Science,Agriculture & Forestry,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Languages, Literature & Linguistics,Communication & Media Studies,Accounting & Finance,General Engineering,Sociology,Business & Management,Civil Engineering,Chemistry,Mechanical & Aerospace Engineering,Physics & Astronomy,Art, Performing Arts & Design,Economics & Econometrics,Electrical & Electronic Engineering,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences,Law', 10, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e4/Dartmouth_College_shield.svg/140px-Dartmouth_College_shield.svg.png', ' Dartmouth College est une université privée de recherche de l\'Ivy League située à Hanover, New Hampshire. Fondée en 1769 par Eleazar Wheelock, Dartmouth est l\'une des neuf universités coloniales chartées avant la Révolution américaine. Émergeant à la renommée nationale au tournant du XXe siècle, Dartmouth était considérée comme le collège universitaire le plus prestigieux aux États-Unis au début des années 1900.\nBien qu\'elle ait été initialement établie pour éduquer les Amérindiens en théologie chrétienne et en mode de vie anglais, l\'université a principalement formé des pasteurs congrégationalistes au cours de son histoire avant de se séculariser progressivement. Bien que Dartmouth soit maintenant une université de recherche plutôt qu\'un simple collège universitaire, elle continue de s\'appeler \"Dartmouth College\" pour souligner son accent sur l\'éducation de premier cycle.\nSuivant un programme d\'arts libéraux, Dartmouth propose un enseignement de premier cycle dans 40 départements académiques et programmes interdisciplinaires, comprenant 60 filières dans les domaines des humanités, des sciences sociales, des sciences naturelles et du génie, et permet aux étudiants de concevoir des concentrations spécialisées ou de participer à des programmes de double diplôme. En plus de la faculté de premier cycle en arts et sciences, Dartmouth possède quatre écoles professionnelles et supérieures : la Geisel School of Medicine, la Thayer School of Engineering, la Tuck School of Business et la Guarini School of Graduate and Advanced Studies. L\'université a également des liens avec le Dartmouth–Hitchcock Medical Center. Dartmouth abrite le Rockefeller Center for Public Policy and the Social Sciences, le Hood Museum of Art, le John Sloan Dickey Center for International Understanding et le Hopkins Center for the Arts. Avec un effectif étudiant d\'environ 6 700, Dartmouth est la plus petite université de l\'Ivy League. Les admissions de premier cycle sont très sélectives, avec un taux d\'acceptation de 6 % pour la promotion de 2027, y compris un taux de 4,5 % pour les candidats en décision régulière.\nSitué sur une terrasse au-dessus de la rivière Connecticut, le campus principal de 269 acres (109 hectares) de Dartmouth se trouve dans la région rurale de l\'Upper Valley en Nouvelle-Angleterre. L\'université fonctionne sur un système de trimestre, opérant toute l\'année sur quatre termes académiques de dix semaines chacun. Dartmouth est connue pour son accent sur l\'enseignement de premier cycle, sa culture grecque et ses traditions sur le campus. Ses 34 équipes sportives de niveau universitaire participent à des compétitions intercollégiales dans la conférence Ivy League de la NCAA Division I. L\'université compte de nombreux anciens élèves éminents, dont 170 membres du Congrès américain, 24 gouverneurs américains, 8 secrétaires de cabinet américains, 3 lauréats du prix Nobel, 2 juges de la Cour suprême américaine et un vice-président américain. D\'autres anciens élèves notables incluent 81 boursiers Rhodes, 26 récipiendaires de la bourse Marshall, 13 lauréats du prix Pulitzer, 10 PDG de sociétés Fortune 500 et 51 médaillés olympiques.', 22000);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(25, 3744, 'Drexel University', 'Education,Physics & Astronomy,Accounting & Finance,Mechanical & Aerospace Engineering,Computer Science,Biological Sciences,Architecture,General Engineering,Communication & Media Studies,Medicine & Dentistry,Languages, Literature & Linguistics,Art, Performing Arts & Design,Politics & International Studies (incl Development Studies),Chemical Engineering,Electrical & Electronic Engineering,Sport Science,Business & Management,Economics & Econometrics,Law,History, Philosophy & Theology,Psychology,Veterinary Science,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Sociology,Mathematics & Statistics,Other Health,Chemistry,Agriculture & Forestry', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/8c/Drexel_University_seal.svg/150px-Drexel_University_seal.svg.png', ' Drexel University est une université de recherche privée dont le campus principal est situé à Philadelphie, en Pennsylvanie. L\'école de premier cycle de Drexel a été fondée en 1891 par Anthony J. Drexel, un financier et philanthrope. Fondée sous le nom de Drexel Institute of Art, Science and Industry, elle a été rebaptisée Drexel Institute of Technology en 1936, avant de prendre son nom actuel en 1970.\nEn 2020, plus de 24 000 étudiants étaient inscrits dans plus de 70 programmes de premier cycle et plus de 100 programmes de maîtrise, de doctorat et professionnels à l\'université.\nLe programme de coopération éducative de Drexel (coop) est un aspect unique des programmes de l\'école, offrant aux étudiants la possibilité d\'acquérir jusqu\'à 18 mois d\'expérience professionnelle rémunérée à temps plein dans un domaine lié à leur majeure de premier cycle ou à leur programme de maîtrise ou de doctorat avant l\'obtention de leur diplôme.', 0),
(26, 1229, 'Duke University', 'Medicine & Dentistry,Psychology,Other Health,Biological Sciences,Computer Science,Agriculture & Forestry,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Languages, Literature & Linguistics,Communication & Media Studies,Accounting & Finance,General Engineering,Sociology,Business & Management,Civil Engineering,Chemistry,Mechanical & Aerospace Engineering,Physics & Astronomy,Art, Performing Arts & Design,Economics & Econometrics,Electrical & Electronic Engineering,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences,Law', 10, 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e6/Duke_University_logo.svg/512px-Duke_University_logo.svg.png', ' Duke University est une université de recherche privée située à Durham, en Caroline du Nord, aux États-Unis. Fondée par des méthodistes et des quakers dans la ville actuelle de Trinity en 1838, l\'école a déménagé à Durham en 1892. En 1924, l\'industriel du tabac et de l\'électricité James Buchanan Duke a créé The Duke Endowment et l\'institution a changé de nom pour honorer son père décédé, Washington Duke.\nLe campus s\'étend sur plus de 8 600 acres (3 500 hectares) sur trois sous-campus contigus à Durham, et un laboratoire marin à Beaufort. Le campus ouest, largement conçu par l\'architecte Julian Abele, intègre une architecture gothique avec la Duke Chapel de 210 pieds (64 mètres) au centre du campus et le point culminant, adjacent au centre médical. Le campus est, à 1,5 mile (2,4 kilomètres) de là, où résident tous les étudiants de première année, comprend une architecture de style géorgien.\nL\'université administre deux écoles simultanées en Asie, la Duke–NUS Medical School à Singapour (créée en 2005) et la Duke Kunshan University à Kunshan, en Chine (créée en 2013).\nLes admissions de premier cycle à Duke sont parmi les plus sélectives aux États-Unis, avec un taux d\'acceptation global de 6,2% pour la classe de 2026. Duke dépense plus de 1 milliard de dollars par an en recherche, ce qui en fait l\'une des dix plus grandes universités de recherche aux États-Unis. En 2019, 15 lauréats du prix Nobel et 3 lauréats du prix Turing ont été affiliés à l\'université. Les anciens élèves de Duke incluent également 50 boursiers Rhodes. Duke est l\'alma mater d\'un président des États-Unis (Richard Nixon) et de 14 milliardaires vivants.', 22000),
(27, 1874, 'East Carolina University', 'History, Philosophy & Theology,General Engineering,Communication & Media Studies,Business & Management,Mathematics & Statistics,Geography,Medicine & Dentistry,Geology, Environmental, Earth & Marine Sciences,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Chemistry,Economics & Econometrics,Sociology,Archaeology,Computer Science,Physics & Astronomy,Accounting & Finance,Electrical & Electronic Engineering,Languages, Literature & Linguistics,Education,Psychology,Architecture,Biological Sciences,Other Health,Sport Science', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/2/22/East_Carolina_University.svg/512px-East_Carolina_University.svg.png', ' East Carolina University (ECU) est une université de recherche publique située à Greenville, en Caroline du Nord. C\'est la quatrième plus grande université de Caroline du Nord.\nFondée le 8 mars 1907 en tant qu\'école de formation des enseignants, East Carolina est passée de ses 43 acres (17 hectares) d\'origine à près de 1 600 acres (647 hectares) aujourd\'hui. Les installations académiques de l\'université sont situées sur six sites : le campus principal, le campus des sciences de la santé, le campus de recherche ouest, la station de terrain pour les études côtières à New Holland, en Caroline du Nord, le Millennial Research Innovation Campus dans le quartier des entrepôts de Greenville, et un campus à l\'étranger à Certaldo Alto, en Italie. ECU exploite également l\'Institut d\'études côtières.\nL\'université compte neuf collèges de premier cycle, une école supérieure et quatre écoles professionnelles. Toutes les filières non liées aux sciences de la santé sont situées sur le campus principal. Le Collège des soins infirmiers, le Collège des sciences de la santé alliées, l\'École de médecine Brody et l\'École de médecine dentaire sont situés sur le campus des sciences de la santé. ECU est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\".\nIl existe onze sororités sociales, 16 fraternités sociales, quatre sororités historiquement noires, cinq fraternités historiquement noires, une fraternité amérindienne et une sororité amérindienne. Il y a plus de 400 clubs enregistrés sur le campus, y compris des fraternités et des sororités.', 0),
(29, 187, 'Emory University', 'Law,Other Health,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Physics & Astronomy,Biological Sciences,Business & Management,Chemistry,Computer Science,Psychology,Economics & Econometrics,Communication & Media Studies,General Engineering,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Medicine & Dentistry,Sociology,Languages, Literature & Linguistics,Art, Performing Arts & Design,Mathematics & Statistics', 22, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/63/Emory_University_Seal.svg/150px-Emory_University_Seal.svg.png', ' Emory University est une université de recherche privée située à Atlanta, en Géorgie. Elle a été fondée en 1836 sous le nom d\'Emory College par l\'Église épiscopale méthodiste et nommée en l\'honneur de l\'évêque méthodiste John Emory. Son campus principal est situé dans le quartier de Druid Hills, à 4,8 km du centre-ville d\'Atlanta.\nEmory est composée de neuf écoles de premier cycle, supérieures et professionnelles et compte près de 16 000 étudiants venant des États-Unis et de plus de 100 pays étrangers. Emory Healthcare est le plus grand système de soins de santé de l\'État de Géorgie et comprend sept grands hôpitaux, dont l\'hôpital universitaire Emory et l\'hôpital universitaire Emory Midtown. L\'université exploite l\'Institut du cancer Winship, le Centre de recherche sur les primates Yerkes et de nombreux centres de recherche sur les maladies et les vaccins. Emory University est adjacente aux Centers for Disease Control and Prevention (CDC) des États-Unis et est un partenaire de longue date dans des initiatives mondiales et nationales de prévention et de recherche. Emory University est le principal coordinateur du National Ebola Training and Education Center du Département de la santé des États-Unis. L\'université est l\'une des quatre institutions impliquées dans le programme des unités de recherche sur la tuberculose du NIAID. L\'Association internationale des instituts nationaux de santé publique a son siège social à l\'université.\nEmory University dispose du 15e plus gros fonds de dotation parmi les collèges et universités américains. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\" et est citée pour ses performances scientifiques élevées et son impact en matière de citations dans le classement Leiden du CWTS. Emory University a été élue à l\'Association of American Universities en 1995.\nLes professeurs et anciens élèves d\'Emory incluent un président des États-Unis, 2 premiers ministres, 9 présidents d\'université, 11 membres du Congrès américain, 2 lauréats du prix Nobel de la paix, un vice-président des États-Unis, un président de la Chambre des représentants des États-Unis et un juge de la Cour suprême des États-Unis. D\'autres anciens élèves notables comprennent 21 boursiers Rhodes et 6 lauréats du prix Pulitzer, ainsi que des lauréats d\'Emmy, des lauréats du Grammy, des boursiers MacArthur, des PDG de sociétés du Fortune 500, des chefs d\'État et d\'autres dirigeants de gouvernements étrangers. Emory compte plus de 165 000 anciens élèves, avec 75 clubs d\'anciens élèves établis dans le monde entier, dans 20 pays.', 26000),
(30, 4705, 'Florida Agricultural and Mechanical University', 'Art, Performing Arts & Design,Economics & Econometrics,General Engineering,Communication & Media Studies,Education,Physics & Astronomy,Languages, Literature & Linguistics,Agriculture & Forestry,Sociology,Other Health,Mathematics & Statistics,Politics & International Studies (incl Development Studies),Architecture,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Computer Science,Sport Science,Civil Engineering,Chemistry,History, Philosophy & Theology,Law,Geography,Business & Management,Mechanical & Aerospace Engineering,Psychology,Accounting & Finance,Electrical & Electronic Engineering,Biological Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/9/90/Florida_A%26M_University_seal.svg/800px-Florida_A%26M_University_seal.svg.png', ' Florida Agricultural and Mechanical University (FAMU), couramment appelée Florida A&M, est une université publique à prédominance noire, à vocation agricole et historique, située à Tallahassee, en Floride. Fondée en 1887, c\'est la troisième plus grande université historiquement noire aux États-Unis en termes d\'inscription et la seule université historiquement noire publique en Floride. Elle est une institution membre du système universitaire de l\'État de Floride, ainsi que l\'une des universités agricoles de l\'État, et est accréditée pour décerner des diplômes de baccalauréat, de maîtrise et de doctorat par la Commission sur les collèges de l\'Association des collèges et écoles du Sud.\nLes équipes sportives de FAMU sont connues sous le nom de Rattlers et participent à la Division I de la NCAA. Elles font partie de la Southwestern Athletic Conference (SWAC).', 0),
(31, 447, 'Florida Atlantic University', 'History, Philosophy & Theology,Architecture,Computer Science,Psychology,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Geography,Education,Physics & Astronomy,Accounting & Finance,General Engineering,Art, Performing Arts & Design,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Politics & International Studies (incl Development Studies),Business & Management,Electrical & Electronic Engineering,Mathematics & Statistics,Other Health,Sport Science,Sociology,Medicine & Dentistry,Chemistry,Archaeology,Civil Engineering,Communication & Media Studies,Biological Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f3/Florida_Atlantic_University_seal.svg/800px-Florida_Atlantic_University_seal.svg.png', ' Florida Atlantic University (Florida Atlantic ou FAU) est une université publique de recherche avec son campus principal à Boca Raton, en Floride, et des campus satellites à Dania Beach, Davie, Fort Lauderdale, Jupiter et Fort Pierce. L\'université est membre du système universitaire d\'État de la Floride et est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\".\nFAU est rapidement devenue l\'une des plus grandes institutions de l\'État en termes d\'inscription. Florida Atlantic propose plus de 180 programmes de premier cycle et de cycles supérieurs au sein de ses 10 collèges. L\'université est accréditée par la Southern Association of Colleges and Schools (SACS).\nFAU a ouvert ses portes en 1964 en tant que première université publique de la région métropolitaine de Miami, ne proposant que des cours de niveau supérieur et des cycles supérieurs. L\'inscription initiale était de seulement 867 étudiants, augmentant en 1984 lorsque l\'université a admis ses premiers étudiants de premier cycle de premier cycle. En 2021, l\'inscription a atteint plus de 30 000 étudiants représentant 180 pays, 50 États et le District de Columbia. L\'université dispose d\'un budget annuel de 900 millions de dollars et d\'un impact économique annuel de 6,3 milliards de dollars. Depuis 1964, la Florida Atlantic University a décerné des diplômes à plus de 185 000 anciens élèves.\nLes équipes sportives intercollégiales de FAU, les Florida Atlantic Owls, concourent en Division I de la National Collegiate Athletic Association (NCAA) et dans l\'American Athletic Conference (AAC). Avec 19 équipes sportives de compétition, les Owls ont remporté des titres et des championnats dans la C-USA (la conférence sportive précédente de FAU) et ont attiré l\'attention à l\'échelle nationale. Le 21 octobre 2021, Florida Atlantic a accepté l\'invitation à rejoindre l\'AAC et est devenue membre à part entière le 1er juillet 2023.', 0),
(32, 2948, 'Florida Institute of Technology', 'Computer Science,Sport Science,Sociology,Chemical Engineering,Mechanical & Aerospace Engineering,Other Health,Law,Civil Engineering,Agriculture & Forestry,Communication & Media Studies,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Mathematics & Statistics,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Psychology,General Engineering,Physics & Astronomy,Education,Chemistry,Business & Management,Biological Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/7f/Florida_Institute_of_Technology_%28seal%29.svg/316px-Florida_Institute_of_Technology_%28seal%29.svg.png?20210502001029', ' The Florida Institute of Technology (Florida Tech ou FIT) est une université de recherche privée située à Melbourne, en Floride. L\'université comprend quatre collèges universitaires : Ingénierie et Sciences, Aéronautique, Psychologie et Arts libéraux, et Commerce. Environ la moitié des étudiants de FIT sont inscrits au Collège d\'Ingénierie et de Sciences. Le campus résidentiel principal de 130 acres de l\'université est situé près de l\'aéroport international de Melbourne Orlando et du parc de recherche de la Florida Tech. Le campus est situé à 16 miles de la Patrick Space Force Base.\nL\'université a été fondée en 1958 sous le nom de Brevard Engineering College pour fournir une éducation avancée aux professionnels travaillant dans le programme spatial américain au Kennedy Space Center et au Space Launch Delta 45 à la Cape Canaveral Space Force Station. Depuis 1966, date à laquelle elle a fusionné avec l\'Institute of Technology (FIT) à la suite du changement de nom de l\'University of Central Florida, FIT porte son nom actuel de Florida Tech. En 2021, Florida Tech comptait un effectif d\'étudiants sur le campus de 5 693 personnes entre son campus de Melbourne, ses sites de Melbourne et ses centres éducatifs, ainsi que 3 623 étudiants inscrits dans ses programmes en ligne, répartis presque également entre les étudiants diplômés et de premier cycle, la majorité se concentrant sur les études d\'ingénierie et de sciences. Florida Tech est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\".', 0),
(33, 2989, 'Florida International University', 'History, Philosophy & Theology,Biological Sciences,Mathematics & Statistics,Languages, Literature & Linguistics,Civil Engineering,Architecture,Computer Science,Law,Chemistry,Business & Management,Sociology,Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Geography,Communication & Media Studies,Economics & Econometrics,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Art, Performing Arts & Design,Accounting & Finance,Other Health,Mechanical & Aerospace Engineering,Medicine & Dentistry,General Engineering,Education,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/commons/7/76/Florida_International_University_logo.svg', ' La Florida International University (FIU) est une université publique de recherche située à University Park, en Floride. Fondée en 1965 par la législature de la Floride, l\'université a ouvert officiellement ses portes aux étudiants en 1972. Depuis, la FIU est devenue la troisième plus grande université de Floride et la huitième plus grande université publique des États-Unis en termes d\'effectifs. Elle fait partie intégrante du système universitaire de l\'État de la Floride.\nLa FIU est reconnue en tant qu\'institution Carnegie \"R1 : Universités doctorales - Activité de recherche très élevée\". L\'université est composée de 11 collèges et abrite plus de 40 centres, installations, laboratoires et instituts, proposant une gamme diversifiée de plus de 200 programmes d\'études. Avec un budget annuel dépassant 1,7 milliard de dollars et un impact économique annuel dépassant 5 milliards de dollars, la FIU est un contributeur majeur au paysage académique et économique de la région. L\'université est accréditée par la Southern Association of Colleges and Schools (SACS).\nLes Panthers de la FIU représentent l\'université dans les sports interuniversitaires, participant à la NCAA Division I et à la Conference USA (C-USA). Les équipes sportives de la FIU, connues sous le nom de FIU Panthers, ont remporté cinq championnats sportifs, et des athlètes individuels des Panthers ont connu le succès dans divers championnats nationaux de la NCAA. Kenneth A. Jessell occupe le poste de président de la FIU depuis 2022.', 0),
(34, 4705, 'Florida State University', 'Chemical Engineering,Sport Science,Languages, Literature & Linguistics,Architecture,Biological Sciences,Archaeology,Sociology,Accounting & Finance,Medicine & Dentistry,Mechanical & Aerospace Engineering,Computer Science,Geology, Environmental, Earth & Marine Sciences,Communication & Media Studies,General Engineering,Economics & Econometrics,Psychology,Geography,History, Philosophy & Theology,Physics & Astronomy,Civil Engineering,Education,Art, Performing Arts & Design,Politics & International Studies (incl Development Studies),Mathematics & Statistics,Other Health,Electrical & Electronic Engineering,Chemistry,Law,Business & Management', 49, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/6b/Florida_State_University_seal.svg/150px-Florida_State_University_seal.svg.png', ' La Florida State University (FSU ou, plus communément, Florida State) est une université publique de recherche située à Tallahassee, en Floride, aux États-Unis. Elle est un membre éminent du système universitaire de l\'État de Floride. Fondée en 1851, elle est implantée sur le plus ancien site d\'enseignement supérieur continu de la Floride.\nLa Florida State University est composée de 16 collèges distincts et de plus de 110 centres, installations, laboratoires et instituts proposant plus de 360 programmes d\'études, y compris des programmes d\'écoles professionnelles. En 2021, l\'université comptait 45 493 étudiants en provenance des 50 États et de 130 pays. La FSU abrite le seul laboratoire national de Floride, le National High Magnetic Field Laboratory, et est le lieu de naissance du médicament anticancéreux commercialement viable, le Taxol. L\'université gère également le musée d\'art John & Mable Ringling, le musée d\'art d\'État de la Floride et l\'un des plus grands complexes musée', 16000),
(35, 540, 'Fordham University', 'Accounting & Finance,Archaeology,Art, Performing Arts & Design,Biological Sciences,Business & Management,Chemistry,Communication & Media Studies,Computer Science,Economics & Econometrics,Education,Geography,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Languages, Literature & Linguistics,Mathematics & Statistics,Mechanical & Aerospace Engineering,Physics & Astronomy,Politics & International Studies (incl Development Studies),Psychology,Sociology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bb/Fordham_Rams_logo.svg/800px-Fordham_Rams_logo.svg.png', ' Fordham University est une université de recherche jésuite privée située à New York City. Fondée en 1841 et nommée d\'après le quartier de Fordham dans le Bronx où se trouve son campus d\'origine, Fordham est la plus ancienne université catholique et jésuite du nord-est des États-Unis et la troisième plus ancienne université de l\'État de New York.\nFondé en tant que St. John\'s College par John Hughes, alors évêque coadjuteur de New York, le collège a été confié à la Société de Jésus peu de temps après et est depuis devenu une école indépendante affiliée aux jésuites sous la direction d\'un conseil d\'administration laïque. Bien que gouverné indépendamment de l\'Église depuis 1969, chaque président de l\'Université Fordham entre 1846 et 2022 était un prêtre jésuite, et le programme d\'études reste influencé par les principes éducatifs jésuites.\nFordham compte environ 15 300 étudiants originaires de plus de 65 pays et est composé de dix collèges constitutifs, dont quatre sont de premier cycle et six sont des cycles supérieurs, répartis sur trois campus dans le sud de l\'État de New York : le campus Rose Hill dans le Bronx, le campus Lincoln Center dans l\'Upper West Side de Manhattan, et le campus de Westchester à West Harrison, New York. En plus de ces emplacements, l\'université possède un centre d\'études à l\'étranger à Londres et des bureaux de terrain en Espagne et en Afrique du Sud. L\'université propose des diplômes dans plus de 60 disciplines.\nLes équipes sportives de l\'université, les Rams, comprennent une équipe de football qui a remporté le Sugar Bowl, deux membres du Pro Football Hall of Fame, deux joueurs All-Americans, deux étoiles de la Ligue canadienne de football et de nombreux joueurs de la NFL. Les Rams ont également participé au tout premier match de football universitaire télévisé en 1939 et au tout premier match de basketball universitaire télévisé en 1940. L\'équipe de baseball de Fordham a disputé le premier match de baseball universitaire sous les règles modernes en 1859, a aligné 56 joueurs de la Ligue majeure et détient le record du plus grand nombre de victoires de l\'histoire du baseball universitaire de la NCAA.\nLes anciens élèves et les professeurs de Fordham incluent le président Donald Trump, des sénateurs et des représentants américains, quatre cardinaux de l\'Église catholique, plusieurs gouverneurs et ambassadeurs américains, plusieurs milliardaires, deux directeurs de la CIA, des acteurs oscarisés et lauréats d\'un Emmy Award, de la royauté, un chef d\'État étranger, un conseiller de la Maison Blanche, un vice-chef d\'état-major de l\'armée américaine, un procureur général des États-Unis, un président de la Réserve fédérale de New York et la première candidate à la vice-présidence d\'un grand parti politique aux États-Unis.', 0),
(36, 1459, 'George Mason University', 'Psychology,Communication & Media Studies,Civil Engineering,Art, Performing Arts & Design,General Engineering,Education,Law,Sociology,Physics & Astronomy,History, Philosophy & Theology,Business & Management,Biological Sciences,Sport Science,Mechanical & Aerospace Engineering,Accounting & Finance,Geography,Electrical & Electronic Engineering,Chemistry,Other Health,Languages, Literature & Linguistics,Economics & Econometrics,Politics & International Studies (incl Development Studies),Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences,Computer Science', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/53/George_Mason_University_logo.svg/300px-George_Mason_University_logo.svg.png', ' L\'université George-Mason (George Mason University, aussi appelée GMU) est une université américaine située dans le comté de Fairfax en Virginie, dans la banlieue de Washington. Fondée en 1957 comme une branche de l\'université de Virginie, elle est devenue une institution indépendante en 1972. Elle est aujourd\'hui la plus grande université de Virginie par le nombre d\'étudiants, avec 33 320 étudiants en 2011.\nGeorge Mason possède plusieurs campus outre celui de Fairfax : le campus d\'Arlington fondé en 1979 qui abrite l\'École de droit, le campus de Prince William fondé en 1997 à Manassas et le campus de Loundoun. Les campus de Fairfax et d\'Arlington sont situés à proximité de la ligne orange du métro de Washington (stations Vienna', 0),
(37, 5027, 'George Washington University', 'Sociology,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Psychology,Archaeology,Other Health,Physics & Astronomy,Medicine & Dentistry,General Engineering,Art, Performing Arts & Design,Education,Sport Science,Economics & Econometrics,Biological Sciences,Accounting & Finance,Mathematics & Statistics,Business & Management,Law,Communication & Media Studies,Computer Science,Chemistry,History, Philosophy & Theology,Civil Engineering,Politics & International Studies (incl Development Studies),Architecture,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences,Geography', 41, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d8/George_Washington_University_seal.svg/150px-George_Washington_University_seal.svg.png', ' La George Washington University (GW ou GWU) est une université de recherche privée à charte fédérale située à Washington, D.C. Fondée en 1821 en tant que première université de Washington, D.C. par le Congrès des États-Unis, GW est l\'une des six universités aux États-Unis ayant une charte du Congrès.\nGW est classée parmi les \"R1: Universités doctorales - Très grande activité de recherche\". Elle est membre de l\'Association of American Universities. L\'université propose des programmes de diplômes dans soixante et onze disciplines, avec environ 11 500 étudiants de premier cycle et 15 000 étudiants diplômés. Les équipes sportives de l\'école, les George Washington Revolutionaries, jouent dans la NCAA Division I Atlantic 10 Conference. GW accueille également chaque année de nombreux événements politiques, dont les Réunions annuelles de la Banque mondiale et du Fonds monétaire international.\nLes anciens élèves, les professeurs et les affiliés de l\'université comprennent 16 chefs d\'État ou de gouvernement étrangers, 28 sénateurs américains, 27 gouverneurs américains, 18 membres du Cabinet américain, cinq lauréats du prix Nobel, deux médaillés olympiques, deux lauréats d\'un Oscar et un lauréat d\'un Golden Globe. GW compte plus de 1 100 anciens élèves actifs au sein du Service extérieur des États-Unis et est l\'une des plus grandes écoles fournisseuses de diplomates.', 37000),
(38, 5027, 'Georgetown University', 'Law,Languages, Literature & Linguistics,Accounting & Finance,Chemistry,History, Philosophy & Theology,Agriculture & Forestry,Economics & Econometrics,Architecture,Communication & Media Studies,Biological Sciences,Medicine & Dentistry,Sport Science,Other Health,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Education,Physics & Astronomy,Business & Management,Mathematics & Statistics,General Engineering,Sociology,Computer Science,Psychology', 16, 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d9/Georgetown_University_seal.svg/150px-Georgetown_University_seal.svg.png', ' Georgetown University est une université de recherche jésuite privée située dans le quartier de Georgetown à Washington, D.C., aux États-Unis. Fondée par l\'évêque John Carroll en 1789 en tant que Georgetown College, elle est la plus ancienne institution d\'enseignement supérieur catholique aux États-Unis et la première université à charte fédérale du pays.\nL\'université compte onze écoles universitaires et propose des programmes de premier cycle et des cycles supérieurs. Le campus principal de l\'université se trouve sur une colline au-dessus de la rivière Potomac et est reconnaissable grâce à Healy Hall, un monument historique national. Georgetown est classée parmi les \"R1: Universités doctorales - Très grande activité de recherche\" et ses admissions de premier cycle sont considérées comme très sélectives. L\'université propose des programmes de diplômes dans quarante-huit disciplines, accueillant en moyenne 7 500 étudiants de premier cycle et 10 000 étudiants diplômés de plus de 135 pays. Les équipes sportives de l\'école portent le surnom de Hoyas et comprennent une équipe de basket-ball masculin.\nParmi les anciens élèves notables, on compte 28 boursiers Rhodes, 41 boursiers Marshall, 33 boursiers Truman, 543 boursiers Fulbright, huit milliardaires vivants, deux juges de la Cour suprême des États-Unis et deux présidents américains, ainsi que des membres de la royauté internationale et plus d\'une douzaine de chefs d\'État étrangers. Georgetown a formé plus de diplomates américains que toute autre université, ainsi que de nombreux politiciens et fonctionnaires américains.', 27000),
(39, 187, 'Georgia Institute of Technology', 'Architecture,Computer Science,Business & Management,Chemistry,Economics & Econometrics,General Engineering,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Chemical Engineering,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Physics & Astronomy,History, Philosophy & Theology,Civil Engineering,Languages, Literature & Linguistics,Sociology,Accounting & Finance,Geography,Psychology,Art, Performing Arts & Design,Mathematics & Statistics', 23, 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Georgia_Tech_seal.svg/150px-Georgia_Tech_seal.svg.png', ' Le Georgia Institute of Technology, couramment appelé Georgia Tech ou GT, est une université publique de recherche et un institut de technologie situé à Atlanta, en Géorgie. Fondée en 1885, elle fait partie du système universitaire de la Géorgie et possède des campus satellites à Savannah (Géorgie), Metz (France), Shenzhen (Chine) et Singapour.\nL\'école a été fondée sous le nom de Georgia School of Technology dans le cadre des plans de la Reconstruction visant à développer une économie industrielle dans le Sud des États-Unis après la guerre civile. Initialement, elle ne proposait qu\'un diplôme en génie mécanique. D\'ici 1901, son programme s\'était élargi pour inclure le génie électrique, civil et chimique. En 1948, l\'école a changé de nom pour refléter son évolution d\'une école de métiers à un institut technique et une université de recherche plus grande et plus capable. Aujourd\'hui, le Georgia Tech est organisé en 6 collèges et compte environ 31 départements et unités académiques, mettant l\'accent sur les sciences et la technologie.\nLes activités sportives étudiantes, qu\'elles soient organisées ou intramurales, font partie de la vie des étudiants et des anciens élèves. Les équipes sportives compétitives intercollégiales de l\'école, les Yellow Jackets, quadruples champions nationaux de football, et la chanson de combat reconnue nationalement \"Ramblin\' Wreck from Georgia Tech\", ont contribué à maintenir le Georgia Tech sous les feux de la rampe nationale. Georgia Tech aligne huit équipes masculines et sept équipes féminines qui concourent dans les sports universitaires de la NCAA Division I et dans la Football Bowl Subdivision. Georgia Tech est membre de l\'Atlantic Coast Conference.', 15000),
(40, 4590, 'Georgia Southern University', 'Sport Science,Economics & Econometrics,Electrical & Electronic Engineering,Sociology,Business & Management,Politics & International Studies (incl Development Studies),Computer Science,Geography,Chemical Engineering,Physics & Astronomy,Languages, Literature & Linguistics,Civil Engineering,Medicine & Dentistry,Biological Sciences,Mathematics & Statistics,History, Philosophy & Theology,Communication & Media Studies,Education,Art, Performing Arts & Design,Geology, Environmental, Earth & Marine Sciences,Accounting & Finance,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/2a/Georgia_Southern_Eagles_logo.svg/1024px-Georgia_Southern_Eagles_logo.svg.png', ' Georgia Southern University (Southern ou Georgia Southern) est une université publique de recherche dans l\'État de Géorgie aux États-Unis. Le campus principal est situé à Statesboro, avec des campus supplémentaires à Savannah (Armstrong Campus) et à Hinesville (Liberty Campus). Fondée en 1906, Georgia Southern est la cinquième plus grande institution du système universitaire de Géorgie. Southern propose plus de 140 filières académiques différentes aux niveaux du baccalauréat, de la maîtrise et du doctorat. L\'université compte environ 27 000 étudiants provenant des 50 États et de plus de 80 pays. Georgia Southern est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\" et une université complète par le système universitaire de Géorgie.\nLes équipes sportives intercollégiales de l\'Université Georgia Southern, connues sous le nom de \"Eagles\", concourent dans la Sun Belt Conference.', 0),
(41, 187, 'Georgia State University', 'Biological Sciences,Economics & Econometrics,Geography,Mathematics & Statistics,Other Health,Physics & Astronomy,Sport Science,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,History, Philosophy & Theology,Chemistry,Psychology,Languages, Literature & Linguistics,Education,Accounting & Finance,Law,Sociology,Business & Management,Computer Science,Communication & Media Studies,Medicine & Dentistry,Geology, Environmental, Earth & Marine Sciences', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6c/Georgia_State_University_Logo.svg/716px-Georgia_State_University_Logo.svg.png', ' Georgia State University (Georgia State, State ou GSU) est une université de recherche publique située à Atlanta, en Géorgie. Fondée en 1913, elle fait partie des quatre universités de recherche du système universitaire de Géorgie. C\'est également la plus grande institution d\'enseignement supérieur de Géorgie en termes d\'inscription et l\'une des plus grandes du pays, avec environ 50 000 étudiants, dont environ 33 000 étudiants de premier cycle et cycles supérieurs sur le campus principal du centre-ville.\nGeorgia State est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". L\'université est l\'institution publique la plus complète de Géorgie, proposant plus de 250 programmes de diplômes dans plus de 100 domaines d\'études répartis dans 10 collèges et écoles académiques. Georgia State possède deux bibliothèques : la bibliothèque universitaire, qui est répartie entre la bibliothèque nord et la bibliothèque sud sur le campus principal et également répartie entre les campus du Perimeter College, et la bibliothèque de droit, qui est située sur le campus principal. Ensemble, les deux bibliothèques contiennent plus de 13 millions de documents et servent de dépôts de documents fédéraux. Georgia State a un impact économique de 2,5 milliards de dollars en Géorgie.\nLes équipes sportives intercollégiales de l\'Université Georgia State, les Georgia State Panthers, concourent dans la Sun Belt Conference de la NCAA Division I. Georgia State est membre fondateur de la Sun Belt Conference.', 0),
(42, 62, 'Grand Valley State University', 'Languages, Literature & Linguistics,Electrical & Electronic Engineering,Other Health,Computer Science,Art, Performing Arts & Design,Mathematics & Statistics,Accounting & Finance,Medicine & Dentistry,General Engineering,Psychology,Biological Sciences,Economics & Econometrics,Agriculture & Forestry,Civil Engineering,Sport Science,Communication & Media Studies,Business & Management,Education,Mechanical & Aerospace Engineering,Physics & Astronomy,Geography,History, Philosophy & Theology,Sociology,Geology, Environmental, Earth & Marine Sciences,Chemistry,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/commons/e/ee/Logo_of_Grand_Valley_State_University.svg', ' La Grand Valley State University (GVSU, GV ou Grand Valley) est une université publique située à Allendale, dans le Michigan. Elle a été créée en 1960 sous le nom de Grand Valley State College. Son campus principal est situé sur 1 322 acres (5,35 km2) à environ 12 miles (19 km) à l\'ouest de Grand Rapids. L\'université dispose également de campus à Grand Rapids et à Holland, ainsi que de centres régionaux à Battle Creek, Detroit, Muskegon et Traverse City.\nGVSU compte plus de 24 000 étudiants à l\'automne 2021, issus des 83 comtés du Michigan, ainsi que de nombreux autres États et pays étrangers. Elle emploie plus de 3 000 personnes, dont environ 1 780 enseignants et 1 991 membres du personnel de soutien. L\'université compte des anciens élèves originaires de 50 États américains, du Canada et de 25 autres pays.\nLes équipes sportives de la GVSU, qui participent à la NCAA Division II, portent le nom de Lakers et concourent dans la Great Lakes Intercollegiate Athletic Conference (GLIAC) dans les 21 sports universitaires intercollégiaux. Elles ont remporté 28 championnats nationaux de la NCAA Division II.', 0),
(43, 643, 'Harvard University', 'Mathematics & Statistics,Civil Engineering,Languages, Literature & Linguistics,Art, Performing Arts & Design,Business & Management,General Engineering,Geography,Archaeology,Geology, Environmental, Earth & Marine Sciences,Computer Science,Chemistry,Sociology,Mechanical & Aerospace Engineering,Accounting & Finance,Other Health,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Agriculture & Forestry,Psychology,Economics & Econometrics,Communication & Media Studies,Biological Sciences,Architecture,Medicine & Dentistry,Law,Physics & Astronomy,Education,History, Philosophy & Theology', 5, 'https://upload.wikimedia.org/wikipedia/commons/thumb/c/cc/Harvard_University_coat_of_arms.svg/800px-Harvard_University_coat_of_arms.svg.png', ' L\'Université Harvard est une université de recherche privée de la Ivy League située à Cambridge, dans le Massachusetts. Fondée en 1636 sous le nom de Harvard College et nommée en l\'honneur de son premier bienfaiteur, le pasteur puritain John Harvard, elle est la plus ancienne institution d\'enseignement supérieur aux États-Unis. Son influence, sa richesse et ses classements en font l\'une des universités les plus prestigieuses au monde.\nLa création de Harvard a été autorisée par la législature coloniale du Massachusetts, \"craignant de laisser un ministère illettré aux églises\". Bien que jamais formellement affilié à une dénomination, Harvard College formait principalement des ministres congrégationalistes dans ses premières années. Son programme d\'études et son corps étudiant ont été progressivement laïcisés au cours du XVIIIe siècle. Au XIXe siècle, Harvard est devenue l\'institution académique et culturelle la plus importante parmi l\'élite de Boston. Après la guerre civile américaine, sous la longue direction du président Charles William Eliot (1869–1909), le collège a développé plusieurs écoles professionnelles affiliées qui ont transformé le collège en une université de recherche moderne. En 1900, Harvard a cofondé l\'Association of American Universities. James B. Conant a dirigé l\'université à travers la Grande Dépression et la Seconde Guerre mondiale, et a assoupli les admissions après la guerre.\nL\'université est composée de dix facultés académiques ainsi que de l\'Institut Radcliffe de Harvard. La Faculté des arts et des sciences propose des études dans un large éventail de disciplines académiques au niveau du premier cycle et du cycle supérieur, et d\'autres facultés ne proposent que des diplômes de cycle supérieur, y compris des diplômes professionnels. Harvard possède trois campus principaux : le campus de Cambridge de 209 acres (85 ha) centré sur Harvard Yard ; un campus adjacent immédiatement de l\'autre côté de la Charles River dans le quartier d\'Allston à Boston ; et le campus médical dans la zone médicale de Longwood à Boston. La dotation de Harvard est estimée à 50,7 milliards de dollars, ce qui en fait l\'institution académique la plus riche du monde. Les revenus de la dotation permettent au collège de premier cycle d\'admettre des étudiants indépendamment des besoins financiers et de fournir une aide financière sans prêts. Selon l\'American Library Association, l\'Université Harvard possède la quatrième plus grande bibliothèque en termes de volumes aux États-Unis.\nLes anciens élèves, les professeurs et les chercheurs de Harvard comptent 188 milliardaires vivants, 8 présidents américains, de nombreux chefs d\'État, fondateurs d\'entreprises renommées, lauréats du prix Nobel, médaillés Fields, membres du Congrès, boursiers MacArthur, boursiers Rhodes, boursiers Marshall, lauréats du prix Turing, lauréats du prix Pulitzer et boursiers Fulbright. Selon la plupart des critères, Harvard figure parmi les meilleures mondialement dans chacune de ces catégories. De plus, les étudiants et les anciens élèves ont remporté 10 Oscars et 110 médailles olympiques (46 en or).', 17000),
(44, 2042, 'Hofstra University', 'Education,Civil Engineering,Psychology,Biological Sciences,Other Health,Sport Science,Accounting & Finance,Law,Communication & Media Studies,Business & Management,Agriculture & Forestry,Geography,History, Philosophy & Theology,Electrical & Electronic Engineering,Physics & Astronomy,Art, Performing Arts & Design,General Engineering,Geology, Environmental, Earth & Marine Sciences,Sociology,Languages, Literature & Linguistics,Medicine & Dentistry,Chemistry,Computer Science,Mathematics & Statistics,Economics & Econometrics,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/d/d8/HUSeal.png', ' Hofstra University est une université privée située à Hempstead, dans l\'État de New York.\nHofstra a été créée en 1935 en tant qu\'extension de l\'Université de New York sous le nom de Nassau College - Hofstra Memorial of New York University. Elle est devenue indépendante en tant que Hofstra College en 1939 et a obtenu le statut d\'université en 1963. Composée de dix écoles, dont la Zucker School of Medicine et la Maurice A. Deane School of Law, Hofstra a accueilli une série de conférences présidentielles de premier plan et plusieurs débats présidentiels aux États-Unis.', 0),
(45, 5027, 'Howard University', 'Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Sport Science,Chemical Engineering,Civil Engineering,Psychology,Sociology,Other Health,Biological Sciences,General Engineering,Chemistry,Art, Performing Arts & Design,Computer Science,Law,Medicine & Dentistry,History, Philosophy & Theology,Physics & Astronomy,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Archaeology,Mechanical & Aerospace Engineering,Accounting & Finance,Communication & Media Studies,Languages, Literature & Linguistics,Architecture,Business & Management,Mathematics & Statistics,Education', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a3/Howard_University_seal.svg/800px-Howard_University_seal.svg.png', ' Howard University est une université de recherche historiquement noire privée et fédéralement chartée à Washington, D.C., située dans le quartier Shaw. Elle est classée parmi les \"R2 : universités doctorales - activité de recherche élevée\" et accréditée par la Middle States Commission on Higher Education.\nFondée en 1867, Howard est une institution non sectaire. Elle propose des diplômes de premier cycle, des cycles supérieurs et des diplômes professionnels dans plus de 120 programmes.', 0),
(46, 811, 'Illinois Institute of Technology', 'Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Sociology,Languages, Literature & Linguistics,Chemical Engineering,Physics & Astronomy,Economics & Econometrics,Law,General Engineering,Mathematics & Statistics,Computer Science,Education,Communication & Media Studies,Architecture,Civil Engineering,Accounting & Finance,Chemistry,Electrical & Electronic Engineering,Psychology,Business & Management,Biological Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/9/96/Illinois_Institute_of_Technology_%28seal%29.svg/300px-Illinois_Institute_of_Technology_%28seal%29.svg.png?20231118101613', ' L\'Illinois Institute of Technology (IIT), communément appelé Illinois Tech, est une université de recherche privée située à Chicago, dans l\'Illinois. Tracant son histoire jusqu\'en 1890, le nom actuel a été adopté lors de la fusion de l\'Armour Institute et du Lewis Institute en 1940. L\'université propose des programmes dans les domaines de l\'architecture, des affaires, des communications, du design, de l\'ingénierie, de la technologie industrielle, de l\'informatique, du droit, de la psychologie et des sciences. Elle est classée parmi les \"R2 : universités doctorales - activité de recherche élevée\". Le corps professoral et les anciens élèves de l\'université comprennent 3 lauréats du prix Nobel, 2 bénéficiaires de bourses Fulbright et 1 récipiendaire de la National Medal of Technology.\nLes racines historiques de l\'université remontent à plusieurs institutions américaines d\'éducation en génie et en professionnalisme du 19e siècle. Au milieu du 20e siècle, elle s\'est étroitement associée aux tendances de l\'architecture moderniste grâce au travail de son doyen de l\'architecture, Ludwig Mies van der Rohe, qui a conçu son campus. L\'Institute of Design, la Chicago-Kent College of Law et le Midwest College of Engineering ont également été fusionnés dans l\'Illinois Tech.', 0),
(47, 433, 'Indiana University', 'Civil Engineering,Mechanical & Aerospace Engineering,History, Philosophy & Theology,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences,Mathematics & Statistics,General Engineering,Chemistry,Medicine & Dentistry,Law,Accounting & Finance,Art, Performing Arts & Design,Communication & Media Studies,Sociology,Other Health,Economics & Econometrics,Archaeology,Politics & International Studies (incl Development Studies),Languages, Literature & Linguistics,Geography,Chemical Engineering,Sport Science,Business & Management,Veterinary Science,Physics & Astronomy,Agriculture & Forestry,Education,Architecture,Psychology,Computer Science,Biological Sciences', 76, 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/7e/Indiana_University_logotype.svg/512px-Indiana_University_logotype.svg.png', ' L\'Université de l\'Indiana à Bloomington (IU Bloomington, Indiana University, IU, ou simplement Indiana) est une université de recherche publique située à Bloomington, dans l\'Indiana. C\'est le campus principal de l\'Université de l\'Indiana et son plus grand campus avec plus de 40 000 étudiants. Établie comme séminaire d\'État en 1820, le nom a été changé en \"Indiana College\" en 1829 et en \"Indiana University\" en 1838.\nL\'Université de l\'Indiana est membre de l\'Association of American Universities et est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". Ses écoles et programmes comprennent la Jacobs School of Music, la Kelley School of Business, la School of Education, la Luddy School of Informatics, la O\'Neill School of Public and Environmental Affairs, la School of Public Health, la School of Medicine, la School of Nursing, la Hutton Honors College et la Maurer School of Law. Le campus abrite également la Lilly Library, l\'Eskenazi Museum of Art et l\'Indiana Memorial Union.\nLes équipes sportives de l\'Indiana participent à la Division I de la NCAA et sont connues sous le nom de Indiana Hoosiers. L\'université est membre de la Big Ten Conference. Comme elle n\'a pas de mascotte, toutes les équipes sont simplement appelées \"Hoosiers\". Les Indiana Hoosiers ont remporté 24 championnats nationaux de la NCAA et un championnat national de l\'Association for Intercollegiate Athletics for Women (AIAW), en plus de 145 championnats nationaux individuels de la NCAA. Les titres remportés par les équipes incluent huit par l\'équipe de soccer masculin des Hoosiers, six records consécutifs en natation et plongée masculine, cinq par l\'équipe de basketball masculin des Hoosiers, trois en cross-country masculin, un en athlétisme masculin et un en lutte.', 12000);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(48, 89, 'Iowa State University', 'Mechanical & Aerospace Engineering,History, Philosophy & Theology,Chemical Engineering,Accounting & Finance,Veterinary Science,Mathematics & Statistics,Politics & International Studies (incl Development Studies),Architecture,Other Health,General Engineering,Psychology,Medicine & Dentistry,Sport Science,Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Languages, Literature & Linguistics,Civil Engineering,Biological Sciences,Law,Business & Management,Sociology,Education,Art, Performing Arts & Design,Computer Science,Economics & Econometrics,Communication & Media Studies,Chemistry,Electrical & Electronic Engineering,Agriculture & Forestry', 89, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/80/Iowa_State_University_seal.svg/800px-Iowa_State_University_seal.svg.png', ' L\'Iowa State University of Science and Technology (Iowa State University, Iowa State ou ISU) est une université publique de recherche agricole à Ames, dans l\'Iowa. Fondée en 1858 sous le nom de Iowa Agricultural College and Model Farm, l\'Iowa State est devenue l\'une des premières institutions agricoles désignées par le gouvernement fédéral lorsque la législature de l\'Iowa a accepté les dispositions du Morrill Act de 1862 le 11 septembre 1862, faisant de l\'Iowa le premier État de la nation à le faire. Le 4 juillet 1959, le collège a été officiellement renommé Iowa State University of Science and Technology.\nIowa State est la plus grande université de l\'État de l\'Iowa en termes d\'effectifs totaux. Les offres académiques de l\'université sont gérées à travers huit collèges, dont le College of Agriculture and Life Sciences, le College of Veterinary Medicine, le College of Engineering, le Graduate College, le College of Liberal Arts & Sciences, le College of Design, Debbie and Jerry Ivy College of Business, et le College of Human Sciences. Ils proposent plus de 100 programmes de licence, 112 programmes de master et 83 programmes de doctorat, ainsi qu\'un programme professionnel en médecine vétérinaire.\nIowa State est classée parmi les \"R1: universités doctorales - activité de recherche très élevée\". L\'université abrite l\'Ames Laboratory, l\'un des dix laboratoires de recherche du Département de l\'Énergie des États-Unis, le Biorenewables Research Laboratory, le Plant Sciences Institute, et divers autres instituts de recherche. Les équipes sportives de l\'Iowa State University, les Cyclones, participent à la Division I de la NCAA et sont membres fondateurs de la Big 12.', 13000),
(49, 1983, 'James Madison University', 'General Engineering,Psychology,Law,Economics & Econometrics,Communication & Media Studies,History, Philosophy & Theology,Geology, Environmental, Earth & Marine Sciences,Geography,Languages, Literature & Linguistics,Biological Sciences,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Business & Management,Chemistry,Sociology,Accounting & Finance,Sport Science,Other Health,Mathematics & Statistics,Computer Science,Physics & Astronomy,Education', 75, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/7c/James_Madison_University_seal.svg/247px-James_Madison_University_seal.svg.png?20220815221908', ' La James Madison University (JMU, Madison ou James Madison) est une université publique de recherche située à Harrisonburg, en Virginie. Fondée en 1908 sous le nom de State Normal and Industrial School for Women at Harrisonburg, l\'institution a été renommée Madison College en 1938 en l\'honneur du président James Madison, puis James Madison University en 1977. Elle est située dans la vallée de Shenandoah, juste à l\'ouest de la montagne Massanutten.', 16000),
(50, 247, 'Johns Hopkins University', 'Sociology,General Engineering,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Accounting & Finance,Archaeology,Psychology,Biological Sciences,Art, Performing Arts & Design,Business & Management,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Medicine & Dentistry,Economics & Econometrics,Chemical Engineering,Education,Languages, Literature & Linguistics,Chemistry,Other Health,Physics & Astronomy,Computer Science,Mathematics & Statistics,Mechanical & Aerospace Engineering,History, Philosophy & Theology', 13, 'https://logos-world.net/wp-content/uploads/2023/02/Johns-Hopkins-University-Logo-500x281.png', ' La Johns Hopkins University (souvent abrégée en Johns Hopkins, Hopkins ou JHU) est une université de recherche privée située à Baltimore, dans le Maryland. Fondée en 1876, Johns Hopkins a été la première université américaine basée sur le modèle des institutions de recherche européennes.\nL\'université a été nommée d\'après son premier bienfaiteur, l\'entrepreneur américain et philanthrope quaker Johns Hopkins. Le legs de 7 millions de dollars de Hopkins pour créer l\'université était le plus grand don philanthropique de l\'histoire américaine jusqu\'à cette époque. Daniel Coit Gilman, inauguré en tant que premier président de Johns Hopkins le 22 février 1876, a conduit l\'université à révolutionner l\'enseignement supérieur aux États-Unis en intégrant l\'enseignement et la recherche. En 1900, Johns Hopkins est devenue membre fondateur de l\'Association américaine des universités. L\'université a été en tête de toutes les universités américaines en matière de dépenses annuelles de recherche et développement pendant plus de quatre décennies consécutives (3,18 milliards de dollars au cours de l\'exercice 2021).\nBien que son campus principal soit à Baltimore, Johns Hopkins entretient également dix divisions sur des campus dans d\'autres endroits du Maryland, notamment Laurel, Rockville, Columbia, Aberdeen, California, Elkridge et Owings Mills. Les deux divisions de premier cycle, la Zanvyl Krieger School of Arts and Sciences et la Whiting School of Engineering, sont situées sur le campus de Homewood dans le quartier Charles Village de Baltimore. L\'école de médecine, l\'école d\'infirmières, la Bloomberg School of Public Health et le Johns Hopkins Children\'s Center sont situés sur le campus des institutions médicales à l\'est de Baltimore. L\'université comprend également le Peabody Institute, le Applied Physics Laboratory, la Paul H. Nitze School of Advanced International Studies, l\'école d\'éducation, la Carey Business School et divers autres établissements. L\'université a également des campus de troisième cycle en Italie, en Chine et à Washington, D.C.\nEn octobre 2019, 39 lauréats du prix Nobel et un lauréat de la médaille Fields ont été affiliés au corps professoral et aux anciens élèves de Johns Hopkins. Fondée en 1883, l\'équipe de crosse masculine des Blue Jays a remporté 44 titres nationaux et joue dans la Big Ten Conference en tant que membre affilié. Les autres équipes sportives de l\'université concourent en Division III de la NCAA en tant que membres de la Centennial Conference.', 29000),
(51, 2810, 'Kansas State University', 'Agriculture & Forestry,Economics & Econometrics,Mathematics & Statistics,Chemical Engineering,Sociology,Biological Sciences,Computer Science,History, Philosophy & Theology,Mechanical & Aerospace Engineering,Accounting & Finance,Electrical & Electronic Engineering,Business & Management,Geography,Psychology,Sport Science,Veterinary Science,Chemistry,Languages, Literature & Linguistics,Architecture,General Engineering,Physics & Astronomy,Education,Politics & International Studies (incl Development Studies),Communication & Media Studies,Art, Performing Arts & Design,Civil Engineering,Law,Other Health,Geology, Environmental, Earth & Marine Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/74/Kansas_State_University_seal.svg/150px-Kansas_State_University_seal.svg.png', ' Kansas State University (KSU, Kansas State ou K-State) est une université de recherche publique avec son campus principal à Manhattan, Kansas. Elle a été créée en tant que collège de subvention foncière de l\'État en 1863 et a été la première institution publique d\'enseignement supérieur dans l\'État du Kansas. Elle a atteint un record avec 24 766 étudiants inscrits pour le semestre d\'automne 2014.\nL\'université est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". Les offres académiques de Kansas State sont administrées à travers neuf collèges, dont le College of Veterinary Medicine et le College of Technology and Aviation à Salina. Les diplômes de troisième cycle comprennent 65 programmes de master et 45 doctorats.\nIl existe des campus décentralisés à Salina et Olathe. Le Kansas State University Salina Aerospace and Technology Campus abrite le College of Technology and Aviation. L\'Olathe Innovation Campus se concentre sur les travaux de troisième cycle en recherche sur la bioénergie, la santé animale, la science des plantes et la sécurité et la sûreté alimentaires.', 0),
(52, 2343, 'Kent State University', 'Physics & Astronomy,Geography,Mechanical & Aerospace Engineering,Accounting & Finance,General Engineering,Politics & International Studies (incl Development Studies),Architecture,Communication & Media Studies,Medicine & Dentistry,Computer Science,Art, Performing Arts & Design,Sociology,Geology, Environmental, Earth & Marine Sciences,Other Health,Education,Mathematics & Statistics,Languages, Literature & Linguistics,Economics & Econometrics,Sport Science,Biological Sciences,Business & Management,Chemistry,History, Philosophy & Theology,Psychology,Veterinary Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/2a/Kent_State_seal.svg/800px-Kent_State_seal.svg.png', ' Kent State University (KSU) est une université de recherche publique située à Kent, Ohio, aux États-Unis. L\'université comprend sept campus régionaux dans le nord-est de l\'Ohio, situés à Ashtabula, Burton, East Liverpool, Jackson Township, New Philadelphia, Salem et Warren, ainsi que des installations régionales et internationales supplémentaires à Cleveland, Independence et Twinsburg, dans l\'Ohio; New York City; et Florence, en Italie.\nL\'université a été créée en 1910 en tant qu\'école normale. Les premiers cours ont eu lieu en 1912 à divers endroits et dans des bâtiments temporaires à Kent, et les premiers bâtiments du campus d\'origine ont ouvert l\'année suivante. Depuis lors, l\'université s\'est développée pour inclure de nombreux programmes d\'études de premier cycle et de troisième cycle supplémentaires dans les arts et les sciences, des opportunités de recherche, ainsi que plus de 1 000 acres (405 ha) et 119 bâtiments sur le campus de Kent. À la fin des années 1960 et au début des années 1970, l\'université était connue à l\'échelle internationale pour son activisme étudiant contre l\'implication des États-Unis dans la guerre du Vietnam, principalement en raison des tirs de Kent State en 1970.\nEn 2022, Kent State était la troisième plus grande université de l\'Ohio avec plus de 34 000 étudiants dans le système des huit campus et plus de 25 000 étudiants sur le campus principal de Kent. Kent State propose plus de 300 programmes de diplômes, dont 250 programmes de premier cycle, 40 programmes associés, 50 programmes de maîtrise et 23 programmes de doctorat, qui comprennent des programmes notables tels que les soins infirmiers, les affaires, l\'histoire, la bibliothéconomie, l\'aéronautique, le journalisme, l\'architecture, la mode et l\'Institut du cristal liquide. Elle est classée par la Classification Carnegie des Institutions d\'Enseignement Supérieur parmi les \"R1: Universités doctorales - activité de recherche très élevée\".', 0),
(53, 392, 'Lehigh University', 'Art, Performing Arts & Design,Accounting & Finance,Economics & Econometrics,Civil Engineering,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Chemistry,Education,Psychology,Languages, Literature & Linguistics,Communication & Media Studies,Biological Sciences,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,Sociology,Physics & Astronomy,Chemical Engineering,Mechanical & Aerospace Engineering,Architecture,History, Philosophy & Theology,Other Health,General Engineering,Computer Science,Business & Management,Mathematics & Statistics', 25, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/ef/LUwithShield-CMYK.svg/300px-LUwithShield-CMYK.svg.png?20160910203042', ' L\'université Lehigh (Lehigh University), ou plus simplement Lehigh, est une université privée américaine située à Bethlehem en Pennsylvanie. Elle a été fondée en 1865 par Asa Packer comme un institut d’enseignement technique et est devenue plus tard une université comprenant quatre facultés (colleges) différentes. Le corps enseignant est constitué de 600 professeurs, 4 600 étudiants undergraduate et 2 000 étudiants graduate.\nL’université comprend aujourd’hui quatre facultés différentes : le P.C. Rossin College of Engineering, le College of Arts and Sciences, le College of Business and Economics (qui est classé comme une des meilleures écoles de commerce aux États-Unis) et le College of Education (qui n’offre des cours qu\'aux étudiants graduate).  Le College of Arts and Sciences est l’école la plus grande de l’université.  Les étudiants de Lehigh passent une variété de diplômes, y compris les baccalauréats, les maîtrises en sciences, les Master of Business Administration, et les doctorats. En 2009, le U.S. News and World Report a classé Lehigh comme la 35e meilleure université des États-Unis.', 26000),
(54, 274, 'Louisiana State University', 'Communication & Media Studies,Civil Engineering,Politics & International Studies (incl Development Studies),General Engineering,Business & Management,Sociology,Sport Science,Medicine & Dentistry,Geology, Environmental, Earth & Marine Sciences,Architecture,Economics & Econometrics,Chemistry,Other Health,Education,Languages, Literature & Linguistics,Geography,Computer Science,Agriculture & Forestry,Mathematics & Statistics,Biological Sciences,Physics & Astronomy,Electrical & Electronic Engineering,History, Philosophy & Theology,Chemical Engineering,Psychology,Law,Art, Performing Arts & Design,Accounting & Finance,Mechanical & Aerospace Engineering', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c2/Louisiana-State-University-LSU-Seal.png/1024px-Louisiana-State-University-LSU-Seal.png', ' Louisiana State University (officiellement Louisiana State University and Agricultural and Mechanical College, couramment appelée LSU) est une université américaine de recherche publique avec une subvention foncière située à Baton Rouge, en Louisiane. L\'université a été fondée en 1860 près de Pineville, en Louisiane, sous le nom de Louisiana State Seminary of Learning & Military Academy. Le campus principal actuel de LSU a été inauguré en 1926, se compose de plus de 250 bâtiments construits dans le style de l\'architecte de la Renaissance italienne Andrea Palladio, et le district historique du campus principal occupe un plateau de 650 acres (260 hectares) sur les rives du fleuve Mississippi.\nLSU est l\'université phare de l\'État de Louisiane, ainsi que l\'institution phare du système de l\'Université d\'État de Louisiane. En 2021, l\'université comptait plus de 28 000 étudiants de premier cycle et plus de 4 500 étudiants diplômés répartis dans 14 écoles et collèges. Elle est classée parmi les \"R1: Universités doctorales - activité de recherche très élevée\". LSU mène environ 800 projets de recherche parrainés financés par des organismes tels que les National Institutes of Health, la National Science Foundation, la National Endowment for the Humanities et la National Aeronautics and Space Administration. LSU est l\'une des huit universités aux États-Unis offrant des programmes en médecine dentaire, en droit, en médecine vétérinaire, en médecine et en Master of Business Administration.\nLe département des sports de LSU aligne des équipes dans 21 sports universitaires (neuf masculins et 12 féminins) et est membre de la NCAA (National Collegiate Athletic Association) et de la SEC (Southeastern Conference). L\'université est représentée par sa mascotte, Mike le Tigre.', 0),
(55, 4149, 'Louisiana Tech University', 'History, Philosophy & Theology,Mathematics & Statistics,Civil Engineering,Architecture,Communication & Media Studies,Chemical Engineering,Computer Science,Economics & Econometrics,Business & Management,Sport Science,Chemistry,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Other Health,Geology, Environmental, Earth & Marine Sciences,Psychology,Physics & Astronomy,Art, Performing Arts & Design,Languages, Literature & Linguistics,Agriculture & Forestry,Sociology,Accounting & Finance,Biological Sciences,Education,General Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/5/57/LouisianaTechSeal.png?20190902014114', ' Louisiana Tech University (Louisiana Tech, La. Tech, ou simplement Tech) est une université publique de recherche située à Ruston, en Louisiane. Elle fait partie du système de l\'Université de la Louisiane et est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nLouisiana Tech a ouvert ses portes en tant qu\'Institut industriel et collège de la Louisiane en 1894 pendant la Deuxième Révolution industrielle. La mission initiale du collège était l\'éducation des étudiants dans les arts et les sciences dans le but de développer une économie industrielle en Louisiane post-reconstruction. Quatre ans plus tard, en 1898, la constitution de l\'État a changé le nom de l\'école pour Louisiana Industrial Institute. En 1921, le collège a changé de nom pour devenir Louisiana Polytechnic Institute afin de refléter son développement en tant qu\'institut de technologie de plus grande envergure. Louisiana Polytechnic Institute a été déségrégué dans les années 1960. Il a officiellement changé son nom en Louisiana Tech University en 1970 lorsqu\'il a satisfait aux critères d\'une université de recherche.\nLouisiana Tech comptait 12 463 étudiants répartis dans cinq collèges académiques au cours du trimestre académique de l\'automne 2018, dont 1 282 étudiants à la faculté des cycles supérieurs. En plus du campus principal à Ruston, Louisiana Tech dispense des cours au Louisiana Tech University Shreveport Center, à l\'Academic Success Center à Bossier City, au Barksdale Air Force Base Instructional Site et sur le campus de CenturyLink à Monroe.\nLouisiana Tech aligne 16 équipes sportives de la NCAA Division I (7 équipes masculines, 9 équipes féminines) et est membre de la Conference USA de la Football Bowl Subdivision. L\'université est connue pour son équipe de football Bulldogs et le programme de basketball féminin Lady Techsters qui a remporté trois titres de championnat national (1981, 1982, 1988) et a fait 13 apparitions en demi-finale dans l\'histoire du programme.', 0),
(56, 3061, 'Marquette University', 'Economics & Econometrics,Sociology,Psychology,Mathematics & Statistics,Civil Engineering,Law,Business & Management,Mechanical & Aerospace Engineering,Electrical & Electronic Engineering,Communication & Media Studies,Geology, Environmental, Earth & Marine Sciences,Other Health,Chemistry,History, Philosophy & Theology,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Accounting & Finance,Chemical Engineering,Biological Sciences,Languages, Literature & Linguistics,General Engineering,Medicine & Dentistry,Physics & Astronomy,Sport Science,Education,Computer Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f2/Marquette_University_seal.jpg/200px-Marquette_University_seal.jpg', ' Marquette University est une université de recherche jésuite privée située à Milwaukee, Wisconsin. Établie par la Compagnie de Jésus en tant que Marquette College le 28 août 1881, elle a été fondée par John Martin Henni, le premier évêque du diocèse de Milwaukee, Wisconsin. Initialement une institution réservée aux hommes, Marquette est devenue la première université catholique mixte au monde en 1909.\nMarquette fait partie de l\'Association des universités et collèges jésuites. L\'université est accréditée par la Commission de l\'enseignement supérieur et comptait environ 12 000 étudiants en 2013. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\". Marquette est l\'une des plus grandes universités jésuites aux États-Unis et la plus grande université privée du Wisconsin.\nMarquette est organisée en 11 écoles et collèges sur son campus principal de Milwaukee, proposant des programmes dans les domaines des arts libéraux, des affaires, de la communication, de l\'éducation, de l\'ingénierie, du droit et des sciences de la santé. L\'université dispense également des cours dans les banlieues de la région de Milwaukee et à Washington, D.C. Bien que la plupart des étudiants poursuivent des diplômes de premier cycle, l\'université propose plus de 68 programmes de doctorat et de master, une école de droit, une école de médecine dentaire (la seule de l\'État) et 22 programmes de certificat d\'études supérieures.\nLes équipes sportives universitaires, connues sous le nom de Golden Eagles, font partie de la Big East Conference et participent à la Division I de la NCAA dans tous les sports. Parmi ses professeurs et anciens élèves actuels et passés figurent 43 boursiers Fulbright, 6 boursiers Truman, 6 gouverneurs d\'État, et 3 sénateurs américains.', 0),
(57, 643, 'Massachusetts Institute of Technology', 'Mathematics & Statistics,Languages, Literature & Linguistics,Physics & Astronomy,History, Philosophy & Theology,Other Health,General Engineering,Biological Sciences,Computer Science,Architecture,Geology, Environmental, Earth & Marine Sciences,Psychology,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Chemistry,Chemical Engineering,Business & Management,Accounting & Finance,Electrical & Electronic Engineering,Communication & Media Studies,Archaeology,Civil Engineering,Economics & Econometrics,Politics & International Studies (incl Development Studies)', 7, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/44/MIT_Seal.svg/150px-MIT_Seal.svg.png', ' Le Massachusetts Institute of Technology (MIT) est une université de recherche privée avec une charte de terre (land-grant) située à Cambridge, Massachusetts. Fondé en 1861, le MIT a joué un rôle significatif dans le développement de nombreux domaines de la technologie moderne et des sciences.\nFondé en réponse à l\'industrialisation croissante des États-Unis, le MIT a adopté un modèle universitaire polytechnique européen et a mis l\'accent sur l\'enseignement en laboratoire des sciences appliquées et de l\'ingénierie. Le MIT fait partie des trois universités privées avec une charte de terre aux États-Unis, aux côtés de Cornell University et de Tuskegee University. Le campus urbain de l\'institut s\'étend sur plus d\'un mile (1,6 km) le long de la rivière Charles et comprend plusieurs installations importantes en dehors du campus, telles que le MIT Lincoln Laboratory, le Bates Center et l\'Observatoire de Haystack, ainsi que des laboratoires affiliés tels que les instituts Broad et Whitehead.\nEn octobre 2023, 101 lauréats du prix Nobel, 26 lauréats du prix Turing et 8 lauréats de la médaille Fields ont été affiliés au MIT en tant qu\'anciens élèves, membres du corps professoral ou chercheurs. De plus, 58 récipiendaires de la Médaille nationale des sciences, 29 récipiendaires de la Médaille nationale de la technologie et de l\'innovation, 50 boursiers MacArthur, 83 boursiers Marshall, 41 astronautes, 16 scientifiques en chef de l\'US Air Force et divers chefs d\'État ont été affiliés au MIT. L\'institut a également une culture entrepreneuriale forte, avec de nombreuses entreprises notables fondées ou cofondées par des anciens élèves du MIT. Le MIT est membre de l\'Association of American Universities.', 22000),
(58, 3061, 'Medical College of Wisconsin', '', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/26/Medical_College_of_Wisconsin_logo.svg/180px-Medical_College_of_Wisconsin_logo.svg.png', ' The Medical College of Wisconsin (MCW) est une école de médecine privée, une école de pharmacie et une école supérieure des sciences située à Milwaukee, Wisconsin. L\'école a été fondée en 1893 et est le plus grand centre de recherche dans l\'est du Wisconsin. Elle est associée à l\'hôpital Froedtert ainsi qu\'à l\'hôpital pour enfants du Wisconsin et abrite le Center for Infectious Disease Research. Il existe deux campus supplémentaires, l\'un à Green Bay et l\'autre à Wausau.\nMCW est accréditée par la Higher Learning Commission de la North Central Association of Colleges and Schools (HLC) et par le Liaison Committee on Medical Education (LCME). C\'est la seule école de médecine privée du Wisconsin, et l\'une des deux seules écoles de médecine du Wisconsin, avec l\'University of Wisconsin School of Medicine and Public Health à Madison.', 0),
(59, 3597, 'Miami University', 'Accounting & Finance,Chemistry,Economics & Econometrics,Business & Management,Chemical Engineering,Communication & Media Studies,Medicine & Dentistry,Psychology,History, Philosophy & Theology,Education,Biological Sciences,Geography,Other Health,Architecture,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Sport Science,Sociology,Mechanical & Aerospace Engineering,Languages, Literature & Linguistics,Mathematics & Statistics,Computer Science,General Engineering,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/1/16/Seal_of_Miami_University.png', ' Miami University (informellement Miami of Ohio ou simplement Miami) est une université de recherche publique située à Oxford, Ohio. L\'université a été fondée en 1809, ce qui en fait la deuxième plus ancienne université de l\'Ohio (derrière l\'Ohio University, fondée en 1804) et la 10e plus ancienne université publique (32e au total) aux États-Unis. Le système de l\'école comprend le campus principal à Oxford, ainsi que des campus régionaux à Hamilton, Middletown et West Chester. Miami possède également un campus international, le Dolibois European Center à Differdange, au Luxembourg. Elle est classée parmi les \"R2: Doctoral Universities – High research activity\".\nMiami University propose une éducation en arts libéraux ; elle propose plus de 120 programmes de premier cycle et plus de 70 programmes de cycles supérieurs au sein de ses 7 écoles et collèges en architecture, commerce, ingénierie, lettres et sciences. Miami faisait partie des huit écoles Public Ivy d\'origine, un groupe d\'universités financées par des fonds publics considérées comme offrant une qualité d\'éducation comparable à celles de la Ivy League.\nMiami University a une longue tradition de vie grecque ; cinq organisations sociales avec lettres grecques ont été fondées à l\'université, ce qui a valu à Miami le surnom de \"Mother of Fraternities\". Aujourd\'hui, Miami University accueille plus de 50 chapitres de fraternités et de sororités, et environ un tiers de la population étudiante de premier cycle sont membres de la communauté grecque.\nLes équipes sportives de Miami concourent dans la Division I de la National Collegiate Athletic Association (NCAA) et sont collectivement connues sous le nom de Miami RedHawks. Elles participent à la Mid-American Conference dans tous les sports universitaires sauf le hockey sur glace, qui participe à la National Collegiate Hockey Conference.', 0),
(60, 1272, 'Michigan State University', 'Education,Languages, Literature & Linguistics,Chemistry,Accounting & Finance,Chemical Engineering,Business & Management,Architecture,Psychology,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Sport Science,General Engineering,Geography,Communication & Media Studies,Medicine & Dentistry,Law,Geology, Environmental, Earth & Marine Sciences,Sociology,Civil Engineering,Mathematics & Statistics,Computer Science,Veterinary Science,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Biological Sciences,Economics & Econometrics,Other Health,Archaeology,Physics & Astronomy,Agriculture & Forestry,History, Philosophy & Theology', 72, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/53/Michigan_State_University_seal.svg/150px-Michigan_State_University_seal.svg.png', ' Michigan State University (Michigan State ou MSU) est une université publique de recherche agricole située à East Lansing, au Michigan. Elle a été fondée en 1855 sous le nom de Agricultural College of the State of Michigan, la première du genre aux États-Unis. Après l\'introduction du Morrill Act en 1862, l\'État a désigné le collège comme une institution de subvention foncière en 1863, en faisant le premier des collèges de subvention foncière aux États-Unis. Le collège est devenu mixte en 1870. Aujourd\'hui, Michigan State a rapidement étendu sa présence dans tout l\'État du Michigan avec des installations partout dans l\'État et l\'un des plus grands réseaux d\'anciens élèves universitaires avec 634 000 membres.\nMichigan State est membre de l\'Association of American Universities et est classée parmi les \"R1: Doctoral Universities – Very high research activity\". Le campus de l\'université abrite le Facility for Rare Isotope Beams, le W. J. Beal Botanical Garden, l\'Abrams Planetarium, le Wharton Center for Performing Arts, le Eli and Edythe Broad Art Museum et le plus grand système de résidence universitaire du pays.\nLes six écoles professionnelles de l\'université comprennent la College of Law (fondée à Détroit en 1891, sous le nom de Detroit College of Law et transférée à East Lansing en 1995), la Eli Broad College of Business ; la College of Nursing, la College of Osteopathic Medicine (la première école d\'ostéopathie financée par l\'État au monde), la College of Human Medicine et la College of Veterinary Medicine. L\'université a été pionnière dans les études de musicothérapie, d\'emballage, de gestion hôtelière, de gestion de la chaîne d\'approvisionnement et de sciences de la communication.\nLe corps professoral, les anciens élèves et les affiliés de l\'université comprennent 2 lauréats du prix Nobel, 20 boursiers Rhodes, 20 boursiers Marshall, 18 boursiers Churchill, 17 boursiers Truman, 5 boursiers Mitchell, 13 boursiers Udall, 53 boursiers Goldwater, 215 boursiers Fulbright et 8 lauréats du prix Pulitzer. Les Spartans de Michigan State concourent dans la conférence Big Ten de la NCAA Division I. L\'équipe de football américain des Spartans de Michigan State a remporté le Rose Bowl Game en 1954, 1956, 1988 et 2014, et l\'université a remporté six championnats nationaux de football américain. L\'équipe de basketball masculin des Spartans a remporté le championnat national de la NCAA en 1979 et 2000, et a atteint le Final Four huit fois depuis la saison 1998–1999. L\'équipe de hockey sur glace des Spartans a remporté les titres nationaux de la NCAA en 1966, 1986 et 2007.', 16000),
(62, 4099, 'Missouri University of Science and Technology', 'General Engineering,Communication & Media Studies,History, Philosophy & Theology,Education,Physics & Astronomy,Mechanical & Aerospace Engineering,Business & Management,Economics & Econometrics,Electrical & Electronic Engineering,Accounting & Finance,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences,Psychology,Civil Engineering,Biological Sciences,Chemical Engineering,Languages, Literature & Linguistics,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Chemistry,Computer Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b8/University_of_Missouri_seal.svg/180px-University_of_Missouri_seal.svg.png', ' La Missouri University of Science and Technology (Missouri S&T ou S&T) est une université de recherche publique située à Rolla, dans le Missouri. Elle est membre du système de l\'Université du Missouri. La plupart de ses 7 083 étudiants (2022) étudient l\'ingénierie, les affaires, les sciences et les mathématiques. Principalement connue pour son école d\'ingénieurs, la Missouri S&T propose des programmes de diplômes en affaires et en systèmes de gestion, en informatique et en technologie de l\'information, en sciences, en sciences sociales, en sciences humaines et en arts. Elle est classée comme une université doctorale R2 \"dominante STEM\" avec \"une activité de recherche élevée\".', 0),
(63, 941, 'Mizzou - University of Missouri', 'Mechanical & Aerospace Engineering,Mathematics & Statistics,Other Health,Sociology,Chemical Engineering,Chemistry,Geology, Environmental, Earth & Marine Sciences,Sport Science,Business & Management,Geography,Civil Engineering,Education,Art, Performing Arts & Design,Archaeology,Biological Sciences,Veterinary Science,Medicine & Dentistry,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Economics & Econometrics,Agriculture & Forestry,Psychology,Computer Science,Accounting & Finance,Law,General Engineering,Languages, Literature & Linguistics,Physics & Astronomy,Communication & Media Studies', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4a/University_of_Missouri_logo.svg/182px-University_of_Missouri_logo.svg.png', ' The University of Missouri (Mizzou ou MU) est une université publique de recherche située à Columbia, Missouri. C\'est la plus grande université du Missouri et la principale du système de l\'Université du Missouri, qui compte quatre campus. MU a été fondée en 1839 en tant que première université publique à l\'ouest du fleuve Mississippi. Elle est membre de l\'Association of American Universities depuis 1908 et est classée parmi les \"R1: universités doctorales - très haute activité de recherche\".\nAvec 31 041 étudiants inscrits en 2023, elle propose plus de 300 programmes de diplômes dans treize grandes divisions académiques. Sa Missouri School of Journalism, fondée par Walter Williams en 1908, a été créée en tant que première école de journalisme au monde ; elle publie un journal quotidien, le Columbia Missourian, et exploite la station affiliée NBC KOMU. Le Centre de recherche sur les réacteurs de l\'Université du Missouri est la seule source d\'isotopes en médecine nucléaire aux États-Unis. L\'université exploite University of Missouri Health Care, gérant plusieurs hôpitaux et cliniques dans le centre du Missouri.\nSes équipes sportives de la NCAA Division I sont les Missouri Tigers et concourent dans la Southeastern Conference. La tradition américaine du retour au bercail est revendiquée comme ayant pris naissance à MU. Ses anciens élèves, professeurs et employés comprennent 18 boursiers Rhodes, 19 boursiers Truman, 141 boursiers Fulbright, 7 gouverneurs du Missouri, et 6 membres du Congrès américain. Deux anciens élèves et professeurs ont été récompensés par le prix Nobel : l\'ancien élève Frederick Chapman Robbins a remporté le prix Nobel de physiologie ou médecine en 1954 et George Smith (chimiste) a été récompensé par le prix Nobel de chimie en 2018 alors qu\'il était affilié à l\'université.', 0),
(64, 485, 'Montana State University', 'Chemical Engineering,Architecture,Economics & Econometrics,Civil Engineering,Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Medicine & Dentistry,Sociology,Chemistry,Mathematics & Statistics,Electrical & Electronic Engineering,Other Health,Veterinary Science,Psychology,Languages, Literature & Linguistics,Art, Performing Arts & Design,Physics & Astronomy,Business & Management,Agriculture & Forestry,Education,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Computer Science,Sport Science,History, Philosophy & Theology,Accounting & Finance,General Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d5/MontanaStateUniversity_Seal.svg/150px-MontanaStateUniversity_Seal.svg.png', ' La Montana State University (MSU) est une université publique de recherche agraire située à Bozeman, dans le Montana. C\'est la plus grande université de l\'État. La MSU propose des licences dans 60 domaines, des masters dans 68 domaines et des doctorats dans 35 domaines à travers ses neuf collèges. Plus de 16 700 étudiants ont fréquenté la MSU à l\'automne 2019, enseignés par 796 professeurs à temps plein et 547 professeurs à temps partiel.\nLa MSU est classée parmi les \"R1: universités doctorales - très haute activité de recherche\" et a des dépenses de recherche de 129,6 millions de dollars en 2017.\nSitué du côté sud de Bozeman, le campus de 1 170 acres (470 hectares) de l\'université est le plus grand de l\'État. Le campus principal de l\'université à Bozeman abrite la télévision KUSM, la radio KGLT et le Museum of the Rockies. La MSU propose des services de sensibilisation aux citoyens et aux communautés de l\'État grâce à son station d\'expérimentation agricole et à ses 60 bureaux d\'extension dans les comtés et les réserves. L\'altitude du campus est de 4 900 pieds (1 500 mètres) au-dessus du niveau de la mer.', 0),
(65, 247, 'Morgan State University', 'Sociology,Languages, Literature & Linguistics,Business & Management,History, Philosophy & Theology,Biological Sciences,Other Health,Geography,Communication & Media Studies,Psychology,General Engineering,Architecture,Accounting & Finance,Politics & International Studies (incl Development Studies),Chemistry,Computer Science,Education,Physics & Astronomy,Art, Performing Arts & Design,Civil Engineering,Mathematics & Statistics,Economics & Econometrics,Electrical & Electronic Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/63/Morgan_State_University_Logo.svg/150px-Morgan_State_University_Logo.svg.png', ' La Morgan State University (Morgan State ou MSU) est une université de recherche historiquement noire située à Baltimore, dans le Maryland. C\'est la plus grande des collèges et universités historiquement noirs (HBCU) du Maryland. En 1890, l\'université, alors connue sous le nom de Centenary Biblical Institute, a changé de nom pour devenir le Morgan College en l\'honneur du révérend Lyttleton Morgan, premier président de son conseil d\'administration et donateur de terres au collège. Elle est devenue une université en 1975.\nLa Morgan State est membre du Thurgood Marshall College Fund. Bien qu\'il s\'agisse d\'une institution publique, la Morgan State ne fait pas partie du University System of Maryland. Elle est classée parmi les \"R2: universités doctorales - activité de recherche élevée\".', 0),
(66, 3305, 'New Jersey Institute of Technology', 'Civil Engineering,Other Health,Electrical & Electronic Engineering,History, Philosophy & Theology,Physics & Astronomy,Chemical Engineering,Chemistry,General Engineering,Mechanical & Aerospace Engineering,Accounting & Finance,Geography,Architecture,Geology, Environmental, Earth & Marine Sciences,Business & Management,Art, Performing Arts & Design,Communication & Media Studies,Law,Computer Science,Biological Sciences,Mathematics & Statistics,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e9/New_Jersey_IT_seal.svg/200px-New_Jersey_IT_seal.svg.png', ' New Jersey Institute of Technology (NJIT) est une université publique de recherche située à Newark, dans le New Jersey, avec un campus satellite délivrant des diplômes de troisième cycle à Jersey City. Fondée en 1881 avec le soutien d\'industriels et d\'inventeurs locaux, en particulier Edward Weston, NJIT a ouvert ses portes en 1885 sous le nom de Newark Technical School (NTS) avec 88 étudiants. À l\'automne 2022, l\'université compte 12 332 étudiants originaires de 92 pays, dont environ 2 500 vivent sur son campus principal dans le quartier de University Heights à Newark.\nNJIT propose 51 filières de premier cycle (baccalauréat ès sciences', 0),
(68, 3304, 'New York University', 'Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Physics & Astronomy,Medicine & Dentistry,Communication & Media Studies,Law,Art, Performing Arts & Design,Business & Management,Chemical Engineering,General Engineering,Computer Science,Accounting & Finance,Mathematics & Statistics,Sociology,Electrical & Electronic Engineering,Languages, Literature & Linguistics,Archaeology,Economics & Econometrics,Biological Sciences,Education,Geology, Environmental, Earth & Marine Sciences,Other Health,Architecture,Psychology,Civil Engineering,Chemistry,History, Philosophy & Theology', 28, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/16/New_York_University_Seal.svg/150px-New_York_University_Seal.svg.png', ' La New York University (NYU) est une université privée de recherche située à New York. Charte accordée en 1831 par la législature de l\'État de New York, la NYU a été fondée en 1832 par un groupe de New-Yorkais dirigé par Albert Gallatin en tant qu\'institution laïque exclusivement masculine près de l\'hôtel de ville, axée sur un programme éducatif laïque. L\'université a déménagé en 1833 et a maintenu son campus principal dans le quartier de Greenwich Village, entourant le parc Washington Square. Depuis lors, l\'université a ajouté une école d\'ingénierie au MetroTech Center de Brooklyn et des écoles supérieures dans tout Manhattan. La NYU est devenue la plus grande université privée aux États-Unis en termes d\'inscription, avec un total de 51 848 étudiants inscrits, dont 26 733 étudiants de premier cycle et 25 115 étudiants diplômés en 2019. Elle est l\'une des écoles les plus demandées du pays et les admissions sont considérées comme sélectives.\nLe campus principal de la NYU à New York est organisé en dix écoles de premier cycle, dont le College of Arts & Science, la Gallatin School, la Steinhardt School, la Stern School of Business, la Tandon School of Engineering et la Tisch School of the Arts. Les 15 écoles supérieures de la NYU comprennent la Grossman School of Medicine, la School of Law, la Wagner Graduate School of Public Service, la School of Professional Studies, la Silver School of Social Work et la Rory Meyers School of Nursing. Les centres académiques internes de l\'université comprennent le Courant Institute of Mathematical Sciences, le Center for Data Science, le Center for Neural Science, le Clive Davis Institute, l\'Institute for the Study of the Ancient World, l\'Institute of Fine Arts et le NYU Langone Health System.\nLa NYU est un système universitaire mondial avec des campus portails délivrant des diplômes à NYU Abu Dhabi aux Émirats arabes unis et à NYU Shanghai en Chine, ainsi que des centres d\'apprentissage académiques à Accra, Berlin, Buenos Aires, Florence, Londres, Los Angeles, Madrid, Paris, Prague, Sydney, Tel Aviv et Washington, D.C. Les enseignants et anciens élèves passés et présents comprennent 39 lauréats du prix Nobel, 8 lauréats du prix Turing, 5 médaillés Fields, 31 boursiers MacArthur, 26 lauréats du prix Pulitzer, 3 chefs d\'État, 5 gouverneurs américains, 12 sénateurs américains, 58 membres de la Chambre des représentants des États-Unis.', 36000),
(69, 3934, 'North Carolina State University', 'Biological Sciences,Art, Performing Arts & Design,Chemistry,Education,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Economics & Econometrics,Civil Engineering,Psychology,Computer Science,Communication & Media Studies,History, Philosophy & Theology,Architecture,Mathematics & Statistics,General Engineering,Mechanical & Aerospace Engineering,Sociology,Business & Management,Chemical Engineering,Physics & Astronomy,Veterinary Science,Accounting & Finance,Languages, Literature & Linguistics,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences', 51, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/24/North_Carolina_State_University_seal.svg/150px-North_Carolina_State_University_seal.svg.png', ' North Carolina State University (NC State, North Carolina State, NC State University, ou NCSU) est une université publique de recherche de Raleigh, en Caroline du Nord, aux États-Unis. Fondée en 1887 et faisant partie du système de l\'Université de Caroline du Nord, c\'est la plus grande université des Carolines. L\'université forme l\'un des coins du Triangle de recherche avec l\'Université Duke à Durham et l\'Université de Caroline du Nord à Chapel Hill. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\".\nL\'Assemblée générale de Caroline du Nord a créé le North Carolina College of Agriculture and Mechanic Arts, maintenant NC State, le 7 mars 1887, initialement en tant que collège agricole de subvention de terres. Le collège a subi plusieurs changements de nom et est officiellement devenu l\'Université d\'État de Caroline du Nord à Raleigh en 1965. Cependant, selon une longue tradition, la partie \"à Raleigh\" est généralement omise. Aujourd\'hui, NC State compte plus de 35 000 étudiants, ce qui en fait l\'une des plus grandes du pays. NC State a des points forts historiques dans les domaines de l\'ingénierie, de la statistique, de l\'agriculture, des sciences de la vie, des textiles et du design, et propose des licences dans 106 domaines d\'études. L\'école supérieure propose des maîtrises dans 104 domaines, des doctorats dans 61 domaines et un doctorat en médecine vétérinaire.\nLes équipes sportives de NC State sont connues sous le nom de Wolfpack. Le nom a été adopté de manière non officielle en 1921 à la suite d\'une lettre non signée adressée aux anciens élèves de NC State suggérant le surnom \"Wolf Pack\". Elles concourent en NCAA Division I et ont remporté dix championnats nationaux : quatre championnats de la NCAA, deux championnats de l\'AIAW et quatre titres sous d\'autres organes de sanction.', 13000),
(70, 468, 'Northeastern University, US', 'Psychology,Accounting & Finance,Politics & International Studies (incl Development Studies),Veterinary Science,Communication & Media Studies,Physics & Astronomy,Civil Engineering,Art, Performing Arts & Design,Languages, Literature & Linguistics,Chemical Engineering,Mathematics & Statistics,Other Health,Business & Management,Architecture,Mechanical & Aerospace Engineering,Electrical & Electronic Engineering,History, Philosophy & Theology,Geology, Environmental, Earth & Marine Sciences,General Engineering,Geography,Biological Sciences,Computer Science,Medicine & Dentistry,Education,Chemistry,Law,Sociology,Sport Science,Economics & Econometrics', 27, 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6f/Northeastern_seal.svg/150px-Northeastern_seal.svg.png', ' La Northeastern University (NU ou NEU) est une université de recherche privée dont le campus principal est situé à Boston, dans le Massachusetts. Fondée en 1898 par l\'Association chrétienne des jeunes hommes de Boston en tant qu\'institut exclusivement masculin, elle a été constituée en tant que Northeastern College en 1916 et a obtenu le statut d\'université en 1922. Avec plus de 36 000 étudiants, Northeastern est l\'une des plus grandes universités du Massachusetts en termes d\'effectifs.\nNortheastern est une université importante, principalement résidentielle, composée de neuf écoles, dont la Northeastern University School of Law. Le campus principal de l\'université à Boston est situé au centre de la ville le long de Huntington Avenue et Columbus Avenue, près des quartiers Fenway–Kenmore et Roxbury. Elle propose des programmes de premier cycle et des cycles supérieurs, et la plupart des étudiants de premier cycle participent à un programme de formation coopérative. Northeastern est accréditée par la New England Commission of Higher Education et est membre du Boston Consortium for Higher Education. Elle est classée parmi les \"R1: Universités doctorales - Très forte activité de recherche\".\nNortheastern possède des campus satellites à Charlotte, en Caroline du Nord ; Seattle, Washington ; San Jose, Californie ; Oakland, Californie ; Portland, Maine ; ainsi qu\'à Toronto et Vancouver au Canada. En 2019, elle a acquis le New College of the Humanities, établissant un campus supplémentaire à Londres, en Angleterre. Les équipes sportives de l\'université, les Northeastern Huskies, participent à la Division I de la NCAA en tant que membres de la Coastal Athletic Association (CAA) dans 18 sports universitaires. Les équipes de hockey masculin et féminin participent à Hockey East, tandis que les équipes d\'aviron masculin et féminin participent respectivement à l\'Eastern Association of Rowing Colleges (EARC) et à l\'Eastern Association of Women\'s Rowing Colleges (EAWRC).', 30000);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(71, 1541, 'Northern Illinois University', 'General Engineering,Sociology,History, Philosophy & Theology,Computer Science,Law,Psychology,Art, Performing Arts & Design,Other Health,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Business & Management,Geography,Mechanical & Aerospace Engineering,Accounting & Finance,Sport Science,Politics & International Studies (incl Development Studies),Economics & Econometrics,Languages, Literature & Linguistics,Chemistry,Physics & Astronomy,Education,Electrical & Electronic Engineering,Mathematics & Statistics,Agriculture & Forestry,Communication & Media Studies', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/5e/Northern_Illinois_University_seal.svg/180px-Northern_Illinois_University_seal.svg.png', ' Northern Illinois University (NIU) est une université publique de recherche située à DeKalb, dans l\'Illinois. Elle a été fondée en 1895 sous le nom de Northern Illinois State Normal School par le gouverneur de l\'Illinois, John P. Altgeld, dans le but de fournir à l\'État des enseignants diplômés. En plus du campus principal à DeKalb, elle dispose de centres satellites à Chicago, Naperville, Rockford et Oregon, dans l\'Illinois.\nL\'université est composée de sept collèges délivrant des diplômes et compte un effectif d\'environ 16 000 étudiants. NIU est l\'une des sept universités publiques de l\'Illinois qui participent à la Division I de la National Collegiate Athletic Association (NCAA). Les équipes sportives sont connues sous le nom de Huskies et concourent dans la Mid-American Conference (MAC).', 0),
(72, 1435, 'Northwestern University', 'Computer Science,Geography,Physics & Astronomy,Languages, Literature & Linguistics,Business & Management,Biological Sciences,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Politics & International Studies (incl Development Studies),Accounting & Finance,Mathematics & Statistics,Civil Engineering,Sociology,Education,General Engineering,History, Philosophy & Theology,Architecture,Economics & Econometrics,Mechanical & Aerospace Engineering,Communication & Media Studies,Medicine & Dentistry,Law,Psychology,Art, Performing Arts & Design,Electrical & Electronic Engineering,Chemistry,Other Health', 9, 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/56/Northwestern_University_seal.svg/150px-Northwestern_University_seal.svg.png', ' Northwestern University (NU) est une université de recherche privée située à Evanston, Illinois, aux États-Unis. Fondée en 1851 pour servir le territoire historique du Nord-Ouest, c\'est la plus ancienne université chartée de l\'Illinois. L\'université a son campus principal le long des rives du lac Michigan dans la région métropolitaine de Chicago.\nChartée par l\'Assemblée générale de l\'Illinois en 1851, Northwestern était initialement affiliée à l\'Église méthodiste épiscopale mais est devenue plus tard non confessionnelle. En 1900, l\'université était la troisième plus grande des États-Unis. Northwestern est devenue membre fondateur de la Big Ten Conference en 1896 et a rejoint l\'Association of American Universities en 1917.\nNorthwestern est composée de onze écoles de premier cycle, de cycles supérieurs et professionnelles, qui comprennent la Kellogg School of Management, la Pritzker School of Law, la Feinberg School of Medicine, la Weinberg College of Arts and Sciences, la Bienen School of Music, la McCormick School of Engineering and Applied Science, la Medill School of Journalism, la School of Communication, la School of Professional Studies, la School of Education and Social Policy et The Graduate School. Northwestern a également des campus supplémentaires dans le centre-ville de Chicago, à Coral Gables, à San Francisco, à Doha et à Washington, D.C. En 2023, l\'université dispose d\'une dotation de 14,1 milliards de dollars, d\'un budget annuel d\'environ 2,9 milliards de dollars et d\'un financement de la recherche de plus de 1 milliard de dollars. Les équipes sportives intercollégiales de l\'université, collectivement connues sous le nom de Northwestern Wildcats, concourent en NCAA Division I dans la Big Ten Conference.\nEn septembre 2020, 33 lauréats du prix Nobel et 2 médaillés Fields, ont été affiliés à Northwestern en tant qu\'anciens élèves ou professeurs. De plus, Northwestern a été associée à 45 lauréats du prix Pulitzer, 23 lauréats de la National Medal of Science, 11 récipiendaires de la National Humanities Medal, 23 boursiers MacArthur, 20 Rhodes Scholars et 28 Marshall Scholars. Les anciens élèves de Northwestern incluent également 10 milliardaires vivants, 2 juges de la Cour suprême des États-Unis et 24 médaillés olympiques.', 26000),
(73, 1598, 'Nova Southeastern University', 'Computer Science,Communication & Media Studies,Accounting & Finance,Psychology,Art, Performing Arts & Design,Politics & International Studies (incl Development Studies),Economics & Econometrics,Physics & Astronomy,Chemistry,Sociology,Sport Science,Education,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Medicine & Dentistry,History, Philosophy & Theology,General Engineering,Business & Management,Mathematics & Statistics,Other Health,Biological Sciences,Law', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/8/8c/Nova_Southeastern_University_seal.svg/150px-Nova_Southeastern_University_seal.svg.png', ' Nova Southeastern University (NSU) est une université privée de recherche avec son campus principal à Fort Lauderdale-Davie, en Floride, aux États-Unis, dans la région métropolitaine de Miami. L\'université se compose de 14 collèges au total, proposant plus de 150 programmes d\'études. Elle offre des diplômes professionnels dans les sciences sociales, le droit, les affaires, la médecine ostéopathique (DO), la médecine allopathique (MD), les sciences de la santé, la pharmacie, la dentisterie, l\'optométrie, la physiothérapie, l\'éducation, l\'ergothérapie et les soins infirmiers. En 2019, 20 576 étudiants étaient inscrits à Nova Southeastern University, avec plus de 210 000 anciens élèves. Avec un campus principal situé sur 314 acres à Davie, en Floride, NSU exploite des campus supplémentaires à Dania Beach, à North Miami Beach, dans la région de Tampa Bay-Clearwater, ainsi que dans tout l\'État de la Floride. Il existe également des campus à San Juan, à Porto Rico, et à Denver, au Colorado.\nL\'université a été fondée en 1964 sous le nom de Nova University of Advanced Technology sur un ancien terrain d\'atterrissage extérieur naval construit pendant la Seconde Guerre mondiale, et a d\'abord proposé des diplômes de troisième cycle en sciences physiques et sociales. En 1994, l\'université a fusionné avec la Southeastern University of the Health Sciences et a adopté son nom actuel.\nNSU est classée parmi les \"R2 : Universités doctorales - Activités de recherche élevées\" ; elle est également classée comme université \"engagée dans la communauté\" par la Carnegie Foundation for the Advancement of Teaching. L\'université est accréditée par l\'Association des collèges et écoles du Sud et possède également de nombreuses accréditations spécialisées supplémentaires pour ses collèges et programmes, dont l\'A.A.C.S.B.\nLes équipes sportives intercollégiales de Nova Southeastern University sont collectivement connues sous le nom de Nova Southeastern Sharks et concourent en Division II de la National Collegiate Athletic Association (NCAA). Les Sharks ont remporté neuf championnats nationaux de la NCAA, dont le championnat de la Division II de la NCAA en basket-ball masculin en 2023.', 0),
(74, 4072, 'Oakland University', 'Mathematics & Statistics,Accounting & Finance,Medicine & Dentistry,Geography,Law,Psychology,History, Philosophy & Theology,Archaeology,Computer Science,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Agriculture & Forestry,Veterinary Science,Mechanical & Aerospace Engineering,Business & Management,Chemistry,Chemical Engineering,Architecture,General Engineering,Languages, Literature & Linguistics,Physics & Astronomy,Sociology,Electrical & Electronic Engineering,Other Health,Biological Sciences,Communication & Media Studies,Economics & Econometrics,Sport Science,Politics & International Studies (incl Development Studies),Education,Art, Performing Arts & Design', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a2/Oakland_University_seal.svg/180px-Oakland_University_seal.svg.png', ' L\'Université d\'Oakland (également connue localement sous le nom de OU ou Oakland) est une université publique de recherche à Rochester, dans le Michigan. Fondée en 1957 grâce à une donation de Matilda Dodge Wilson, elle était initialement connue sous le nom de Michigan State University-Oakland, relevant du conseil d\'administration de la Michigan State University, avant d\'obtenir son indépendance institutionnelle du conseil en 1970.\nL\'Université d\'Oakland est l\'une des huit universités de recherche de l\'État du Michigan et est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\". L\'université propose 132 programmes de licence et 138 programmes de certificat professionnel, de master et de doctorat, y compris ceux offerts par la Oakland University William Beaumont School of Medicine. Elle comptait plus de 20 000 étudiants inscrits en 2016.\nLe site de l\'université comprend le campus principal, le domaine de Meadow Brook et deux parcours de golf classés au niveau national, répartis sur 1 443 acres (5,84 km2). Meadow Brook Hall, un site historique national des États-Unis et le quatrième plus grand musée de maison historique du pays, est situé sur le site.\nAuparavant connues sous le nom de Pioneers, les équipes sportives d\'Oakland ont été renommées Golden Grizzlies en 1998. Elles concourent dans la Horizon League de la NCAA Division I.', 0),
(75, 949, 'Ohio State University (Main campus)', 'Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Chemical Engineering,Education,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Communication & Media Studies,Agriculture & Forestry,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Sport Science,Chemistry,Geography,History, Philosophy & Theology,Economics & Econometrics,Mathematics & Statistics,Languages, Literature & Linguistics,Other Health,Civil Engineering,Psychology,Medicine & Dentistry,General Engineering,Physics & Astronomy,Architecture,Computer Science,Veterinary Science,Business & Management,Law,Archaeology,Sociology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e1/Ohio_State_University_seal.svg/150px-Ohio_State_University_seal.svg.png', ' The Ohio State University (Ohio State ou OSU) est une université publique de recherche relevant du système d\'universités de l\'Ohio, située à Columbus, Ohio. Fondée en 1870, elle fait partie du University System of Ohio. L\'université est composée de seize collèges et propose plus de 400 programmes de licence et de troisième cycle. Le campus principal est devenu le cinquième plus grand campus universitaire en termes d\'effectifs aux États-Unis, avec près de 50 000 étudiants de premier cycle et près de 15 000 étudiants diplômés. L\'université exploite également des campus régionaux à Lima, Mansfield, Marion, Newark et Wooster.\nFondée avec un accent sur diverses disciplines agricoles et mécaniques, l\'Ohio State s\'est développée en une université complète sous la direction du gouverneur Rutherford B. Hayes. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". En 2023, l\'université dispose d\'une dotation de 7,4 milliards de dollars. Elle compte plus de 1 000 organisations étudiantes, des programmes sportifs intercollégiaux, de clubs et de loisirs, des organisations et publications médiatiques étudiantes, des fraternités et sororités, ainsi que trois gouvernements étudiants. Ses équipes sportives concourent dans la NCAA Division I en tant que Ohio State Buckeyes, membre de la Big Ten Conference pour la majorité des sports. En 2017, le programme de football de l\'Ohio State est évalué à 1,5 milliard de dollars.\nMembre de l\'Association of American Universities, l\'Ohio State est un important producteur de boursiers Fulbright. Les anciens élèves et le corps professoral, passés et présents, comprennent six lauréats du prix Nobel, neuf boursiers Rhodes, sept boursiers Churchill, un médaillé Fields, sept lauréats du prix Pulitzer, 64 boursiers Goldwater, sept sénateurs américains, 15 représentants américains et 104 médaillés olympiques.', 0),
(76, 183, 'Ohio University (Main campus)', 'Psychology,Accounting & Finance,Chemistry,Geology, Environmental, Earth & Marine Sciences,Computer Science,Education,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Biological Sciences,Business & Management,General Engineering,Languages, Literature & Linguistics,Sociology,Mathematics & Statistics,Communication & Media Studies,Medicine & Dentistry,Economics & Econometrics,History, Philosophy & Theology,Physics & Astronomy,Sport Science,Chemical Engineering,Geography,Civil Engineering,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/3/39/Ohio_University_seal.svg/150px-Ohio_University_seal.svg.png', ' Ohio University (Ohio ou OU) est une université publique de recherche située à Athens, Ohio. Première université chartée par un acte du Congrès et la première à être chartée dans l\'Ohio, l\'université a été chartée en 1787 par le Congrès de la Confédération, puis approuvée pour le territoire en 1802 et pour l\'État en 1804, ouvrant ses portes aux étudiants en 1809. L\'Ohio University est la plus ancienne université de l\'Ohio et l\'une des plus anciennes universités publiques des États-Unis.\nL\'Ohio University comprend neuf campus, neuf collèges de premier cycle, son Graduate College, son collège de médecine et son école des affaires publiques. Elle propose plus de 250 domaines d\'études de premier cycle ainsi que des certificats, des master et des doctorats. L\'université est accréditée par la Higher Learning Commission et classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". À l\'automne 2020, l\'effectif total de l\'université à Athens était légèrement supérieur à 18 000 étudiants, tandis que l\'effectif total sur tous les campus était légèrement supérieur à 30 000.\nLes équipes sportives intercollégiales de l\'Ohio sont connues sous le nom de Bobcats et concourent dans la National Collegiate Athletic Association (NCAA) au niveau de la Division I en tant que membres fondateurs de la Mid-American Conference. L\'équipe de football de l\'Ohio a participé à 16 bowls jusqu\'à la saison 2023. L\'équipe de basketball masculin a participé à 14 éditions du tournoi de basketball masculin de la NCAA, sa participation la plus récente remontant à 2021.', 0),
(77, 4604, 'Oklahoma State University', 'Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Economics & Econometrics,General Engineering,Art, Performing Arts & Design,Chemical Engineering,Psychology,Mathematics & Statistics,Communication & Media Studies,Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences,Veterinary Science,Archaeology,Business & Management,Politics & International Studies (incl Development Studies),Chemistry,Civil Engineering,Agriculture & Forestry,History, Philosophy & Theology,Architecture,Education,Other Health,Geography,Sport Science,Computer Science,Biological Sciences,Medicine & Dentistry,Accounting & Finance,Sociology,Physics & Astronomy', 74, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f4/Oklahoma_State_University_seal.svg/150px-Oklahoma_State_University_seal.svg.png', ' Oklahoma State University–Stillwater (officiellement Oklahoma State University ; informellement OSU, OK State, Oklahoma State) est une université publique de recherche à vocation agricole à Stillwater, Oklahoma. OSU a été fondée en 1890 en vertu du Morrill Act. Initialement connue sous le nom de Oklahoma Agricultural and Mechanical College (Oklahoma A&M), c\'est l\'institution phare du système de l\'Université d\'État de l\'Oklahoma qui compte plus de 35 000 étudiants sur ses cinq campus, avec un budget annuel de 1,7 milliard de dollars. L\'effectif principal pour le semestre d\'automne 2019 était de 24 071 étudiants, avec 20 024 étudiants de premier cycle et 4 017 étudiants diplômés. OSU est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". Selon la National Science Foundation, OSU a dépensé 198,8 millions de dollars en recherche et développement en 2021.\nLes équipes sportives, les Oklahoma State Cowboys and Cowgirls, ont remporté 53 championnats nationaux, ce qui les place au cinquième rang des équipes nationales les plus titrées de la NCAA, après l\'Université Stanford, l\'Université de Californie à Los Angeles, l\'Université de Californie du Sud et l\'Université du Texas à Austin, à égalité avec l\'Université d\'État de Pennsylvanie. En 2021, les étudiants et anciens étudiants d\'Oklahoma State ont remporté 34 médailles olympiques (21 d\'or, 5 d\'argent et 8 de bronze). L\'université a produit 48 boursiers Fulbright, des astronautes et un milliardaire.\nLes étudiants passent une partie du semestre d\'automne à se préparer à la célébration du retour à la maison d\'OSU, commencée en 1913, qui attire plus de 40 000 anciens élèves et plus de 70 000 participants chaque année sur le campus et est présentée par l\'université comme \"la plus grande célébration du retour à la maison en Amérique\". Le réseau des anciens élèves de l\'Université d\'État de l\'Oklahoma compte plus de 250 000 diplômés.', 14000),
(78, 3352, 'Old Dominion University', 'Medicine & Dentistry,Other Health,Mathematics & Statistics,Education,Politics & International Studies (incl Development Studies),Sociology,Sport Science,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Business & Management,Chemistry,History, Philosophy & Theology,Communication & Media Studies,Electrical & Electronic Engineering,Computer Science,Civil Engineering,Languages, Literature & Linguistics,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Physics & Astronomy,Psychology,General Engineering,Geography,Economics & Econometrics,Accounting & Finance', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/42/Old_Dominion_University_seal.png/130px-Old_Dominion_University_seal.png', ' Old Dominion University (ODU) est une université publique de recherche à Norfolk, en Virginie. Fondée en 1930 en tant que Norfolk Division du College of William & Mary, Old Dominion est l\'une des plus grandes universités de Virginie avec un effectif de 23 494 étudiants pour l\'année académique 2023. L\'université accueille également plus de 600 étudiants internationaux de 99 pays. Son campus principal s\'étend sur 250 acres (1,0 km2) à cheval sur les quartiers de Larchmont, Highland Park et Lambert\'s Point, à environ cinq miles (8,0 km) au nord du centre-ville de Norfolk le long de la rivière Elizabeth.\nL\'université propose 175 programmes de premier cycle et de cycles supérieurs issus de sept collèges et trois écoles. Tirant son nom de l\'un des surnoms de l\'État de Virginie, \"The Old Dominion\", donné à l\'État par le roi Charles II d\'Angleterre pour être resté loyal à la couronne pendant la guerre civile anglaise, Old Dominion compte environ 165 000 anciens élèves dans les 50 États et 67 pays.\nOld Dominion University est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". Selon la National Science Foundation, ODU a dépensé 73,6 millions de dollars en recherche et développement en 2021.', 0),
(79, 3864, 'Oregon Health and Science University', 'Other Health,Psychology,Medicine & Dentistry,Biological Sciences,Chemistry', 0, 'https://upload.wikimedia.org/wikipedia/en/f/ff/OHSU-Logo.png?20081215154531', ' Oregon Health & Science University (OHSU) est une université publique de recherche axée principalement sur les sciences de la santé, avec un campus principal, comprenant deux hôpitaux, à Portland, Oregon. L\'institution a été fondée en 1887 sous le nom de University of Oregon Medical Department, puis est devenue la University of Oregon Medical School. En 1974, le campus est devenu une institution indépendante et autonome appelée University of Oregon Health Sciences Center, regroupant les programmes de médecine dentaire, médecine, soins infirmiers et santé publique de l\'État en un seul centre. Il a été renommé Oregon Health Sciences University en 1981 et a pris son nom actuel en 2001, dans le cadre d\'une fusion avec l\'Oregon Graduate Institute (OGI) à Hillsboro. L\'université propose plusieurs programmes de partenariat, dont un programme de pharmacie PharmD conjoint avec l\'Oregon State University à Corvallis.\nLes programmes de l\'université sont très bien classés au niveau national, la School of Medicine se classant dans le top 5 pour les soins primaires et la résidence en médecine familiale à la première place selon U.S. News & World Report, ainsi que la résidence en ophtalmologie sous la Casey Eye Institute se classant dans le top 10 selon Ophthalmology Times en 2020. Elle est désignée comme une \"Institution de recherche à focus spécial\" selon la Classification Carnegie.', 0),
(80, 1009, 'Oregon State University', 'History, Philosophy & Theology,Biological Sciences,Accounting & Finance,Other Health,Geography,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences,Civil Engineering,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Chemistry,Computer Science,Business & Management,Chemical Engineering,Psychology,Sport Science,Sociology,Agriculture & Forestry,Physics & Astronomy,Communication & Media Studies,Languages, Literature & Linguistics,Education,Veterinary Science,Electrical & Electronic Engineering,Economics & Econometrics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/13/Oregon_State_University_seal.svg/150px-Oregon_State_University_seal.svg.png', ' Oregon State University (OSU) est une université publique de recherche agricole basée à Corvallis, Oregon. OSU propose plus de 200 programmes de premier cycle ainsi qu\'une variété de programmes de troisième cycle et de doctorat. Elle possède le septième plus grand collège d\'ingénierie du pays pour l\'année 2023. L\'inscription au premier cycle pour tous les collèges combinés dépasse en moyenne 32 000 étudiants, tandis qu\'environ 5 000 étudiants suivent des cours de troisième cycle à l\'université. En 2023, plus de 37 000 étudiants étaient inscrits à OSU, ce qui en fait la plus grande université de l\'État. Les étudiants hors de l\'État représentent généralement plus d\'un quart de la population étudiante. Depuis sa fondation, plus de 272 000 étudiants ont obtenu leur diplôme de OSU. L\'université est classée par la Classification Carnegie des établissements d\'enseignement supérieur comme une \"Université doctorale de type R1\", avec \"une activité de recherche très intense\".\nInitialement créée en tant qu\'université agraire, OSU est devenue l\'un des quatre membres fondateurs du programme Sea Grant en 1971. Les adhésions aux consortiums de recherche Space Grant et Sun Grant ont été attribuées en 1991 et 2003, ce qui en fait l\'une des trois seules écoles du pays à obtenir des adhésions à des programmes de subventions pour la terre, le soleil, la mer et l\'espace. OSU a reçu un financement record de 449,9 millions de dollars pour la recherche au cours de l\'exercice 2022 et est classée comme le principal bénéficiaire de financements de recherche de l\'État depuis plus de 50 ans. OSU est également l\'une des cinq principales destinations d\'universités doctorales dans le pays pour les boursiers Fulbright (2022-2023).', 0),
(81, 4588, 'Penn State (Main campus)', 'Business & Management,General Engineering,Physics & Astronomy,History, Philosophy & Theology,Chemical Engineering,Chemistry,Accounting & Finance,Mechanical & Aerospace Engineering,Sport Science,Medicine & Dentistry,Agriculture & Forestry,Geography,Education,Veterinary Science,Art, Performing Arts & Design,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Law,Communication & Media Studies,Languages, Literature & Linguistics,Computer Science,Mathematics & Statistics,Sociology,Archaeology,Other Health,Biological Sciences,Politics & International Studies (incl Development Studies),Architecture,Civil Engineering,Psychology', 50, 'https://upload.wikimedia.org/wikipedia/fr/f/f5/Penn_State_Nittany_Lions_logo.svg.png?20230126210657', ' The Pennsylvania State University (généralement appelée Penn State et parfois par l\'acronyme PSU) est une université publique de recherche associée à l\'État avec des campus et des installations dans tout la Pennsylvanie. Fondée en 1855 sous le nom de Farmers\' High School of Pennsylvania, en 1863, Penn State a été désignée comme la première université agraire de l\'État. Son campus principal, connu sous le nom de Penn State University Park, est situé à State College et College Township en Pennsylvanie.\nEn plus de sa désignation agraire, l\'université est une université de subvention maritime, de subvention spatiale et l\'une des sept universités de subvention solaire. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très intense\" et est membre de l\'Association of American Universities (AAU). L\'université dispose de deux écoles de droit : Penn State Law sur le campus University Park de l\'université et Penn State Dickinson Law à Carlisle. Le College of Medicine est à Hershey. L\'université gère 19 campus communs et cinq campus à mission spéciale répartis dans toute la Pennsylvanie.\nL\'université participe à la Big Ten Conference en Division I de la NCAA pour la plupart de ses équipes sportives, connues collectivement sous le nom de Penn State Nittany Lions. Depuis sa création, Penn State a remporté 81 championnats nationaux universitaires d\'équipes, dont 53 titres de la NCAA dans tous les sports, et les étudiants, anciens élèves, professeurs et entraîneurs de Penn State ont remporté un total de 60 médailles olympiques, dont 17 médailles d\'or.', 25000),
(82, 3864, 'Portland State University', 'Business & Management,General Engineering,Geography,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Mathematics & Statistics,Art, Performing Arts & Design,Education,Politics & International Studies (incl Development Studies),Economics & Econometrics,Biological Sciences,Psychology,Accounting & Finance,Civil Engineering,Sociology,History, Philosophy & Theology,Electrical & Electronic Engineering,Sport Science,Architecture,Other Health,Geology, Environmental, Earth & Marine Sciences,Agriculture & Forestry,Communication & Media Studies,Archaeology,Computer Science,Chemistry,Medicine & Dentistry,Chemical Engineering,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b9/Portland_State_University_seal.svg/175px-Portland_State_University_seal.svg.png', ' Portland State University (PSU) est une université publique de recherche à Portland, Oregon. Elle a été fondée en 1946 en tant qu\'établissement d\'enseignement postsecondaire pour les vétérans de la Seconde Guerre mondiale. Elle est devenue un collège universitaire sur quatre ans au cours des deux décennies suivantes et a obtenu le statut d\'université en 1969. C\'est l\'une des deux universités publiques de l\'Oregon situées dans une grande ville. Elle est régie par un conseil d\'administration. PSU est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nPortland State est composée de sept collèges constituants, proposant des diplômes de premier cycle dans cent vingt-trois domaines et des diplômes de troisième cycle dans cent dix-sept domaines. Ses équipes sportives sont connues sous le nom de Portland State Vikings avec des couleurs d\'école vert et blanc. Elles concourent au niveau de la NCAA Division I, principalement dans la Big Sky Conference.', 0),
(83, 3897, 'Princeton University', 'Languages, Literature & Linguistics,Biological Sciences,Other Health,Psychology,Sociology,Mechanical & Aerospace Engineering,Computer Science,Politics & International Studies (incl Development Studies),Economics & Econometrics,Chemistry,Chemical Engineering,Mathematics & Statistics,History, Philosophy & Theology,Civil Engineering,Physics & Astronomy,Architecture,Agriculture & Forestry,General Engineering,Art, Performing Arts & Design,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences', 6, 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d0/Princeton_seal.svg/140px-Princeton_seal.svg.png', ' Princeton University est une université de recherche privée de la Ivy League située à Princeton, dans le New Jersey. Fondée en 1746 à Elizabeth sous le nom de College of New Jersey, Princeton est la quatrième plus ancienne institution d\'enseignement supérieur aux États-Unis et l\'une des neuf universités coloniales chartées avant la Révolution américaine. L\'établissement a déménagé à Newark en 1747, puis sur son campus actuel neuf ans plus tard. Il est officiellement devenu une université en 1896 et a été ensuite renommé Princeton University.\nL\'université est dirigée par les Trustees de Princeton University et dispose d\'une dotation de 37,7 milliards de dollars, la plus grande dotation par étudiant aux États-Unis. Princeton dispense des cours de premier cycle et des cycles supérieurs en sciences humaines, sciences sociales, sciences naturelles et génie à environ 8 500 étudiants sur son campus principal de 600 acres (2,4 km2). Elle propose des diplômes de troisième cycle par le biais de la Princeton School of Public and International Affairs, de la School of Engineering and Applied Science, de la School of Architecture et du Bendheim Center for Finance. L\'université gère également le Princeton Plasma Physics Laboratory du Département de l\'Énergie et abrite le Geophysical Fluid Dynamics Laboratory de la NOAA. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\" et possède l\'une des plus grandes bibliothèques universitaires au monde.\nPrinceton utilise un système de collèges résidentiels et est connu pour ses clubs de restauration pour les étudiants de cycles supérieurs. L\'université compte plus de 500 organisations étudiantes. Les étudiants de Princeton embrassent une grande variété de traditions du passé et du présent. L\'université est une école de la NCAA Division I et participe à la Ivy League. L\'équipe sportive de l\'école, les Princeton Tigers, a remporté le plus grand nombre de titres de sa conférence et a envoyé de nombreux étudiants et anciens aux Jeux olympiques.\nEn octobre 2021, 75 lauréats du prix Nobel, 16 médaillés Fields et 16 lauréats du prix Turing ont été associés à l\'Université de Princeton en tant qu\'anciens élèves, membres du corps professoral ou chercheurs. De plus, Princeton a été associée à 21 lauréats de la National Medal of Science, 5 lauréats du prix Abel, 11 récipiendaires de la National Humanities Medal, 217 boursiers Rhodes, 137 boursiers Marshall et 62 boursiers Gates Cambridge. Deux présidents américains, douze juges de la Cour suprême des États-Unis (dont trois siègent actuellement à la Cour) et de nombreux magnats de l\'industrie et des médias ainsi que des chefs d\'État étrangers sont tous comptés parmi les anciens élèves de Princeton. Princeton a diplômé de nombreux membres du Congrès américain et du Cabinet américain, dont huit secrétaires d\'État, trois secrétaires de la Défense et deux présidents du Comité des chefs d\'état-major interarmées.', 16000),
(84, 5134, 'Purdue University West Lafayette', 'Architecture,History, Philosophy & Theology,Sociology,Chemistry,Education,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Chemical Engineering,Languages, Literature & Linguistics,General Engineering,Physics & Astronomy,Sport Science,Psychology,Law,Business & Management,Electrical & Electronic Engineering,Art, Performing Arts & Design,Economics & Econometrics,Computer Science,Agriculture & Forestry,Mathematics & Statistics,Civil Engineering,Medicine & Dentistry,Communication & Media Studies,Politics & International Studies (incl Development Studies),Other Health,Mechanical & Aerospace Engineering,Veterinary Science,Accounting & Finance', 57, 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f7/Purdue_University_system_logo.svg/246px-Purdue_University_system_logo.svg.png', ' Purdue University est une université publique de recherche subventionnée par l\'État à West Lafayette, Indiana, et le campus principal du système de l\'Université Purdue. L\'université a été fondée en 1869 après que John Purdue, un homme d\'affaires de Lafayette, ait fait don de terres et d\'argent pour établir un collège des sciences, de la technologie et de l\'agriculture à son nom. Les premiers cours ont eu lieu le 16 septembre 1874, avec six instructeurs et 39 étudiants.\nLe campus principal à West Lafayette propose plus de 200 filières pour les étudiants de premier cycle, plus de 70 programmes de maîtrise et de doctorat, ainsi que des diplômes professionnels en pharmacie, médecine vétérinaire et soins infirmiers avancés. De plus, Purdue compte 18 équipes sportives intercollégiales et plus de 1000 organisations étudiantes. Purdue est le membre fondateur de la Big Ten Conference et compte le plus grand nombre d\'étudiants de tout campus universitaire individuel de l\'Indiana, ainsi que la neuvième plus grande population étudiante étrangère de toutes les universités aux États-Unis.\nPurdue University est membre de l\'Association of American Universities et est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". Purdue a été associée à 13 lauréats du prix Nobel, 1 lauréat du prix Turing, 2 lauréats du prix mondial de l\'alimentation, 3 lauréats du prix Pulitzer, 18 médaillés olympiques, 3 récipiendaires de la Médaille nationale de la technologie et de l\'innovation, 2 récipiendaires de la Médaille nationale des sciences, 3 récipiendaires de la Médaille présidentielle de la liberté, 7 membres du Congrès, 3 gouverneurs américains et 2 chefs d\'État.', 12000),
(85, 4814, 'Rensselaer Polytechnic Institute', 'History, Philosophy & Theology,Chemical Engineering,Psychology,Art, Performing Arts & Design,Civil Engineering,Communication & Media Studies,Accounting & Finance,General Engineering,Electrical & Electronic Engineering,Architecture,Computer Science,Physics & Astronomy,Medicine & Dentistry,Geology, Environmental, Earth & Marine Sciences,Other Health,Chemistry,Languages, Literature & Linguistics,Mathematics & Statistics,Economics & Econometrics,Biological Sciences,Business & Management,Mechanical & Aerospace Engineering', 44, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/5a/Rensselaer_Polytechnic_Institute_coat_of_arms.svg/130px-Rensselaer_Polytechnic_Institute_coat_of_arms.svg.png', ' Rensselaer Polytechnic Institute (RPI) est une université de recherche privée située à Troy, New York, avec un campus supplémentaire à Hartford, Connecticut. Un troisième campus à Groton, Connecticut, a fermé en 2018. RPI a été créée en 1824 par Stephen Van Rensselaer et Amos Eaton dans le but de \"mettre la science au service des besoins quotidiens\" et est la plus ancienne université technologique du monde anglophone et de l\'hémisphère occidental.\nConstruit sur une colline, le campus de 265 acres (107 hectares) de RPI surplombe la ville de Troy et la rivière Hudson. L\'institut exploite un incubateur d\'entreprises sur le campus et le Rensselaer Technology Park de 1 250 acres (510 hectares).\nRPI est organisée en six grandes écoles qui regroupent 37 départements, mettant l\'accent sur les sciences et la technologie. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". En 2017, le corps professoral et les anciens élèves de RPI comprenaient 6 membres du Temple de la renommée des inventeurs nationaux, 6 lauréats de la Médaille nationale de la technologie, 5 lauréats de la Médaille nationale des sciences, 8 récipiendaires de bourses Fulbright et l\'ingénieur lauréat du prix Nobel Ivar Giaever.', 37000),
(86, 2162, 'Rice University', 'Sociology,Business & Management,Computer Science,Sport Science,Architecture,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Languages, Literature & Linguistics,Psychology,General Engineering,Art, Performing Arts & Design,Biological Sciences,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Medicine & Dentistry,Archaeology,Other Health,Physics & Astronomy,History, Philosophy & Theology,Accounting & Finance,Mechanical & Aerospace Engineering,Civil Engineering,Education,Mathematics & Statistics,Chemistry,Chemical Engineering', 16, 'https://upload.wikimedia.org/wikipedia/en/thumb/c/c7/Rice_University_seal.svg/140px-Rice_University_seal.svg.png', ' Rice University, formellement William Marsh Rice University, est une université de recherche privée située à Houston, Texas, aux États-Unis. Elle est située sur un campus de 300 acres à côté du Houston Museum District et du Texas Medical Center.\nOuverte en 1912 en tant que Rice Institute après le meurtre de son fondateur William Marsh Rice, Rice est une université de recherche avec un accent sur le premier cycle. Elle a un ratio étudiants-enseignants de 6:1. Rice est membre de l\'Association of American Universities depuis 1985 et est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". L\'université est organisée en huit écoles d\'études académiques. Rice participe à 14 sports universitaires de la NCAA Division I et fait partie de l\'American Athletic Conference. Ses équipes sont les Rice Owls.\nLes anciens élèves de l\'université comprennent 26 boursiers Marshall, 12 boursiers Rhodes, 7 boursiers Churchill et 3 lauréats du prix Nobel. Le Rice Space Institute collabore avec le Johnson Space Center depuis plus de 50 ans. Dans le domaine des affaires, les diplômés de Rice comprennent des PDG, des fondateurs d\'entreprises du Fortune 500 et quatre milliardaires ; en politique, les anciens élèves incluent des hommes politiques et des membres du cabinet.', 24000),
(87, 4069, 'Rochester Institute of Technology', 'Geology, Environmental, Earth & Marine Sciences,Architecture,Biological Sciences,Physics & Astronomy,Medicine & Dentistry,Business & Management,Communication & Media Studies,Mathematics & Statistics,Psychology,Other Health,Languages, Literature & Linguistics,Chemistry,General Engineering,Civil Engineering,Sociology,Computer Science,History, Philosophy & Theology,Sport Science,Art, Performing Arts & Design,Accounting & Finance,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Chemical Engineering,Economics & Econometrics', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/49/Rochester_Institute_of_Technology_Seal_%282018%29.svg/150px-Rochester_Institute_of_Technology_Seal_%282018%29.svg.png', ' Le Rochester Institute of Technology (RIT) est une université privée de recherche située dans la ville de Henrietta, dans la région métropolitaine de Rochester, dans l\'État de New York. Fondée en 1829, l\'Université RIT est devenue une institution renommée avec un corps étudiant diversifié.\nL\'Université RIT compte environ 19 000 étudiants, dont 16 000 étudiants de premier cycle et 3 000 étudiants diplômés. Ces étudiants proviennent des 50 États des États-Unis et de plus de 100 pays. L\'université compte plus de 4 000 enseignants et membres du personnel. De plus, RIT a établi des antennes internationales en Chine, en Croatie, au Kosovo et aux Émirats arabes unis.\nL\'université est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\". Onze anciens élèves, collaborateurs et membres du corps professoral de RIT ont été lauréats du prix Pulitzer, remportant un total de 15 prix.', 0),
(88, 1763, 'Rowan University', 'Art, Performing Arts & Design,Biological Sciences,Politics & International Studies (incl Development Studies),Economics & Econometrics,Agriculture & Forestry,Geology, Environmental, Earth & Marine Sciences,Sport Science,Education,Languages, Literature & Linguistics,Electrical & Electronic Engineering,Mathematics & Statistics,Computer Science,Sociology,Accounting & Finance,Mechanical & Aerospace Engineering,Psychology,Medicine & Dentistry,General Engineering,Physics & Astronomy,History, Philosophy & Theology,Chemical Engineering,Chemistry,Business & Management,Civil Engineering,Communication & Media Studies,Other Health,Geography', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/6c/Rowan_University_seal.svg/150px-Rowan_University_seal.svg.png', ' Rowan University est une université de recherche publique située à Glassboro, dans le New Jersey, avec un campus médical à Stratford et des campus médicaux et académiques à Camden. Fondée en 1923 en tant que Glassboro Normal School sur un terrain de 25 acres (10 hectares) offert par 107 résidents, l\'école était auparavant connue sous le nom de Glassboro State College de 1958 à 1992, puis de Rowan College of New Jersey de 1992 à 1997.\nL\'université comprend 14 collèges et écoles avec un effectif total (premier cycle, cycles supérieurs et études professionnelles) de légèrement plus de 19 600 étudiants. Rowan propose 85 licences, 46 masters, six doctorats et deux diplômes professionnels. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".', 0),
(89, 811, 'Rush University', 'Biological Sciences,Medicine & Dentistry,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/4f/Rush_University_seal.gif/130px-Rush_University_seal.gif', ' L\'université Rush (en anglais Rush University) est un établissement d\'enseignement supérieur privé situé à Chicago aux États-Unis. Elle comprend une école de médecine (Rush Medical College), d\'infirmières (Rush University College of Nursing), de sciences médicales (Rush University College of Health Sciences) ainsi qu\'un college (The Graduate College of Rush University). Son campus mesure 32 000 m2 au total et se trouve dans le quartier de Near West Side, plus précisément dans l\'Illinois Medical District, à côté du Rush University Medical Center, du John H. Stroger Jr. Hospital of Cook County et de l\'hôpital de l\'Université de l\'Illinois à Chicago. Elle fut fondée en 1837 et formait des chirurgiens.', 0),
(90, 3776, 'Rutgers University – New Brunswick', 'Psychology,Sociology,Accounting & Finance,Mechanical & Aerospace Engineering,Mathematics & Statistics,Languages, Literature & Linguistics,General Engineering,Physics & Astronomy,Art, Performing Arts & Design,Medicine & Dentistry,Agriculture & Forestry,Chemical Engineering,Communication & Media Studies,Other Health,Chemistry,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Business & Management,Electrical & Electronic Engineering,Geography,Architecture,Education,Sport Science,History, Philosophy & Theology,Civil Engineering,Computer Science,Biological Sciences,Politics & International Studies (incl Development Studies)', 58, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f0/Rutgers_University_seal.svg/180px-Rutgers_University_seal.svg.png', ' Rutgers University–New Brunswick est l\'un des trois campus régionaux de l\'Université Rutgers, une université publique de recherche agraire composée de quatre campus au New Jersey. Il est situé à New Brunswick et Piscataway. C\'est le campus le plus ancien de l\'université, les autres étant à Camden et Newark. Le campus est composé de plusieurs campus plus petits qui sont éloignés les uns des autres : College Avenue, Busch, Livingston, Cook et Douglass, ces deux derniers étant parfois appelés \"Cook', 16000),
(91, 4564, 'Saint Louis University', 'Chemistry,Electrical & Electronic Engineering,Art, Performing Arts & Design,Physics & Astronomy,Education,Civil Engineering,Sociology,Geology, Environmental, Earth & Marine Sciences,General Engineering,Economics & Econometrics,Communication & Media Studies,Biological Sciences,Computer Science,Mathematics & Statistics,Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Sport Science,Chemical Engineering,History, Philosophy & Theology,Geography,Other Health,Medicine & Dentistry,Psychology,Accounting & Finance,Agriculture & Forestry,Languages, Literature & Linguistics,Business & Management,Law', 64, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/6d/Saint_Louis_University_seal.png/150px-Saint_Louis_University_seal.png', ' Saint Louis University (SLU) est une université de recherche jésuite privée avec des campus à St. Louis, Missouri, aux États-Unis, et à Madrid, en Espagne. Fondée en 1818 par Louis William Valentine DuBourg, c\'est la plus ancienne université à l\'ouest du Mississippi et la deuxième plus ancienne université jésuite aux États-Unis. L\'université est accréditée par la Higher Learning Commission.\nAu cours de l\'année académique 2022-2023, SLU comptait 13 546 étudiants. La population étudiante comprenait 8 437 étudiants de premier cycle et 5 109 étudiants des cycles supérieurs représentant tous les 50 États et 82 pays. L\'université est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nDepuis plus de 50 ans, l\'université entretient un campus à Madrid, en Espagne. Le campus de Madrid a été le premier campus indépendant exploité par une université américaine en Europe et la première institution américaine à être reconnue par l\'autorité espagnole de l\'enseignement supérieur en tant qu\'université étrangère officielle.\nLes équipes sportives de SLU participent à la Division I de la National Collegiate Athletic Association (NCAA) et font partie de l\'Atlantic 10 Conference.', 31000),
(92, 4198, 'San Diego State University', 'Computer Science,Art, Performing Arts & Design,Mathematics & Statistics,Other Health,Civil Engineering,Biological Sciences,Physics & Astronomy,Education,Electrical & Electronic Engineering,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,History, Philosophy & Theology,Sociology,Mechanical & Aerospace Engineering,Languages, Literature & Linguistics,Psychology,General Engineering,Communication & Media Studies,Geography,Accounting & Finance,Business & Management,Politics & International Studies (incl Development Studies),Chemistry', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/60/San_Diego_State_University_seal.svg/150px-San_Diego_State_University_seal.svg.png', ' San Diego State University (SDSU) est une université de recherche publique située à San Diego, en Californie. Fondée en 1897 sous le nom de San Diego Normal School, c\'est la troisième plus ancienne université et la plus méridionale des 23 membres du système de l\'Université d\'État de Californie (CSU). À l\'automne 2022, SDSU a atteint un record historique d\'inscription avec près de 37 000 étudiants et une base d\'anciens de plus de 300 000.\nSan Diego State University est accréditée par la Western Association of Schools and Colleges. SDSU est une institution au service des Hispaniques et est éligible pour être désignée comme une institution au service des Asiatiques, des Amérindiens et des insulaires du Pacifique (AANAPISI). Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\". Depuis 2005, l\'université a produit plus de 65 boursiers Fulbright.', 0);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(93, 679, 'Southern Illinois University Carbondale', 'Law,Geography,Business & Management,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Veterinary Science,Sociology,Civil Engineering,Computer Science,Medicine & Dentistry,General Engineering,Economics & Econometrics,Sport Science,Communication & Media Studies,Art, Performing Arts & Design,Education,Geology, Environmental, Earth & Marine Sciences,Architecture,Electrical & Electronic Engineering,Physics & Astronomy,Chemistry,Accounting & Finance,Languages, Literature & Linguistics,Agriculture & Forestry,Mathematics & Statistics,Archaeology,Other Health,Biological Sciences,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/4d/Southern_Illinois_University_seal.png/150px-Southern_Illinois_University_seal.png', ' Southern Illinois University (SIU ou SIUC) est une université publique de recherche située à Carbondale, en Illinois. Fondée en 1869, SIU est le campus le plus ancien et le campus principal du système de l\'Université du Sud de l\'Illinois. SIU accueille des étudiants de tous les 50 États et de plus de 100 pays. À l\'origine fondée comme un collège normal, l\'université propose aujourd\'hui des programmes dans diverses disciplines, combinant une solide tradition des arts libéraux avec un accent sur la recherche. SIU a obtenu le statut d\'université limitée en 1943 et a commencé à délivrer des diplômes de troisième cycle en 1950. Un campus distinct a été établi à Edwardsville, en Illinois, en 1957, devenant finalement l\'Université du Sud de l\'Illinois Edwardsville.\nL\'université est connue pour ses partenariats de recherche, notamment ceux avec les laboratoires nationaux d\'Argonne et Oak Ridge, le U.S. Geological Survey, le U.S. Fish and Wildlife Service et la NASA. L\'université abrite également des centaines d\'organisations étudiantes, vingt-sept chapitres de fraternités et sororités, et une équipe de vol compétitive reconnue au niveau national. Les équipes sportives intercollégiales de SIU sont collectivement connues sous le nom de Southern Illinois Salukis.', 0),
(94, 4583, 'Stanford University', 'Physics & Astronomy,Computer Science,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Geology, Environmental, Earth & Marine Sciences,Agriculture & Forestry,Medicine & Dentistry,Education,Communication & Media Studies,Chemistry,Mechanical & Aerospace Engineering,Languages, Literature & Linguistics,History, Philosophy & Theology,Psychology,Mathematics & Statistics,Biological Sciences,Sociology,Law,Accounting & Finance,Business & Management,Archaeology,General Engineering,Civil Engineering,Chemical Engineering,Other Health,Economics & Econometrics,Electrical & Electronic Engineering,Veterinary Science', 5, 'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b5/Seal_of_Leland_Stanford_Junior_University.svg/150px-Seal_of_Leland_Stanford_Junior_University.svg.png', ' Stanford University (officiellement Leland Stanford Junior University) est une université privée de recherche située à Stanford, en Californie. Le campus s\'étend sur 8 180 acres (3 310 hectares), l\'un des plus vastes aux États-Unis, et compte plus de 17 000 étudiants.\nL\'université a été fondée en 1885 par Leland Stanford, magnat des chemins de fer qui a été le huitième gouverneur de Californie et sénateur en exercice, ainsi que son épouse Jane, en mémoire de leur seul enfant, Leland Stanford Jr., décédé de la fièvre typhoïde à l\'âge de 15 ans l\'année précédente. L\'université a admis ses premiers étudiants le 1er octobre 1891, en tant qu\'institution mixte et non confessionnelle. Stanford a connu des difficultés financières après la mort de Leland en 1893, puis à nouveau après que la majeure partie du campus ait été endommagée par le séisme de San Francisco en 1906. Après la Seconde Guerre mondiale, Frederick Terman, le provost de l\'université, a inspiré et soutenu l\'entrepreneuriat des professeurs et des diplômés pour construire une industrie locale autosuffisante, qui serait plus tard connue sous le nom de Silicon Valley.\nL\'université est organisée autour de sept écoles sur le même campus : trois écoles comprenant 45 départements académiques au niveau du premier cycle, ainsi que quatre écoles professionnelles axées sur les programmes de troisième cycle en droit, médecine, éducation et commerce. L\'université abrite également l\'Hoover Institution, un groupe de réflexion sur les politiques publiques. Les étudiants participent à 36 sports de compétition, et l\'université est l\'une des deux institutions privées de la Division I FBS Pac-12 Conference. Au 26 mai 2022, Stanford a remporté 131 championnats d\'équipe de la NCAA, plus que toute autre université, et a reçu la NACDA Directors\' Cup pendant 25 années consécutives à partir de 1994. En outre, d\'ici 2021, les étudiants et anciens élèves de Stanford avaient remporté au moins 296 médailles olympiques, dont 150 d\'or et 79 d\'argent.\nEn avril 2021, 58 lauréats du prix Nobel, 29 lauréats du prix Turing et 8 médaillés Fields étaient affiliés à Stanford en tant qu\'étudiants, anciens élèves, professeurs ou personnel. De plus, Stanford est particulièrement reconnue pour son esprit d\'entreprise et est l\'une des universités les plus performantes pour attirer des financements pour les start-ups. Les anciens élèves de Stanford ont fondé de nombreuses entreprises, qui génèrent ensemble plus de 2,7 billions de dollars de revenus annuels. Stanford est l\'alma mater du président américain Herbert Hoover, du Premier ministre actuel du Royaume-Uni Rishi Sunak, de 74 milliardaires vivants et de 17 astronautes. Dans le milieu universitaire, ses anciens élèves comprennent les présidents et provosts de Yale, Harvard et Princeton. Elle est également l\'un des principaux producteurs de boursiers Fulbright, de boursiers Marshall, de boursiers Gates Cambridge, de boursiers Rhodes et de membres du Congrès américain.', 16000),
(95, 2110, 'Stevens Institute of Technology', 'Computer Science,Civil Engineering,Chemical Engineering,General Engineering,Geology, Environmental, Earth & Marine Sciences,Mechanical & Aerospace Engineering,Business & Management,Sociology,Electrical & Electronic Engineering,Mathematics & Statistics,Art, Performing Arts & Design,Other Health,Physics & Astronomy,Languages, Literature & Linguistics,Biological Sciences,History, Philosophy & Theology,Chemistry', 44, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/8e/Seal_of_Stevens_Institute_of_Technology.svg/150px-Seal_of_Stevens_Institute_of_Technology.svg.png', ' Le Stevens Institute of Technology est une université de recherche privée située à Hoboken, dans le New Jersey. Fondée en 1870, c\'est l\'une des plus anciennes universités technologiques des États-Unis et la première université américaine entièrement dédiée au génie mécanique. Le campus de 55 acres englobe Castle Point, le point le plus élevé de Hoboken, un espace vert du campus et 43 bâtiments académiques, étudiants et administratifs.\nÉtabli grâce à un legs de 1868 d\'Edwin Augustus Stevens, l\'inscription à Stevens comprend plus de 8 000 étudiants de premier cycle et des cycles supérieurs représentant 47 États et 60 pays d\'Asie, d\'Europe et d\'Amérique latine. Stevens comprend quatre écoles qui délivrent des diplômes axés sur la technologie en STEM (sciences, technologie, ingénierie et mathématiques) et des diplômes en affaires, arts, sciences humaines et sciences sociales : l\'école d\'ingénierie et de sciences Charles V. Schaefer, l\'école de commerce, l\'école de systèmes et d\'entreprises, et l\'école des sciences humaines, des arts et des sciences sociales. Pour les étudiants de premier cycle, Stevens propose le baccalauréat en ingénierie (B.E.), le baccalauréat en sciences (B.S.) et le baccalauréat en arts (B.A.). Au niveau des cycles supérieurs, Stevens propose des programmes en ingénierie, en sciences, en systèmes, en ingénierie, en gestion et en arts libéraux. Les étudiants des cycles supérieurs peuvent poursuivre des diplômes avancés dans plus de 50 spécialités différentes, allant des certificats de troisième cycle et des master\'s aux niveaux Ph.D.\nStevens est classé parmi les \"R2 : Universités doctorales - Activité de recherche élevée\". L\'université abrite deux Centres d\'Excellence nationaux désignés par le Département de la Défense et le Département de la Sécurité intérieure des États-Unis. Deux membres de la communauté de Stevens, en tant qu\'anciens élèves ou membres du corps professoral, ont reçu le prix Nobel : Frederick Reines (promotion 1939), en physique, et Irving Langmuir (professeur de chimie de 1906 à 1909), en chimie.', 38000),
(96, 4615, 'Stony Brook University', 'Art, Performing Arts & Design,Computer Science,Politics & International Studies (incl Development Studies),Civil Engineering,Biological Sciences,Languages, Literature & Linguistics,Accounting & Finance,Psychology,General Engineering,Other Health,Mechanical & Aerospace Engineering,History, Philosophy & Theology,Business & Management,Education,Electrical & Electronic Engineering,Medicine & Dentistry,Geography,Physics & Astronomy,Chemical Engineering,Mathematics & Statistics,Archaeology,Sociology,Geology, Environmental, Earth & Marine Sciences,Communication & Media Studies,Chemistry,Economics & Econometrics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/1d/Stony_Brook_University_seal.svg/150px-Stony_Brook_University_seal.svg.png', ' La Stony Brook University (SBU), officiellement la State University of New York à Stony Brook, est une université publique de recherche située sur l\'île de Long Island à Stony Brook, dans l\'État de New York. Avec l\'Université de Buffalo, elle est l\'une des deux institutions phares du système de l\'Université d\'État de New York. Son campus est composé de 213 bâtiments sur plus de 1 454 acres (588 hectares) de terres dans le comté de Suffolk, et c\'est la plus grande université publique (en superficie) de l\'État de New York.\nOuverte il y a 67 ans en 1957 à Oyster Bay sous le nom de State University College on Long Island, l\'institution a déménagé à Stony Brook en 1962. En 2001, Stony Brook a été élue à l\'Association of American Universities. Elle est également membre de l\'Universities Research Association plus large. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".\nLa Stony Brook University, en partenariat avec Battelle, gère le Brookhaven National Laboratory, un laboratoire national du Département de l\'Énergie des États-Unis. L\'université a acquis des terrains pour un parc de recherche et développement adjacent à son campus principal en 2004, et possède quatre incubateurs d\'entreprises dans la région. Stony Brook est le plus grand employeur sur un seul site de Long Island ; plus de 25 500 étudiants sont inscrits à l\'université, qui compte plus de 15 000 employés et plus de 2 850 professeurs.\nLes équipes sportives intercollégiales de Stony Brook participent à la Division I de la NCAA depuis 1999 en tant que Seawolves. Stony Brook a rejoint la Colonial Athletic Association le 1er juillet 2022 après avoir participé en tant que membre de l\'America East Conference depuis 2001. En mai 2022, les professeurs et anciens élèves de Stony Brook comprenaient : 7 lauréats du prix Nobel, 2 lauréats du prix Abel, au moins 5 milliardaires vivants, 2 lauréats du prix Pulitzer et 5 lauréats de la médaille Fields, ce qui la place à égalité pour la septième place parmi les universités américaines.', 0),
(97, 409, 'SUNY Binghamton University', 'Education,Electrical & Electronic Engineering,General Engineering,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Chemical Engineering,Psychology,History, Philosophy & Theology,Physics & Astronomy,Archaeology,Geography,Medicine & Dentistry,Art, Performing Arts & Design,Business & Management,Accounting & Finance,Mathematics & Statistics,Computer Science,Politics & International Studies (incl Development Studies),Chemistry,Sociology,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Economics & Econometrics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/67/State_University_of_New_York_at_Binghamton_Seal.png/180px-State_University_of_New_York_at_Binghamton_Seal.png', ' La State University of New York à Binghamton (Binghamton University ou SUNY Binghamton) est une université publique de recherche avec des campus à Binghamton, Vestal et Johnson City, dans l\'État de New York. Elle est l\'un des quatre centres universitaires du système de l\'Université d\'État de New York (SUNY). À l\'automne 2020, 18 128 étudiants de premier cycle et des cycles supérieurs fréquentaient l\'université.\nDepuis sa création en 1946, l\'école est passée d\'un petit collège d\'arts libéraux à une grande université de recherche. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". Les équipes sportives de Binghamton sont les Bearcats et elles participent à la Division I de la National Collegiate Athletic Association (NCAA). Les Bearcats sont membres de l\'America East Conference.', 0),
(98, 38, 'SUNY University at Albany', 'Computer Science,Geography,Mathematics & Statistics,Politics & International Studies (incl Development Studies),Archaeology,Electrical & Electronic Engineering,Other Health,Sociology,Business & Management,Biological Sciences,Economics & Econometrics,Art, Performing Arts & Design,Physics & Astronomy,Education,Communication & Media Studies,History, Philosophy & Theology,Chemistry,Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences,Psychology,Accounting & Finance', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/06/University_at_Albany_Seal.png/150px-University_at_Albany_Seal.png', ' La State University of New York à Albany, couramment appelée University at Albany, UAlbany ou SUNY Albany, est une université publique de recherche avec des campus à Albany, Rensselaer et Guilderland, dans l\'État de New York. Fondée en 1844, elle est l\'un des quatre \"university centers\" du système de l\'Université d\'État de New York (SUNY).\nL\'université compte 16 849 étudiants répartis dans neuf écoles et collèges, qui proposent 50 filières de premier cycle et 125 programmes de cycles supérieurs. Grâce aux programmes d\'échange UAlbany et SUNY, les étudiants ont le choix parmi plus de 600 programmes d\'études à l\'étranger, ainsi que des opportunités de stages gouvernementaux et commerciaux dans la capitale de l\'État de New York et ses environs. Elle est classée par le système de classification de Carnegie parmi les \"Universités doctorales - Activité de recherche très élevée\". L\'entreprise de recherche a totalisé des dépenses de 115 millions de dollars pour l\'exercice 2021 et est axée sur quatre domaines : les sciences sociales, le droit public et la politique, les sciences de la vie et les sciences atmosphériques. SUNY Albany abrite le New York State Writers Institute.', 0),
(99, 4698, 'Syracuse University', 'Economics & Econometrics,Chemical Engineering,Physics & Astronomy,History, Philosophy & Theology,Law,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Electrical & Electronic Engineering,Communication & Media Studies,Architecture,Civil Engineering,Mathematics & Statistics,Education,Biological Sciences,Sociology,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Accounting & Finance,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Other Health,Chemistry,Computer Science,Sport Science,Geography,Business & Management,General Engineering,Psychology', 47, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bf/Syracuse_University_seal.svg/150px-Syracuse_University_seal.svg.png', ' Syracuse University (informellement \'Cuse ou SU) est une université de recherche privée située à Syracuse, dans l\'État de New York, aux États-Unis. Fondée en 1870 avec des racines dans l\'Église méthodiste épiscopale, l\'université est laïque depuis 1920. Situé dans le quartier University Hill de la ville, à l\'est et au sud-est du centre-ville de Syracuse, le vaste campus présente un mélange éclectique d\'architecture, allant du style néo-roman du XIXe siècle à des bâtiments contemporains. Syracuse University est organisée en 13 écoles et collèges et est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\".\nLes équipes sportives de l\'université, les Orange, participent à 20 sports intercollégiaux. SU est membre de l\'Atlantic Coast Conference (ACC) pour toutes les activités sportives de la NCAA Division I, à l\'exception des équipes d\'aviron masculin et de hockey sur glace féminin. SU est également membre de l\'Eastern College Athletic Conference. Parmi les anciens élèves, professeurs et affiliés figurent le président Joe Biden, trois lauréats du prix Nobel, un médaillé Fields, 36 médaillés olympiques, treize lauréats du prix Pulitzer, des lauréats d\'Oscars, des lauréats de Grammy, deux Rhodes Scholars, six Marshall Scholars, des gouverneurs, et des membres du Sénat et de la Chambre des représentants des États-Unis.', 35000),
(100, 3744, 'Temple University', 'Accounting & Finance,General Engineering,Physics & Astronomy,Architecture,Medicine & Dentistry,Communication & Media Studies,Law,Languages, Literature & Linguistics,Computer Science,Sport Science,Sociology,History, Philosophy & Theology,Education,Agriculture & Forestry,Mechanical & Aerospace Engineering,Geography,Business & Management,Art, Performing Arts & Design,Biological Sciences,Civil Engineering,Chemistry,Politics & International Studies (incl Development Studies),Economics & Econometrics,Mathematics & Statistics,Other Health,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/45/Temple_University_seal.svg/150px-Temple_University_seal.svg.png', ' L\'Université Temple (Temple ou TU) est une université de recherche publique liée à l\'État de Pennsylvanie, située à Philadelphie. Elle a été fondée en 1884 par le pasteur baptiste Russell Conwell et sa congrégation, la Grace Baptist Church of Philadelphia, alors appelée Baptist Temple. Le 12 mai 1888, elle a été rebaptisée Temple College of Philadelphia. En 1907, l\'institution a révisé son statut institutionnel et a été constituée en tant qu\'université de recherche.\nEn 2020, environ 37 289 étudiants de premier cycle, de cycles supérieurs et professionnels étaient inscrits à l\'université. Temple est l\'un des plus grands fournisseurs mondiaux d\'éducation professionnelle, formant le plus grand nombre de praticiens professionnels en Pennsylvanie.', 0),
(101, 925, 'Texas A&M University', 'Art, Performing Arts & Design,Sociology,Chemistry,History, Philosophy & Theology,Business & Management,Law,Economics & Econometrics,Medicine & Dentistry,Veterinary Science,Psychology,Politics & International Studies (incl Development Studies),Geography,Computer Science,Archaeology,Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Mathematics & Statistics,Communication & Media Studies,Architecture,Other Health,Chemical Engineering,General Engineering,Languages, Literature & Linguistics,Accounting & Finance,Civil Engineering,Biological Sciences,Sport Science,Education,Agriculture & Forestry', 71, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f7/Texas_A%26M_University_seal.svg/150px-Texas_A%26M_University_seal.svg.png', ' L\'Université Texas A&M (Texas A&M, A&M ou TAMU) est une université publique, à vocation agricole et mécanique, de recherche, située à College Station, au Texas. Fondée en 1876, elle est devenue l\'institution phare du système universitaire Texas A&M en 1948. Depuis 2021, Texas A&M compte le plus grand nombre d\'étudiants inscrits aux États-Unis[14] et est la seule université au Texas à détenir simultanément les désignations d\'institution agricole, maritime et spatiale. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\" et est membre de l\'Association des universités américaines.\nL\'université a été la première institution d\'enseignement supérieur public au Texas ; elle a ouvert ses portes le 4 octobre 1876 en tant que Collège agricole et mécanique du Texas (A.M.C.) en vertu des dispositions du Morrill Land-Grant Act de 1862. Au fil des décennies, le collège a augmenté en taille et en envergure, atteignant son plus grand effectif pendant la Seconde Guerre mondiale avant une première stagnation significative de l\'inscription après la guerre[15]. L\'inscription a de nouveau augmenté dans les années 1960 sous la direction du président James Earl Rudder, pendant le mandat duquel le collège a été déségrégué, est devenu mixte et a mis fin à l\'obligation de participer au Corps des cadets. En 1963, pour refléter les rôles et offres académiques élargis de l\'institution, la législature du Texas a rebaptisé le collège Texas A&M University ; les lettres \"A&M\" ont été conservées en hommage à l\'ancienne désignation de l\'université.\nLe campus principal de l\'université s\'étend sur plus de 5 500 acres (22 km2) et comprend la bibliothèque et le musée présidentiels George H. W. Bush. L\'université propose des diplômes dans plus de 130 domaines d\'études répartis dans 18 collèges et abrite 21 instituts de recherche. En tant que collège militaire senior, Texas A&M est l\'une des six universités américaines dotées d\'un Corps de cadets à temps plein dont les membres étudient aux côtés des étudiants civils de premier cycle. Environ un cinquième du corps étudiant vit sur le campus. Texas A&M compte plus de 1 000 organisations étudiantes officiellement reconnues. De nombreux étudiants respectent les traditions universitaires qui régissent la conduite dans la vie quotidienne et lors d\'événements sportifs. Les étudiants, anciens élèves et équipes sportives de l\'université sont connus sous le nom d\'Aggies, et ses athlètes participent à dix-huit sports universitaires en tant que membres de la Southeastern Conference.', 19000),
(102, 4214, 'Texas State University', 'Education,Politics & International Studies (incl Development Studies),Geology, Environmental, Earth & Marine Sciences,Architecture,General Engineering,History, Philosophy & Theology,Communication & Media Studies,Agriculture & Forestry,Computer Science,Art, Performing Arts & Design,Electrical & Electronic Engineering,Civil Engineering,Economics & Econometrics,Mathematics & Statistics,Languages, Literature & Linguistics,Sociology,Law,Chemistry,Business & Management,Geography,Biological Sciences,Sport Science,Other Health,Psychology,Mechanical & Aerospace Engineering,Accounting & Finance,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/fb/Texas_State_University_seal.svg/130px-Texas_State_University_seal.svg.png', ' L\'Université d\'État du Texas (TXST) est une université publique de recherche, avec son campus principal à San Marcos, au Texas, et un autre campus à Round Rock. Depuis sa création en 1899, l\'université est devenue l\'une des plus grandes universités des États-Unis. L\'Université d\'État du Texas a atteint un effectif record de 38 873 étudiants au semestre d\'automne 2023, poursuivant une tendance à la croissance des effectifs depuis plusieurs années[5].\nL\'Université d\'État du Texas propose plus de 200 programmes de baccalauréat, de master et de doctorat dans ses dix collèges. L\'université est accréditée par l\'Association des collèges et écoles du Sud (SACS) et désignée comme une institution servant les Hispaniques (HSI) par le département de l\'Éducation des États-Unis. L\'Université d\'État du Texas est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\"[6][7] et est une université de recherche émergente (ERU) par l\'État du Texas[8]. Elle a dépensé plus de 140 millions de dollars en dépenses de recherche au cours de l\'exercice 2023[9].\nLe 36e président des États-Unis, Lyndon B. Johnson, a obtenu son diplôme de l\'institution en 1930 ;[10] l\'Université d\'État du Texas est le seul collège ou université au Texas à avoir un président américain parmi ses anciens élèves.\nLe campus principal de l\'Université d\'État du Texas comprend 245 bâtiments sur 507 acres (2,05 km2) de terrain vallonné le long de la rivière San Marcos. De plus, elle possède un campus satellite de 101 acres (0,41 km2) sur son campus de Round Rock (RRC) dans la région métropolitaine d\'Austin. L\'université exploite le parc Science, Technology and Advanced Research (STAR) de 70 acres (0,28 km2), un centre de recherche appliquée et de commercialisation de la technologie[11]. L\'Université d\'État du Texas dispose de 4 522 acres (18,30 km2) supplémentaires de terres récréatives, pédagogiques, agricoles et pastorales. Le Centre d\'anthropologie légale de l\'Université d\'État du Texas est le plus grand centre de recherche en anthropologie légale au monde[12].\nLes équipes sportives intercollégiales de l\'Université d\'État du Texas, les Bobcats, concourent en Division I de la National Collegiate Athletic Association (NCAA) et dans la Sun Belt Conference.', 0),
(103, 2733, 'Texas Tech University', 'Sociology,Archaeology,Accounting & Finance,Art, Performing Arts & Design,Communication & Media Studies,Geography,Mathematics & Statistics,Education,Architecture,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,General Engineering,History, Philosophy & Theology,Biological Sciences,Law,Electrical & Electronic Engineering,Chemistry,Languages, Literature & Linguistics,Physics & Astronomy,Psychology,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Chemical Engineering,Agriculture & Forestry,Sport Science,Civil Engineering,Business & Management', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/47/Texas_Tech_University_seal.svg/150px-Texas_Tech_University_seal.svg.png', ' L\'Université Texas Tech (Texas Tech, Tech ou TTU) est une université de recherche publique située à Lubbock, au Texas. Fondée le 2 octobre 1923 et appelée Texas Technological College jusqu\'en 1969, elle est l\'établissement phare du système universitaire Texas Tech, composé de cinq institutions. À l\'automne 2023, l\'université comptait 40 944 étudiants, ce qui en fait la sixième plus grande université du Texas. Plus de 25 % de sa population étudiante de premier cycle s\'identifie comme hispanique, ce qui a valu à l\'université le statut d\'institution au service des Hispaniques (HSI).\nL\'université propose des diplômes dans plus de 150 domaines d\'études à travers 13 collèges et abrite 60 centres de recherche et instituts. Depuis 1927, l\'Université Texas Tech a décerné plus de 200 000 diplômes, dont plus de 40 000 diplômes d\'études supérieures et professionnels. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". Les projets de recherche dans les domaines de l\'épidémiologie, de la puissance pulsée, de l\'informatique en grille, des sciences atmosphériques, de la nanophotonique, des sciences classiques et de l\'énergie éolienne figurent parmi les plus importants de l\'université.\nLe campus, inspiré de la Renaissance espagnole et décrit par l\'auteur James Michener comme \"le plus beau à l\'ouest du Mississippi jusqu\'à Stanford\", a reçu le Grand Prix pour l\'excellence de son entretien paysager et est remarqué pour posséder l\'une des dix meilleures collections d\'art public aux États-Unis.\nLes Texas Tech Red Raiders sont membres fondateurs de la Big 12 Conference et participent à la Division I pour tous les sports universitaires. L\'équipe de football des Red Raiders a participé à 40 bowls, soit le 17e plus grand nombre parmi les universités. L\'équipe de basketball des Red Raiders a participé à 14 tournois de la Division I de la NCAA. Bob Knight, qui détient le cinquième plus grand nombre de victoires en tant qu\'entraîneur-chef de l\'histoire du basketball masculin de la NCAA, a dirigé l\'équipe de 2001 à 2008. L\'équipe de basketball féminin Lady Raiders a remporté le tournoi de la Division I de la NCAA en 1993. En 1999, la Goin\' Band from Raiderland de Texas Tech a reçu le Sudler Trophy, décerné pour \"reconnaître les fanfares universitaires d\'une excellence particulière\".\nBien que la majorité des étudiants de l\'université proviennent du sud-ouest des États-Unis, l\'école accueille des étudiants de tout le pays et de plus de 100 autres pays. De nombreux anciens étudiants de Texas Tech ont connu des carrières remarquables dans le gouvernement, les affaires, la science, la médecine, l\'éducation, le sport et le divertissement.', 0),
(104, 3304, 'The New School', 'Computer Science,Art, Performing Arts & Design,Architecture,Education,Sociology,Languages, Literature & Linguistics,Communication & Media Studies,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Biological Sciences,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Business & Management,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/dd/The_New_School_seal.svg/180px-The_New_School_seal.svg.png', ' La New School est une université de recherche privée située à New York City. Elle a été fondée en 1919 sous le nom de The New School for Social Research avec pour mission originale de promouvoir la liberté académique, l\'investigation intellectuelle et de servir de lieu pour les penseurs progressistes. Depuis lors, l\'école s\'est développée pour abriter cinq divisions au sein de l\'université. Celles-ci comprennent la Parsons School of Design, le Eugene Lang College of Liberal Arts, le College of Performing Arts, qui inclut la Mannes School of Music, The New School for Social Research, et les Schools of Public Engagement.\nDe plus, l\'université gère le campus Parsons Paris et a également lancé ou accueilli diverses institutions, telles que l\'institut de recherche international World Policy Institute, le Vera List Center for Art and Politics, l\'India China Institute, l\'Observatoire sur l\'Amérique latine et le Center for New York City Affairs. Elle est classée parmi les \"R2 : universités doctorales - activité de recherche élevée\". Environ 10 000 étudiants sont inscrits dans des programmes de premier cycle et de cycles supérieurs, couvrant des disciplines telles que le design, la musique, les beaux-arts, les arts libéraux, les sciences humaines, les sciences sociales, l\'architecture, le théâtre, la psychologie et la politique publique. La grande majorité, plus de 70 pour cent de tous les étudiants inscrits à l\'université, se trouvent dans les domaines créatifs du design, des arts du spectacle et des beaux-arts.', 0),
(105, 4837, 'The University of Alabama', 'Psychology,Agriculture & Forestry,Chemical Engineering,Politics & International Studies (incl Development Studies),Languages, Literature & Linguistics,Physics & Astronomy,Sociology,General Engineering,Mathematics & Statistics,Computer Science,Electrical & Electronic Engineering,Art, Performing Arts & Design,Sport Science,History, Philosophy & Theology,Civil Engineering,Mechanical & Aerospace Engineering,Communication & Media Studies,Business & Management,Law,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Chemistry,Biological Sciences,Other Health,Geography,Education', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a8/University_of_Alabama_seal.svg/150px-University_of_Alabama_seal.svg.png', ' L\'Université de l\'Alabama (connue informellement sous le nom d\'Alabama, UA, ou Bama) est une université de recherche publique située à Tuscaloosa, en Alabama. Fondée en 1820 et ouverte aux étudiants en 1831, l\'Université de l\'Alabama est la plus ancienne et la plus grande des universités publiques en Alabama, ainsi que du système de l\'Université de l\'Alabama. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\".\nL\'université propose des programmes d\'études dans 13 divisions académiques conduisant à des diplômes de licence, de maîtrise, de spécialiste en éducation et de doctorat. La seule école de droit soutenue publiquement dans l\'État se trouve à l\'UA. D\'autres programmes académiques non disponibles ailleurs en Alabama comprennent des programmes de doctorat en anthropologie, en sciences de la communication et de l\'information, en génie métallurgique, en musique, en langues romanes et en travail social.\nL\'école a été un centre d\'activités pendant la guerre civile américaine et le mouvement des droits civiques. Le programme de football universitaire de l\'Université de l\'Alabama (surnommé les Crimson Tide), inauguré en 1892, est classé parmi les dix meilleurs de l\'histoire des États-Unis. Dans un discours prononcé en 1913, le président George H. Denny a qualifié l\'université de \"pierre angulaire du système d\'écoles publiques de l\'État\", établissant ainsi le surnom actuel de l\'université, \"The Capstone\" (la pierre angulaire). Parmi les anciens élèves et les professeurs, on compte 59 boursiers Goldwater, 15 boursiers Rhodes et 16 boursiers Truman.', 0),
(106, 811, 'The University of Chicago', 'Business & Management,Physics & Astronomy,Economics & Econometrics,Psychology,Accounting & Finance,Law,Politics & International Studies (incl Development Studies),Chemical Engineering,Sociology,Archaeology,Computer Science,Art, Performing Arts & Design,Geography,Biological Sciences,Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Mathematics & Statistics,Medicine & Dentistry,Chemistry', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/79/University_of_Chicago_shield.svg/130px-University_of_Chicago_shield.svg.png', ' L\'Université de Chicago (UChicago, Chicago, U of C ou UChi) est une université de recherche privée située à Chicago, dans l\'Illinois, aux États-Unis. L\'université a son campus principal dans le quartier de Hyde Park à Chicago.\nL\'université est composée d\'un collège de premier cycle et de quatre divisions de recherche universitaire, qui regroupent l\'ensemble des programmes de troisième cycle de l\'université et des comités interdisciplinaires. Elle compte huit écoles professionnelles : l\'école de droit ; l\'école de commerce Booth ; l\'école de médecine Pritzker ; l\'école Crown Family de travail social, de politique et de pratique ; l\'école Harris de politique publique ; l\'école de théologie ; l\'école Graham d\'études libérales et professionnelles continues ; et l\'école Pritzker de génie moléculaire. L\'université possède des campus et des centres supplémentaires à Londres, Paris, Beijing, Delhi et Hong Kong, ainsi qu\'au centre-ville de Chicago.\nLes chercheurs de l\'Université de Chicago ont joué un rôle majeur dans le développement de nombreuses disciplines académiques, dont l\'économie, le droit, la critique littéraire, les mathématiques, la physique, la religion, la sociologie et la science politique, établissant les écoles de Chicago dans divers domaines. Le Laboratoire métallurgique de Chicago a produit la première réaction nucléaire auto-soutenue artificielle au monde dans le Chicago Pile-1, sous les gradins du Stagg Field de l\'université. Des avancées en chimie ont conduit à la \"révolution du radiocarbone\" dans la datation au carbone-14 de la vie et des objets anciens. Les efforts de recherche de l\'université comprennent l\'administration du Fermi National Accelerator Laboratory et de l\'Argonne National Laboratory, ainsi que le Marine Biological Laboratory. L\'université abrite également la University of Chicago Press, la plus grande maison d\'édition universitaire aux États-Unis.\nLes étudiants, professeurs et employés de l\'université comptent 99 lauréats du prix Nobel. Les membres du corps professoral et les anciens élèves de l\'université incluent également 10 médaillés Fields, 4 lauréats du prix Turing, 52 boursiers MacArthur, 26 boursiers Marshall, 53 boursiers Rhodes, 27 lauréats du prix Pulitzer, 20 médaillés nationaux des Humanités, 29 diplômés milliardaires vivants et 8 médaillés olympiques.', 0),
(107, 2389, 'The University of Tennessee-Knoxville', 'Physics & Astronomy,Economics & Econometrics,Electrical & Electronic Engineering,General Engineering,Mechanical & Aerospace Engineering,Law,History, Philosophy & Theology,Business & Management,Geology, Environmental, Earth & Marine Sciences,Architecture,Agriculture & Forestry,Geography,Education,Biological Sciences,Archaeology,Other Health,Sport Science,Sociology,Computer Science,Veterinary Science,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Chemical Engineering,Psychology,Languages, Literature & Linguistics,Civil Engineering,Mathematics & Statistics,Communication & Media Studies,Chemistry,Accounting & FinanceFalse', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/5f/UT_Knoxville_logo_left.svg/512px-UT_Knoxville_logo_left.svg.png', ' L\'Université du Tennessee à Knoxville (ou l\'Université du Tennessee ; UT Knoxville ; UTK ; ou familièrement Tennessee ou UT) est une université publique de recherche de type « land-grant » à Knoxville, dans le Tennessee, aux États-Unis. Fondée en 1794, deux ans avant que le Tennessee ne devienne le 16e État, elle est le campus principal du système de l\'Université du Tennessee, avec dix collèges de premier cycle et onze collèges de troisième cycle. Elle accueille plus de 30 000 étudiants de tous les 50 États et de plus de 100 pays étrangers. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\".\nLes liens de l\'UT avec le Oak Ridge National Laboratory voisin, établis sous la présidence de l\'UT par Andrew Holt et poursuivis dans le cadre du partenariat UT–Battelle, offrent d\'importantes opportunités de recherche pour les enseignants et les étudiants. Également affiliés à l\'université se trouvent le Howard H. Baker Jr. Center for Public Policy, le University of Tennessee Anthropological Research Facility et le University of Tennessee Arboretum, qui occupe 250 acres (100 ha) du voisinage d\'Oak Ridge et présente des centaines d\'espèces de plantes indigènes de la région. L\'université est un partenaire direct du University of Tennessee Medical Center, qui est l\'un des deux centres de traumatologie de niveau I dans l\'est du Tennessee.\nL\'Université du Tennessee est la seule université du pays à avoir trois projets d\'édition de papiers présidentiels. Elle détient des collections des papiers de tous les trois présidents américains originaires du Tennessee : Andrew Jackson, James K. Polk et Andrew Johnson. Neuf de ses anciens élèves ont été sélectionnés en tant que boursiers Rhodes et un ancien élève, James M. Buchanan, a reçu le prix Nobel d\'économie en 1986. L\'UT est l\'une des plus anciennes universités publiques aux États-Unis et la plus ancienne institution laïque à l\'ouest de la ligne de partage continentale orientale.', 0),
(108, 4190, 'The University of Texas at San Antonio', 'Physics & Astronomy,Politics & International Studies (incl Development Studies),Education,Accounting & Finance,Law,Business & Management,Chemistry,Civil Engineering,Biological Sciences,Psychology,Sociology,Art, Performing Arts & Design,Computer Science,General Engineering,History, Philosophy & Theology,Medicine & Dentistry,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Geography,Chemical Engineering,Mathematics & Statistics,Electrical & Electronic Engineering,Languages, Literature & Linguistics,Other Health,Agriculture & Forestry,Communication & Media Studies,Mechanical & Aerospace Engineering,Architecture,Sport Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/8b/University_of_Texas_at_San_Antonio_seal.svg/150px-University_of_Texas_at_San_Antonio_seal.svg.png', ' L\'Université du Texas à San Antonio (UTSA) est une université publique de recherche située à San Antonio, au Texas. Avec plus de 34 000 étudiants répartis sur ses quatre campus couvrant plus de 758 acres, l\'UTSA est la plus grande université de San Antonio et la huitième en termes d\'effectifs dans l\'État du Texas. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\" et propose plus de 170 options de diplômes réparties dans neuf collèges.\nFondée en 1969, l\'UTSA est devenue la troisième plus grande institution au sein du système de l\'Université du Texas en termes d\'effectifs. L\'université a un impact économique local de 1,2 milliard de dollars, et l\'UTSA Institute for Economic Development génère 2,9 milliards de dollars d\'impact économique direct à l\'échelle nationale. L\'UTSA a dépensé 141,7 millions de dollars au total pour la recherche, dont 70,55 millions de dollars en dépenses de recherche restreintes pour l\'exercice financier 2022.\nLes étudiants-athlètes de l\'UTSA concourent en tant que Roadrunners de l\'UTSA et font partie de l\'American Athletic Conference (AAC). L\'équipe de football, fondée en 2009, a précédemment participé à la Conference USA, à la WAC et en tant qu\'indépendant de la FCS.', 0),
(109, 4833, 'The University of Tulsa', 'Computer Science,Communication & Media Studies,Economics & Econometrics,Civil Engineering,Psychology,Other Health,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,General Engineering,Chemistry,Law,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Mathematics & Statistics,Business & Management,Electrical & Electronic Engineering,Physics & Astronomy,Accounting & Finance,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Education,Sport Science,Sociology,Biological Sciences', 39, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d0/UTULSEA1.png/150px-UTULSEA1.png', ' L\'Université de Tulsa (TU) est une université privée de recherche située à Tulsa, en Oklahoma. Elle a une affiliation historique avec l\'Église presbytérienne, et le style architectural du campus est principalement néo-gothique. L\'école remonte à la Presbyterian School for Girls, fondée en 1882 à Muskogee, en Oklahoma, alors une ville dans le Territoire indien, et qui a évolué pour devenir un établissement d\'enseignement supérieur appelé Henry Kendall College d\'ici 1894. Le collège a déménagé à Tulsa, une autre ville dans la nation Creek, en 1904, avant la création de l\'État de l\'Oklahoma. En 1920, Kendall College a été rebaptisé l\'Université de Tulsa.\nL\'Université de Tulsa est classée parmi les \"R2 : universités doctorales - activité de recherche élevée\". Elle gère le musée Gilcrease, qui comprend l\'une des plus grandes collections d\'art occidental américain et d\'artefacts amérindiens au monde. TU abrite également le Tulsa Studies in Women\'s Literature, fondé par l\'ancienne professeure de TU et critique féministe renommée Germaine Greer (maintenant à l\'Université de Cambridge). L\'université abrite également les archives de Bob Dylan au Helmerich Center for American Research.\nLes équipes sportives de TU sont collectivement connues sous le nom de Tulsa Golden Hurricane et participent à la Division I de la NCAA en tant que membres de l\'American Athletic Conference (The American).', 25000),
(110, 2941, 'Tufts University', 'Other Health,Business & Management,Veterinary Science,Geography,Medicine & Dentistry,Mechanical & Aerospace Engineering,Sociology,Computer Science,General Engineering,Psychology,Chemical Engineering,Architecture,Chemistry,Electrical & Electronic Engineering,Archaeology,Mathematics & Statistics,History, Philosophy & Theology,Physics & Astronomy,Education,Languages, Literature & Linguistics,Biological Sciences,Communication & Media Studies,Art, Performing Arts & Design,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Law,Politics & International Studies (incl Development Studies),Agriculture & Forestry', 15, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b1/Tufts_official_seal.svg/150px-Tufts_official_seal.svg.png', ' L\'Université Tufts est une université de recherche privée située dans la région du Grand Boston. Le campus principal se trouve dans le quartier de Walnut Hill des villes de Medford et Somerville, dans le Massachusetts, avec des installations supplémentaires à Boston et Grafton, dans le Massachusetts, ainsi qu\'à Talloires, en France. Fondée en 1852 en tant que Tufts College par des universalistes chrétiens qui cherchaient à créer une institution d\'enseignement supérieur non sectaire, Tufts est restée un petit collège d\'arts libéraux jusqu\'aux années 1970, moment où elle s\'est transformée en une grande université de recherche proposant plusieurs doctorats.\nTufts propose plus de 90 programmes de premier cycle et 160 programmes de troisième cycle répartis dans dix écoles de la région du Grand Boston et de Talloires, en France. Elle abrite la plus ancienne école supérieure de relations internationales du pays, la Fletcher School of Law and Diplomacy. La plus grande école est l\'École des Arts et Sciences, qui comprend à la fois la Graduate School of Arts and Sciences et l\'École du Musée des Beaux-Arts de l\'Université Tufts, affiliée au Museum of Fine Arts, Boston. L\'École d\'Ingénierie propose une orientation entrepreneuriale grâce à son Gordon Institute et maintient des liens étroits avec le collège d\'origine. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\" et est membre de l\'Association of American Universities, qui met l\'accent sur la recherche académique.\nTufts possède un campus dans le centre-ville de Boston, qui abrite les écoles de médecine, de dentisterie et de nutrition, ainsi que la Graduate School of Biomedical Sciences, affiliée à plusieurs centres médicaux de la région. Plusieurs programmes sont affiliés à proximité de l\'Université Harvard et du Massachusetts Institute of Technology, et des programmes de double diplôme sont proposés avec le New England Conservatory, le Collège d\'Europe et Sciences Po Paris.\nLes anciens élèves, les professeurs et les affiliés de Tufts comprennent trois lauréats du prix Nobel, douze lauréats du prix Pulitzer, cinq gouverneurs d\'État, deux sénateurs américains, quatre lauréats d\'un Emmy Award et trois lauréats d\'un Oscar. Tufts a également diplômé quatre boursiers Rhodes, cinq boursiers Marshall, cinq boursiers Truman et cinq boursiers Goldwater.', 29000),
(111, 3290, 'Tulane University', 'Languages, Literature & Linguistics,Chemistry,Art, Performing Arts & Design,Computer Science,Biological Sciences,Architecture,Education,Business & Management,General Engineering,Geology, Environmental, Earth & Marine Sciences,Chemical Engineering,Mechanical & Aerospace Engineering,Sociology,History, Philosophy & Theology,Sport Science,Accounting & Finance,Agriculture & Forestry,Communication & Media Studies,Other Health,Law,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Physics & Astronomy,Economics & Econometrics,Psychology,Mathematics & Statistics', 21, 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/77/Tulane_University_Logo.svg/130px-Tulane_University_Logo.svg.png', ' L\'Université Tulane, officiellement la Tulane University of Louisiana, est une université de recherche privée située à La Nouvelle-Orléans, en Louisiane. Fondée en 1834 sous le nom de Medical College of Louisiana par sept jeunes médecins, elle a été transformée en une université publique complète, l\'University of Louisiana, par la législature de l\'État en 1847. L\'institution est devenue privée grâce aux dons de Paul Tulane et Josephine Louise Newcomb en 1884 et 1887. La Tulane University Law School et la Tulane University Medical School sont respectivement la 12e plus ancienne école de droit et la 15e plus ancienne école de médecine aux États-Unis.\nTulane est membre de l\'Association of American Universities depuis 1958 et est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". Elle a un taux d\'acceptation global de 14%. Parmi ses anciens élèves figurent douze gouverneurs de la Louisiane, un président de la Cour suprême des États-Unis, divers membres du Congrès, dont un président de la Chambre des représentants des États-Unis, deux chirurgiens généraux des États-Unis, 23 boursiers Marshall, 18 boursiers Rhodes, 15 boursiers Truman, 155 boursiers Fulbright, quatre milliardaires vivants et un ancien président du Costa Rica. Deux lauréats du prix Nobel ont été affiliés à l\'université.', 33000);
