(112, 587, 'University at Buffalo', 'Architecture,Communication & Media Studies,Education,Electrical & Electronic Engineering,Physics & Astronomy,History, Philosophy & Theology,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Archaeology,General Engineering,Psychology,Economics & Econometrics,Mechanical & Aerospace Engineering,Chemistry,Accounting & Finance,Civil Engineering,Mathematics & Statistics,Medicine & Dentistry,Biological Sciences,Politics & International Studies (incl Development Studies),Business & Management,Law,Geography,Languages, Literature & Linguistics,Other Health,Sport Science,Art, Performing Arts & Design,Computer Science,Agriculture & Forestry,Sociology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/eb/University_at_Buffalo_seal.svg/150px-University_at_Buffalo_seal.svg.png', ' La State University of New York à Buffalo, communément appelée l\'University at Buffalo (UB) et parfois appelée SUNY Buffalo, est une université publique de recherche avec des campus à Buffalo et Amherst, dans l\'État de New York, aux États-Unis. L\'université a été fondée en 1846 en tant que collège médical privé et a fusionné avec le système de la State University of New York en 1962. Elle est l\'une des deux institutions phares du système SUNY. À l\'automne 2020, l\'université comptait 32 347 étudiants répartis dans 13 écoles et collèges, ce qui en fait la plus grande université publique de l\'État de New York.\nDepuis sa fondation par un groupe comprenant le futur président des États-Unis Millard Fillmore, l\'université est passée d\'une petite école de médecine à une grande université de recherche. Aujourd\'hui, en plus du College of Arts and Sciences, l\'université abrite la plus grande école de médecine, école dentaire, école d\'éducation, école de commerce, école d\'ingénierie et école de pharmacie gérées par l\'État, et est également le site de la seule école de droit de la SUNY. UB a le plus grand effectif, le plus grand fonds de dotation et le plus de financements de recherche parmi les universités du système SUNY. L\'université propose des licences dans plus de 140 domaines d\'études, ainsi que plus de 220 programmes de master et plus de 95 programmes de doctorat, ainsi que 55 programmes de double diplôme. L\'University at Buffalo et l\'University of Virginia sont les seules universités fondées par des présidents des États-Unis.\nL\'University at Buffalo est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". En 1989, l\'UB a été élue à l\'Association of American Universities. Les équipes sportives intercollégiales de l\'University at Buffalo sont les Bulls. Elles participent à la Division I de la NCAA et font partie de la Mid-American Conference.', 0),
(113, 411, 'University of Alabama at Birmingham', 'Mechanical & Aerospace Engineering,Computer Science,Chemistry,Business & Management,Civil Engineering,Sociology,Archaeology,Mathematics & Statistics,History, Philosophy & Theology,Education,Geology, Environmental, Earth & Marine Sciences,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Accounting & Finance,Chemical Engineering,Biological Sciences,Economics & Econometrics,Electrical & Electronic Engineering,Art, Performing Arts & Design,Sport Science,Languages, Literature & Linguistics,Physics & Astronomy,Other Health,Communication & Media Studies,Geography,Psychology,General Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/7/7a/University_of_Alabama_at_Birmingham_seal.png', ' L\'Université d\'Alabama à Birmingham (UAB) est une université publique de recherche située à Birmingham, en Alabama. Fondée en 1969 au sein du système de l\'Université d\'Alabama, l\'UAB est devenue le plus grand employeur unique de l\'État, avec plus de 24 200 enseignants et employés et plus de 53 000 emplois à l\'université et dans le système de santé. L\'université est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\".\nL\'UAB propose 140 programmes d\'études répartis dans 12 divisions académiques menant à des diplômes de premier cycle, des maîtrises, des doctorats et des diplômes professionnels dans les domaines des arts libéraux, des sciences humaines, des mathématiques, des sciences sociales, du comportement, des sciences naturelles et physiques, des affaires, de l\'éducation, de l\'ingénierie, et des domaines liés à la santé tels que la médecine, la dentisterie, l\'optométrie, les soins infirmiers et la santé publique. À l\'automne 2020, 22 563 étudiants provenant de plus de 110 pays étaient inscrits.\nLe système de santé de l\'UAB, l\'un des plus grands centres médicaux universitaires des États-Unis, est affilié à l\'université. L\'hôpital de l\'UAB parraine des programmes de résidence dans des spécialités médicales telles que la médecine interne, la neurologie, la médecine physique et de réadaptation, la chirurgie, la radiologie et l\'anesthésiologie.', 0),
(114, 2187, 'University of Alabama in Huntsville', 'General Engineering,Business & Management,Politics & International Studies (incl Development Studies),Psychology,Education,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Accounting & Finance,Art, Performing Arts & Design,Chemical Engineering,Mechanical & Aerospace Engineering,Communication & Media Studies,Geography,History, Philosophy & Theology,Languages, Literature & Linguistics,Sociology,Other Health,Physics & Astronomy,Chemistry,Sport Science,Mathematics & Statistics,Electrical & Electronic Engineering,Biological Sciences,Civil Engineering,Computer Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/05/UAHuntsville_seal.png/150px-UAHuntsville_seal.png', ' L\'Université de l\'Alabama à Huntsville (UAH) est une université publique de recherche située à Huntsville, en Alabama. L\'université est accréditée par l\'Association des collèges et écoles du Sud et comprend huit collèges : arts, sciences humaines et sociales ; commerce ; éducation ; ingénierie ; honneurs ; soins infirmiers ; sciences ; et cycles supérieurs. L\'effectif de l\'université est d\'environ 10 000 étudiants. Elle fait partie du système de l\'Université de l\'Alabama et est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\".', 0),
(115, 1456, 'University of Alaska Fairbanks', 'Education,Accounting & Finance,Psychology,Politics & International Studies (incl Development Studies),Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Art, Performing Arts & Design,General Engineering,Communication & Media Studies,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Mathematics & Statistics,Geography,Sociology,Economics & Econometrics,Architecture,Biological Sciences,Other Health,History, Philosophy & Theology,Civil Engineering,Chemistry,Computer Science,Business & Management,Agriculture & Forestry,Languages, Literature & Linguistics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/75/UAFairbanksSeal.png/150px-UAFairbanksSeal.png', ' L\'Université de l\'Alaska à Fairbanks (UAF ou Alaska) est une université publique de recherche et un établissement de subvention de terres situé à College, en Alaska, une banlieue de Fairbanks. Elle est le campus principal du système de l\'Université de l\'Alaska. L\'UAF a été fondée en 1917 et a ouvert ses portes en 1922. À l\'origine appelée l\'Alaska Agricultural College and School of Mines, elle est devenue l\'Université de l\'Alaska en 1935. Les programmes basés à Fairbanks sont devenus l\'Université de l\'Alaska à Fairbanks en 1975.\nL\'UAF est classée parmi les \"R2 : universités doctorales - activité de recherche élevée\". En plus du campus de Fairbanks, l\'UAF englobe six campus ruraux et urbains : le Bristol Bay Campus à Dillingham ; le Chukchi Campus à Kotzebue ; le campus de l\'Alaska intérieur basé à Fairbanks, qui dessert l\'intérieur rural de l\'État ; le Kuskokwim Campus à Bethel ; le Northwest Campus à Nome ; et le UAF Community and Technical College, dont le siège est au centre-ville de Fairbanks. L\'UAF abrite également UAF eCampus, qui propose des programmes entièrement en ligne.\nÀ l\'automne 2017, l\'UAF comptait 8 720 étudiants. Parmi ces étudiants, 58% étaient des femmes et 41% étaient des hommes ; 87,8% étaient des étudiants de premier cycle et 12,2% étaient des étudiants diplômés. En mai 2018, 1 352 étudiants avaient obtenu leur diplôme au cours des semestres d\'été, d\'automne et de printemps immédiatement précédents.', 0),
(116, 4827, 'University of Arizona', 'Physics & Astronomy,Chemical Engineering,Chemistry,Architecture,Other Health,General Engineering,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Sociology,Archaeology,Computer Science,Sport Science,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Education,Veterinary Science,Mathematics & Statistics,Accounting & Finance,Agriculture & Forestry,Psychology,Business & Management,Biological Sciences,Geography,Economics & Econometrics,Law,Communication & Media Studies,Medicine & Dentistry,Electrical & Electronic Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e4/University_of_Arizona_seal.svg/150px-University_of_Arizona_seal.svg.png', ' L\'Université de l\'Arizona (Arizona, U of A, UArizona ou UA) est une université publique de recherche et de subvention de terres à Tucson, en Arizona. Fondée en 1885 par la 13e Législature territoriale de l\'Arizona, elle a été la première université dans le territoire de l\'Arizona.\nL\'université est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". L\'Université de l\'Arizona est l\'une des trois universités régies par le Arizona Board of Regents. En 2021, l\'université comptait 49 471 étudiants répartis dans 19 collèges', 0),
(117, 1510, 'University of Arkansas', 'Sociology,Geography,Education,Communication & Media Studies,Archaeology,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Computer Science,Physics & Astronomy,Law,Agriculture & Forestry,Medicine & Dentistry,Accounting & Finance,Mathematics & Statistics,Architecture,History, Philosophy & Theology,Sport Science,General Engineering,Economics & Econometrics,Chemistry,Psychology,Business & Management,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Civil Engineering,Biological Sciences,Languages, Literature & Linguistics,Veterinary Science,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d1/University_of_Arkansas_seal.svg/140px-University_of_Arkansas_seal.svg.png', ' L\'Université de l\'Arkansas (U of A, UArk ou UA) est une université publique de recherche et de subvention de terres située à Fayetteville, en Arkansas. Elle est le campus principal du système de l\'Université de l\'Arkansas. Fondée sous le nom d\'Arkansas Industrial University en 1871, les cours ont commencé en 1872, et son nom actuel a été adopté en 1899.\nLe campus universitaire comprend 378 bâtiments répartis sur 512 acres (2,07 km2) de terre à Fayetteville, en Arkansas. Certains bâtiments bien connus sur le campus comprennent Old Main, le premier bâtiment académique permanent construit. L\'université propose plus de 200 programmes académiques, dont un programme d\'histoire très réputé. En automne 2023, l\'effectif total était de 32 140 étudiants. L\'université est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\" et a dépensé 164,4 millions de dollars pour la recherche au cours de l\'exercice 2021.\nLes équipes sportives de l\'Université de l\'Arkansas, les Razorbacks de l\'Arkansas, participent à la Division I de la NCAA en tant que membres de la Southeastern Conference (SEC) avec huit équipes masculines et onze équipes féminines dans treize sports. L\'université est connue pour ses traditions, notamment le \"Calling the Hogs\" lors des événements sportifs, et le \"Senior Walk\", plus de 4 miles (6,4 km) de trottoir sur le campus gravé avec les noms de tous les diplômés de l\'UA depuis 1871.', 0),
(118, 372, 'University of California, Berkeley', 'Communication & Media Studies,Education,Civil Engineering,Languages, Literature & Linguistics,Mathematics & Statistics,History, Philosophy & Theology,Agriculture & Forestry,Psychology,Economics & Econometrics,Mechanical & Aerospace Engineering,Geography,Chemical Engineering,Business & Management,Archaeology,Law,Physics & Astronomy,Politics & International Studies (incl Development Studies),Architecture,Biological Sciences,Sociology,Geology, Environmental, Earth & Marine Sciences,Computer Science,Electrical & Electronic Engineering,Art, Performing Arts & Design,Chemistry,General Engineering,Other Health', 17, 'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a1/Seal_of_University_of_California%2C_Berkeley.svg/150px-Seal_of_University_of_California%2C_Berkeley.svg.png', ' L\'Université de Californie à Berkeley (UC Berkeley, Berkeley, Cal ou California) est une université publique de recherche et de subvention de terres située à Berkeley, en Californie. Elle a été créée en 1868 et est la première université de subvention de terres de l\'État. Elle est également l\'un des membres fondateurs de l\'Association of American Universities et le campus fondateur du système de l\'Université de Californie. Berkeley est considérée comme l\'une des meilleures universités du monde avec le plus grand nombre de départements classés au niveau national. Plus d\'entreprises ont été fondées par d\'anciens élèves de cette université que par toute autre université.\nBerkeley abrite plusieurs instituts de recherche et trois laboratoires nationaux pour le Département de l\'Énergie des États-Unis (Lawrence Berkeley National Laboratory, Lawrence Livermore National Laboratory et Los Alamos National Laboratory). Elle a également joué un rôle dans le projet Manhattan et la découverte de seize éléments chimiques. Les équipes sportives de Berkeley, qui concourent en tant que California Golden Bears dans la Pac-12 Conference, ont remporté 107 championnats nationaux, et les anciens élèves ont remporté 223 médailles olympiques (dont 121 médailles d\'or).\nBerkeley est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". Parmi les anciens élèves, les enseignants et les chercheurs de Berkeley, on compte 190 lauréats de la bourse MacArthur, 107 lauréats du prix Nobel, 68 récipiendaires de la Médaille nationale de la science, 34 lauréats du prix Pulitzer, 30 lauréats du prix Wolf, 25 lauréats du prix Turing, 19 lauréats de l\'Oscar et 14 lauréats de la Médaille Fields. L\'université a également produit sept chefs d\'État ou de gouvernement, six juges en chef et au moins vingt-cinq milliardaires.', 18000),
(119, 1104, 'University of California, Davis', 'Agriculture & Forestry,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Mathematics & Statistics,Chemical Engineering,Art, Performing Arts & Design,Medicine & Dentistry,Business & Management,History, Philosophy & Theology,Psychology,General Engineering,Law,Civil Engineering,Geography,Physics & Astronomy,Chemistry,Sociology,Veterinary Science,Economics & Econometrics,Other Health,Biological Sciences,Computer Science,Accounting & Finance,Education,Geology, Environmental, Earth & Marine Sciences,Communication & Media Studies,Languages, Literature & Linguistics', 43, 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/The_University_of_California_Davis.svg/150px-The_University_of_California_Davis.svg.png', ' L\'Université de Californie à Davis (UC Davis, UCD ou Davis) est une université publique de recherche et de subvention de terres située à Davis, en Californie, aux États-Unis. Elle est le campus le plus septentrional des dix campus du système de l\'Université de Californie. L\'institution a été fondée pour la première fois en 1905 en tant que branche agricole du système et est devenue le septième campus de l\'Université de Californie en 1959.\nFondée comme un campus principalement agricole, l\'université s\'est étendue au cours du siècle dernier pour inclure des programmes de troisième cycle et professionnels en médecine (qui comprend le UC Davis Medical Center), en droit, en médecine vétérinaire, en éducation, en soins infirmiers et en gestion des affaires, en plus de 90 programmes de recherche offerts par les études supérieures de l\'UC Davis. La Faculté de médecine vétérinaire de l\'UC Davis est la plus grande école vétérinaire des États-Unis. Le UC Center Sacramento, un programme orienté vers le service public fondé en 2004, est exploité par l\'UC Davis. L\'UC Davis propose également des certificats et des cours, y compris des cours en ligne, pour les adultes et les apprenants non traditionnels par le biais de sa Division de la formation continue et professionnelle.\nL\'université est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\". Les équipes sportives des Aggies de l\'UC Davis participent à la Division I de la NCAA, principalement en tant que membres de la Big West Conference avec des sports supplémentaires dans la Big Sky Conference (football seulement) et la Mountain Pacific Sports Federation. Les athlètes de l\'UC Davis ont remporté un total de 10 médailles olympiques. Les professeurs, anciens élèves et chercheurs de l\'université ont été les lauréats de deux prix Nobel, d\'une médaille Fields, d\'une médaille présidentielle de la liberté, de trois prix Pulitzer, de trois bourses MacArthur et d\'une médaille nationale des sciences.', 16000),
(120, 2232, 'University of California, Irvine', 'Languages, Literature & Linguistics,Biological Sciences,Chemical Engineering,Mathematics & Statistics,Economics & Econometrics,Sociology,Civil Engineering,Business & Management,General Engineering,Architecture,Computer Science,Geology, Environmental, Earth & Marine Sciences,Accounting & Finance,Law,Other Health,Electrical & Electronic Engineering,Physics & Astronomy,Art, Performing Arts & Design,Education,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Chemistry,Medicine & Dentistry,Mechanical & Aerospace Engineering,Psychology', 37, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0e/University_of_California%2C_Irvine_seal.svg/150px-University_of_California%2C_Irvine_seal.svg.png', ' L\'Université de Californie à Irvine (UCI ou UC Irvine) est une université publique de recherche et de subvention de terres située à Irvine, en Californie, aux États-Unis. L\'un des dix campus du système de l\'Université de Californie, l\'UCI propose 87 programmes de premier cycle et 129 programmes de troisième cycle et professionnels, avec environ 30 000 étudiants de premier cycle et 6 000 étudiants diplômés inscrits à l\'UCI à l\'automne 2019. L\'université est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\" et a dépensé 523,7 millions de dollars en recherche et développement en 2021. L\'UCI est devenue membre de l\'Association of American Universities en 1996.\nL\'université administre le UC Irvine Medical Center, un grand hôpital universitaire à Orange, ainsi que son système de sciences de la santé affilié ; l\'Arboretum de l\'Université de Californie à Irvine ; et une partie du University of California Natural Reserve System. L\'UC Irvine a créé le premier département des sciences du système terrestre aux États-Unis. L\'université a été classée comme l\'un des \"Public Ivies\" dans les enquêtes de 1985 et 2001 comparant les universités financées par des fonds publics que les auteurs prétendent offrir une éducation comparable à celle de la Ivy League.\nLes Anteaters de l\'UC Irvine concourent actuellement dans la Division I de la NCAA en tant que membres de la Big West Conference. Pendant les premières années de l\'existence de l\'école, les équipes jouaient au niveau de la Division II de la NCAA. Les Anteaters ont remporté 28 championnats nationaux dans neuf sports d\'équipe différents, 64 Anteaters ont remporté des championnats nationaux individuels, et 53 Anteaters ont participé aux Jeux olympiques, remportant un total de 33 médailles olympiques. En janvier 2022, il y avait eu 5 lauréats du prix Nobel, 7 lauréats du prix Pulitzer, 6 récipiendaires de la bourse MacArthur, 37 boursiers Guggenheim et 1 lauréat du prix Turing affiliés à l\'université en tant qu\'anciens élèves, professeurs ou chercheurs.', 13000),
(121, 2698, 'University of California, Los Angeles', 'Chemical Engineering,Psychology,Biological Sciences,Mechanical & Aerospace Engineering,Medicine & Dentistry,General Engineering,Communication & Media Studies,Agriculture & Forestry,Business & Management,Politics & International Studies (incl Development Studies),Accounting & Finance,Art, Performing Arts & Design,History, Philosophy & Theology,Computer Science,Chemistry,Sociology,Languages, Literature & Linguistics,Sport Science,Other Health,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Archaeology,Mathematics & Statistics,Education,Economics & Econometrics,Geography,Architecture,Physics & Astronomy,Electrical & Electronic Engineering,Law,Veterinary Science', 16, 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0d/The_University_of_California_UCLA.svg/150px-The_University_of_California_UCLA.svg.png', ' L\'Université de Californie à Los Angeles (UCLA) est une université publique de recherche et de subvention de terres située à Los Angeles, en Californie, aux États-Unis. Ses racines académiques ont été établies en 1881 en tant qu\'école normale, alors connue sous le nom de succursale du sud de la California State Normal School (aujourd\'hui San José State University). Elle a été absorbée lors de la fondation officielle de l\'UCLA en tant que Southern Branch de l\'University of California en 1919, ce qui en fait la deuxième plus ancienne des dix campus du système de l\'University of California après l\'University of California, Berkeley.\nL\'UCLA propose 337 programmes de premier cycle et de troisième cycle dans diverses disciplines, inscrivant environ 31 600 étudiants de premier cycle et 14 300 étudiants diplômés et professionnels chaque année. Elle a reçu 174 914 demandes d\'admission de premier cycle pour l\'automne 2022, y compris les transferts, ce qui en fait l\'université la plus demandée aux États-Unis. L\'université est organisée en College of Letters and Science et douze écoles professionnelles. Six des écoles proposent des programmes de premier cycle : Arts and Architecture, Engineering and Applied Science, Music, Nursing, Public Affairs et Theater, Film and Television. Trois autres sont des écoles professionnelles de sciences de la santé au niveau du troisième cycle : Medicine, Dentistry et Public Health. Les trois écoles restantes sont Education & Information Studies, Management et Law.\nLes étudiants-athlètes de l\'UCLA concourent en tant que Bruins dans la Pac-12 Conference. Ils ont remporté 121 championnats d\'équipe de la NCAA, se classant au deuxième rang derrière les 128 titres d\'équipe de l\'Université Stanford. 410 Bruins ont participé aux équipes olympiques, remportant 270 médailles olympiques : 136 d\'or, 71 d\'argent et 63 de bronze. L\'UCLA a été représentée à chaque Olympiade depuis la fondation de l\'université (sauf en 1924) et a eu un médaillé d\'or à chaque Olympiade à laquelle les États-Unis ont participé depuis 1932.\nL\'UCLA est considérée comme une Public Ivy. En octobre 2021, 27 lauréats du prix Nobel, cinq lauréats du prix Turing, deux chefs scientifiques de l\'US Air Force et un lauréat de la médaille Fields ont été affiliés à l\'université en tant que professeurs, chercheurs et anciens élèves. En août 2021, 55 membres associés de la faculté ont été élus à l\'Académie nationale des sciences, 29 à l\'Académie nationale de l\'ingénierie, 41 à l\'Académie nationale de médecine et 156 à l\'American Academy of Arts and Sciences. L\'université a été élue à l\'Association of American Universities en 1974.', 14000),
(122, 2967, 'University of California, Merced', 'Economics & Econometrics,History, Philosophy & Theology,Electrical & Electronic Engineering,Mathematics & Statistics,Business & Management,General Engineering,Sociology,Civil Engineering,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Biological Sciences,Chemistry,Languages, Literature & Linguistics,Psychology,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/51/UC_Merced_Seal.png/150px-UC_Merced_Seal.png', ' La University of California, Merced (UC Merced ou, familièrement, UCM) est une université de recherche publique de subvention de terres située à Merced, en Californie. Elle est l\'un des dix campus du système de l\'University of California (UC). Établie en 2005, UC Merced est le campus le plus récent du système UC. Le campus principal est situé à environ cinq miles au nord de Merced et est adjacent au lac Yosemite. Le campus principal a une superficie d\'environ 415 hectares, et la superficie totale de terres détenues par l\'université s\'élève à environ 3 316 hectares, comprenant de vastes zones de terres préservées. De vastes étendues de vergers d\'amandiers et de prairies naturelles entourent l\'université.\nLa création de l\'UC Merced a été initiée pour faire face à la forte croissance démographique de la vallée centrale et de la vallée de San Joaquin, et pour rendre l\'enseignement supérieur plus accessible aux étudiants de la région. L\'UCM est également en cours de développement en tenant compte des projections de croissance futures du système UC. L\'UC Merced se compose de trois écoles pour les premier cycle, cycles supérieurs et professionnelles, avec une école de médecine en cours de création. La future école de médecine est en cours d\'établissement en partenariat avec l\'UCSF et l\'UCSF Fresno. L\'UC Merced propose plus de 60 diplômes de premier cycle et 18 diplômes de cycles supérieurs et professionnels, et environ 8 000 étudiants de premier cycle et 700 étudiants diplômés sont inscrits à l\'UCM à l\'automne 2023. L\'université est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\" et a dépensé 45,9 millions de dollars en recherche et développement en 2021.\nUC Merced est l\'un des plus grands employeurs du comté de Merced et contribue environ 1,7 milliard de dollars à l\'économie de la vallée de San Joaquin. Chaque bâtiment sur le campus est certifié LEED, la majorité étant certifiée or. Les UC Merced Golden Bobcats concourent actuellement en tant que membres de la Cal Pac de la NAIA. À partir de 2025, l\'université prévoit de passer à la Division II de la NCAA. De plus, parmi le corps professoral actuel, l\'un a été élu à l\'Académie nationale de l\'ingénierie.', 0),
(123, 4049, 'University of California, Riverside', 'Economics & Econometrics,Mathematics & Statistics,Chemical Engineering,Chemistry,Languages, Literature & Linguistics,General Engineering,Sociology,History, Philosophy & Theology,Psychology,Other Health,Physics & Astronomy,Accounting & Finance,Agriculture & Forestry,Medicine & Dentistry,Communication & Media Studies,Biological Sciences,Education,Mechanical & Aerospace Engineering,Computer Science,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Business & Management,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/51/UC_Riverside_seal.svg/150px-UC_Riverside_seal.svg.png', ' The University of California, Riverside (UCR ou UC Riverside) est une université de recherche publique de subvention de terres située à Riverside, en Californie. Elle est l\'un des dix campus du système de l\'University of California. Le campus principal s\'étend sur 769 hectares dans un quartier suburbain de Riverside, avec un campus secondaire de 8 hectares à Palm Desert. En 1907, le prédécesseur de l\'UCR a été fondé sous le nom de UC Citrus Experiment Station, Riverside, pionnier de la recherche en lutte biologique contre les ravageurs et de l\'utilisation de régulateurs de croissance.\nLa faculté de premier cycle de l\'UCR, le College of Letters and Science, a ouvert ses portes en 1954. En 1959, les régents de l\'University of California ont déclaré l\'UCR campus général du système, et les étudiants diplômés ont été admis en 1961. Pour accueillir un effectif de 21 000 étudiants d\'ici 2015, plus de 730 millions de dollars ont été investis dans de nouveaux projets de construction depuis 1999. Une accréditation préliminaire de la UC Riverside School of Medicine a été accordée en octobre 2012, et la première promotion de 50 étudiants a été inscrite en août 2013. Il s\'agit de la première nouvelle école de médecine publique axée sur la recherche depuis 40 ans. L\'UCR est membre de l\'Association of American Universities.\nEn 2000, l\'UC Riverside a été classée comme une \"R1 : Universités doctorales - Activité de recherche très élevée\". Les équipes sportives de l\'UCR sont connues sous le nom de Highlanders et participent à la Big West Conference de la Division I de la National Collegiate Athletic Association (NCAA). Leur surnom a été inspiré par l\'altitude élevée du campus, situé sur les contreforts du Box Springs Mountain. L\'équipe de basketball féminin de l\'UCR a remporté les championnats de la Big West consécutifs en 2006 et 2007.', 0),
(124, 4198, 'University of California, San Diego', 'Other Health,Computer Science,Chemical Engineering,Physics & Astronomy,Economics & Econometrics,General Engineering,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Biological Sciences,Sociology,History, Philosophy & Theology,Education,Mathematics & Statistics,Business & Management,Electrical & Electronic Engineering,Communication & Media Studies,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Chemistry,Accounting & Finance,Civil Engineering,Psychology,Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences', 34, 'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c1/Seal_of_the_University_of_California%2C_San_Diego.svg/150px-Seal_of_the_University_of_California%2C_San_Diego.svg.png', ' The University of California, San Diego (UC San Diego ou colloquial, UCSD) est une université publique de recherche de subvention de terres située à San Diego, en Californie, aux États-Unis. Établie en 1960 près de l\'Institution Scripps d\'océanographie existante, UC San Diego est le campus le plus au sud des dix campus de l\'University of California, et propose plus de 200 programmes de premier cycle et de cycles supérieurs, accueillant 33 096 étudiants de premier cycle et 9 872 étudiants diplômés. L\'université occupe 881 hectares près de la côte de l\'océan Pacifique, le campus principal reposant sur environ 466 hectares.\nUC San Diego se compose de douze écoles de premier cycle, de cycles supérieurs et professionnelles, ainsi que de huit collèges résidentiels de premier cycle. L\'université exploite 19 unités de recherche organisées ainsi que huit unités de recherche de l\'école de médecine, six centres de recherche à l\'Institution Scripps d\'océanographie et deux initiatives multi-campus. UC San Diego est également étroitement affiliée à plusieurs centres de recherche régionaux, tels que l\'Institut Salk, l\'Institut de découverte médicale Sanford Burnham Prebys, le Consortium Sanford pour la médecine régénérative et l\'Institut de recherche Scripps. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". En 2021, la National Science Foundation a classé UC San Diego au 7e rang des universités américaines pour les dépenses de recherche et de développement avec 1,42 milliard de dollars.\nUC San Diego est considérée comme une Public Ivy. Le corps professoral, les chercheurs et les anciens de UC San Diego ont remporté 27 prix Nobel, ainsi que 3 médailles Fields, 8 médailles nationales des sciences, 8 bourses MacArthur et 3 prix Pulitzer. De plus, parmi le corps professoral actuel, 29 ont été élus à la National Academy of Engineering, 70 à la National Academy of Sciences, 45 à l\'Institute of Medicine et 110 à l\'American Academy of Arts and Sciences.', 14000),
(125, 4237, 'University of California, Santa Barbara', 'Archaeology,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Veterinary Science,Geography,Chemical Engineering,Communication & Media Studies,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Architecture,Biological Sciences,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Education,Physics & Astronomy,Languages, Literature & Linguistics,Mathematics & Statistics,Computer Science,Chemistry,Agriculture & Forestry,Economics & Econometrics,Electrical & Electronic Engineering,Psychology,Sociology', 33, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/48/UC_Santa_Barbara_Seal.png/150px-UC_Santa_Barbara_Seal.png', ' The University of California, Santa Barbara (UC Santa Barbara or UCSB) est une université publique de recherche de subvention de terres à Santa Barbara, en Californie, aux États-Unis. Faisant partie du système universitaire de l\'University of California, UCSB remonte à 1891 en tant que collège indépendant pour enseignants, avant de rejoindre l\'ancêtre du système California State University en 1909, puis de passer au système University of California en 1944. C\'est le troisième campus de premier cycle le plus ancien du système, après UC Berkeley et UCLA. L\'inscription totale des étudiants pour 2022 était de 23 460 étudiants de premier cycle et 2 961 étudiants diplômés.\nLe campus de l\'UCSB se trouve sur le site océanique d\'une ancienne station aérienne du Corps des Marines datant de la Seconde Guerre mondiale. UCSB est organisée en trois collèges de premier cycle (Lettres et sciences, Ingénierie, Études créatives) et deux écoles supérieures (Éducation et Sciences et gestion de l\'environnement), proposant plus de 200 diplômes et programmes. UCSB est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\" et est considérée comme une Public Ivy. L\'université compte 10 centres nationaux de recherche, dont l\'Institut Kavli de physique théorique. Selon la National Science Foundation, UC Santa Barbara a dépensé 235 millions de dollars en recherche et développement au cours de l\'exercice 2018, la classant au 100e rang national. UCSB était le troisième hôte sur l\'ARPAnet et a été élue à l\'Association of American Universities en 1995.\nLe corps professoral actuel de l\'UCSB comprend 6 lauréats du prix Nobel, 1 lauréat de la médaille Fields, 39 membres de la National Academy of Sciences, 27 membres de la National Academy of Engineering et 34 membres de l\'American Academy of Arts and Sciences. Le corps enseignant comprend également deux lauréats d\'un Academy Award et d\'un Emmy Award, ainsi que des lauréats d\'un Millennium Technology Prize, d\'une médaille d\'honneur de l\'IEEE, d\'une médaille nationale de la technologie et de l\'innovation et d\'un Breakthrough Prize en physique fondamentale.', 16000),
(126, 4241, 'University of California, Santa Cruz', 'Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Biological Sciences,Archaeology,Agriculture & Forestry,Business & Management,Physics & Astronomy,Languages, Literature & Linguistics,General Engineering,Computer Science,Chemistry,Other Health,Mathematics & Statistics,Education,Sociology,History, Philosophy & Theology,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/5/53/The_University_of_California_1868_UCSC.svg/150px-The_University_of_California_1868_UCSC.svg.png', ' L\'Université de Californie à Santa Cruz (UC Santa Cruz ou UCSC) est une université publique de recherche située à Santa Cruz, en Californie. Elle fait partie des dix campus du système de l\'Université de Californie. Situé sur la baie de Monterey, à la lisière de la communauté côtière de Santa Cruz, le campus s\'étend sur 2 001 acres (810 hectares) de collines boisées surplombant l\'océan Pacifique. À l\'automne 2022, ses dix collèges résidentiels accueillent environ 17 500 étudiants de premier cycle et 2 000 étudiants diplômés.\nFondée en 1965, UC Santa Cruz a été créée dans le but de promouvoir une éducation de premier cycle progressive et interdisciplinaire, des méthodes d\'enseignement innovantes et une architecture moderne. Le système de collèges résidentiels, inspiré du modèle universitaire collégial d\'Oxbridge, se compose de dix petits collèges.\nLe corps professoral de UC Santa Cruz comprend des lauréats du prix Nobel, des lauréats du Breakthrough Prize en sciences de la vie, 12 membres de l\'Académie nationale des sciences, 28 membres de l\'Académie américaine des arts et des sciences, et 40 membres de l\'Association américaine pour l\'avancement des sciences. Notamment, neuf anciens élèves de UC Santa Cruz ont remporté des prix Pulitzer, totalisant 11 Pulitzer.\nUC Santa Cruz est classée parmi les \"R1: Universités doctorales - Très haute activité de recherche\" et est membre de la prestigieuse Association of American Universities.', 0),
(127, 3570, 'University of Central Florida', 'Medicine & Dentistry,Mathematics & Statistics,Sociology,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Biological Sciences,Business & Management,Communication & Media Studies,Computer Science,Geology, Environmental, Earth & Marine Sciences,Civil Engineering,History, Philosophy & Theology,Politics & International Studies (incl Development Studies),Languages, Literature & Linguistics,General Engineering,Electrical & Electronic Engineering,Physics & Astronomy,Sport Science,Economics & Econometrics,Chemistry,Other Health,Psychology,Accounting & Finance,Education', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a4/Seal_of_the_University_of_Central_Florida.svg/150px-Seal_of_the_University_of_Central_Florida.svg.png', ' L\'Université de Floride centrale (UCF) est une université publique de recherche dont le campus principal est situé dans le comté d\'Orange non constitué en société, en Floride. Elle fait partie du système universitaire de l\'État de Floride. Avec 68 442 étudiants au cours du semestre d\'automne 2022, l\'UCF possède le deuxième plus grand effectif d\'étudiants sur le campus de toute université publique aux États-Unis. L\'UCF est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\" et est accréditée par la Commission des collèges de l\'Association des collèges et écoles du Sud.\nFondée en 1963 et ouvrant ses premiers cours en 1968 en tant qu\'Université technologique de Floride, l\'UCF avait pour mission de former du personnel en sciences, technologie, ingénierie et mathématiques pour soutenir le programme spatial en croissance du centre spatial Kennedy et de la base de la Force spatiale du Cap Canaveral sur la Space Coast de la Floride. À mesure que son champ académique s\'est élargi au-delà de l\'ingénierie et de la technologie, Florida Tech a été rebaptisée Université de Floride centrale en 1978. L\'UCF continue d\'avoir des liens avec l\'espace, car elle développe et supervise l\'Institut spatial de Floride, l\'Observatoire Robinson, gère le Centre national d\'astronomie et d\'ionosphère, et est le leader du Consortium spatial de la NASA en Floride. L\'inscription initiale en 1968 était de 1 948 étudiants ; l\'inscription en 2022 dépasse 68 000 étudiants originaires de plus de 150 pays, des 50 États et de Washington, D.C.\nLa plupart des étudiants assistent aux cours sur le campus principal de l\'université, à 13 milles (21 km) à l\'est du centre-ville d\'Orlando et à 35 milles (56 km) à l\'ouest du Cap Canaveral. L\'UCF propose plus de 230 diplômes répartis dans 13 collèges, dont le Health Sciences Campus à Lake Nona Medical City, le Rosen College of Hospitality Management dans le sud d\'Orlando et le campus urbain du centre-ville d\'Orlando. Depuis sa création, l\'UCF a décerné plus de 401 245 diplômes, dont plus de 60 000 diplômes de troisième cycle et professionnels.\nSes couleurs officielles sont le noir et l\'or, et le sceau académique de l\'université présente Pégase, qui \"symbolise la vision illimitée de l\'université\". Les équipes sportives interuniversitaires de l\'université, connues sous le nom des UCF Knights et représentées par la mascotte Knightro, concourent en NCAA Division I et dans la Big 12 Conference, à l\'exception du soccer masculin, qui participe à la Sun Belt Conference.', 0),
(128, 834, 'University of Cincinnati – Uptown', 'Electrical & Electronic Engineering,Economics & Econometrics,Education,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Archaeology,Communication & Media Studies,Computer Science,Agriculture & Forestry,Chemistry,Business & Management,Sociology,Psychology,General Engineering,Other Health,Architecture,Geography,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Mechanical & Aerospace Engineering,Languages, Literature & Linguistics,Accounting & Finance,Chemical Engineering,Physics & Astronomy,Art, Performing Arts & Design,Civil Engineering,History, Philosophy & Theology,Mathematics & Statistics,Law', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/59/University_of_Cincinnati_logo.svg/2560px-University_of_Cincinnati_logo.svg.png', ' L\'Université de Cincinnati (UC ou Cincinnati, familièrement Cincy) est une université publique de recherche située à Cincinnati, Ohio, aux États-Unis. Fondée en 1819 sous le nom de Cincinnati College, c\'est la plus ancienne institution d\'enseignement supérieur de Cincinnati et compte plus de 50 000 étudiants chaque année, ce qui en fait la deuxième plus grande université de l\'Ohio. Elle fait partie du système universitaire de l\'Ohio. Le campus principal de l\'université et le campus médical sont situés dans les quartiers de Heights et Corryville, avec des campus annexes à Batavia et Blue Ash, Ohio.\nL\'université compte 14 collèges constituants, proposant des programmes en architecture, commerce, éducation, ingénierie, sciences humaines, sciences, droit, musique et médecine. Le collège de médecine comprend un hôpital universitaire de premier plan et plusieurs laboratoires de recherche biomédicale, avec des développements tels qu\'un vaccin antipoliomyélitique vivant et la diphenhydramine. UC a également été la première université à mettre en œuvre un modèle d\'éducation coopérative (co-op).\nL\'université est accréditée par la Higher Learning Commission et est classée \"R1: Universités doctorales - Activité de recherche très élevée\". Selon la National Science Foundation, UC a consacré 480 millions de dollars à la recherche et au développement en 2018, la classant au 54e rang national.\nLes équipes sportives de l\'UC sont appelées les Cincinnati Bearcats et participent à la Division I de la National Collegiate Athletic Association en tant que membre de la Big 12 Conference.', 0),
(129, 473, 'University of Colorado Boulder', 'Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Biological Sciences,Sociology,Accounting & Finance,Chemistry,Art, Performing Arts & Design,Civil Engineering,Mathematics & Statistics,Education,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Chemical Engineering,Communication & Media Studies,Architecture,Electrical & Electronic Engineering,Physics & Astronomy,Business & Management,Mechanical & Aerospace Engineering,Computer Science,Law,General Engineering,Psychology,Geography', 0, 'https://upload.wikimedia.org/wikipedia/commons/8/86/University_of_Colorado_Boulder_logo.png', ' L\'Université du Colorado à Boulder (CU Boulder, CU, ou Colorado) est une université publique de recherche située à Boulder, Colorado, aux États-Unis. Fondée en 1876, cinq mois avant que le Colorado ne devienne un État, elle est l\'université phare du système de l\'Université du Colorado. CU Boulder est membre de l\'Association of American Universities et est classée parmi les universités doctorales R1 - Activité de recherche très élevée.\nL\'université est composée de neuf collèges et écoles et propose plus de 150 programmes académiques, avec un effectif de plus de 35 000 étudiants en janvier 2022. En 2021, l\'université a bénéficié d\'un soutien financier de plus de 634 millions de dollars pour la recherche et a dépensé 536 millions de dollars pour la recherche et le développement selon la National Science Foundation, la classant au 50e rang national.\nLes Colorado Buffaloes participent à 17 sports universitaires et sont membres de la Division I de la Pac-12 Conference de la NCAA. Les Buffaloes ont remporté 28 championnats nationaux : 20 en ski, sept au total en cross-country masculin et féminin, et un en football. L\'université a produit 10 médaillés olympiques. Parmi les anciens élèves, les enseignants et les collaborateurs figurent 5 lauréats du prix Nobel, 10 lauréats du prix Pulitzer, 11 récipiendaires de la bourse MacArthur, 1 lauréat du prix Turing, 20 astronautes et 2 juges associés de la Cour suprême des États-Unis ont été affiliés à CU Boulder en tant qu\'anciens élèves, chercheurs ou enseignants.', 0),
(130, 937, 'University of Colorado Colorado Springs', 'Education,Chemistry,History, Philosophy & Theology,Politics & International Studies (incl Development Studies),Business & Management,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Biological Sciences,Computer Science,Geography,Accounting & Finance,General Engineering,Mathematics & Statistics,Communication & Media Studies,Economics & Econometrics,Other Health,Physics & Astronomy,Sociology,Languages, Literature & Linguistics,Sport Science,Art, Performing Arts & Design,Psychology', 0, 'https://dxbhsrqyrr690.cloudfront.net/sidearm.nextgen.sites/uccs.sidearmsports.com/images/responsive_2022/logo-main.svg', ' L\'Université du Colorado à Colorado Springs (UCCS) est une université publique de recherche située à Colorado Springs, Colorado. Elle est l\'un des quatre campus qui composent le système de l\'Université du Colorado. À l\'automne 2017, l\'UCCS comptait plus de 12 400 étudiants de premier cycle et 1 822 étudiants diplômés, dont 32 % étaient issus de minorités ethniques. Elle est classée parmi les universités doctorales R2 - Activité de recherche élevée.', 0),
(131, 209, 'University of Colorado Denver/Anschutz Medical Campus', 'Medicine & Dentistry,Mathematics & Statistics,Communication & Media Studies,Electrical & Electronic Engineering,Business & Management,General Engineering,Physics & Astronomy,Art, Performing Arts & Design,Biological Sciences,Politics & International Studies (incl Development Studies),Geography,Other Health,Geology, Environmental, Earth & Marine Sciences,Computer Science,Sociology,History, Philosophy & Theology,Accounting & Finance,Mechanical & Aerospace Engineering,Sport Science,Economics & Econometrics,Architecture,Civil Engineering,Chemistry,Education,Psychology,Languages, Literature & Linguistics', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/2/22/University_of_Colorado_School_of_Medicine_logo.jpg/800px-University_of_Colorado_School_of_Medicine_logo.jpg', ' Le campus médical Anschutz de l\'Université du Colorado est le campus universitaire des sciences de la santé à Aurora, Colorado, qui abrite les six écoles et collèges liés aux sciences de la santé de l\'Université du Colorado, dont la Faculté de médecine de l\'Université du Colorado, l\'École de pharmacie et des sciences pharmaceutiques de CU Skaggs, le Collège des soins infirmiers de CU, la Faculté de médecine dentaire de l\'Université du Colorado et l\'École de santé publique du Colorado, ainsi que l\'école supérieure pour divers domaines des sciences biologiques et biomédicales. Le campus comprend également le parc d\'innovation Fitzsimons de 184 acres (0,74 km2), l\'Hôpital universitaire UCHealth de l\'Université du Colorado, l\'Hôpital pour enfants du Colorado, l\'hôpital régional des anciens combattants de Rocky Mountain et un centre-ville résidentiel', 0);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(132, 4618, 'University of Connecticut', 'Civil Engineering,Sociology,Business & Management,Economics & Econometrics,General Engineering,Physics & Astronomy,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Geography,Art, Performing Arts & Design,Education,Biological Sciences,Psychology,History, Philosophy & Theology,Chemistry,Law,Medicine & Dentistry,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,Communication & Media Studies,Accounting & Finance,Architecture,Computer Science,Sport Science,Other Health,Mathematics & Statistics,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Chemical Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/56/University_of_Connecticut_seal.svg/150px-University_of_Connecticut_seal.svg.png', ' L\'Université du Connecticut (UConn) est un système universitaire public de recherche dont le campus principal est situé à Storrs, Connecticut. Elle a été fondée en 1881 sous le nom de Storrs Agricultural School, en l\'honneur de deux frères ayant fait don des terres pour l\'école. En 1893, l\'école est devenue un collège public agricole, devenant l\'Université du Connecticut en 1939. Au cours de la décennie suivante, des programmes de travail social, d\'infirmière et de troisième cycle ont été établis, tandis que les écoles de droit et de pharmacie ont également été absorbées par l\'université. Dans les années 1960, UConn Health a été créée pour les nouvelles écoles de médecine et de dentisterie. L\'UConn est accréditée par la Commission de l\'enseignement supérieur de la Nouvelle-Angleterre.\nL\'université est classée comme une institution de recherche de niveau R1. L\'UConn est l\'une des institutions fondatrices du partenariat économique et culturel régional de Hartford', 0),
(133, 1105, 'University of Dayton', 'Languages, Literature & Linguistics,Veterinary Science,Civil Engineering,Electrical & Electronic Engineering,Agriculture & Forestry,Economics & Econometrics,Politics & International Studies (incl Development Studies),Business & Management,Mechanical & Aerospace Engineering,Other Health,Chemistry,Mathematics & Statistics,Computer Science,Archaeology,Communication & Media Studies,Sociology,History, Philosophy & Theology,General Engineering,Psychology,Education,Physics & Astronomy,Art, Performing Arts & Design,Geology, Environmental, Earth & Marine Sciences,Accounting & Finance,Biological Sciences,Chemical Engineering,Sport Science,Law', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/02/University_of_Dayton.svg/240px-University_of_Dayton.svg.png', ' La University of Dayton (UD) est une université de recherche privée et catholique située à Dayton, Ohio. Fondée en 1850 par la Société de Marie, elle est l\'une des trois universités marianistes aux États-Unis et la deuxième plus grande université privée de l\'Ohio. Son campus est situé dans le sud de Dayton et s\'étend sur 388 acres des deux côtés de la rivière Great Miami.\nÀ l\'automne 2020, l\'université a inscrit 11 347 étudiants à temps plein issus de divers milieux religieux, ethniques et géographiques. Elle propose plus de 80 programmes académiques dans les domaines des arts, des sciences, des affaires, de l\'éducation, des sciences de la santé, du génie et du droit. En 2009, l\'UD a proposé ce qu\'elle croit être l\'un des premiers programmes de premier cycle en droits de l\'homme. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nLe campus est réputé pour la chapelle de l\'Immaculée Conception et l\'University of Dayton Arena. Parmi les anciens élèves notables de l\'université, on trouve : Jon Husted, lieutenant-gouverneur de l\'Ohio ; l\'humoriste Erma Bombeck ; l\'ingénieur David Bradley ; l\'architecte Bruce Graham ; les entraîneurs vainqueurs du Super Bowl Jon Gruden et Chuck Noll ; la première femme Premier ministre de Nouvelle-Galles du Sud, Kristina Keneally ; le commentateur sportif Dan Patrick ; et le lauréat du prix Nobel de chimie en 1987, Charles J. Pedersen.', 0),
(134, 3308, 'University of Delaware', 'Art, Performing Arts & Design,Electrical & Electronic Engineering,Psychology,Other Health,Veterinary Science,Politics & International Studies (incl Development Studies),Business & Management,Biological Sciences,Mathematics & Statistics,Languages, Literature & Linguistics,Agriculture & Forestry,Architecture,Computer Science,Sport Science,Sociology,Economics & Econometrics,Physics & Astronomy,Mechanical & Aerospace Engineering,Chemical Engineering,Geography,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Accounting & Finance,General Engineering,History, Philosophy & Theology,Education,Chemistry,Communication & Media Studies', 63, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/29/University_of_Delaware_Seal.svg/150px-University_of_Delaware_Seal.svg.png', ' La University of Delaware (connue familièrement sous le nom de UD ou Delaware) est une université de recherche à gestion privée et assistée par l\'État, située à Newark, Delaware. L\'UD est la plus grande université du Delaware. Elle propose trois programmes de premier cycle, 148 programmes de baccalauréat, 121 programmes de master (avec 13 diplômes conjoints) et 55 programmes de doctorat répartis dans ses huit collèges. Le campus principal est à Newark, avec des campus satellites à Dover, Wilmington, Lewes et Georgetown. Il est considéré comme une grande institution comptant environ 18 200 étudiants de premier cycle et 4 200 étudiants diplômés. Il s\'agit d\'une université à gestion privée qui reçoit un financement public en tant qu\'institution de recherche sous statut de bénéficiaire de subventions de terre, de mer et d\'espace.\nL\'UD est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". Selon la National Science Foundation, l\'UD a dépensé 186 millions de dollars en recherche et développement en 2018, la classant au 119e rang national. Elle est reconnue avec la classification de l\'engagement communautaire par la Carnegie Foundation for the Advancement of Teaching.\nLes étudiants, anciens élèves et équipes sportives de l\'UD sont connus sous le nom de \"Fightin\' Blue Hens\", plus couramment abrégé en \"Blue Hens\", et les couleurs de l\'école sont le bleu et l\'or du Delaware. L\'UD parraine 21 équipes sportives NCAA Division I masculines et féminines et participe à la Colonial Athletic Association (CAA) depuis 2001.', 16000),
(135, 1146, 'University of Denver', 'General Engineering,Psychology,Electrical & Electronic Engineering,History, Philosophy & Theology,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Chemistry,Other Health,Mathematics & Statistics,Accounting & Finance,Sociology,Communication & Media Studies,Law,Physics & Astronomy,Geography,Biological Sciences,Business & Management,Education,Languages, Literature & Linguistics,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Computer Science,Sport Science,Politics & International Studies (incl Development Studies)', 58, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a9/University_of_Denver_seal.svg/150px-University_of_Denver_seal.svg.png', ' L\'Université de Denver (DU) est une université privée de recherche située à Denver, Colorado. Fondée en 1864, c\'est la plus ancienne université privée indépendante de la région des Montagnes Rocheuses aux États-Unis. Elle est classée parmi les \"R1: Universités doctorales - activité de recherche très élevée\". La DU compte environ 5 700 étudiants de premier cycle et 7 200 étudiants diplômés. Le campus principal de 125 acres (0,51 km2) est un arboretum désigné et est situé principalement dans le quartier universitaire, à environ cinq miles (8 km) au sud du centre-ville de Denver. Le Kennedy Mountain Campus de 720 acres est situé à environ 110 miles au nord-ouest de Denver, dans le comté de Larimer.', 35000),
(136, 1699, 'University of Florida', 'Veterinary Science,Languages, Literature & Linguistics,Law,Geography,Psychology,Politics & International Studies (incl Development Studies),Civil Engineering,Biological Sciences,Agriculture & Forestry,Geology, Environmental, Earth & Marine Sciences,Sociology,Accounting & Finance,Medicine & Dentistry,Other Health,Economics & Econometrics,Sport Science,Chemical Engineering,Mathematics & Statistics,Business & Management,Chemistry,Physics & Astronomy,Education,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,History, Philosophy & Theology,Art, Performing Arts & Design,Communication & Media Studies,Architecture,Computer Science,General Engineering', 42, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/6d/University_of_Florida_seal.svg/150px-University_of_Florida_seal.svg.png', ' L\'Université de Floride (Florida ou UF) est une université publique de recherche agricole située à Gainesville, en Floride. Elle est membre éminent du système universitaire de l\'État de la Floride. L\'université trace ses origines en 1853 et opère continuellement sur son campus de Gainesville depuis septembre 1906.\nAprès l\'adoption de normes de performance par la législature de l\'État de Floride en 2013, le Conseil des gouverneurs de la Floride a désigné l\'Université de Floride comme une \"université éminente\". L\'Université de Floride est l\'un des trois membres de l\'Association of American Universities en Floride et est classée parmi les \"R1: Universités doctorales - activité de recherche très élevée\".\nL\'université est accréditée par l\'Association des collèges et écoles du Sud (SACS). C\'est la troisième plus grande université de Floride en termes de population étudiante et la cinquième plus grande université monocomposante des États-Unis avec 57 841 étudiants inscrits pendant l\'année scolaire 2020–2021. L\'Université de Floride abrite 16 collèges universitaires et plus de 150 centres et instituts de recherche. Elle propose plusieurs programmes professionnels de troisième cycle, notamment en administration des affaires, génie, droit, odontologie, médecine, pharmacie et médecine vétérinaire, sur un campus contigu, et administre 123 programmes de master et 76 programmes de doctorat dans 87 écoles et départements. Le sceau de l\'université est également le sceau de l\'État de Floride, qui figure sur le drapeau de l\'État, bien qu\'en bleu plutôt qu\'en plusieurs couleurs.\nLes équipes sportives intercollégiales de l\'Université de Floride, les Florida Gators, participent à la Division I de la National Collegiate Athletic Association (NCAA) et à la Southeastern Conference (SEC). En 2021, les étudiants et anciens élèves de l\'Université de Floride ont remporté 143 médailles olympiques, dont 69 médailles d\'or.', 15000),
(137, 181, 'University of Georgia', 'Architecture,Archaeology,Mathematics & Statistics,Accounting & Finance,Mechanical & Aerospace Engineering,Agriculture & Forestry,Civil Engineering,Psychology,Other Health,Communication & Media Studies,Biological Sciences,Sport Science,Economics & Econometrics,Computer Science,Physics & Astronomy,Sociology,Law,Electrical & Electronic Engineering,History, Philosophy & Theology,Medicine & Dentistry,Languages, Literature & Linguistics,Education,Chemistry,Business & Management,General Engineering,Geology, Environmental, Earth & Marine Sciences,Geography,Politics & International Studies (incl Development Studies),Chemical Engineering,Art, Performing Arts & Design,Veterinary Science', 54, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/2d/University_of_Georgia_seal.svg/150px-University_of_Georgia_seal.svg.png', ' L\'Université de Géorgie (UGA ou Georgia) est une université publique de recherche agricole dont le campus principal est situé à Athens, en Géorgie. Fondée en 1785, elle est l\'une des plus anciennes universités publiques des États-Unis. Elle est l\'établissement phare du University System of Georgia.\nEn plus des campus principaux à Athens, avec environ 470 bâtiments, l\'université possède deux campus plus petits situés à Tifton et Griffin. Elle a également deux campus satellites à Atlanta et Lawrenceville. La superficie totale de l\'université dans 30 comtés de Géorgie est de 41 539 acres (168,10 km2).\nL\'université est classée parmi les \"R1: Universités doctorales - activité de recherche très élevée\" et elle a des admissions de premier cycle qualifiées de \"plus sélectives\". En tant qu\'établissement phare du University System of Georgia, elle a été classée parmi les meilleures universités publiques des États-Unis par les principaux classements institutionnels. Les équipes sportives intercollégiales de l\'Université de Géorgie, communément connues sous le nom de Georgia Bulldogs, participent à la Division I de la National Collegiate Athletic Association (NCAA) et à la Southeastern Conference (SEC). L\'Université de Géorgie a eu plus d\'anciens élèves Rhodes Scholars depuis 1990 que presque toutes les autres universités publiques du pays. Parmi ses anciens élèves figurent également un poète lauréat des États-Unis, des lauréats des Emmy Awards, des lauréats des Grammy Awards et plusieurs champions du Super Bowl.', 15000),
(138, 2140, 'University of Hawai’i at Mānoa', 'Economics & Econometrics,Mechanical & Aerospace Engineering,Physics & Astronomy,Accounting & Finance,Law,Psychology,Languages, Literature & Linguistics,Agriculture & Forestry,Geology, Environmental, Earth & Marine Sciences,Other Health,Geography,Architecture,Computer Science,Chemistry,Sociology,Medicine & Dentistry,Electrical & Electronic Engineering,Mathematics & Statistics,Archaeology,Civil Engineering,Sport Science,Business & Management,General Engineering,Communication & Media Studies,History, Philosophy & Theology,Chemical Engineering,Biological Sciences,Art, Performing Arts & Design,Education,Veterinary Science,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/8f/UH_Manoa_Logo.png/260px-UH_Manoa_Logo.png', ' L\'Université de Hawaiʻi à Mānoa (University of Hawaii–Mānoa, UH Mānoa, Hawaiʻi, ou simplement UH) est une université publique de recherche et de subvention foncière située à Mānoa, un quartier d\'Honolulu, à Hawaï. C\'est le campus principal du système de l\'Université de Hawaï et abrite les bureaux principaux du système. La majeure partie du campus occupe la moitié est de l\'embouchure de la vallée de Mānoa, avec la John A. Burns School of Medicine située à proximité du Kakaʻako Waterfront Park.\nHawaiʻi Hall était le cœur de l\'Université de Hawaï lors de son ouverture en 1912. Il abritait des salles de classe, des bureaux administratifs et la bibliothèque du campus.\nL\'UH propose plus de 200 programmes de diplômes répartis dans 17 collèges et écoles. Elle est accréditée par la WASC Senior College and University Commission et est régie par la législature de l\'État d\'Hawaï et un conseil d\'administration semi-autonome. Elle est également membre de l\'Association of Pacific Rim Universities.\nMānoa est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". C\'est une université de subvention foncière qui participe également aux consortiums de recherche en matière de subvention maritime, spatiale et solaire; elle est l\'une des quatre seules universités de ce type dans le pays (les autres étant l\'Université d\'État de l\'Oregon, l\'Université Cornell et l\'Université d\'État de Pennsylvanie).\nParmi les anciens élèves notables de l\'UH, on compte Patsy T. Mink, Robert Ballard, Richard Parsons, et les parents de Barack Obama - Barack Obama Sr. et Stanley Ann Dunham. Quarante-quatre pour cent des sénateurs de l\'État d\'Hawaï et 51 pour cent de ses représentants d\'État sont diplômés de l\'UH.', 0),
(139, 2162, 'University of Houston', 'Chemical Engineering,Psychology,Accounting & Finance,Electrical & Electronic Engineering,Communication & Media Studies,Business & Management,General Engineering,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Geography,Architecture,Economics & Econometrics,Sport Science,Civil Engineering,Chemistry,Computer Science,Mathematics & Statistics,History, Philosophy & Theology,Education,Physics & Astronomy,Medicine & Dentistry,Law,Sociology,Art, Performing Arts & Design,Biological Sciences,Politics & International Studies (incl Development Studies),Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/77/University_of_Houston_seal.svg/150px-University_of_Houston_seal.svg.png', ' L\'Université de Houston (UH, UofH, ou Houston) est une université publique de recherche à Houston, au Texas. Elle a été créée en 1927 en tant que Houston Junior College, l\'une des multiples institutions de collège junior formées dans les premières décennies du XXe siècle. En 1934, HJC a été restructurée en tant qu\'institution octroyant des diplômes de quatre ans et rebaptisée University of Houston. Aujourd\'hui, Houston est la troisième plus grande université du Texas, décernant près de 11 000 diplômes chaque année pour ajouter à sa base mondiale d\'anciens élèves d\'environ 310 000.\nL\'université est composée de quinze collèges et d\'un collège d\'honneurs interdisciplinaire proposant environ 310 programmes de diplômes et accueillant environ 37 000 étudiants de premier cycle et 10 000 étudiants diplômés. Houston compte neuf écoles professionnelles : la Hines College of Architecture, le Bauer College of Business, le Hilton College of Global Hospitality, le Law Center, le College of Medicine, le College of Nursing, le College of Optometry, le College of Pharmacy, le College of Social Work et la Hobby School of Public Affairs. Le campus de l\'université, situé principalement au sud-est de Houston, s\'étend sur 894 acres (3,62 km2), avec l\'inclusion de ses deux sites d\'enseignement situés à Sugar Land et Katy. L\'université est également le campus fondateur du University of Houston System. Les admissions de premier cycle à l\'université sont classées dans le deuxième quintile, \"plus sélectives\". Près de 88 % de la population étudiante provient de l\'État du Texas et 9 % sont des étudiants internationaux représentant plus de 130 nations.\nL\'université est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\" et dépense environ 240 millions de dollars chaque année dans la recherche. L\'université exploite plus de 35 centres de recherche et instituts sur le campus dans des domaines tels que la supraconductivité, la commercialisation et l\'exploration spatiales, les sciences biomédicales et l\'ingénierie, l\'énergie et les ressources naturelles, et l\'intelligence artificielle. L\'impact économique de l\'université contribue plus de 6,4 milliards de dollars chaque année à l\'économie du Texas, tout en générant environ 62 000 emplois.\nL\'Université de Houston accueille une variété de représentations théâtrales, de concerts, de conférences et d\'événements. Elle compte plus de 500 organisations étudiantes et 17 équipes sportives intercollégiales. Parmi les événements et traditions annuels de l\'UH, citons The Cat\'s Back, Homecoming et Frontier Fiesta. Les équipes sportives universitaires, connues sous le nom de Houston Cougars, sont membres de la Big 12 Conference et participent à la NCAA Division I dans tous les sports. En 2021, l\'université a reçu et accepté une invitation à rejoindre la Big 12 Conference. L\'équipe de football participe régulièrement à des matchs de bowl, et l\'équipe de basketball masculin a participé à 23 reprises au tournoi de basketball masculin de la NCAA Division I, dont six participations aux Elite Eight et Final Four. L\'équipe de golf masculin a remporté 16 championnats nationaux - le plus élevé de l\'histoire de la NCAA. En 2022, l\'équipe d\'athlétisme masculine de l\'UH a remporté son septième titre de championnat d\'athlétisme en salle de conférence, et son équipe de natation et de plongée a défendu son titre de champion de l\'American Athletic Conference pour la sixième saison consécutive.', 0),
(140, 3159, 'University of Idaho', 'Medicine & Dentistry,Veterinary Science,Art, Performing Arts & Design,General Engineering,Chemistry,Politics & International Studies (incl Development Studies),Chemical Engineering,Mathematics & Statistics,History, Philosophy & Theology,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Education,Physics & Astronomy,Languages, Literature & Linguistics,Electrical & Electronic Engineering,Sport Science,Sociology,Architecture,Economics & Econometrics,Mechanical & Aerospace Engineering,Geography,Archaeology,Accounting & Finance,Agriculture & Forestry,Psychology,Business & Management,Law,Communication & Media Studies,Computer Science,Biological Sciences', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/44/University_of_Idaho_seal.svg/150px-University_of_Idaho_seal.svg.png', ' L\'Université de l\'Idaho (U de l\'Idaho, ou UIdaho) est une université publique de recherche de l\'État du Idaho, située à Moscow, Idaho. C\'est l\'université d\'État en charge de la subvention de terre et la principale université de recherche, et elle est l\'université principale du Consortium de subvention spatiale de l\'Idaho. L\'Université de l\'Idaho a été l\'unique université de l\'État pendant 71 ans, jusqu\'en 1963. Sa Faculté de droit, fondée en 1909, a été agréée pour la première fois par l\'American Bar Association en 1925.\nElle compte plus de 12 000 étudiants, dont plus de 11 000 sur le campus de Moscow. L\'université propose 142 programmes de diplômes, de la comptabilité aux ressources fauniques, comprenant des diplômes de baccalauréat, de master, de doctorat, et de spécialiste, ainsi que des programmes d\'honneurs associés. Des certificats de réussite sont proposés dans 30 domaines d\'études. Avec des taux de diplomation de 25 % et 53 % pour les périodes de 4 et 6 ans, ils sont les plus élevés de toutes les universités publiques de l\'Idaho, et elle génère 74 % de tous les fonds de recherche de l\'État, avec des dépenses de recherche de 100 millions de dollars rien qu\'en 2010. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nEn tant qu\'université de subvention de terre et principale université de recherche de l\'État, l\'U de l\'Idaho possède le plus grand campus de l\'État avec 1 585 acres (2,5 milles carrés ; 6,4 km2), dans les collines vallonnées de la région de Palouse à une altitude de 2 600 pieds (790 mètres) au-dessus du niveau de la mer. L\'école est le foyer des Idaho Vandals, qui participent aux compétitions sportives de la NCAA Division I. En plus du campus principal à Moscow, l\'U de l\'Idaho possède des campus annexes à Coeur d\'Alene, Boise et Idaho Falls. Elle exploite également un parc de recherche à Post Falls, ainsi que des dizaines de bureaux de vulgarisation dans tout l\'État.', 0),
(141, 761, 'University of Illinois at Urbana-Champaign', 'Art, Performing Arts & Design,Computer Science,Archaeology,General Engineering,Communication & Media Studies,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Law,Architecture,Mechanical & Aerospace Engineering,Mathematics & Statistics,Chemical Engineering,Business & Management,Geography,History, Philosophy & Theology,Other Health,Sport Science,Psychology,Medicine & Dentistry,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Chemistry,Electrical & Electronic Engineering,Sociology,Languages, Literature & Linguistics,Education,Accounting & Finance,Civil Engineering,Veterinary Science,Biological Sciences,Physics & Astronomy', 62, 'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a6/University_of_Illinois_at_Urbana-Champaign_Wordmark.svg/247px-University_of_Illinois_at_Urbana-Champaign_Wordmark.svg.png', ' L\'Université de l\'Illinois à Urbana-Champaign (U de l\'Illinois, Illinois, University of Illinois, ou UIUC) est une université publique de recherche de Champaign, Illinois, et Urbana, Illinois. C\'est l\'institution phare du système de l\'Université de l\'Illinois et a été fondée en 1867. Avec plus de 53 000 étudiants, l\'Université de l\'Illinois est l\'une des plus grandes universités publiques des États-Unis en termes d\'effectifs.\nL\'université compte 16 écoles et collèges et propose plus de 150 programmes de premier cycle et plus de 100 programmes d\'études supérieures. Elle possède 651 bâtiments sur 6 370 acres (2 578 ha), et son budget de fonctionnement annuel en 2016 était de plus de 2 milliards de dollars. L\'Université de l\'Illinois à Urbana-Champaign exploite également un parc de recherche abritant des centres d\'innovation pour plus de 90 start-ups et multinationales.\nL\'Université de l\'Illinois à Urbana-Champaign est membre de l\'Association of American Universities et est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". Pour l\'exercice financier 2019, les dépenses de recherche à l\'Illinois se sont élevées à 652 millions de dollars. Le système de bibliothèques du campus possède la quatrième plus grande bibliothèque universitaire des États-Unis en termes de collections. L\'université abrite également le National Center for Supercomputing Applications et possède le superordinateur le plus rapide sur un campus universitaire.\nLes équipes sportives de l\'Illinois participent à la Division I de la NCAA et sont collectivement connues sous le nom de Fighting Illini. Elles sont membres de la Big Ten Conference et ont remporté le deuxième plus grand nombre de titres de conférence. L\'équipe de football Fighting Illini a remporté le Rose Bowl Game en 1947, 1952, 1964, et un total de cinq championnats nationaux. Les athlètes de l\'Illinois ont remporté 29 médailles dans des événements olympiques. Les anciens élèves, membres du corps professoral ou chercheurs de l\'université comprennent 30 lauréats du prix Nobel, 27 lauréats du prix Pulitzer, deux médaillés Fields et deux lauréats du prix Turing.', 16000),
(142, 811, 'University of Illinois Chicago', 'Civil Engineering,Communication & Media Studies,Business & Management,Art, Performing Arts & Design,Physics & Astronomy,General Engineering,Archaeology,Biological Sciences,Geography,Computer Science,Chemical Engineering,Law,Mathematics & Statistics,Languages, Literature & Linguistics,History, Philosophy & Theology,Medicine & Dentistry,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Other Health,Chemistry,Education,Psychology,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Architecture,Accounting & Finance,Sport Science,Sociology,Electrical & Electronic Engineering', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/96/University_of_Illinois_at_Chicago_circle_logo.svg/150px-University_of_Illinois_at_Chicago_circle_logo.svg.png', ' L\'Université de l\'Illinois à Chicago (UIC) est une université publique de recherche à Chicago, Illinois, aux États-Unis. Son campus est situé dans la communauté du Near West Side, à proximité du Chicago Loop. Deuxième campus établi sous le système de l\'Université de l\'Illinois, l\'UIC est également la plus grande université de la région métropolitaine de Chicago, avec plus de 33 000 étudiants inscrits dans 16 collèges. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\".\nL\'UIC participe à la Division I de la NCAA dans la Missouri Valley Conference.', 0),
(143, 2226, 'University of Iowa', 'Other Health,Biological Sciences,Education,Geology, Environmental, Earth & Marine Sciences,Medicine & Dentistry,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Computer Science,General Engineering,Geography,History, Philosophy & Theology,Electrical & Electronic Engineering,Mathematics & Statistics,Business & Management,Civil Engineering,Physics & Astronomy,Economics & Econometrics,Law,Sociology,Languages, Literature & Linguistics,Chemical Engineering,Psychology,Accounting & Finance,Chemistry,Art, Performing Arts & Design,Sport Science,Communication & Media Studies', 86, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/49/University_of_Iowa_seal.svg/150px-University_of_Iowa_seal.svg.png', ' L\'Université de l\'Iowa (UI, U of I, UIowa, ou simplement Iowa) est une université de recherche publique à Iowa City, Iowa, aux États-Unis. Fondée en 1847, c\'est la plus ancienne université de l\'État. L\'Université de l\'Iowa est organisée en 12 collèges offrant plus de 200 domaines d\'études et sept diplômes professionnels.\nSur un campus urbain de 1 880 acres sur les rives de la rivière Iowa, l\'Université de l\'Iowa est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". Au cours de l\'exercice 2021, les dépenses de recherche à Iowa se sont élevées à 818 millions de dollars. L\'université a été le développeur initial du diplôme de Master of Fine Arts et elle gère l\'Iowa Writers\' Workshop, qui a produit 17 des 46 lauréats du prix Pulitzer de l\'université. L\'Iowa est membre de l\'Association des universités américaines, de l\'Universities Research Association et de la Big Ten Academic Alliance.\nParmi les universités publiques aux États-Unis, l\'UI a été la première à devenir mixte et à accueillir un département d\'études religieuses; elle a également ouvert la première école de médecine mixte. Les 31 000 étudiants de l\'Université de l\'Iowa participent à près de 500 organisations étudiantes. Les 22 équipes sportives universitaires de l\'Iowa, les Iowa Hawkeyes, concourent en Division I de la NCAA et sont membres de la Big Ten Conference. Le réseau des anciens de l\'Université de l\'Iowa compte plus de 250 000 diplômés.', 14000),
(144, 2541, 'University of Kansas', 'History, Philosophy & Theology,Economics & Econometrics,Communication & Media Studies,Electrical & Electronic Engineering,Chemical Engineering,Mechanical & Aerospace Engineering,Psychology,Other Health,Agriculture & Forestry,Biological Sciences,Sport Science,Education,Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Business & Management,Chemistry,General Engineering,Computer Science,Sociology,Civil Engineering,Accounting & Finance,Art, Performing Arts & Design,Law,Geography,Languages, Literature & Linguistics,Medicine & Dentistry,Politics & International Studies (incl Development Studies),Architecture,Mathematics & Statistics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0b/University_of_Kansas_seal.svg/150px-University_of_Kansas_seal.svg.png', ' L\'Université du Kansas (KU) est une université publique de recherche dont le campus principal est situé à Lawrence, Kansas. Deux campus délocalisés se trouvent dans la région métropolitaine de Kansas City côté Kansas : l\'école de médecine et l\'hôpital de l\'université à Kansas City, Kansas, le campus Edwards à Overland Park. Il existe également des sites éducatifs et de recherche à Garden City, Hays, Leavenworth, Parsons et Topeka, un centre éducatif agricole dans le nord du comté de Douglas, ainsi que des antennes de l\'école de médecine à Salina et Wichita. L\'université est membre de l\'Association of American Universities et est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".\nFondée le 21 mars 1865, l\'université a ouvert ses portes en 1866 en vertu d\'une charte accordée par la législature de l\'État du Kansas en 1864 et d\'une loi adoptée en 1863 en vertu de la constitution de l\'État, adoptée deux ans après l\'admission en 1861 de l\'ancien territoire du Kansas comme 34e État dans l\'Union.\nÀ l\'automne 2022, 23 872 étudiants étaient inscrits sur les campus de Lawrence et Edwards, avec 2 836 étudiants supplémentaires inscrits au Centre médical de l\'Université du Kansas (KUMC), pour un effectif total de 26 708 étudiants sur les trois campus. Dans l\'ensemble, l\'université (y compris KUMC) comptait 3 196 membres du corps professoral (professeurs, administrateurs, bibliothécaires et personnel académique non classifié) à l\'automne 2022.\nLes équipes sportives du Kansas participent aux sports de la NCAA Division I sous le nom de Jayhawks, en tant que membres de la Big 12 Conference. Elles alignent 16 sports de niveau universitaire, ainsi que des sports de niveau club tels que le hockey sur glace, le rugby et le volleyball masculin.', 0),
(145, 2600, 'University of Kentucky', 'Geology, Environmental, Earth & Marine Sciences,Sociology,Chemical Engineering,Psychology,Chemistry,Architecture,Computer Science,Biological Sciences,Art, Performing Arts & Design,Medicine & Dentistry,Veterinary Science,Geography,Business & Management,Other Health,Agriculture & Forestry,Physics & Astronomy,Civil Engineering,Sport Science,Mechanical & Aerospace Engineering,History, Philosophy & Theology,Electrical & Electronic Engineering,Law,Economics & Econometrics,Education,Communication & Media Studies,Languages, Literature & Linguistics,Mathematics & Statistics,General Engineering,Politics & International Studies (incl Development Studies),Accounting & Finance', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/2d/University_of_Kentucky_seal.svg/180px-University_of_Kentucky_seal.svg.png', ' L\'Université du Kentucky (UK, UKY, ou U de K) est une université publique de recherche à Lexington, Kentucky. Fondée en 1865 par John Bryan Bowman sous le nom de Collège agricole et mécanique du Kentucky, l\'université est l\'une des deux universités du Kentucky bénéficiant du statut de terre-grant (l\'autre étant l\'Université d\'État du Kentucky). C\'est l\'établissement ayant le plus grand nombre d\'inscriptions dans l\'État, avec 32 710 étudiants à l\'automne 2022.\nL\'institution comprend 16 collèges, une école supérieure, 93 programmes de premier cycle, 99 programmes de master, 66 programmes de doctorat et quatre programmes professionnels. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\". Selon la National Science Foundation, le Kentucky a dépensé 393 millions de dollars en recherche et développement en 2018, le classant au 63e rang national.\nL\'Université du Kentucky dispose de sept bibliothèques sur le campus. La plus grande est la bibliothèque William T. Young, un dépôt fédéral, qui abrite des collections liées aux sciences sociales, aux humanités et aux sciences de la vie. Depuis 1997, l\'université a orienté de plus en plus ses dépenses vers la recherche, suite à un accord conclu par l\'Assemblée générale du Kentucky. La directive stipulait que l\'université devait devenir l\'une des 20 premières institutions de recherche publique, en termes de classement général, à déterminer par elle-même, d\'ici 2020. Deux anciens élèves de l\'université ont remporté des prix Nobel.', 0),
(146, 247, 'University of Maryland, Baltimore County', 'Sociology,Languages, Literature & Linguistics,Civil Engineering,Physics & Astronomy,Art, Performing Arts & Design,Biological Sciences,Psychology,Economics & Econometrics,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Geography,General Engineering,History, Philosophy & Theology,Agriculture & Forestry,Electrical & Electronic Engineering,Chemistry,Computer Science,Communication & Media Studies,Other Health,Accounting & Finance,Business & Management,Education,Mathematics & Statistics,Chemical Engineering', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/0e/UMB-logo_horizontal.png/220px-UMB-logo_horizontal.png', ' L\'Université du Maryland, Baltimore County (UMBC) est une université publique de recherche à Catonsville, Maryland. Elle comptait 13 991 étudiants à l\'automne 2022, proposait 61 filières de premier cycle, plus de 92 programmes de troisième cycle (38 masters, 25 doctorats et 29 certificats de troisième cycle) et le premier parc de recherche universitaire dans le Maryland. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".\nÉtablie en tant que partie du système universitaire du Maryland en 1966, l\'université est devenue le premier collège ou université public du Maryland à être inclusif envers toutes les races. L\'UMBC a le quatrième plus grand nombre d\'inscriptions dans le système universitaire du Maryland, se spécialisant dans les sciences naturelles et le génie, ainsi que dans les programmes en arts libéraux et sciences sociales. Sur le plan sportif, les Retrievers de l\'UMBC comptent 17 équipes de la Division I de la NCAA qui participent à la conférence America East.', 0),
(147, 922, 'University of Maryland, College Park', 'Chemical Engineering,Business & Management,Architecture,History, Philosophy & Theology,Chemistry,Other Health,Art, Performing Arts & Design,Electrical & Electronic Engineering,Archaeology,Politics & International Studies (incl Development Studies),Education,Sociology,Accounting & Finance,Mechanical & Aerospace Engineering,Physics & Astronomy,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Agriculture & Forestry,Communication & Media Studies,Veterinary Science,General Engineering,Economics & Econometrics,Sport Science,Geography,Biological Sciences,Mathematics & Statistics,Computer Science', 45, 'https://upload.wikimedia.org/wikipedia/en/thumb/3/3e/University_of_Maryland_seal.svg/150px-University_of_Maryland_seal.svg.png', ' The University of Maryland, College Park (Université du Maryland, UMD, ou simplement Maryland) est une université publique de recherche à College Park, Maryland. Fondée en 1856, l\'UMD est l\'établissement phare du système universitaire du Maryland. C\'est également la plus grande université de l\'État et de la région métropolitaine de Washington. Ses 12 écoles et collèges proposent plus de 200 programmes de premier cycle, dont 113 filières de premier cycle, 107 programmes de master et 83 programmes de doctorat. L\'UMD est membre de l\'Association of American Universities et participe aux compétitions sportives interuniversitaires en tant que membre de la Big Ten Conference.\nLa proximité de l\'Université du Maryland avec Washington, D.C., a conduit à de nombreux partenariats de recherche avec le gouvernement fédéral ; les enseignants reçoivent des financements de recherche et un soutien institutionnel de nombreux organismes tels que les National Institutes of Health, la NASA, le National Institute of Standards and Technology, la Food and Drug Administration, la National Security Agency et le Department of Homeland Security. Elle est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\" et a été qualifiée de \"Public Ivy\".\nEn 2016, l\'Université du Maryland, College Park et l\'Université du Maryland, Baltimore ont officialisé leur partenariat stratégique après leur collaboration visant à créer des programmes médicaux, scientifiques et éducatifs plus innovants, ainsi que des subventions de recherche plus importantes et des nominations conjointes de professeurs que chacun des campus n\'a pu accomplir seul. Selon la National Science Foundation, l\'université a consacré un total de 1,14 milliard de dollars à la recherche et au développement en 2021, la plaçant au 17e rang des universités américaines. En 2021, le budget de fonctionnement de l\'Université du Maryland était d\'environ 2,2 milliards de dollars.', 17000),
(149, 2954, 'University of Memphis', 'Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Education,Mechanical & Aerospace Engineering,Psychology,Economics & Econometrics,Law,Sociology,Accounting & Finance,Chemistry,History, Philosophy & Theology,Electrical & Electronic Engineering,Geography,Architecture,Languages, Literature & Linguistics,Physics & Astronomy,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,General Engineering,Communication & Media Studies,Computer Science,Biological Sciences,Other Health,Mathematics & Statistics,Business & Management,Sport Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f0/University_of_Memphis_seal.svg/130px-University_of_Memphis_seal.svg.png', ' The University of Memphis (Memphis) est une université publique de recherche à Memphis, Tennessee. Fondée en 1912, l\'université compte plus de 22 000 étudiants.\nL\'université abrite le Herff College of Engineering, le Center for Earthquake Research and Information (CERI), la Cecil C. Humphreys School of Law, la School of Communication Sciences and Disorders, l\'ancien campus de l\'Université Lambuth à Jackson, Tennessee (aujourd\'hui un campus délocalisé de l\'Université de Memphis), le Loewenberg College of Nursing, la School of Public Health, le College of Communication and Fine Arts, le FedEx Institute of Technology, l\'Advanced Distributed Learning Workforce Co-Lab, et l\'Institute of Egyptian Art and Archaeology. L\'Université de Memphis est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\".', 0),
(150, 986, 'University of Miami', 'Architecture,Education,Computer Science,Geology, Environmental, Earth & Marine Sciences,Business & Management,Biological Sciences,Psychology,Art, Performing Arts & Design,Civil Engineering,Physics & Astronomy,Languages, Literature & Linguistics,General Engineering,Communication & Media Studies,History, Philosophy & Theology,Electrical & Electronic Engineering,Mathematics & Statistics,Sociology,Other Health,Agriculture & Forestry,Accounting & Finance,Chemical Engineering,Sport Science,Economics & Econometrics,Law,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Mechanical & Aerospace Engineering,Geography,Chemistry', 36, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/27/University_of_Miami_seal.svg/150px-University_of_Miami_seal.svg.png', ' La University of Miami (UM, UMiami, Miami, U of M, et The U) est une université privée de recherche située à Coral Gables, en Floride. En 2022, l\'université comptait 19 402 étudiants répartis dans 12 collèges et écoles, proposant près de 350 filières académiques et programmes, dont la Leonard M. Miller School of Medicine dans le district de la santé de Miami, l\'école de droit sur le campus principal, la Rosenstiel School of Marine, Atmospheric, and Earth Science sur Virginia Key, ainsi que des installations de recherche supplémentaires dans le comté de Miami-Dade.\nL\'Université de Miami propose 138 programmes de premier cycle, 140 programmes de maîtrise et 67 programmes de doctorat. Depuis sa fondation en 1925, l\'université attire des étudiants des 50 États et de 173 pays étrangers. Avec 16 954 membres du corps professoral et du personnel en 2021, l\'Université de Miami est le deuxième plus grand employeur du comté de Miami-Dade. Le campus principal à Coral Gables s\'étend sur 240 acres, avec plus de 5 700 000 pieds carrés de bâtiments, et est situé à 11 km au sud du centre-ville de Miami, au cœur du neuvième plus grand centre métropolitain du pays et du 65e plus grand du monde. En 2022, elle est la 67e plus grande université de recherche du pays, avec des dépenses de recherche de 413 millions de dollars.\nEn 2022, l\'Université de Miami compte 224 967 anciens élèves depuis sa fondation en 1925. Les membres du corps professoral de l\'Université de Miami comprennent plusieurs universitaires notables dans presque toutes les disciplines, dont quatre lauréats du prix Nobel. L\'université est classée parmi les \"Universités doctorales : Très grande activité de recherche\" et est membre de l\'Association of American Universities.\nLes équipes sportives intercollégiales de l\'Université de Miami sont collectivement connues sous le nom de Miami Hurricanes et participent à la Division I de la National Collegiate Athletic Association. Son équipe de football a remporté cinq championnats nationaux depuis 1983, et son équipe de baseball en a remporté quatre depuis 1982. En 2023, son équipe de basket-ball masculin a atteint le Final Four du championnat NCAA Division I pour la première fois de son histoire.', 42000),
(151, 114, 'University of Michigan-Ann Arbor', 'Chemistry,Architecture,Agriculture & Forestry,Languages, Literature & Linguistics,Psychology,Sociology,Law,Computer Science,Chemical Engineering,Other Health,Archaeology,Mathematics & Statistics,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Civil Engineering,Electrical & Electronic Engineering,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Physics & Astronomy,Economics & Econometrics,General Engineering,Medicine & Dentistry,Education,Accounting & Finance,Biological Sciences,Sport Science,Business & Management,Communication & Media Studies,Geology, Environmental, Earth & Marine Sciences', 27, 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/93/Seal_of_the_University_of_Michigan.svg/150px-Seal_of_the_University_of_Michigan.svg.png', ' La University of Michigan (U-M, UMich, ou simplement Michigan) est une université publique de recherche située à Ann Arbor, au Michigan. Fondée en 1817, c\'est la plus ancienne institution d\'enseignement supérieur de l\'État. Michigan est l\'une des premières universités de recherche américaines et est membre fondateur de l\'Association of American Universities.\nL\'université est la plus grande en termes d\'effectifs dans l\'État du Michigan, avec plus de 52 000 étudiants en 2023. Elle est composée de dix-neuf collèges et propose 250 programmes de diplômes au niveau du premier cycle et des cycles supérieurs dans diverses disciplines des arts libéraux et des STEM (sciences, technologies, ingénierie et mathématiques). L\'université est classée parmi les \"R1 : Universités doctorales - Très grande activité de recherche\" selon la Classification Carnegie des institutions d\'enseignement supérieur. En 2021, elle s\'est classée au 3e rang des universités américaines en termes de dépenses de recherche selon la National Science Foundation. L\'université est accréditée par la Higher Learning Commission.\nLes équipes sportives de l\'Université du Michigan sont collectivement connues sous le nom de Wolverines. Elles participent à la Division I FBS de la NCAA en tant que membres de la Big Ten Conference. L\'université aligne actuellement des équipes de première division dans 29 sports sanctionnés par la NCAA. En 2022, les athlètes de l\'université ont remporté 188 médailles aux Jeux olympiques.\nParmi les anciens élèves notables de l\'université, on compte huit chefs d\'État ou chefs de gouvernement nationaux et étrangers, 47 sénateurs américains, 218 membres de la Chambre des représentants des États-Unis, 42 secrétaires du Cabinet américain et 41 gouverneurs américains.', 16000),
(152, 3066, 'University of Minnesota', 'Veterinary Science,Business & Management,Psychology,General Engineering,Physics & Astronomy,Electrical & Electronic Engineering,Medicine & Dentistry,Civil Engineering,Politics & International Studies (incl Development Studies),Geography,Mathematics & Statistics,Sociology,Agriculture & Forestry,Law,Biological Sciences,Chemistry,Archaeology,Art, Performing Arts & Design,Languages, Literature & Linguistics,Sport Science,Computer Science,History, Philosophy & Theology,Economics & Econometrics,Chemical Engineering,Other Health,Accounting & Finance,Architecture,Communication & Media Studies,Education,Geology, Environmental, Earth & Marine Sciences,Mechanical & Aerospace Engineering', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/8/86/Seal_of_the_University_of_Minnesota.svg/170px-Seal_of_the_University_of_Minnesota.svg.png', ' L\'Université du Minnesota (formellement l\'Université du Minnesota, Twin Cities) est une université publique de recherche et de transfert de terres située dans les Twin Cities de Minneapolis et Saint Paul, dans le Minnesota, aux États-Unis. Le campus Twin Cities comprend des emplacements à Minneapolis et à Falcon Heights, une banlieue de St. Paul, situés à environ 4,8 km l\'un de l\'autre. Le campus Twin Cities est le plus ancien et le plus grand du système de l\'Université du Minnesota et possède le neuvième plus grand effectif d\'étudiants du campus principal aux États-Unis, avec 52 376 étudiants au début de l\'année académique 2021–22. Il est l\'établissement phare du système de l\'Université du Minnesota et est organisé en 19 collèges, écoles et autres unités académiques majeures.\nLa législature territoriale du Minnesota a rédigé une charte pour l\'Université du Minnesota en tant qu\'université territoriale en 1851, sept ans avant que le Minnesota ne devienne un État. Aujourd\'hui, l\'université est classée parmi les \"R1: Universités doctorales - Très grande activité de recherche\". Le Minnesota est membre de l\'Association of American Universities. La National Science Foundation a classé l\'Université du Minnesota au 22e rang des universités américaines pour les dépenses de recherche et développement en 2021 avec 1,07 milliard de dollars. Les professeurs, anciens élèves et chercheurs de l\'Université du Minnesota ont remporté 26 prix Nobel et 3 prix Pulitzer. Parmi ses anciens élèves, l\'université compte 25 boursiers Rhodes, 7 boursiers Marshall, 21 boursiers Truman, et 134 récipiendaires de la bourse Fulbright. L\'Université du Minnesota est considérée comme une université Public Ivy.\nLes Minnesota Golden Gophers participent à 21 sports interuniversitaires dans la NCAA Division I de la Big Ten Conference et ont remporté 29 championnats nationaux. En 2021, les étudiants actuels et anciens du Minnesota ont remporté un total de 76 médailles olympiques.', 0);
