(153, 4564, 'University of Missouri-St Louis', 'Art, Performing Arts & Design,Mathematics & Statistics,Archaeology,Physics & Astronomy,History, Philosophy & Theology,Civil Engineering,Computer Science,Economics & Econometrics,Sociology,Accounting & Finance,Electrical & Electronic Engineering,Chemistry,Business & Management,Mechanical & Aerospace Engineering,Communication & Media Studies,Languages, Literature & Linguistics,Psychology,Other Health,Education,Biological Sciences,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b8/University_of_Missouri_seal.svg/150px-University_of_Missouri_seal.svg.png', ' L\'Université du Missouri–St. Louis (UMSL) est une université publique de recherche à St. Louis, Missouri, aux États-Unis. Fondée en 1963, c\'est la plus récente des quatre universités du système de l\'Université du Missouri. Situé sur les anciens terrains du Bellerive Country Club, le campus de l\'université s\'étend dans les municipalités de Bellerive, Bel-Nor et Normandy. Des installations supplémentaires se trouvent sur le site de l\'ancien collège Marillac et à Grand Center, tous deux situés dans la ville de St. Louis.\nDes programmes de licence, de master et de doctorat sont proposés par le Collège des arts et des sciences, le Collège d\'administration des affaires, le Collège de l\'éducation, le Collège des soins infirmiers, l\'École de travail social et le Collège d\'optométrie. L\'école de commerce est accréditée AACSB et est la seule université publique de la région de St. Louis à être également accréditée AACSB en comptabilité. Des programmes préprofessionnels, un programme conjoint d\'ingénierie avec l\'Université Washington à St. Louis et des programmes du soir sont également proposés. UMSL abrite une école d\'optométrie, offrant à ses étudiants un doctorat en optométrie (OD). Le Pierre Laclede Honors College est le programme d\'honneurs d\'UMSL. UMSL est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nL\'université possède deux bibliothèques : la bibliothèque Thomas Jefferson, qui est la bibliothèque principale de l\'université, et la bibliothèque St. Louis Mercantile, fondée en 1846 et la plus ancienne bibliothèque à l\'ouest du fleuve Mississippi. Le campus compte deux arrêts sur MetroLink, le système de tram léger régional de St. Louis. Un centre étudiant, des bâtiments universitaires, des structures de stationnement, un centre des arts du spectacle et des logements résidentiels ont été construits au cours des dix dernières années dans le cadre de programmes d\'amélioration du campus. L\'université a un accord de double inscription avec l\'Université du Golfe pour les sciences et la technologie au Koweït. KWMU (90.7 FM), qui est la station phare de National Public Radio dans la région de St. Louis et connue à l\'antenne sous le nom de St. Louis Public Radio, est détenue et autorisée par UMSL.\nUMSL compte 10 431 étudiants qui suivent des cours sur le campus, contre 6 010 étudiants qui suivent des cours hors campus, la plupart étant des étudiants inscrits simultanément dans des lycées de la région. L\'université compte l\'équivalent de 9 488 étudiants à temps plein. UMSL a historiquement été une université pour les navetteurs de St. Louis, avec seulement environ 1 200 étudiants vivant sur le campus.', 0),
(154, 3080, 'University of Montana', 'Law,Geology, Environmental, Earth & Marine Sciences,Sociology,Physics & Astronomy,Languages, Literature & Linguistics,Education,Chemistry,Art, Performing Arts & Design,Computer Science,Sport Science,Communication & Media Studies,History, Philosophy & Theology,Other Health,Biological Sciences,Accounting & Finance,Economics & Econometrics,Mathematics & Statistics,Psychology,Business & Management,Geography,Medicine & Dentistry,Agriculture & Forestry,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/e/e9/University_of_Montana_seal.png', ' L\'Université du Montana (UMT) est une université publique de recherche à Missoula, Montana. UM est l\'institution phare du système universitaire du Montana et son deuxième plus grand campus. L\'UM a rapporté 10 962 étudiants de premier cycle et des cycles supérieurs à l\'automne 2018. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\" en 2022.\nL\'Université du Montana se classe 17e nationalement et cinquième parmi les universités publiques dans la production de boursiers Rhodes; elle compte 11 boursiers Truman, 14 boursiers Goldwater et 40 boursiers Udall. Un ancien élève, Harold Urey, a remporté le prix Nobel.', 0),
(155, 3539, 'University of Nebraska Medical Center', 'Psychology,Medicine & Dentistry,Other Health,Education,Biological Sciences', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a2/Seal_of_the_University_of_Nebraska.svg/175px-Seal_of_the_University_of_Nebraska.svg.png', ' L\'University of Nebraska Medical Center (UNMC) est un centre public des sciences de la santé universitaire à Omaha, Nebraska. Fondé en 1869 et charté en tant que collège de médecine privé en 1881, l\'UNMC est devenu partie intégrante du système de l\'University of Nebraska en 1902. En expansion rapide au début du XXe siècle, l\'université a fondé un hôpital, une école de médecine dentaire, une école de pharmacie, une école d\'infirmières et une école de médecine. Elle a ensuite ajouté des écoles de santé publique et de professions paramédicales. L\'UNMC, l\'un des principaux employeurs d\'Omaha, a un budget annuel de 841,6 millions de dollars pour 2020 à 2021 et un impact économique de 4,8 milliards de dollars.', 0),
(156, 2616, 'University of Nebraska-Lincoln', 'Art, Performing Arts & Design,Electrical & Electronic Engineering,Veterinary Science,Sociology,Architecture,Education,Sport Science,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Mathematics & Statistics,Mechanical & Aerospace Engineering,Communication & Media Studies,Chemical Engineering,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Other Health,Psychology,Economics & Econometrics,Civil Engineering,Chemistry,History, Philosophy & Theology,General Engineering,Physics & Astronomy,Archaeology,Law,Biological Sciences,Business & Management,Computer Science,Agriculture & Forestry,Geography', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/University_of_Nebraska%E2%80%93Lincoln_logo.svg/233px-University_of_Nebraska%E2%80%93Lincoln_logo.svg.png', ' L\'University of Nebraska–Lincoln (Nebraska ou UNL) est une université publique de recherche agraire à Lincoln, Nebraska, aux États-Unis. Charte en 1869 par la Législature du Nebraska dans le cadre du Morrill Act de 1862, l\'école était l\'University of Nebraska jusqu\'en 1968, date à laquelle elle a absorbé la Municipal University of Omaha pour former le système University of Nebraska. C\'est la plus ancienne université de l\'État et l\'institution phare du système à l\'échelle de l\'État. L\'université est dirigée par le Board of Regents depuis 1871, dont les membres sont élus par district pour des mandats de six ans.\nL\'université est organisée en neuf collèges : Sciences agricoles et ressources naturelles, Architecture, Arts et sciences, Commerce, Éducation et sciences humaines, Génie, Beaux-arts et arts du spectacle, Journalisme et communications de masse, et Droit. L\'UNL propose plus de deux cents diplômes dans ses programmes de premier cycle, de cycle supérieur et de doctorat. L\'école propose également des programmes par le biais du College of Public Affairs and Community Service de l\'University of Nebraska Omaha, du College of Dentistry et du College of Nursing de l\'University of Nebraska Medical Center, et du Peter Kiewit Institute, géré en partenariat avec la Kiewit Corporation.\nNebraska est classée parmi les \"R1: Universités doctorales - Très haute activité de recherche\". Selon la National Science Foundation, le Nebraska a dépensé 320 millions de dollars en recherche et développement en 2020. Entre ses trois campus (City Campus, East Campus et Nebraska Innovation Campus), l\'université compte plus d\'une centaine de bâtiments de salles de classe et d\'installations de recherche. L\'inscription à l\'université en 2021 était de 19 552 étudiants de premier cycle et 4 879 étudiants diplômés, avec 1 595 membres du corps professoral à temps plein ou à temps partiel. L\'admission au premier cycle à l\'école est considérée comme \"plus sélective\".\nLes programmes sportifs de Nebraska, connus sous le nom de Cornhuskers, participent à la Division I de la NCAA et sont membres de la Big Ten Conference. L\'équipe de football de l\'UNL a remporté quarante-six championnats de conférence et revendique cinq championnats nationaux, avec neuf supplémentaires non revendiqués. Vingt-cinq anciens Cornhuskers ont été intronisés au College Football Hall of Fame. Un total de 111 anciens étudiants-athlètes de Nebraska ont remporté cinquante-quatre médailles olympiques, dont seize médailles d\'or. Parmi environ 300 000 anciens élèves de Nebraska figurent trois lauréats du prix Nobel, quatre lauréats du prix Pulitzer, un lauréat du prix Turing et vingt-deux boursiers Rhodes.', 0),
(157, 2526, 'University of Nevada, Las Vegas', 'Languages, Literature & Linguistics,Physics & Astronomy,Electrical & Electronic Engineering,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Civil Engineering,General Engineering,Sociology,Sport Science,Education,Agriculture & Forestry,Architecture,Economics & Econometrics,Computer Science,Psychology,Archaeology,Veterinary Science,Art, Performing Arts & Design,Medicine & Dentistry,Chemistry,Mechanical & Aerospace Engineering,Geography,Business & Management,Mathematics & Statistics,History, Philosophy & Theology,Communication & Media Studies,Other Health,Law,Biological Sciences,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/1e/University_of_Nevada%2C_Reno_seal.svg/180px-University_of_Nevada%2C_Reno_seal.svg.png', ' La University of Nevada, Las Vegas (UNLV) est une université publique de recherche agraire à Paradise, Nevada. Le campus de 332 acres (134 hectares) se trouve à environ 1,6 mile (2,6 km) à l\'est du Strip de Las Vegas. Elle faisait autrefois partie de l\'University of Nevada de 1957 à 1969. Elle comprend le campus de Shadow Lane, juste à l\'est de l\'University Medical Center of Southern Nevada, qui abrite à la fois la School of Medicine et la School of Dental Medicine. L\'école de droit de l\'UNLV, la William S. Boyd School of Law, est la seule école de droit de l\'État.\nElle est classée parmi les \"R1 : Universités doctorales - Très haute activité de recherche\". Selon la National Science Foundation, l\'UNLV a dépensé 83 millions de dollars en recherche et développement en 2018, la classant au 165e rang national.', 0),
(158, 45, 'University of New Mexico (Main campus)', 'Mechanical & Aerospace Engineering,Biological Sciences,Other Health,Economics & Econometrics,Sociology,Education,Law,Geography,Medicine & Dentistry,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Civil Engineering,Chemical Engineering,History, Philosophy & Theology,Electrical & Electronic Engineering,General Engineering,Psychology,Mathematics & Statistics,Sport Science,Art, Performing Arts & Design,Business & Management,Communication & Media Studies,Chemistry,Languages, Literature & Linguistics,Architecture,Computer Science,Politics & International Studies (incl Development Studies),Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f2/University_of_New_Mexico.jpeg/150px-University_of_New_Mexico.jpeg', ' La University of New Mexico (UNM ; espagnol : Universidad de Nuevo México) est une université publique de recherche à Albuquerque, au Nouveau-Mexique. Fondée en 1889 par la législature territoriale du Nouveau-Mexique, c\'est la deuxième plus ancienne université de l\'État, l\'une des deux universités phares de l\'État, et la plus grande en termes d\'effectifs, avec plus de 25 400 étudiants en 2021.\nL\'UNM comprend douze collèges et écoles, dont une école de médecine et la seule école de droit du Nouveau-Mexique. Elle propose 215 programmes de diplômes et de certificats, dont 94 baccalauréats, 71 masters et 37 doctorats. Le campus principal s\'étend sur 800 acres (320 hectares) dans le centre d\'Albuquerque, avec des campus annexes à Gallup, Los Alamos, Rio Rancho, Taos et Los Lunas.\nL\'UNM est identifiée comme ayant une \"activité de recherche très élevée\" par la Classification Carnegie. Selon la National Science Foundation, elle a dépensé plus de 243 millions de dollars en recherche et développement en 2021, se classant au 103e rang aux États-Unis. L\'UNM est classée comme une institution desservant les Hispaniques (HSI) par le département de l\'Éducation des États-Unis, avec près de la moitié de ses étudiants étant d\'origine hispanique.\nLes 16 programmes sportifs de l\'UNM, connus sous le nom de Lobos, participent à la Division I de la NCAA (FBS pour le football) et sont membres de la Mountain West Conference ; l\'école a remporté des championnats nationaux de ski et de cross-country. Les couleurs officielles de l\'UNM sont la cerise et l\'argent. L\'école compte environ 200 000 anciens élèves dans le monde entier.', 0),
(159, 770, 'University of North Carolina at Chapel Hill', 'Law,Chemistry,Communication & Media Studies,Archaeology,Education,Accounting & Finance,Biological Sciences,Psychology,Geology, Environmental, Earth & Marine Sciences,Mathematics & Statistics,Other Health,Art, Performing Arts & Design,Sociology,Languages, Literature & Linguistics,General Engineering,Medicine & Dentistry,Politics & International Studies (incl Development Studies),Business & Management,Architecture,Geography,Sport Science,Agriculture & Forestry,Economics & Econometrics,History, Philosophy & Theology,Computer Science,Physics & Astronomy', 24, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/5c/University_of_North_Carolina_at_Chapel_Hill_seal.svg/150px-University_of_North_Carolina_at_Chapel_Hill_seal.svg.png', ' La University of North Carolina at Chapel Hill (UNC, UNC-Chapel Hill, North Carolina, Chapel Hill, ou simplement Carolina) est une université publique de recherche à Chapel Hill, en Caroline du Nord. Elle est la principale institution du système de l\'Université de Caroline du Nord. Après avoir été chartée en 1789, l\'université a commencé à accueillir des étudiants en 1795, ce qui en fait l\'une des plus anciennes universités publiques des États-Unis.\nL\'université propose des diplômes dans plus de 70 domaines d\'études et est administrativement divisée en 13 écoles professionnelles distinctes et une unité principale, le College of Arts & Sciences. Elle est classée parmi les \"R1: Doctoral Universities – Very high research activity\" et est membre de l\'Association of American Universities (AAU). La National Science Foundation a classé UNC–Chapel Hill au 13e rang des universités américaines pour les dépenses de recherche et développement en 2021, avec 1,2 milliard de dollars.\nLe campus s\'étend sur 760 acres (310 hectares), englobant le planétarium Morehead et de nombreux magasins situés sur Franklin Street. Les étudiants peuvent participer à plus de 550 organisations étudiantes officiellement reconnues. UNC Chapel Hill est l\'un des membres fondateurs de l\'Atlantic Coast Conference, fondée le 14 juin 1953. Les équipes sportives de l\'université compétitionnent sous le nom des Tar Heels.', 11000),
(160, 774, 'University of North Carolina at Charlotte', 'History, Philosophy & Theology,Geography,Art, Performing Arts & Design,Education,General Engineering,Biological Sciences,Chemistry,Languages, Literature & Linguistics,Physics & Astronomy,Accounting & Finance,Mathematics & Statistics,Architecture,Politics & International Studies (incl Development Studies),Business & Management,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Communication & Media Studies,Other Health,Psychology,Computer Science,Electrical & Electronic Engineering,Mechanical & Aerospace Engineering,Sport Science,Sociology,Civil Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/8/8f/UNC_Charlotte_seal.png/150px-UNC_Charlotte_seal.png', ' La University of North Carolina à Charlotte (ou Charlotte) est une université publique de recherche à Charlotte, en Caroline du Nord. UNC Charlotte propose 24 programmes de doctorat, 66 programmes de master et 79 programmes de baccalauréat répartis dans neuf collèges. Elle est classée parmi les \"R2: Doctoral Universities – High research activity\".\nL\'université a connu une croissance rapide des effectifs à la fin des années 2000 et au début des années 2010, devenant l\'institution à la croissance la plus rapide du système UNC.\nElle possède trois campus : le Charlotte Research Institute Campus, le Center City Campus et le campus principal situé dans University City. Le campus principal s\'étend sur 1 000 acres boisés avec environ 85 bâtiments, à environ 8 miles (13 km) du centre-ville de Charlotte.', 0),
(161, 1869, 'University of North Carolina at Greensboro', 'Politics & International Studies (incl Development Studies),Communication & Media Studies,Art, Performing Arts & Design,Law,Sociology,Biological Sciences,Geography,Economics & Econometrics,Medicine & Dentistry,Psychology,Computer Science,Mathematics & Statistics,History, Philosophy & Theology,Education,Physics & Astronomy,Languages, Literature & Linguistics,Chemistry,Archaeology,Accounting & Finance,Sport Science,Business & Management,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e8/University_of_North_Carolina_at_Greensboro_seal.svg/150px-University_of_North_Carolina_at_Greensboro_seal.svg.png', ' La University of North Carolina à Greensboro (UNCG ou UNC Greensboro) est une université publique de recherche à Greensboro, en Caroline du Nord. Elle fait partie du système de l\'Université de Caroline du Nord. Elle est accréditée par la Southern Association of Colleges and Schools Commission on Colleges pour délivrer des diplômes de premier cycle, des maîtrises, des spécialisations et des doctorats.\nL\'université propose plus de 100 programmes de premier cycle, 61 programmes de maîtrise et 26 programmes de doctorat. UNCG abrite également le Weatherspoon Art Museum.', 0),
(162, 5268, 'University of North Carolina Wilmington', 'Chemistry,Sport Science,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Mathematics & Statistics,Electrical & Electronic Engineering,Biological Sciences,Sociology,Languages, Literature & Linguistics,Physics & Astronomy,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Other Health,Education,Communication & Media Studies,Computer Science,Geography,Psychology,History, Philosophy & Theology,Business & Management,General Engineering,Agriculture & Forestry,Accounting & Finance', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/77/UNC_Wilmington_seal.png/150px-UNC_Wilmington_seal.png', ' La University of North Carolina à Wilmington, ou University of North Carolina at Wilmington (UNCW ou UNC Wilmington), est une université publique de recherche à Wilmington, en Caroline du Nord. Elle fait partie du système de l\'Université de Caroline du Nord et accueille chaque année 17 499 étudiants de premier cycle et des cycles supérieurs. Elle est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\".\nFondée le 4 septembre 1947, Wilmington College a ouvert en tant que collège junior, fournissant principalement une éducation aux anciens combattants de la Seconde Guerre mondiale. L\'établissement est devenu un collège universitaire de quatre ans en 1963, suite à une législation de l\'Assemblée générale de Caroline du Nord. En 1969, le collège est devenu une université et a été renommé University of North Carolina Wilmington. Aujourd\'hui, elle dispose de trois campus, avec le campus principal à Wilmington, un campus d\'extension à Jacksonville, en Caroline du Nord, et le Center for Marine Science près de Myrtle Grove.', 0),
(163, 2252, 'University of North Florida', 'Business & Management,Psychology,Accounting & Finance,Physics & Astronomy,Computer Science,Mathematics & Statistics,Economics & Econometrics,Chemistry,Languages, Literature & Linguistics,Mechanical & Aerospace Engineering,Sociology,Other Health,Civil Engineering,Geography,Art, Performing Arts & Design,Biological Sciences,Education,Geology, Environmental, Earth & Marine Sciences,Communication & Media Studies,History, Philosophy & Theology,Sport Science,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies)', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b7/UofNorthFloridaSeal.png/150px-UofNorthFloridaSeal.png', ' La University of North Florida (UNF) est une université publique de recherche située à Jacksonville, en Floride. Elle fait partie du système universitaire de l\'État de la Floride et est accréditée par la Commission des collèges de l\'Association des collèges et écoles du Sud pour délivrer des diplômes de premier cycle, des maîtrises et des doctorats. Son campus s\'étend sur 1 300 acres au milieu d\'une réserve naturelle dans le quartier de Southside à Jacksonville. Elle est classée parmi les \"R2 : Universités doctorales - Activité de recherche élevée\". Le président actuel est Moez Limayem.\nLa UNF a été créée en 1965 et a commencé à offrir des cours en 1972. Initialement désignée comme un collège du deuxième cycle pour les juniors et les seniors, elle a commencé à admettre des étudiants de première année en 1984. La UNF est organisée en six collèges, dont cinq proposent des programmes de premier cycle et des cycles supérieurs, y compris des programmes de doctorat, avec des programmes notables en affaires, biologie côtière, soins infirmiers, nutrition et musique. La plupart des étudiants résident hors campus, bien qu\'il existe six zones de logements sur le campus. En 2006, le bâtiment des sciences sociales est devenu le premier bâtiment certifié LEED dans le nord-est de la Floride, ainsi que le premier bâtiment \"vert\" sur le campus. En 2010, cinq bâtiments du campus ont été certifiés par le U.S. Green Building Council.\nL\'université compte plus de 200 clubs et organisations pour les étudiants, ainsi qu\'un gouvernement étudiant actif et une vie grecque. Le journal étudiant The Spinnaker est publié mensuellement. Les équipes sportives intercollégiales de l\'université sont connues sous le nom d\'Ospreys et sont membres de la ASUN Conference en NCAA Division I.', 0),
(165, 3356, 'University of Oklahoma', 'Geography,Languages, Literature & Linguistics,Biological Sciences,Politics & International Studies (incl Development Studies),Education,Communication & Media Studies,Accounting & Finance,Electrical & Electronic Engineering,Sport Science,Medicine & Dentistry,Economics & Econometrics,Law,General Engineering,Architecture,History, Philosophy & Theology,Business & Management,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Psychology,Civil Engineering,Sociology,Physics & Astronomy,Computer Science,Other Health,Archaeology,Chemical Engineering,Chemistry,Mathematics & Statistics', 74, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/56/University_of_Oklahoma_seal.svg/150px-University_of_Oklahoma_seal.svg.png', ' La University of Oklahoma (OU) est une université publique de recherche située à Norman, Oklahoma, aux États-Unis. Fondée en 1890, elle a existé dans le Territoire de l\'Oklahoma près du Territoire indien pendant 17 ans avant que les deux territoires ne deviennent l\'État de l\'Oklahoma. À l\'automne 2023, l\'université comptait 32 676 étudiants inscrits, la plupart sur son campus principal à Norman. Employant près de 4 000 membres du corps professoral, l\'université propose 174 programmes de premier cycle, 199 programmes de maîtrise, 101 programmes de doctorat et 88 programmes de certificat.\nL\'université est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\", avec plus de 416 millions de dollars de dépenses de recherche sur ses trois campus pour l\'exercice financier 2022. Son campus de Norman abrite deux musées renommés, le Fred Jones Jr. Museum of Art, spécialisé dans l\'impressionnisme français et l\'art amérindien, et le Sam Noble Oklahoma Museum of Natural History, spécialisé dans l\'histoire naturelle de l\'Oklahoma.\nLa University of Oklahoma a remporté 43 championnats nationaux par équipe, plaçant les Sooners au 13e rang de tous les temps des titres de l\'équipe de la NCAA. OU se classe également 7e de tous les temps pour le nombre d\'Académiciens athlètes de la NCAA avec 215 athlètes. L\'équipe de softball féminin a remporté le championnat national sept fois : en 2000, 2013, et consécutivement en 2016 et 2017, puis en 2021, 2022 et 2023. Les équipes de gymnastique ont remporté un total de 18 championnats nationaux, l\'équipe masculine remportant huit titres au cours des 15 dernières années, dont trois titres consécutifs de 2015 à 2017.\nDepuis les Jeux olympiques de 1932 à Los Angeles, les Sooners ont également produit 82 Olympiens (5 entraîneurs et 77 athlètes) et remporté 23 médailles pendant cette période, plaçant OU parmi les meilleures universités pour la production d\'athlètes olympiques.', 20000),
(166, 1426, 'University of Oregon', 'History, Philosophy & Theology,Computer Science,Other Health,Politics & International Studies (incl Development Studies),Languages, Literature & Linguistics,Law,Geography,Art, Performing Arts & Design,Chemistry,Business & Management,Psychology,Economics & Econometrics,Physics & Astronomy,Architecture,Geology, Environmental, Earth & Marine Sciences,Education,Sociology,Accounting & Finance,Mathematics & Statistics,Biological Sciences,Communication & Media Studies', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/28/University_of_Oregon_seal.svg/140px-University_of_Oregon_seal.svg.png', ' La University of Oregon (UO, U d\'O ou Oregon) est une université publique de recherche située à Eugene, Oregon. Fondée en 1876, l\'université dispose également de deux emplacements à Portland, gère une station marine appelée l\'Oregon Institute of Marine Biology à Charleston, et un observatoire appelé Pine Mountain Observatory dans le centre de l\'Oregon.\nLa University of Oregon est organisée en neuf collèges et écoles et propose 316 programmes de premier cycle et de cycle supérieur. La plupart des programmes académiques suivent le système trimestriel de 10 semaines. L\'université est classée parmi les \"R1 : Universités doctorales - Activité de recherche très élevée\" et est membre de l\'Association of American Universities. Depuis juillet 2014, l\'UO est dirigée par son propre conseil d\'administration.\nLe campus de 295 acres de l\'UO est situé le long de la rivière Willamette. Les étudiants-athlètes de l\'UO concourent en tant que Ducks et font partie de la conférence Pac-12 de la National Collegiate Athletic Association (NCAA). Avec dix-huit équipes de niveau universitaire, les Oregon Ducks sont surtout connus pour leur équipe de football et leur programme d\'athlétisme. Ces deux équipes sont même incorporées dans la conception du logo \"O\" de l\'école. À l\'été 2022, l\'UO a accueilli les Championnats du monde d\'athlétisme 2022. C\'était la première fois que l\'événement se déroulait aux États-Unis. Les couleurs de l\'université sont le vert et le jaune.\nL\'université entretient une relation longue et complexe avec Nike, Inc., et le cofondateur de l\'entreprise, Phil Knight. En conséquence du désinvestissement de l\'État dans l\'enseignement supérieur à partir des années 1990, l\'UO a adopté une image de \"University of Nike\". Alimentée par d\'importants investissements dans l\'infrastructure sportive, cette tendance s\'est accélérée ces dernières années. Knight, un ancien étudiant, a plaidé en faveur à la fois de la renommée sportive et de l\'augmentation de la privatisation de l\'université, et a fait don de plus de 1 milliard de dollars à l\'UO depuis la fin des années 1980, dont une grande partie est allée au sport universitaire. Le logo \"O\" de l\'école a été conçu par Nike en 1998, et les projets d\'installations sportives sur le campus impliquent généralement à la fois Knight et Nike.', 0),
(167, 3744, 'University of Pennsylvania', 'Economics & Econometrics,Archaeology,Medicine & Dentistry,Geography,Accounting & Finance,Geology, Environmental, Earth & Marine Sciences,Law,Veterinary Science,Sociology,Biological Sciences,Psychology,Civil Engineering,Computer Science,Sport Science,Languages, Literature & Linguistics,Mathematics & Statistics,Communication & Media Studies,Agriculture & Forestry,Other Health,Business & Management,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),Chemistry,Electrical & Electronic Engineering,Art, Performing Arts & Design,Chemical Engineering,Education,Architecture,Physics & Astronomy,General Engineering,History, Philosophy & Theology', 9, 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/92/UPenn_shield_with_banner.svg/150px-UPenn_shield_with_banner.svg.png', ' L\'Université de Pennsylvanie (Penn ou UPenn) est une université de recherche privée de l\'Ivy League située à Philadelphie, en Pennsylvanie. Elle fait partie des neuf collèges coloniaux et a été chartée avant la Déclaration d\'indépendance des États-Unis lorsque Benjamin Franklin, fondateur et premier président de l\'université, plaidait en faveur d\'une institution éducative formant des leaders dans le domaine universitaire, le commerce et la fonction publique. Penn se présente comme la quatrième institution d\'enseignement supérieur la plus ancienne aux États-Unis, bien que cette affirmation soit contestée par d\'autres universités, car Franklin a convoqué pour la première fois le conseil d\'administration en 1749, ce qui en fait arguably la cinquième institution la plus ancienne d\'enseignement supérieur aux États-Unis.\nL\'université compte quatre écoles de premier cycle et 12 écoles supérieures et professionnelles. Les écoles accueillant des étudiants de premier cycle comprennent le College of Arts and Sciences, la School of Engineering and Applied Science, la Wharton School et la School of Nursing. Parmi ses écoles supérieures bien classées figurent sa faculté de droit, dont le premier professeur James Wilson a participé à la rédaction du premier projet de la Constitution américaine, sa faculté de médecine, la première école de médecine établie en Amérique du Nord, et Wharton, la première école de commerce universitaire du pays. La dotation de Penn est de 20,7 milliards de dollars, ce qui en fait la sixième institution académique privée la plus riche du pays en 2022. En 2021, elle se classait au 4e rang des universités américaines en termes de dépenses de recherche selon la National Science Foundation.\nLe campus principal de l\'Université de Pennsylvanie est situé dans le quartier de University City à l\'ouest de Philadelphie et est centré autour de College Hall. Parmi les repères notables du campus, citons Houston Hall, la première union étudiante moderne, et Franklin Field, le premier stade de football américain universitaire à deux niveaux du pays et le plus ancien stade de football américain universitaire de la NCAA en fonctionnement continu. Le programme sportif de l\'université, les Penn Quakers, aligne des équipes universitaires dans 33 sports en tant que membre de la conférence Ivy League de la NCAA Division I.\nDepuis sa fondation, les anciens élèves, les administrateurs et les professeurs de Penn comprennent 8 signataires de la Déclaration d\'indépendance des États-Unis, 7 signataires de la Constitution, 3 présidents des États-Unis, 3 juges de la Cour suprême des États-Unis, 32 sénateurs des États-Unis, 163 membres de la Chambre des représentants des États-Unis, 19 secrétaires du Cabinet des États-Unis, 46 gouverneurs, 28 juges de la Cour suprême d\'État et 9 chefs d\'État étrangers. Les anciens élèves et les professeurs incluent 39 lauréats du prix Nobel, 4 lauréats du prix Turing et un lauréat de la médaille Fields. Penn a diplômé 32 boursiers Rhodes et 21 boursiers Marshall. En 2022, Penn compte le plus grand nombre d\'anciens élèves de premier cycle milliardaires de toutes les universités (17, en ne comptant que les quatre écoles de premier cycle de Penn). Les anciens élèves de Penn ont remporté 53 Tony Awards, 17 Grammy Awards, 25 Emmy Awards et 13 Oscars. Au moins 43 anciens élèves de Penn ont remporté 81 médailles olympiques (26 d\'or). 2 anciens élèves de Penn ont été astronautes de la NASA et 5 anciens élèves de Penn ont reçu la Médaille d\'honneur.', 24000),
(168, 3780, 'University of Pittsburgh-Pittsburgh campus', 'Mathematics & Statistics,Physics & Astronomy,Law,Other Health,Biological Sciences,Computer Science,Art, Performing Arts & Design,Education,Geography,Communication & Media Studies,Architecture,Accounting & Finance,Sport Science,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Business & Management,Chemistry,Sociology,Economics & Econometrics,Politics & International Studies (incl Development Studies),Medicine & Dentistry,Civil Engineering,Psychology,Languages, Literature & Linguistics,General Engineering,History, Philosophy & Theology,Mechanical & Aerospace Engineering,Electrical & Electronic Engineering', 60, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/fb/University_of_Pittsburgh_seal.svg/150px-University_of_Pittsburgh_seal.svg.png', ' L\'Université de Pittsburgh (également connue sous le nom de Pitt) est une université de recherche publique liée à l\'État située à Pittsburgh, en Pennsylvanie, aux États-Unis. L\'université est composée de 17 écoles et collèges de premier cycle et de cycles supérieurs sur son campus urbain de Pittsburgh, abritant l\'administration centrale de l\'université et environ 28 000 étudiants de premier cycle et cycles supérieurs. Le campus de Pittsburgh, d\'une superficie de 132 acres, comprend divers bâtiments historiques faisant partie du district historique de Schenley Farms, notamment sa pièce maîtresse de style gothique de 42 étages, la Cathedral of Learning. Pitt est membre de l\'Association of American Universities et est classée parmi les \"R1: Universités doctorales - Très haute activité de recherche\".[7] C\'est le deuxième plus grand employeur non gouvernemental de la région métropolitaine de Pittsburgh.\nPitt remonte à l\'Académie de Pittsburgh fondée par Hugh Henry Brackenridge en 1787. Alors que la ville était encore à la frontière américaine à l\'époque, la croissance rapide de Pittsburgh signifiait qu\'une université convenable était bientôt nécessaire, et la charte de Pitt a été modifiée en 1819 pour lui conférer le statut d\'université sous le nom de Western University of Pennsylvania. Après avoir survécu à deux incendies dévastateurs et plusieurs déménagements, l\'université s\'est installée à son emplacement actuel dans le quartier d\'Oakland à Pittsburgh, et par décret de la législature de l\'État, elle a été rebaptisée Université de Pittsburgh en 1908. Pitt était une institution privée jusqu\'en 1966, date à laquelle elle est devenue partie du Commonwealth System of Higher Education. Le campus est situé à proximité des installations médicales phares de son University of Pittsburgh Medical Center (UPMC) étroitement affilié et de son hôpital phare, UPMC Presbyterian, ainsi que des musées Carnegie de Pittsburgh, du parc Schenley et de l\'Université Carnegie Mellon. L\'université exploite également quatre campus de premier cycle en Pennsylvanie occidentale, situés à Bradford, Greensburg, Johnstown et Titusville.\nSur le plan sportif, Pitt participe à la Division I de la NCAA en tant que Pittsburgh Panthers, principalement en tant que membres de l\'Atlantic Coast Conference. Les athlètes de Pitt ont remporté un total de cinq médailles olympiques. Parmi les anciens élèves, les professeurs et le personnel, on compte 8 boursiers Rhodes, 10 boursiers Marshall et 297 boursiers Fulbright.[8] Les anciens et actuels professeurs et anciens élèves de Pitt comprennent six lauréats du prix Nobel, trois lauréats du prix Pulitzer, trois lauréats d\'un Oscar, des membres de l\'Académie américaine des arts et des sciences, sept sénateurs américains, trois membres du cabinet des États-Unis et cinq gouverneurs d\'États américains.', 22000),
(170, 4069, 'University of Rochester', 'Electrical & Electronic Engineering,Education,Politics & International Studies (incl Development Studies),Sociology,Psychology,History, Philosophy & Theology,Chemical Engineering,Computer Science,Art, Performing Arts & Design,Civil Engineering,Biological Sciences,Chemistry,Economics & Econometrics,Mathematics & Statistics,Geology, Environmental, Earth & Marine Sciences,Archaeology,Communication & Media Studies,Languages, Literature & Linguistics,General Engineering,Other Health,Medicine & Dentistry,Accounting & Finance,Business & Management,Mechanical & Aerospace Engineering,Physics & Astronomy', 34, 'https://upload.wikimedia.org/wikipedia/en/thumb/c/c8/University_of_Rochester_seal.svg/150px-University_of_Rochester_seal.svg.png', ' L\'Université de Rochester est une université privée de recherche située à Rochester, dans l\'État de New York, aux États-Unis. Fondée en 1850, elle compte environ 6 800 étudiants de premier cycle et 5 000 étudiants diplômés. Le campus actuel, situé à côté de la rivière Genesee, est utilisé depuis 1955. Avec environ 30 000 employés à temps plein, l\'université est le plus grand employeur privé dans le nord de l\'État de New York et le septième plus grand de tout l\'État de New York.\nRochester propose 160 programmes de premier cycle et 30 programmes de troisième cycle répartis dans sept écoles sur cinq campus différents. Le College of Arts, Sciences, and Engineering est la plus grande école, comprenant la prestigieuse Hajim School of Engineering and Applied Sciences, abritant certains départements et divisions du collège. L\'Institute of Optics, fondé en 1929, est considéré comme l\'un des meilleurs programmes d\'optique au monde. Les départements de science politique et d\'économie ont influencé les sciences sociales positivistes depuis les années 1960. La Rossell Hope Robbins Library est une ressource de l\'université pour les textes en vieil et moyen anglais et l\'expertise associée. L\'école est réputée pour son programme d\'études Rochester, qui ne nécessite qu\'un seul cours et demande une diversité d\'études dans différents domaines.\nL\'Université de Rochester abrite également le Laboratory for Laser Energetics de Rochester, un laboratoire national soutenu par le département de l\'Énergie des États-Unis, qui est le plus grand programme universitaire du département de l\'Énergie aux États-Unis. L\'université est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\" et est membre de l\'Association of American Universities, mettant l\'accent sur la recherche universitaire.\nLes anciens élèves, les professeurs et les collaborateurs de Rochester comptent parmi eux des lauréats de 13 prix Nobel, 9 médailles nationales de la science, 13 prix Pulitzer, 45 Grammy Awards et 20 bourses Guggenheim.', 37000),
(171, 4198, 'University of San Francisco', 'Accounting & Finance,Architecture,Art, Performing Arts & Design,Biological Sciences,Business & Management,Chemistry,Communication & Media Studies,Computer Science,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Languages, Literature & Linguistics,Mathematics & Statistics,Other Health,Physics & Astronomy,Politics & International Studies (incl Development Studies),Psychology,Sociology,Sport Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/6/61/Usflogo.png/260px-Usflogo.png', ' L\'Université de San Francisco (USF) est une université jésuite privée située à San Francisco, en Californie. Le campus principal de l\'université est situé sur un terrain de 55 acres (22 hectares) entre le pont du Golden Gate et le Golden Gate Park. Le campus principal est surnommé \"The Hilltop\" (La colline) et est divisé en deux sections à l\'intérieur d\'un pâté de maisons l\'une de l\'autre. Une partie du campus principal est située sur Lone Mountain, l\'une des principales caractéristiques géographiques de San Francisco. Ses liens historiques étroits avec la ville et le comté de San Francisco se reflètent dans la devise traditionnelle de l\'université, Pro Urbe et Universität (\'Pour la Ville et l\'Université\').', 0),
(173, 3085, 'University of South Alabama', 'General Engineering,Electrical & Electronic Engineering,Accounting & Finance,Languages, Literature & Linguistics,Business & Management,Economics & Econometrics,Sociology,Computer Science,Chemical Engineering,Geology, Environmental, Earth & Marine Sciences,Communication & Media Studies,Politics & International Studies (incl Development Studies),Medicine & Dentistry,History, Philosophy & Theology,Physics & Astronomy,Biological Sciences,Psychology,Education,Sport Science,Civil Engineering,Geography,Mathematics & Statistics,Other Health,Art, Performing Arts & Design,Chemistry,Mechanical & Aerospace Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/78/University_of_South_Alabama_seal.png/160px-University_of_South_Alabama_seal.png', ' L\'Université du Sud de l\'Alabama (USA) est une université publique de recherche située à Mobile, en Alabama. Elle a été créée par la législature de l\'Alabama en mai 1963 et a remplacé les programmes d\'extension existants exploités à Mobile par l\'Université de l\'Alabama. Les premiers cours ont eu lieu en juin 1964, avec un effectif de 276 étudiants; la première cérémonie de remise des diplômes a eu lieu en juin 1967, avec l\'attribution de 88 baccalauréats.\nUSA est divisée en dix collèges et écoles, dont l\'une des deux écoles de médecine soutenues par l\'État en Alabama. Au semestre d\'automne 2018, l\'Université du Sud de l\'Alabama comptait 15 093 étudiants. Au printemps 2019, l\'université avait décerné plus de 90 000 diplômes. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nL\'USA a une masse salariale annuelle de plus de 400 millions de dollars américains, avec plus de 6 000 employés, et est le deuxième plus grand employeur à Mobile. L\'université prétend avoir un impact économique annuel de 3 milliards de dollars américains.', 0),
(174, 940, 'University of South Carolina-Columbia', 'Chemistry,Communication & Media Studies,Mechanical & Aerospace Engineering,Accounting & Finance,History, Philosophy & Theology,Psychology,Law,Languages, Literature & Linguistics,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Art, Performing Arts & Design,Sport Science,Physics & Astronomy,Medicine & Dentistry,Computer Science,Geography,Biological Sciences,Business & Management,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Education,Civil Engineering,Mathematics & Statistics,Other Health,Sociology,General Engineering,Chemical Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bb/University_of_South_Carolina_seal.svg/130px-University_of_South_Carolina_seal.svg.png', ' L\'Université de la Caroline du Sud (UofSC, Caroline du Sud ou Carolina) est une université publique de recherche située à Columbia, en Caroline du Sud. Elle est la principale institution du système de l\'Université de la Caroline du Sud et la plus grande université de l\'État en termes d\'effectifs. Son campus principal s\'étend sur plus de 359 acres (145 hectares) dans le centre-ville de Columbia, près du Capitole de l\'État de Caroline du Sud. L\'université est classée parmi les \"R1: Universités doctorales avec une activité de recherche très élevée\". Elle abrite la plus grande collection d\'œuvres de Robert Burns et de littérature écossaise en dehors de l\'Écosse et la plus grande collection au monde d\'œuvres d\'Ernest Hemingway.\nFondée en 1801 sous le nom de South Carolina College, l\'UofSC propose aujourd\'hui plus de 350 programmes d\'études conduisant à des diplômes de premier cycle, de master et de doctorat, délivrés par 14 collèges et écoles attributaires de diplômes. Le système universitaire compte environ 52 000 étudiants au total, avec plus de 35 000 sur le campus de recherche de Columbia à l\'automne 2019, ce qui en fait la plus grande université de Caroline du Sud. L\'UofSC compte également plusieurs milliers de futurs étudiants dans des programmes d\'alimentation en provenance de collèges techniques environnants. Les écoles professionnelles sur le campus de Columbia comprennent les domaines des affaires, du génie, du droit, de la médecine, de la pharmacie et du travail social.', 0),
(175, 4925, 'University of South Dakota', 'Mathematics & Statistics,Politics & International Studies (incl Development Studies),Psychology,Education,Business & Management,Geography,Computer Science,Communication & Media Studies,Sport Science,Economics & Econometrics,Art, Performing Arts & Design,Accounting & Finance,Chemistry,Sociology,History, Philosophy & Theology,Medicine & Dentistry,Biological Sciences,Other Health,Languages, Literature & Linguistics,Law,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/3/31/University_of_South_Dakota_seal.svg/150px-University_of_South_Dakota_seal.svg.png', ' L\'Université du Dakota du Sud (USD) est une université publique de recherche située à Vermillion, dans le Dakota du Sud. Fondée par la législature du territoire du Dakota en 1862, soit 27 ans avant la création de l\'État du Dakota du Sud, l\'USD est l\'université phare de l\'État du Dakota du Sud et la plus ancienne université publique de l\'État. Elle occupe un campus de 274 acres (1,11 km2) situé dans le sud-est du Dakota du Sud, à environ 101 km au sud-ouest de Sioux Falls, à 63 km au nord-ouest de Sioux City, Iowa, et au nord de la rivière Missouri.\nL\'université abrite la seule école de médecine et la seule école de droit du Dakota du Sud. Elle est également le lieu du National Music Museum, qui compte plus de 15 000 instruments américains, européens et non-occidentaux. L\'USD est régie par le South Dakota Board of Regents, et sa présidente est Sheila Gestring. L\'université est accréditée par l\'Association nord-centrale des collèges et écoles depuis 1913. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nLes anciens élèves de l\'Université du Dakota du Sud comprennent un total de 17 boursiers Truman, 12 boursiers Rhodes et 1 lauréat du prix Nobel (Ernest Lawrence \'22, Prix Nobel de physique en 1939). Les équipes sportives participent à la Division I de la NCAA en tant que membres de la Summit League, à l\'exception du football, qui participe à la Missouri Valley Football Conference.', 0);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(176, 4710, 'University of South Florida (Tampa)', 'Politics & International Studies (incl Development Studies),Mechanical & Aerospace Engineering,Education,Archaeology,Medicine & Dentistry,Art, Performing Arts & Design,Business & Management,Chemistry,Communication & Media Studies,Computer Science,Veterinary Science,Accounting & Finance,Physics & Astronomy,Civil Engineering,Psychology,History, Philosophy & Theology,Mathematics & Statistics,Electrical & Electronic Engineering,General Engineering,Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,Sociology,Geography,Agriculture & Forestry,Chemical Engineering,Architecture,Other Health,Biological Sciences,Sport Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d1/University_of_South_Florida_seal.svg/150px-University_of_South_Florida_seal.svg.png', ' L\'Université de South Florida (USF) est une université publique de recherche dont le campus principal est situé à Tampa, en Floride, avec d\'autres campus à St. Petersburg et Sarasota. Elle est l\'une des 12 membres du système universitaire de l\'État de la Floride. L\'USF abrite 14 collèges proposant plus de 240 programmes de premier cycle, de cycles supérieurs, de spécialisation et de doctorat. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\" et est accréditée par la Commission sur les collèges de l\'Association des collèges et écoles du Sud. L\'USF est membre de l\'Association des universités américaines (AAU) et est désignée par le conseil d\'administration de la Floride comme l\'une des trois universités de recherche d\'État prééminentes.\nFondée en 1956, l\'USF est la quatrième plus grande université de Floride en termes d\'effectifs, avec 49 766 étudiants de plus de 145 pays, les 50 états, les cinq territoires américains et le district de Columbia pour l\'année universitaire 2022–2023.\nEn 2022, l\'université a rapporté un budget annuel de 2,31 milliards de dollars et un impact économique annuel de plus de 6 milliards de dollars. Selon la National Science Foundation, l\'USF a dépensé 568 millions de dollars en recherche et développement en 2019, la classant 43e nationalement et 25e parmi les universités publiques. Son endowment de 889 millions de dollars est le troisième plus grand parmi les universités publiques de Floride et le plus grand de toutes les universités publiques américaines fondées après la Seconde Guerre mondiale.\nEn 2018, l\'Association des propriétaires de propriété intellectuelle a classé l\'USF 1ère en Floride, 7e aux États-Unis et 16e dans le monde pour le nombre de brevets américains délivrés. Les équipes sportives de l\'USF sont connues sous le nom des Bulls de South Florida et participent principalement à la American Athletic Conference de la Division I de la NCAA. Les 19 équipes universitaires de l\'USF ont remporté un total de 6 championnats nationaux et 161 championnats de conférence. Les athlètes représentant les Bulls ont remporté 23 autres championnats nationaux individuels et en relais, ainsi que 215 championnats de conférence individuels et en relais.', 0),
(177, 2698, 'University of Southern California', 'Accounting & Finance,General Engineering,Biological Sciences,Computer Science,Law,Geography,Other Health,Physics & Astronomy,History, Philosophy & Theology,Education,Geology, Environmental, Earth & Marine Sciences,Architecture,Mechanical & Aerospace Engineering,Mathematics & Statistics,Economics & Econometrics,Agriculture & Forestry,Business & Management,Sport Science,Politics & International Studies (incl Development Studies),Archaeology,Medicine & Dentistry,Chemical Engineering,Chemistry,Languages, Literature & Linguistics,Electrical & Electronic Engineering,Art, Performing Arts & Design,Civil Engineering,Communication & Media Studies,Sociology,Psychology', 17, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bc/University_of_Southern_California_seal.svg/150px-University_of_Southern_California_seal.svg.png', ' L\'Université de Californie du Sud (USC, SC, Southern Cal ou SoCal) est une université privée de recherche située à Los Angeles, en Californie. Fondée en 1880 par Robert Maclay Widney, elle est la plus ancienne université privée de recherche en Californie. L\'université est composée d\'une école des arts libéraux, le Dornsife College of Letters, Arts and Sciences, et de 22 écoles universitaires, de cycles supérieurs et professionnelles, accueillant environ 21 000 étudiants de premier cycle et 28 500 étudiants de cycles supérieurs en provenance de tous les cinquante États américains et de plus de 115 pays. Elle est membre de l\'Association of American Universities, à laquelle elle a adhéré en 1969.\nL\'USC parraine divers sports intercollégiaux et participe à la National Collegiate Athletic Association (NCAA) en tant que membre de la Pac-12 Conference. Les membres des équipes sportives de l\'USC, les Trojans, ont remporté 107 championnats d\'équipe de la NCAA et 412 championnats individuels de la NCAA. En 2021, les athlètes trojans ont remporté 326 médailles aux Jeux olympiques (153 d\'or, 96 d\'argent et 77 de bronze), plus que toute autre université américaine. L\'USC a vu 537 joueurs de football être sélectionnés lors de la draft de la National Football League, le deuxième plus grand nombre de joueurs sélectionnés dans le pays.\nL\'USC a diplômé plus d\'anciens élèves ayant remporté des Oscars et des Emmy Awards que toute autre institution, en grande partie grâce à l\'École des arts cinématographiques, et a décerné des diplômes à 29 milliardaires vivants. Actuellement, l\'USC compte dix lauréats du prix Nobel parmi son personnel, onze boursiers Rhodes, douze boursiers Marshall, six lauréats de la bourse MacArthur, 181 boursiers Fulbright et un lauréat du prix Turing.', 32000),
(178, 2004, 'University of Southern Mississippi', 'Accounting & Finance,Biological Sciences,Architecture,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,Sport Science,Psychology,Education,Sociology,Communication & Media Studies,Art, Performing Arts & Design,Physics & Astronomy,Politics & International Studies (incl Development Studies),Computer Science,Mathematics & Statistics,General Engineering,Chemical Engineering,Business & Management,Chemistry,Geography,History, Philosophy & Theology,Other Health,Law,Languages, Literature & Linguistics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b9/University_of_Southern_Mississippi_seal.svg/150px-University_of_Southern_Mississippi_seal.svg.png', ' L\'Université du Sud du Mississippi (Southern Miss ou USM) est une université publique de recherche dont le campus principal est situé à Hattiesburg, Mississippi. Elle est accréditée par l\'Association des collèges et écoles du Sud pour délivrer des diplômes de premier cycle, de master, de spécialiste et de doctorat. L\'université est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\".\nFondée le 30 mars 1910, l\'université est une institution à double campus, avec son campus principal situé à Hattiesburg et son autre grand campus, Gulf Park, situé à Long Beach. Elle dispose de cinq autres sites d\'enseignement et de recherche, dont le John C. Stennis Space Center et le Gulf Coast Research Laboratory (GCRL).\nÀ l\'origine appelées les \"Mississippi Southerners\", les équipes sportives de Southern Miss sont devenues les Golden Eagles en 1972. Les couleurs de l\'école, le noir et l\'or, ont été choisies par un vote des étudiants peu de temps après la fondation de l\'école. Bien que les mascottes, les noms, les coutumes et le campus aient changé, les couleurs noir et or sont restées constantes. Les 17 programmes sportifs de l\'USM participent aux compétitions de la Division I de la NCAA, principalement en tant que membres de la Sun Belt Conference.', 0),
(179, 148, 'University of Texas at Arlington', 'Mathematics & Statistics,Economics & Econometrics,Biological Sciences,Psychology,Other Health,Education,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Communication & Media Studies,History, Philosophy & Theology,Computer Science,Physics & Astronomy,Business & Management,Civil Engineering,Accounting & Finance,Sociology,Sport Science,Agriculture & Forestry,Languages, Literature & Linguistics,Architecture,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Chemistry,General Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/29/University_of_Texas_at_Arlington_seal.svg/150px-University_of_Texas_at_Arlington_seal.svg.png', ' L\'Université du Texas à Arlington (UTA ou UT Arlington) est une université publique de recherche située à Arlington, au Texas. L\'université a été fondée en 1895 et a fait partie du système de l\'Université Texas A&M pendant plusieurs décennies avant de rejoindre le système de l\'Université du Texas en 1965.\nL\'université est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". L\'inscription sur le campus pour l\'automne 2022 s\'élevait à 40 990 étudiants, ce qui en fait la deuxième plus grande université du nord du Texas et la cinquième plus grande du Texas. UT Arlington est le troisième plus grand producteur de diplômés universitaires au Texas et propose plus de 180 programmes de premier cycle, de master et de doctorat.\nUT Arlington participe à 15 sports intercollégiaux en tant que membre de la Division I de la NCAA et de la Western Athletic Conference. Les équipes sportives de l\'UTA sont connues sous le nom de Mavericks depuis 1971.', 0),
(180, 213, 'University of Texas at Austin', 'Architecture,Business & Management,Law,Communication & Media Studies,Biological Sciences,Economics & Econometrics,Psychology,Education,Sport Science,History, Philosophy & Theology,Computer Science,Physics & Astronomy,Archaeology,Medicine & Dentistry,Electrical & Electronic Engineering,Sociology,General Engineering,Languages, Literature & Linguistics,Politics & International Studies (incl Development Studies),Art, Performing Arts & Design,Chemical Engineering,Mathematics & Statistics,Accounting & Finance,Mechanical & Aerospace Engineering,Geography,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Other Health,Chemistry', 36, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e1/University_of_Texas_at_Austin_seal.svg/150px-University_of_Texas_at_Austin_seal.svg.png', ' L\'Université du Texas à Austin (UT Austin, UT ou Texas) est une université publique de recherche située à Austin, au Texas. Elle est l\'institution phare du système de l\'Université du Texas. Avec 52 384 étudiants à l\'automne 2022, c\'est également la plus grande institution du système.\nFondée en 1883, l\'UT Austin est considérée comme une Public Ivy. L\'université est un important centre de recherche académique, avec des dépenses de recherche totalisant 679,8 millions de dollars pour l\'exercice 2018. Elle a rejoint l\'Association des universités américaines en 1929. L\'université abrite sept musées et dix-sept bibliothèques, dont la Bibliothèque présidentielle Lyndon B. Johnson et le Musée d\'art Blanton, et exploite diverses installations de recherche auxiliaires, telles que le J. J. Pickle Research Campus et l\'Observatoire McDonald.\nLes étudiants-athlètes de l\'université concourent en tant que Texas Longhorns. Les Longhorns ont remporté quatre championnats nationaux de football de la NCAA, six championnats nationaux de baseball de la NCAA, treize championnats nationaux de natation et de plongée masculine de la NCAA, et l\'école a revendiqué plus de titres dans les sports masculins et féminins que tout autre membre de la Big 12.\nEn novembre 2020, l\'université avait affilié 13 lauréats du prix Nobel, plus de 25 lauréats du prix Pulitzer, trois lauréats du prix Turing, deux lauréats de la médaille Fields, deux lauréats du prix Wolf et trois lauréats du prix Abel, en tant qu\'anciens élèves, membres du corps professoral ou chercheurs. L\'université a également été associée à trois lauréats du Primetime Emmy Award, et jusqu\'à 2021, ses étudiants et anciens élèves ont remporté un total de 155 médailles olympiques.', 14000),
(181, 3999, 'University of Texas at Dallas', 'Computer Science,Psychology,Chemistry,History, Philosophy & Theology,Economics & Econometrics,Mechanical & Aerospace Engineering,Geography,General Engineering,Business & Management,Biological Sciences,Accounting & Finance,Physics & Astronomy,Geology, Environmental, Earth & Marine Sciences,Languages, Literature & Linguistics,Art, Performing Arts & Design,Mathematics & Statistics,Electrical & Electronic Engineering,Politics & International Studies (incl Development Studies),Other Health,Sociology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/17/University_of_Texas_at_Dallas_seal.svg/160px-University_of_Texas_at_Dallas_seal.svg.png', ' L\'Université du Texas à Dallas (UTD ou UT Dallas) est une université publique de recherche située à Richardson, au Texas. Elle est la plus septentrionale des institutions du système de l\'Université du Texas. Fondée initialement en 1961 en tant que bras de recherche privé de Texas Instruments, la Fondation Carnegie a classé l\'université comme une université de recherche doctorale avec \"Activité de recherche la plus élevée\".\nL\'université est associée à quatre prix Nobel et compte des membres de l\'Académie nationale des sciences et de l\'Académie nationale de l\'ingénierie parmi son corps professoral, avec des projets de recherche couvrant des domaines tels que les sciences spatiales, la bio-ingénierie, la cybersécurité, la nanotechnologie, et les sciences du comportement et du cerveau. L\'UT Dallas propose plus de 140 programmes académiques à travers ses sept écoles et accueille plus de 50 centres de recherche et instituts.\nBien que le campus principal relève officiellement de la juridiction de la ville de Richardson, un tiers de celui-ci se trouve dans les limites du comté de Dallas. L\'UTD exploite également plusieurs emplacements dans le centre-ville de Dallas, notamment le Crow Museum of Asian Art dans le quartier des arts, ainsi que plusieurs bâtiments dans le district médical à côté de l\'UT Southwestern : le Center for BrainHealth, le Center for Vital Longevity et le Callier Center for Communication Disorders.', 0),
(182, 1354, 'University of Texas at El Paso', 'Physics & Astronomy,Accounting & Finance,Sport Science,Art, Performing Arts & Design,Biological Sciences,Mechanical & Aerospace Engineering,Economics & Econometrics,Sociology,Education,History, Philosophy & Theology,Geology, Environmental, Earth & Marine Sciences,Mathematics & Statistics,Other Health,Geography,Electrical & Electronic Engineering,Civil Engineering,General Engineering,Languages, Literature & Linguistics,Chemistry,Politics & International Studies (incl Development Studies),Computer Science,Psychology,Agriculture & Forestry,Communication & Media Studies,Business & Management', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/c/c8/University_of_Texas_at_El_Paso_seal.svg/150px-University_of_Texas_at_El_Paso_seal.svg.png', ' L\'Université du Texas à El Paso (UTEP) est une université publique de recherche située à El Paso, au Texas. Elle fait partie du système de l\'Université du Texas. UTEP est la deuxième plus grande université aux États-Unis à avoir une majorité d\'étudiants d\'origine mexicaine-américaine (environ 80%), après l\'Université du Texas Rio Grande Valley. Elle est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\". La School of Engineering de l\'université est la première productrice nationale d\'ingénieurs hispaniques détenant des diplômes de maîtrise et de doctorat.\nUTEP abrite le stade Sun Bowl, qui accueille chaque hiver la compétition annuelle de football universitaire, le Sun Bowl.\nLe campus est l\'un des rares endroits dans le monde en dehors du Bhoutan ou du Tibet à avoir des bâtiments créés dans le style architectural Dzong. Il est situé sur des collines surplombant le fleuve Rio Grande, avec Ciudad Juárez en vue de l\'autre côté de la frontière entre le Mexique et les États-Unis.', 0),
(183, 1334, 'University of Texas Rio Grande Valley', 'Languages, Literature & Linguistics,Business & Management,Computer Science,Politics & International Studies (incl Development Studies),Economics & Econometrics,Geography,Mechanical & Aerospace Engineering,Civil Engineering,History, Philosophy & Theology,Mathematics & Statistics,Art, Performing Arts & Design,Education,Geology, Environmental, Earth & Marine Sciences,Agriculture & Forestry,Sport Science,Accounting & Finance,General Engineering,Communication & Media Studies,Other Health,Biological Sciences,Sociology,Medicine & Dentistry,Chemical Engineering,Chemistry,Archaeology,Law,Physics & Astronomy,Electrical & Electronic Engineering,Psychology', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/7/75/UT_Rio_Grande_Valley_seal.svg/150px-UT_Rio_Grande_Valley_seal.svg.png', ' L\'Université du Texas Rio Grande Valley (UTRGV) est une université publique de recherche avec plusieurs campus dans la région de la vallée du Rio Grande, au Texas. Elle est le membre le plus méridional du système de l\'Université du Texas. L\'Université du Texas Rio Grande Valley a été créée par la législature du Texas en 2013 après la fusion de l\'Université du Texas à Brownsville', 0),
(184, 4782, 'University of Toledo', 'Mechanical & Aerospace Engineering,Sociology,Economics & Econometrics,Communication & Media Studies,Geology, Environmental, Earth & Marine Sciences,Physics & Astronomy,Other Health,Languages, Literature & Linguistics,Mathematics & Statistics,Art, Performing Arts & Design,Law,Chemistry,Medicine & Dentistry,Accounting & Finance,Chemical Engineering,Civil Engineering,History, Philosophy & Theology,Psychology,Electrical & Electronic Engineering,Computer Science,Politics & International Studies (incl Development Studies),Geography,Biological Sciences,Education,General Engineering,Business & Management', 0, 'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/UT_Hortz.svg/220px-UT_Hortz.svg.png', ' L\'Université de Toledo (UToledo ou UT) est une université publique de recherche située à Toledo, dans l\'Ohio. Elle est le campus le plus septentrional du système universitaire de l\'Ohio. L\'université exploite également un campus de sciences de la santé de 180 hectares, qui comprend le Centre médical de l\'Université de Toledo, dans le quartier de West Toledo à Toledo ; un campus satellite de 65 hectares dans le quartier de Scott Park à Toledo ; le Center for the Visual Arts est situé au centre-ville de Toledo au Toledo Museum of Art ; et une installation de recherche et d\'éducation, connue sous le nom de Lake Erie Center, au Maumee Bay State Park.\nL\'université a été fondée en 1872 dans le centre-ville de Toledo sous le nom de Toledo University of Arts and Trades. Elle a fermé ses portes après six ans. La ville de Toledo l\'a reprise, la rouvrant en 1884 sous le nom de Toledo Manual Training School. L\'école professionnelle s\'est développée en une université à travers la fin des années 1800.\nEn 1931, l\'université a déménagé à son emplacement actuel dans le quartier d\'Ottawa. Depuis sa création, l\'université s\'est étendue physiquement pour inclure plus de 100 bâtiments principaux d\'une superficie totale de plus de 570 hectares et a transformé son programme académique d\'une orientation vers l\'éducation professionnelle et secondaire en une université de recherche complète. Elle est réputée pour son programme dans les domaines des sciences, de l\'ingénierie et de la médecine. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".\nL\'Université de Toledo compte plus de 100 000 anciens élèves vivants et une inscription actuelle de plus de 15 000 étudiants. L\'université propose plus de 300 organisations étudiantes. Ses équipes sportives, appelées les Rockets, sont membres de la Mid-American Conference.', 0),
(185, 4186, 'University of Utah', 'Architecture,Electrical & Electronic Engineering,Accounting & Finance,Education,Mathematics & Statistics,Languages, Literature & Linguistics,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Geography,Business & Management,Biological Sciences,Chemical Engineering,History, Philosophy & Theology,Chemistry,Politics & International Studies (incl Development Studies),Other Health,Law,Sociology,Mechanical & Aerospace Engineering,Medicine & Dentistry,Computer Science,General Engineering,Physics & Astronomy,Sport Science,Art, Performing Arts & Design,Economics & Econometrics,Agriculture & Forestry,Psychology,Communication & Media Studies', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/4/4a/University_of_Utah_seal.svg/180px-University_of_Utah_seal.svg.png', ' L\'Université de l\'Utah (UU, U of U ou simplement Utah) est une université publique de recherche située à Salt Lake City, Utah. Elle a été établie en 1850 en tant que University of Deseret par l\'Assemblée générale de l\'État provisoire de Deseret, en faisant ainsi la plus ancienne institution d\'enseignement supérieur de l\'Utah. Elle a pris son nom actuel en 1892, quatre ans avant que l\'Utah n\'obtienne son statut d\'État, et a déménagé à son emplacement actuel en 1900.\nÀ l\'automne 2022, l\'université comptait 26 355 étudiants de premier cycle et 8 350 étudiants diplômés, pour un total de 34 705 inscrits, ce qui en fait la deuxième plus grande université publique de l\'État après l\'Université de l\'Utah Valley. Les études supérieures comprennent la S.J. Quinney College of Law et l\'école de médecine, première école de médecine de l\'Utah. Elle est membre de l\'Association of American Universities (AAU) et est classée parmi les \"R1: Universités doctorales - Activité de recherche très élevée\".\nSelon la National Science Foundation, l\'université a reçu 552 millions de dollars de financement pour la recherche et le développement en 2018, la classant au 45e rang national. Le système de soins de santé de l\'université comprend quatre hôpitaux, dont l\'University of Utah Hospital et le Huntsman Cancer Institute, ainsi que douze cliniques communautaires et des centres spécialisés tels que le Moran Eye Center.\nLes équipes sportives de l\'université, les Utes, participent aux compétitions de la Division I de la NCAA (FBS pour le football) en tant que membres de la Pac-12 Conference. Le 4 août 2023, l\'université a présenté sa candidature et a été acceptée pour rejoindre la Big 12 Conference à partir de 2024.\nVingt-deux Rhodes Scholars, quatre lauréats du prix Nobel, trois lauréats du prix Turing, huit boursiers MacArthur, divers lauréats du prix Pulitzer, deux astronautes, des boursiers Gates Cambridge et des boursiers Churchill ont été affiliés à l\'université en tant qu\'étudiants, chercheurs ou membres du corps professoral au cours de son histoire.', 0),
(186, 604, 'University of Vermont', 'Art, Performing Arts & Design,Electrical & Electronic Engineering,Psychology,Economics & Econometrics,Biological Sciences,Sociology,Education,Geography,Other Health,Veterinary Science,Civil Engineering,Communication & Media Studies,Agriculture & Forestry,Mathematics & Statistics,Business & Management,Sport Science,Politics & International Studies (incl Development Studies),Languages, Literature & Linguistics,General Engineering,Chemistry,Mechanical & Aerospace Engineering,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Computer Science,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a9/University_of_Vermont_seal.svg/150px-University_of_Vermont_seal.svg.png', ' L\'Université du Vermont (UVM), officiellement intitulée University of Vermont and State Agricultural College, est une université publique de recherche et un établissement agricole dans la ville de Burlington, au Vermont. Fondée en 1791, l\'université est la plus ancienne du Vermont et la cinquième plus ancienne de la Nouvelle-Angleterre, ce qui en fait l\'une des plus anciennes des États-Unis. Elle fait partie des huit Public Ivies d\'origine.\nL\'UVM est organisée en dix écoles, comprenant sept collèges universitaires, un collège d\'honneur, un collège des cycles supérieurs et le Robert Larner College of Medicine. Le plus grand complexe hospitalier du Vermont, l\'University of Vermont Medical Center, a son principal établissement sur le campus. Reconnue pour son progressisme, l\'UVM a une histoire d\'activisme étudiant. Considérée comme l\'un des campus les plus durables aux États-Unis, l\'université s\'est engagée à atteindre la neutralité carbone d\'ici 2030. En 2022, l\'université a attiré 263 millions de dollars de financement pour la recherche et le développement. Elle est classée parmi les \"R2: Universités doctorales - Activité de recherche élevée\".', 0),
(187, 776, 'University of Virginia (Main campus)', 'Biological Sciences,Law,Art, Performing Arts & Design,Computer Science,Sport Science,Business & Management,Psychology,Medicine & Dentistry,Geography,History, Philosophy & Theology,Politics & International Studies (incl Development Studies),Chemistry,Electrical & Electronic Engineering,Architecture,General Engineering,Mathematics & Statistics,Accounting & Finance,Languages, Literature & Linguistics,Economics & Econometrics,Chemical Engineering,Mechanical & Aerospace Engineering,Sociology,Other Health,Archaeology,Physics & Astronomy,Geology, Environmental, Earth & Marine Sciences,Civil Engineering,Education,Communication & Media Studies', 27, 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/17/University_of_Virginia_seal.svg/200px-University_of_Virginia_seal.svg.png', ' L\'Université de Virginie (UVA) est une université publique de recherche située à Charlottesville, en Virginie, aux États-Unis. Elle a été fondée en 1819 par Thomas Jefferson et abrite son Academical Village, un site classé au patrimoine mondial de l\'UNESCO. Le premier conseil d\'administration comprenait trois présidents américains : Jefferson, James Madison et James Monroe, ce dernier étant président en exercice des États-Unis au moment de la fondation. En tant que premiers deux recteurs, les présidents Jefferson et Madison ont joué un rôle clé dans la fondation de l\'université, Jefferson concevant à la fois les cours originaux et l\'architecture de l\'université. Située au sein de son campus central historique de 1 135 acres, l\'université est composée de huit écoles universitaires et de trois écoles professionnelles : la School of Law, la Darden School of Business et la School of Medicine.\nLes chercheurs de l\'Université de Virginie ont joué un rôle majeur dans le développement de nombreuses disciplines académiques, dont l\'économie, le droit, les arts littéraires, les arts visuels et les sciences. L\'université est qualifiée de \"Public Ivy\" pour offrir une expérience académique similaire à celle d\'une université de la Ivy League. L\'admission à l\'université est très sélective, avec un taux d\'acceptation de 16,2 % pour la promotion de 2027, et l\'université est connue en partie pour ses fondements historiques, son code d\'honneur géré par les étudiants et ses sociétés secrètes.\nEn matière de recherche, l\'université est membre de l\'Association of American Universities depuis 120 ans, et la revue Science a crédité son corps professoral de deux des dix principales percées scientifiques mondiales en une seule année. Dans le domaine sportif, les équipes sportives de l\'université sont appelées les Cavaliers et mènent la Atlantic Coast Conference en termes de championnats NCAA par équipe pour les sports masculins, se classant également deuxièmes pour les sports féminins et dans l\'ensemble. En 2015 et à nouveau en 2019, l\'Université de Virginie a reçu la Coupe Capital One pour avoir présenté les meilleurs programmes sportifs globaux pour les sports masculins aux États-Unis.\nLes anciens élèves, professeurs et chercheurs de l\'université ont inclus plusieurs présidents américains, chefs d\'État, lauréats du prix Nobel, lauréats du prix Pulitzer, boursiers Rhodes, boursiers Marshall et boursiers Fulbright. Une trentaine de gouverneurs d\'États américains différents ont fréquenté l\'université, de même que de nombreux sénateurs et membres du Congrès américain. L\'UVA a produit 56 boursiers Rhodes, classant huitième aux États-Unis, tandis que ses anciens élèves ont fondé des entreprises telles que Reddit, CNET, VMware et Space Adventures.', 16000),
(188, 4301, 'University of Washington', 'Psychology,History, Philosophy & Theology,Other Health,Chemistry,Languages, Literature & Linguistics,General Engineering,Chemical Engineering,Physics & Astronomy,Agriculture & Forestry,Computer Science,Biological Sciences,Archaeology,Education,Veterinary Science,Politics & International Studies (incl Development Studies),Accounting & Finance,Mechanical & Aerospace Engineering,Communication & Media Studies,Economics & Econometrics,Mathematics & Statistics,Architecture,Medicine & Dentistry,Electrical & Electronic Engineering,Sociology,Art, Performing Arts & Design,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Business & Management,Law,Geography', 46, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/58/University_of_Washington_seal.svg/150px-University_of_Washington_seal.svg.png', ' L\'Université de Washington (UW ou informellement U-Dub) est une université publique de recherche située à Seattle, dans l\'État de Washington. Fondée en 1861, environ une décennie après la fondation de Seattle, l\'Université de Washington est l\'une des plus anciennes universités de la côte ouest des États-Unis.\nL\'université dispose d\'un campus principal de 703 acres (284 hectares) situé dans le quartier universitaire de la ville. Elle possède également des campus satellites dans les villes voisines de Tacoma et Bothell. Dans l\'ensemble, l\'UW englobe plus de 500 bâtiments et plus de 20 millions de pieds carrés d\'espace, y compris l\'un des plus grands systèmes de bibliothèques au monde avec plus de 26 bibliothèques universitaires, des centres d\'art, des musées, des laboratoires, des amphithéâtres et des stades.\nWashington est l\'institution phare des six universités publiques de l\'État de Washington. Elle est réputée pour ses recherches médicales, d\'ingénierie et scientifiques. Washington est membre de l\'Association of American Universities. Selon la National Science Foundation, l\'UW a dépensé 1,48 milliard de dollars en recherche et développement en 2021, la classant au 5e rang national. Ses 22 équipes sportives de niveau universitaire concourent sous le nom de Huskies dans la Pac-12 Conference de la NCAA Division I, représentant les États-Unis aux Jeux olympiques et autres compétitions.', 9000),
(189, 2767, 'University of Wisconsin-Madison', 'Sport Science,Geography,Civil Engineering,Computer Science,Psychology,Physics & Astronomy,Medicine & Dentistry,Agriculture & Forestry,Accounting & Finance,Law,Art, Performing Arts & Design,Education,Economics & Econometrics,Mechanical & Aerospace Engineering,Biological Sciences,Politics & International Studies (incl Development Studies),Business & Management,Geology, Environmental, Earth & Marine Sciences,Other Health,History, Philosophy & Theology,Veterinary Science,General Engineering,Mathematics & Statistics,Languages, Literature & Linguistics,Sociology,Chemistry,Architecture,Chemical Engineering,Communication & Media Studies,Electrical & Electronic Engineering', 54, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/45/Seal_of_the_University_of_Wisconsin.svg/150px-Seal_of_the_University_of_Wisconsin.svg.png', ' L\'Université du Wisconsin–Madison (Université du Wisconsin, Wisconsin, UW, UW–Madison, ou simplement Madison) est une université publique de recherche et d\'attribution de terres située à Madison, dans le Wisconsin, aux États-Unis. Fondée en 1848 lorsque le Wisconsin est devenu un État, UW–Madison est l\'université d\'État officielle du Wisconsin et le campus phare du système de l\'Université du Wisconsin. Elle a été la première université publique établie au Wisconsin et reste la plus ancienne et la plus grande université publique de l\'État. UW–Madison est devenue une institution de subvention de terres en 1866. Le campus principal de 933 acres (378 hectares), situé sur les rives du lac Mendota, comprend quatre sites historiques nationaux. L\'université possède également et exploite l\'Arboretum de l\'Université du Wisconsin–Madison, d\'une superficie de 1 200 acres (486 hectares), situé à 4 miles (6,4 km) au sud du campus principal, qui est également un site historique national.\nUW–Madison est organisée en 13 écoles et collèges, qui ont inscrit 35 184 étudiants de premier cycle, 9 993 étudiants diplômés, 2 046 étudiants spéciaux et 2 663 étudiants professionnels en 2022. Ses programmes académiques comprennent 136 filières de premier cycle, 148 programmes de master et 120 programmes de doctorat.\nLe Wisconsin est l\'un des douze membres fondateurs de l\'Association of American Universities, un groupe sélectif de grandes universités de recherche en Amérique du Nord. Elle est considérée comme une Public Ivy et est classée comme une université de niveau R1. UW–Madison a également été le berceau de l\'éminente \"Wisconsin School\" d\'économie et d\'histoire diplomatique. La National Science Foundation a classé UW–Madison au 8e rang des universités américaines pour les dépenses de recherche et de développement en 2021, avec 1,38 milliard de dollars. En mars 2023, 20 lauréats du prix Nobel, 41 lauréats du prix Pulitzer, 2 lauréats de la médaille Fields et 1 lauréat du prix Turing ont été affiliés à UW–Madison en tant qu\'anciens élèves, professeurs ou chercheurs. Elle est également l\'un des principaux producteurs de boursiers Fulbright et de membres de la Fondation MacArthur. En novembre 2018, 14 PDG de sociétés du Fortune 500 ont fréquenté UW–Madison, le plus grand nombre parmi toutes les universités du pays.\nLes Wisconsin Badgers concourent dans 25 sports interuniversitaires dans la NCAA Division I Big Ten Conference et ont remporté 31 championnats nationaux. Les étudiants et anciens élèves du Wisconsin ont remporté 50 médailles olympiques (dont 13 médailles d\'or).', 15000),
(190, 3061, 'University of Wisconsin-Milwaukee', 'Accounting & Finance,Mathematics & Statistics,Art, Performing Arts & Design,Geography,Computer Science,Languages, Literature & Linguistics,General Engineering,Chemistry,Business & Management,Sociology,Civil Engineering,Biological Sciences,Economics & Econometrics,Geology, Environmental, Earth & Marine Sciences,Other Health,Electrical & Electronic Engineering,Physics & Astronomy,Mechanical & Aerospace Engineering,Psychology,Medicine & Dentistry,Communication & Media Studies,Politics & International Studies (incl Development Studies),Education,History, Philosophy & Theology,Architecture,Sport Science', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/a/a9/University_of_Wisconsin%E2%80%93Milwaukee_seal.svg/150px-University_of_Wisconsin%E2%80%93Milwaukee_seal.svg.png', ' L\'Université du Wisconsin–Milwaukee (UW–Milwaukee, UWM ou Milwaukee) est une université publique de recherche urbaine située à Milwaukee, dans le Wisconsin. Elle est la plus grande université de la région métropolitaine de Milwaukee et membre du système de l\'Université du Wisconsin. C\'est également l\'une des deux universités de recherche délivrant des doctorats et la deuxième plus grande université du Wisconsin.\nL\'université est composée de 14 écoles et collèges, comprenant la seule école d\'hydrologie des sciences de l\'eau aux États-Unis, la première école de santé publique accréditée par le CEPH dans le Wisconsin, et la seule école d\'architecture de l\'État. Au cours de l\'année scolaire 2015–2016, l\'Université du Wisconsin–Milwaukee comptait 27 156 étudiants inscrits, avec 1 604 membres du corps professoral, proposant 191 programmes d\'études, dont 94 licences, 64 masters et 33 doctorats.\nL\'université est classée parmi les \"R1: Universités doctorales – Activité de recherche très élevée\". En 2018, l\'université a consacré 55 millions de dollars à la recherche.\nLes équipes sportives de l\'université sont les Panthers. Au total, 15 équipes sportives des Panthers participent à la Division I de la NCAA. Les Panthers ont remporté sept fois le trophée James J. McCafferty en tant que champions de tous les sports de la Horizon League depuis l\'an 2000. Ils ont remporté 133 titres de la Horizon League et participé à 40 tournois de la NCAA jusqu\'en 2016.', 0),
(191, 2520, 'University of Wyoming', 'Computer Science,Sociology,Business & Management,Economics & Econometrics,Agriculture & Forestry,Psychology,Accounting & Finance,Biological Sciences,Communication & Media Studies,Medicine & Dentistry,Civil Engineering,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Electrical & Electronic Engineering,Geography,Education,Sport Science,Chemistry,Chemical Engineering,Physics & Astronomy,Other Health,Law,Languages, Literature & Linguistics,Mathematics & Statistics', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e1/University_of_Wyoming_seal.svg/140px-University_of_Wyoming_seal.svg.png', ' L\'Université du Wyoming (UW) est une université publique de recherche agraire située à Laramie, dans le Wyoming. Fondée en mars 1886, quatre ans avant l\'admission du territoire en tant que 44e État, elle a ouvert ses portes en septembre 1887. L\'Université du Wyoming est inhabituelle en ce que son emplacement dans l\'État est inscrit dans la constitution de l\'État. L\'université propose également des programmes d\'éducation à distance dans des communautés à travers le Wyoming et en ligne.\nL\'Université du Wyoming est composée de sept collèges : agriculture et ressources naturelles, arts et sciences, commerce, éducation, génie et sciences appliquées, sciences de la santé, et droit. L\'université propose plus de 120 programmes de premier cycle, de cycles supérieurs et de certificats, y compris le doctorat en pharmacie et le juris doctor. Elle est classée parmi les \"R2: Universités doctorales – Activité de recherche élevée\".\nEn plus des cours sur le campus à Laramie, l\'École de formation à distance de l\'université propose plus de 41 programmes degrés, de certificats et d\'approbation pour les apprenants à distance à travers l\'État et au-delà. Ces programmes sont dispensés grâce à l\'utilisation de la technologie, tels que les cours en ligne et par vidéoconférence. L\'École de formation à distance compte neuf centres régionaux dans l\'État, dont plusieurs sur les campus des collèges communautaires, afin de donner aux résidents du Wyoming l\'accès à une éducation universitaire sans avoir à déménager à Laramie.', 0),
(192, 3240, 'Vanderbilt University', 'Psychology,Politics & International Studies (incl Development Studies),History, Philosophy & Theology,Business & Management,General Engineering,Economics & Econometrics,Communication & Media Studies,Electrical & Electronic Engineering,Languages, Literature & Linguistics,Education,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Geography,Geology, Environmental, Earth & Marine Sciences,Law,Chemical Engineering,Mathematics & Statistics,Computer Science,Archaeology,Biological Sciences,Medicine & Dentistry,Physics & Astronomy,Sociology,Civil Engineering,Accounting & Finance,Other Health,Chemistry', 11, 'https://upload.wikimedia.org/wikipedia/en/thumb/2/29/Vanderbilt_University_seal.svg/150px-Vanderbilt_University_seal.svg.png', ' La Vanderbilt University (informellement appelée Vandy ou VU) est une université privée de recherche située à Nashville, dans le Tennessee. Fondée en 1873, elle a été nommée en l\'honneur du magnat de la navigation et du rail Cornelius Vanderbilt, qui a fourni à l\'école son endowment initial de 1 million de dollars dans l\'espoir que son don et le travail plus vaste de l\'université contribueraient à guérir les blessures causées par la guerre civile américaine. Vanderbilt est un membre fondateur de la Southeastern Conference et est la seule école privée de la conférence depuis 1966.\nL\'université comprend dix écoles et compte près de 13 800 étudiants venant des États-Unis et de 70 pays étrangers. Vanderbilt est classée parmi les \"R1: Universités doctorales – Activité de recherche très élevée\". Plusieurs centres de recherche et instituts sont affiliés à l\'université, dont le Robert Penn Warren Center for the Humanities, le Freedom Forum First Amendment Center et l\'Observatoire Dyer. Le Centre médical de l\'Université Vanderbilt, autrefois partie de l\'université, est devenu une institution distincte en 2016. À l\'exception de l\'observatoire hors campus, toutes les installations de l\'université sont situées sur son campus de 330 acres (1,3 km2) au cœur de Nashville, à 2,4 km du centre-ville.\nLes anciens élèves, professeurs et employés de Vanderbilt ont inclus 54 membres actuels et anciens du Congrès des États-Unis, 18 ambassadeurs américains, 13 gouverneurs, 8 lauréats du prix Nobel, 2 vice-présidents des États-Unis et 2 juges de la Cour suprême des États-Unis. Parmi les anciens élèves notables figurent également 3 lauréats du prix Pulitzer, 27 boursiers Rhodes, 2 lauréats d\'un Oscar, 1 lauréat d\'un Grammy Award, 6 boursiers MacArthur, 4 chefs d\'État étrangers et 5 médaillés olympiques. Vanderbilt compte plus de 145 000 anciens élèves, avec 40 clubs d\'anciens élèves établis dans le monde entier.', 23000),
(193, 4007, 'Virginia Commonwealth University', 'Medicine & Dentistry,General Engineering,Communication & Media Studies,Business & Management,Biological Sciences,Geography,Art, Performing Arts & Design,Electrical & Electronic Engineering,Agriculture & Forestry,Politics & International Studies (incl Development Studies),Economics & Econometrics,Chemistry,Accounting & Finance,Mechanical & Aerospace Engineering,Sociology,Computer Science,Mathematics & Statistics,Education,Geology, Environmental, Earth & Marine Sciences,History, Philosophy & Theology,Chemical Engineering,Psychology,Languages, Literature & Linguistics,Sport Science,Other Health,Physics & Astronomy', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/c/cd/VCU_Seal_sans_logotype.svg/130px-VCU_Seal_sans_logotype.svg.png', ' Virginia Commonwealth University (VCU) est une université publique de recherche située à Richmond, en Virginie. VCU a été fondée en 1838 en tant que département de médecine du Hampden–Sydney College, devenant le Medical College of Virginia en 1854. En 1968, l\'Assemblée générale de Virginie a fusionné le MCV avec le Richmond Professional Institute, fondé en 1917, pour créer l\'Université de Virginie Commonwealth.\nEn 2022, plus de 28 000 étudiants poursuivaient 217 programmes de diplômes et de certificats à travers les 11 écoles et trois collèges de VCU. Le VCU Health System soutient l\'éducation en matière de soins de santé, la recherche et les soins aux patients.\nVCU a obtenu un financement record de 464 millions de dollars pour la recherche parrainée au cours de l\'exercice 2023 et est classée parmi les \"R1: Universités doctorales – Activité de recherche très élevée\". Les équipes sportives de VCU concourent en NCAA Division I et sont collectivement connues sous le nom de VCU Rams. Elles sont membres de l\'Atlantic 10 Conference. Le campus de VCU comprend des bâtiments historiques tels que la Ginter House, aujourd\'hui utilisée par le doyen de l\'université.', 0),
(194, 420, 'Virginia Polytechnic Institute and State University', 'Languages, Literature & Linguistics,General Engineering,Mechanical & Aerospace Engineering,Mathematics & Statistics,Education,Sport Science,Communication & Media Studies,Art, Performing Arts & Design,Business & Management,Geology, Environmental, Earth & Marine Sciences,Architecture,Computer Science,Sociology,Archaeology,Geography,Politics & International Studies (incl Development Studies),Chemistry,Veterinary Science,Agriculture & Forestry,Other Health,Physics & Astronomy,History, Philosophy & Theology,Biological Sciences,Medicine & Dentistry,Electrical & Electronic Engineering,Economics & Econometrics,Psychology,Chemical Engineering,Accounting & Finance,Civil Engineering', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/5/54/Virginia_Tech_seal.svg/150px-Virginia_Tech_seal.svg.png', ' Virginia Tech (VT), formellement connue sous le nom de Virginia Polytechnic Institute and State University (VPI), est une université publique de recherche avec son campus principal à Blacksburg, en Virginie. Elle possède également des installations éducatives dans six régions de l\'État, un centre de recherche à Punta Cana, en République dominicaine, et un site d\'études à l\'étranger à Riva San Vitale, en Suisse. Grâce à son programme de Corps des élèves officiers de réserve (ROTC), Virginia Tech est une école militaire supérieure.\nVirginia Tech propose 280 programmes de premier cycle et de cycles supérieurs à ses 37 000 étudiants ; en 2016, c\'était la deuxième plus grande université publique de l\'État en termes d\'effectifs. Elle est classée parmi les \"R1: Universités doctorales – Activité de recherche très élevée\".\nLes équipes sportives de l\'université sont connues sous le nom de Virginia Tech Hokies et participent à la Division I de la NCAA en tant que membres de l\'Atlantic Coast Conference. Les anciens élèves de Virginia Tech comprennent 2 boursiers Rhodes, 4 boursiers Marshall, 38 boursiers Goldwater et 131 boursiers Fulbright. Parmi ses anciens élèves figurent 8 récipiendaires de la Médaille d\'honneur, 97 officiers supérieurs, les gouverneurs de deux États américains, 2 astronautes et un milliardaire. Trois lauréats du prix Nobel et deux fellows MacArthur ont obtenu un diplôme ou ont été membres du corps professoral de l\'université. En 2015, Virginia Tech comptait plus de 240 000 anciens élèves vivants dans le monde entier.', 0),
(195, 5301, 'Wake Forest University', 'Law,Chemistry,Accounting & Finance,Biological Sciences,History, Philosophy & Theology,Sport Science,Business & Management,General Engineering,Sociology,Economics & Econometrics,Mathematics & Statistics,Languages, Literature & Linguistics,Education,Communication & Media Studies,Other Health,Physics & Astronomy,Medicine & Dentistry,Psychology,Geology, Environmental, Earth & Marine Sciences,Art, Performing Arts & Design,Computer Science,Politics & International Studies (incl Development Studies)', 28, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0a/Wake_Forest_University_seal.svg/156px-Wake_Forest_University_seal.svg.png?20170909021832', ' L\'Université Wake Forest (WFU) est une université privée de recherche située à Winston-Salem, en Caroline du Nord, aux États-Unis. Fondée en 1834, l\'université tient son nom de son emplacement d\'origine à Wake Forest, au nord de Raleigh, en Caroline du Nord. Le campus de Reynolda, le principal campus de l\'université, est situé au nord du centre-ville de Winston-Salem depuis le déménagement de l\'université en 1956. Le campus médical Atrium Health Wake Forest Baptist possède deux emplacements, l\'ancien situé près du quartier d\'Ardmore au centre de Winston-Salem, et le nouveau campus au Wake Forest Innovation Quarter en centre-ville. L\'université occupe également des espaces de laboratoire au Biotech Plaza à Innovation Quarter et au Center for Nanotechnology and Molecular Materials. L\'École supérieure de gestion de l\'université a une présence sur le campus principal de Winston-Salem et à Charlotte, en Caroline du Nord.\nLes collèges et écoles de premier cycle et de troisième cycle de la WFU comprennent l\'École de droit de l\'Université Wake Forest, l\'École de théologie de l\'Université Wake Forest, l\'École de commerce de l\'Université Wake Forest, l\'École supérieure des arts et des sciences de l\'Université Wake Forest, et l\'École de médecine de l\'Université Wake Forest. Les étudiants peuvent participer à plus de 250 clubs et organisations étudiants, y compris des fraternités et des sororités, des sports intramuros, un journal étudiant et une station de radio. L\'université est classée parmi les \"R-2 : Universités doctorales - Activité de recherche élevée\". Les équipes sportives de l\'Université Wake Forest sont connues sous le nom de Demon Deacons et participent à seize sports intercollégiaux de la NCAA Division I. Wake Forest est également l\'un des membres fondateurs de l\'Atlantic Coast Conference.', 23000);
INSERT INTO `universite` (`id_universite`, `id_ville`, `name`, `domaine_etude`, `acceptance_rate(%)`, `image`, `description`, `price`) VALUES
(196, 3914, 'Washington State University', 'Medicine & Dentistry,Geography,Agriculture & Forestry,Accounting & Finance,Chemistry,Civil Engineering,Architecture,Electrical & Electronic Engineering,Physics & Astronomy,Languages, Literature & Linguistics,Psychology,Computer Science,Business & Management,Geology, Environmental, Earth & Marine Sciences,Chemical Engineering,General Engineering,History, Philosophy & Theology,Sport Science,Mechanical & Aerospace Engineering,Mathematics & Statistics,Archaeology,Sociology,Art, Performing Arts & Design,Education,Veterinary Science,Biological Sciences,Economics & Econometrics,Politics & International Studies (incl Development Studies),Communication & Media Studies,Other Health', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/0/0e/Washington_State_University_seal.svg/150px-Washington_State_University_seal.svg.png', ' L\'Université d\'État de Washington (Washington State University, WSU, ou informellement Wazzu) est une université publique de recherche agricole, avec son campus principal, et le plus ancien, à Pullman, Washington. Fondée en 1890, la WSU est également l\'une des plus anciennes universités agricoles de l\'Ouest américain. Avec 24 278 étudiants de premier cycle et un effectif total de 28 581, elle est la deuxième plus grande institution d\'enseignement supérieur de l\'État de Washington, derrière l\'Université de Washington. Elle est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\".\nLe campus de Pullman de la WSU s\'élève sur une colline et se caractérise par des espaces ouverts et une palette de matériaux en brique rouge et en basalte, des matériaux originaires du site. L\'université est située dans la topographie vallonnée du Palouse, dans l\'est de Washington, et reste étroitement liée à la ville et à la région. L\'université exploite également des campus à travers l\'État de Washington à WSU Spokane, WSU Tri-Cities et WSU Vancouver, tous fondés en 1989. En 2012, la WSU a lancé un campus mondial basé sur Internet, qui comprend son programme de diplômes en ligne, WSU Online. En 2015, la WSU s\'est étendue à un sixième campus à WSU Everett. Ces campus délivrent principalement des diplômes de premier cycle et de maîtrise. Les étudiants de première et deuxième année ont été admis pour la première fois sur le campus de Vancouver en 2006 et sur le campus de Tri-Cities en 2007.\nLes équipes sportives de la WSU sont appelées les Cougars et les couleurs de l\'école sont le cramoisi et le gris. Six équipes masculines et neuf équipes féminines de niveau universitaire participent à la Division I de la NCAA dans la Conférence Pac-12. Les équipes de course en salle masculine et féminine participent à la Mountain Pacific Sports Federation.', 0),
(197, 4564, 'Washington University in St Louis', 'General Engineering,Languages, Literature & Linguistics,Computer Science,Geology, Environmental, Earth & Marine Sciences,Law,Psychology,Biological Sciences,Chemistry,Education,Architecture,Communication & Media Studies,History, Philosophy & Theology,Medicine & Dentistry,Economics & Econometrics,Sociology,Chemical Engineering,Business & Management,Mathematics & Statistics,Electrical & Electronic Engineering,Accounting & Finance,Archaeology,Other Health,Mechanical & Aerospace Engineering,Art, Performing Arts & Design,Politics & International Studies (incl Development Studies),Physics & Astronomy', 16, 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d7/WashU_St._Louis_seal.svg/150px-WashU_St._Louis_seal.svg.png', ' L\'Université Washington à St. Louis (WashU) est une université privée de recherche située à St. Louis, Missouri, aux États-Unis. Fondée en 1853, l\'université porte le nom de George Washington, général de l\'armée continentale et premier président des États-Unis.\nL\'Université Washington est composée de huit écoles pour les études de premier cycle, les cycles supérieurs et les études professionnelles, notamment les Arts et Sciences, l\'École de travail social George Warren Brown, l\'École de commerce Olin, l\'École de médecine de l\'Université Washington, l\'École d\'ingénierie McKelvey, l\'École de droit de l\'Université Washington, l\'École d\'études continues et professionnelles, et l\'École Sam Fox de design et arts visuels. L\'université compte environ 16 550 étudiants sur ses campus, provenant des 50 États américains et de plus de 110 pays.\nL\'Université Washington est membre de l\'Association of American Universities depuis 1923 et est classée parmi les \"R1: universités doctorales - activité de recherche très élevée\". En 2021, la National Science Foundation a classé l\'Université Washington au 25e rang des institutions académiques aux États-Unis en termes de dépenses de recherche et développement. Les équipes sportives de l\'université, les Washington University Bears, participent à la Division III de la NCAA en tant que membre fondateur de l\'University Athletic Association.\nEn 2023, l\'université compte 26 lauréats du prix Nobel, 11 lauréats du prix Pulitzer, 4 poètes lauréats des États-Unis et 6 boursiers MacArthur qui ont été affiliés à l\'université en tant que membres du corps professoral ou anciens élèves. Les anciens élèves de l\'Université Washington incluent également 16 présidents d\'université, 21 membres du Congrès américain, 30 boursiers Rhodes, 7 boursiers Marshall et 2 boursiers Churchill.', 27000),
(198, 1164, 'Wayne State University', 'Sociology,Civil Engineering,Law,Biological Sciences,Sport Science,Chemistry,Other Health,Geology, Environmental, Earth & Marine Sciences,Economics & Econometrics,History, Philosophy & Theology,Chemical Engineering,Politics & International Studies (incl Development Studies),Computer Science,Art, Performing Arts & Design,Mathematics & Statistics,General Engineering,Medicine & Dentistry,Psychology,Business & Management,Education,Accounting & Finance,Mechanical & Aerospace Engineering,Languages, Literature & Linguistics,Electrical & Electronic Engineering,Physics & Astronomy,Communication & Media Studies', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/13/Wayne_State_University_seal.svg/150px-Wayne_State_University_seal.svg.png', ' Wayne State University (WSU), ou simplement Wayne, est une université publique de recherche située à Detroit, dans le Michigan. C\'est la troisième plus grande université du Michigan. Fondée en 1868, Wayne State est composée de 13 écoles et collèges offrant environ 350 programmes à près de 24 000 étudiants de premier cycle et cycles supérieurs. Wayne State University, aux côtés de l\'Université du Michigan et de l\'Université d\'État du Michigan, constitue le University Research Corridor du Michigan. Wayne State est classée parmi les \"R1 : universités doctorales - activité de recherche très élevée\".\nLe campus principal de Wayne State comprend 203 acres et relie plus de 100 bâtiments dédiés à l\'éducation et à la recherche. Il possède également trois campus satellites dans les comtés de Macomb et Wayne.\nLes Warriors de Wayne State participent à la Great Lakes Intercollegiate Athletic Conference (GLIAC) de la NCAA Division II.', 0),
(199, 2304, 'Western Michigan University', 'Economics & Econometrics,Geography,Mechanical & Aerospace Engineering,Education,Mathematics & Statistics,Languages, Literature & Linguistics,Computer Science,Civil Engineering,Architecture,Art, Performing Arts & Design,Sport Science,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Agriculture & Forestry,Electrical & Electronic Engineering,Chemistry,Psychology,General Engineering,Accounting & Finance,Chemical Engineering,Law,Communication & Media Studies,Politics & International Studies (incl Development Studies),Sociology,Physics & Astronomy,History, Philosophy & Theology,Other Health,Business & Management', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/1/1e/Western_Michigan_University_seal.svg/180px-Western_Michigan_University_seal.svg.png', ' Western Michigan University (Western Michigan, Western ou WMU) est une université publique de recherche située à Kalamazoo, dans le Michigan, aux États-Unis. Elle a été initialement créée sous le nom de Western State Normal School en 1903 par le gouverneur Aaron T. Bliss dans le but de former des enseignants. En 1957, elle a été rebaptisée Western Michigan University.\nWestern fait partie des huit universités de recherche de l\'État du Michigan et est classée parmi les \"R2 : universités doctorales - activité de recherche élevée\". L\'université comprend sept collèges délivrant des diplômes, proposant 147 programmes de premier cycle, 73 programmes de master, 30 programmes de doctorat et un programme de diplôme spécialisé. Elle est gouvernée par un conseil de huit membres de régence, dont les membres sont nommés par le gouverneur du Michigan et confirmés par le Sénat du Michigan pour des mandats de huit ans.\nLes équipes sportives de l\'université participent à la Division I de la National Collegiate Athletic Association (NCAA) et sont connues sous le nom de Western Michigan Broncos. Elles concourent dans la Mid-American Conference pour la plupart des sports.', 0),
(200, 339, 'Western Washington University', 'General Engineering,Mathematics & Statistics,Languages, Literature & Linguistics,Other Health,Geology, Environmental, Earth & Marine Sciences,Accounting & Finance,Art, Performing Arts & Design,Sociology,Geography,Economics & Econometrics,Education,Biological Sciences,Medicine & Dentistry,Communication & Media Studies,History, Philosophy & Theology,Chemistry,Computer Science,Physics & Astronomy,Politics & International Studies (incl Development Studies),Electrical & Electronic Engineering,Psychology,Sport Science,Archaeology,Business & Management', 0, 'https://upload.wikimedia.org/wikipedia/en/thumb/f/f6/WesternWashingtonUniversitySeal.png/150px-WesternWashingtonUniversitySeal.png', ' Western Washington University (WWU ou Western) est une université publique située à Bellingham, dans l\'État de Washington. L\'université, la plus septentrionale des États-Unis contigus, a été fondée en 1893 en tant qu\'école normale New Whatcom financée par l\'État, succédant à une école privée d\'enseignement pour femmes fondée en 1886. L\'université a adopté son nom actuel en 1977.\nWWU propose une variété de diplômes de premier cycle et de cycles supérieurs, ainsi que quelques doctorats limités. En 2022, l\'université comptait 14 747 étudiants, dont 13 801 étaient des étudiants de premier cycle, et elle employait 664 professeurs à temps plein. Ses équipes sportives sont connues sous le nom de Vikings et participent à la division II de la National Collegiate Athletic Association (NCAA).\nLe campus principal est situé sur 215 acres à Bellingham, avec un centre universitaire marin à Anacortes. L\'université est accréditée par la Northwest Commission on Colleges and Universities. Des accréditations supplémentaires sont détenues par les collèges individuels de l\'université.', 0),
(201, 5251, 'William & Mary', 'Psychology,Computer Science,Sport Science,History, Philosophy & Theology,Mathematics & Statistics,Accounting & Finance,Law,Sociology,Art, Performing Arts & Design,Education,Physics & Astronomy,Geography,Languages, Literature & Linguistics,Chemistry,Politics & International Studies (incl Development Studies),Business & Management,Geology, Environmental, Earth & Marine Sciences,Biological Sciences,Economics & Econometrics', 36, 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/William_%26_Mary_Athletics_logo.svg/150px-William_%26_Mary_Athletics_logo.svg.png', ' Le surnom \"Tribe\" désigne les équipes sportives du College of William & Mary ainsi que la communauté universitaire de manière plus générale.\nWilliam & Mary a remporté deux championnats nationaux par équipe (les deux en tennis masculin), les championnats AIAW en golf féminin, les championnats NAIA en gymnastique féminine, treize championnats universitaires de gymnastique de la USA Gymnastics, ainsi que divers championnats nationaux individuels. Le collège a remporté plus de championnats de conférence que toute autre école de la Coastal Athletic Association. À la fin de l\'année académique 2010–2011, le Tribe avait remporté 101 championnats de conférence. Depuis les débuts du programme sportif en 1893, il y a eu environ 160 titres de conférence au total.\nWilliam & Mary est la deuxième plus ancienne université des États-Unis. Depuis la création de son programme sportif en 1893, les athlètes de l\'école ont porté différentes couleurs et surnoms. De 1893 à 1909, les joueurs de football de William & Mary étaient simplement connus sous le nom de Orange and White, reflétant les couleurs officielles de l\'école à cette époque. De 1910 à 1916, les couleurs de l\'équipe ont changé, et le nouveau surnom, \"The Orange and Black\", a reflété cela. De 1916 jusqu\'au milieu des années 1980, les équipes sportives de William & Mary étaient connues sous le nom d\'Indians. Depuis 1978, les équipes de l\'école sont simplement appelées le Tribe. Au cours de l\'année scolaire 2006–2007, le président de l\'époque, Gene Nichol, a retiré deux plumes tribales du logo sportif de William & Mary pour se conformer aux nouvelles réglementations de la NCAA. Le 6 avril 2010, après des discussions étudiantes et des sondages ultérieurs, le griffon a été annoncé comme la nouvelle mascotte de l\'école.\nEn 1995, William & Mary a abandonné le sport de la lutte. En septembre 2020, l\'université a annoncé l\'arrêt de sept sports - l\'athlétisme masculin en salle et en plein air, la natation masculine et féminine, la gymnastique masculine et féminine et le volleyball féminin - à la fin de l\'année académique 2020–2021. Après une réaction considérable et controversée, Samantha Huge a démissionné de son poste de directrice athlétique le 6 octobre 2020. Jeremy Martin a été nommé directeur athlétique par intérim.\nLes trois sports féminins qui avaient été supprimés ont été entièrement rétablis le 19 octobre 2020. Puis, le 5 novembre 2020, les quatre sports masculins qui avaient été supprimés ont été rétablis jusqu\'à la fin de l\'année scolaire 2021–2022, et éventuellement au-delà après un examen plus approfondi.', 17000),
(202, 5349, 'Worcester Polytechnic Institute', 'Politics & International Studies (incl Development Studies),Civil Engineering,Physics & Astronomy,Mechanical & Aerospace Engineering,General Engineering,Computer Science,Art, Performing Arts & Design,Psychology,Biological Sciences,Mathematics & Statistics,Business & Management,Communication & Media Studies,Education,Chemistry,Economics & Econometrics,Sociology,Chemical Engineering,Other Health,Geology, Environmental, Earth & Marine Sciences,Electrical & Electronic Engineering,History, Philosophy & Theology', 48, 'https://upload.wikimedia.org/wikipedia/en/thumb/e/ec/WPI_logo.svg/220px-WPI_logo.svg.png', ' Le Worcester Polytechnic Institute (WPI) est une université privée de recherche située à Worcester, dans le Massachusetts. Fondée en 1865, le WPI a été l\'une des premières universités d\'ingénierie et de technologie aux États-Unis et propose maintenant 14 départements académiques avec plus de 50 programmes de premier cycle et de cycles supérieurs dans les domaines des sciences, de l\'ingénierie, de la technologie, de la gestion, des sciences sociales, des humanités et des arts. Le WPI décerne des diplômes de baccalauréat, de master et de doctorat pour l\'achèvement de ces programmes. Il est classé parmi les \"R2 : universités doctorales - activité de recherche élevée\".', 43000),
(203, 3279, 'Yale University', 'Economics & Econometrics,Medicine & Dentistry,Mathematics & Statistics,Politics & International Studies (incl Development Studies),Other Health,Accounting & Finance,Architecture,Law,Art, Performing Arts & Design,Mechanical & Aerospace Engineering,Agriculture & Forestry,History, Philosophy & Theology,General Engineering,Electrical & Electronic Engineering,Chemistry,Physics & Astronomy,Archaeology,Biological Sciences,Computer Science,Psychology,Business & Management,Chemical Engineering,Languages, Literature & Linguistics,Geology, Environmental, Earth & Marine Sciences,Sociology', 7, 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/07/Yale_University_Shield_1.svg/150px-Yale_University_Shield_1.svg.png', ' Yale University est une université de recherche privée faisant partie de la Ivy League, située à New Haven, dans le Connecticut. Fondée en 1701, Yale est la troisième plus ancienne institution d\'enseignement supérieur aux États-Unis et l\'une des neuf collèges coloniaux créés avant la Révolution américaine.\nYale a été établie sous le nom de Collegiate School en 1701 par des ecclésiastiques congrégationalistes de la colonie du Connecticut. À l\'origine réservée à l\'instruction des ministres en théologie et langues sacrées, le programme d\'études de l\'école s\'est élargi pour inclure les humanités et les sciences à l\'époque de la Révolution américaine. Au XIXe siècle, le collège s\'est développé pour inclure l\'enseignement supérieur et professionnel, décernant le premier doctorat aux États-Unis en 1861 et s\'organisant en université en 1887. La faculté et la population étudiante de Yale ont rapidement augmenté après 1890 en raison de l\'expansion du campus physique et de ses programmes de recherche scientifique.\nAujourd\'hui, Yale est organisée en quatorze écoles constituantes, dont le collège de premier cycle d\'origine, la Graduate School of Arts and Sciences de Yale et la Yale Law School. Bien que l\'université soit gouvernée par la Yale Corporation, la faculté de chaque école supervise son programme d\'études et ses diplômes. En plus d\'un campus central dans le centre-ville de New Haven, l\'université possède des installations sportives à l\'ouest de New Haven, un campus à West Haven, ainsi que des forêts et des réserves naturelles dans tout la Nouvelle-Angleterre. En 2021, l\'endowment de l\'université était évalué à 42,3 milliards de dollars, le troisième plus grand de toutes les institutions éducatives. La bibliothèque de l\'Université Yale, qui dessert toutes les écoles constituantes, abrite plus de 15 millions de volumes et est la troisième plus grande bibliothèque universitaire aux États-Unis. Les étudiants-athlètes participent à des sports intercollégiaux en tant que Bulldogs de Yale dans la conférence Ivy League de la NCAA Division I.\nEn octobre 2020, 65 lauréats du prix Nobel, cinq médaillés Fields, quatre lauréats du prix Abel et trois lauréats du prix Turing ont été affiliés à l\'Université Yale. De plus, Yale a diplômé de nombreux anciens élèves notables, dont cinq présidents américains, dix Pères fondateurs, 19 juges de la Cour suprême des États-Unis, 31 milliardaires vivants, 54 fondateurs et présidents d\'université, de nombreux chefs d\'État, membres de cabinets et gouverneurs. Des centaines de membres du Congrès, de nombreux diplomates américains, 78 boursiers MacArthur, 263 boursiers Rhodes, 123 boursiers Marshall, 81 boursiers Gates Cambridge, 102 boursiers Guggenheim et neuf boursiers Mitchell ont été affiliés à l\'université. Le corps professoral actuel de Yale comprend 67 membres de l\'Académie nationale des sciences, 55 membres de l\'Académie nationale de médecine, huit membres de l\'Académie nationale de génie et 187 membres de l\'Académie américaine des arts et des sciences.', 18000);
